INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('00b3e844-f947-488a-8cd7-387b1402c028', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2016', 'smex-2016', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-2016-1746755157889.jpg\"><p></p><p>Pada Event&nbsp;ke-7&nbsp;Surabaya Music Expo (SMEX) 2016, yang diadakan tanggal 8-11 September 2016 di Grand City Convex Surabaya, CV Sinar Baja Electric kembali meramaikan salah satu event Pro Audio, Lighting, &amp; Music expo terbesar di tanah air.&nbsp; Dengan memamerkan produk Pro Audio andalannya, RHYME <em>Professional Audio</em> dan ACR speaker –Fabulous Series.</p><p></p><p>Pada event ini, RHYME <em>Professional Audio</em> sekaligus memperkenalkan untuk pertama kalinya, RM 212 MK IV. Produk premium system speaker single 12” 2-way terbaru ini diaplikasikan untuk stereo karaoke ataupun <em>floor monitor</em> panggung. Selain versi pasif, tersedia juga versi <em>active</em> dengan menggunakan <em>Powersoft power module</em>.</p><p></p><p>Selain produk baru, RHYME <em>Professional Audio</em> juga memamerkan produk-produk andalan lain: <em>Line array series</em> dengan range produk yang lengkap dari 15in sampai 8in, yaitu RM156 LA, RM 126 LA, RM 10 LA MKIII, RM 811 LA, &amp; flying sub RM 122FSB; Subwoofer 18” double RM 18 LA &amp; RM 128 SB dan subwoofer single RM 1121 SB &amp; RM 1182 SB; 10” 2-way RM 2110; dan <em>wall mounted</em> speaker Rhyme C-2. Untuk informasi produk lengkap dapat dilihat di website resmi RHYME <em>Professional Audio </em>: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.rhymeaudio.com\">www.rhymeaudio.com</a></p><p></p><p>Sedangkan ACR sendiri memajang ACR Fabulous series, memperkenalkan tipe terbarunya 6in 5061 N, speaker middle dengan magnet neodymium dan voice coil 50mm. Dan 12in 75214, woofer dengan magnet neodymium dan coil 75mm, serta cone paper berteknologi dari USA. Dengan harga yang relative murah jika dibandingkan dengan kualitas dan performa produknya, varian produk ACR Speaker semakin menjangkau pasar dari berbagai level konsumen.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-2016-1-1746755253995.jpg\"><p></p><p>Di Area Line Array demo, RHYME Professional Audio menampilkan produk line array RM 126 LA dan subwoofer RM 18 LA MKII SE. Menggunakan power Rhyme R1000 untuk RM 126 LA dan R5200 untuk subwoofer RM 18 LA MKII SE. Kualitas produk ini mampu dibandingkan dengan branded-branded ternama yang mengikuti demo line array juga saat event SMEX 2016. Suara yang dihasilkan terdengar <em>clear </em>bahkan sampai di ujung timur Grand City Mall Surabaya yang berjarak kurang lebih 300 meter dari speaker yang digantung dengan ketinggian 6 meter saja.</p><p></p><p>RHYME Professional Audio dan ACR Speaker merupakan produk lokal dari CV Sinar Baja Electric dengan standard internasional yang sudah diakui berbagai negara. Terbukti dengan banyaknya produk hasil buatan CV Sinar Baja Electric yang telah dieksport ke berbagai negara selama 30 tahun lebih.</p>', '2017-02-18 17:00:00.000', 'admin', '2025-05-09 01:47:54.828', '2025-07-03 03:27:37.510', '', '', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-2016-1746755157889.jpg\"><p></p><p>At the 7th Surabaya Music Expo (SMEX) 2016, held on September 8–11, 2016 at Grand City Convex Surabaya, CV Sinar Baja Electric once again enlivened one of the largest Pro Audio, Lighting, &amp; Music expos in the country by showcasing its flagship Pro Audio products, RHYME Professional Audio and ACR Speaker – Fabulous Series.</p><p></p><p>At this event, RHYME Professional Audio also introduced for the first time the RM 212 MK IV. This new premium single 12” 2-way system speaker is designed for stereo karaoke or stage floor monitor applications. In addition to the passive version, an active version is also available using a Powersoft power module.</p><p></p><p>In addition to the new products, RHYME Professional Audio also showcased other flagship products: a full range of line array series from 15” to 8”, including RM156 LA, RM 126 LA, RM 10 LA MKIII, RM 811 LA, and flying sub RM 122FSB; 18” double subwoofers RM 18 LA &amp; RM 128 SB, and single subwoofers RM 1121 SB &amp; RM 1182 SB; the 10” 2-way RM 2110; and wall-mounted speaker Rhyme C-2. Full product information is available at the official RHYME Professional Audio website: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.rhymeaudio.com\">www.rhymeaudio.com</a></p><p></p><p>Meanwhile, ACR displayed the ACR Fabulous Series, introducing its newest types: the 6” 5061 N, a mid speaker with neodymium magnet and 50mm voice coil, and the 12” 75214, a woofer with neodymium magnet, 75mm coil, and USA technology cone paper. With relatively affordable prices compared to the product’s quality and performance, ACR Speaker’s product variants continue to reach a wider range of consumer markets.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-2016-1-1746755253995.jpg\"><p></p><p>In the Line Array demo area, RHYME Professional Audio showcased its RM 126 LA line array product and RM 18 LA MKII SE subwoofer. The Rhyme R1000 amplifier was used for the RM 126 LA and the R5200 for the RM 18 LA MKII SE subwoofer. The quality of these products is comparable to well-known international brands that also participated in the line array demo during SMEX 2016. The sound produced was clear, even reaching the eastern end of Grand City Mall Surabaya, approximately 300 meters from the speakers, which were hung at a height of only 6 meters.</p><p></p><p>RHYME Professional Audio and ACR Speaker are local products from CV Sinar Baja Electric, built to international standards and recognized by various countries. This is proven by the fact that many of CV Sinar Baja Electric\'s products have been exported to numerous countries for over 30 years.</p>', 'SMEX 2016', 'smex-2016'),
('04cf61bb-6e30-4d41-9f8d-8ce217e6d603', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - BLORA SOUND COMMUNITY (BSC). Season IV', 'review-blora-sound-community-bsc-season-iv', '<p>Acara ini merupakan acara tahunan yang dilaksanakan oleh Komunitas Sound System di Kab. Blora dengan maksud para pecinta sound dapat mengenal dan menambah pengalaman mengenai sound system. Acara ini merupakan acara yang ke-4 dimana telah diselenggarakan pada tanggal 13 - 15 September 2019 &nbsp;di Desa Ngawen, Kec. Ngawen, Kab. Blora, Jawa Tengah.</p><p></p><p>Acaranya berlangsung sukses dan lancar dengan didukung oleh sponsor yang kebanyakan dari beberapa Toko Elektronik di sekitar Kec. Ngawen dan peserta lomba yang ikut meramaikan acara tersebut. Pengunjung yang datang rata-rata merupakan warga sekitar yang ingin mengetahui acara pameran sound system.</p><p></p><p>Kami sebagai salah satu sponsor mendemokan speaker line array dari RHYME Pro-AUDIO, yaitu RM 103 LA (dual 10in 2-way) dan Subwoofernya RM 1283 SB (18in double) dengan konfigurasi 6x4 box. Pengunjung juga memberikan komentar yang positif terhadap produk RHYME yang didemokan, ditambah pengunjung juga sempat berkeinginan membeli.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-02-e1568776986388-1746761531462.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-01-e1568776965818-1746761537381.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-04-e1568777020444-1746761542486.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-03-e1568777002396-1746761549635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-05-e1568777048262-1746761554841.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-06-e1568777211367-1746761558994.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-08-e1568777249999-1746761562613.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-09-e1568776919290-1746761566655.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-07-e1568777227988-1746761571257.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-10-e1568776940495-1746761574673.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190915_120425-e1568779939700-1746761578086.jpg\">', '2019-09-17 17:00:00.000', 'admin', '2025-05-09 03:33:01.440', '2025-07-03 03:20:34.418', '', '', '<p>This event is an annual program held by the Sound System Community in Blora Regency, aimed at allowing sound system enthusiasts to gain knowledge and experience about sound systems. This was the 4th event, which took place on September 13–15, 2019, in Ngawen Village, Ngawen District, Blora Regency, Central Java.</p><p></p><p>The event ran smoothly and successfully, supported by sponsors, mostly from several electronics stores around the Ngawen District, as well as by competition participants who helped enliven the event. Most of the visitors were local residents interested in learning more about the sound system exhibition.</p><p></p><p>We participated as one of the sponsors by showcasing RHYME Pro-AUDIO\'s line array speaker, RM 103 LA (dual 10in 2-way), and its subwoofer, RM 1283 SB (18in double), with a configuration of 6x4 boxes. Visitors gave positive feedback on the RHYME products demonstrated, and some even expressed interest in making a purchase.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-02-e1568776986388-1746761531462.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-01-e1568776965818-1746761537381.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-04-e1568777020444-1746761542486.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-03-e1568777002396-1746761549635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-05-e1568777048262-1746761554841.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-06-e1568777211367-1746761558994.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-08-e1568777249999-1746761562613.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-09-e1568776919290-1746761566655.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-07-e1568777227988-1746761571257.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Blora-10-e1568776940495-1746761574673.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190915_120425-e1568779939700-1746761578086.jpg\">', 'Review - BLORA SOUND COMMUNITY (BSC). Season IV', 'review-blora-sound-community-bsc-season-iv'),
('0844132b-be31-43ec-8be3-31bdb05b2239', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pameran Sound System - PSST (Paguyuban Sound System Tulungagung) Pada 11 - 12 Mei 2024', 'pameran-sound-system-psst-paguyuban-sound-system-tulungagung-pada-11-12-mei-2024', '<p>Pada&nbsp;tahun&nbsp;2024, ACR, Rhyme Desibel kembali mengikuti pameran yang digelar oleh PSTT di Tulungagung. Acara ini digelar rutin tahunan dan di tahun ini merupakan Parade Sound Jilid yang ke #7. Acara yang digelar di&nbsp;lapangan&nbsp;desa&nbsp;Pulotondo&nbsp;pada&nbsp;tanggal&nbsp;11&nbsp;–&nbsp;12&nbsp;Mei&nbsp;2024 ini dimeriahkan oleh&nbsp;banyak&nbsp;sponsor2&nbsp;lain.</p><p></p><p>Dalam&nbsp;acara&nbsp;ini&nbsp;juga dilakukan beberapa lomba, diantaranya Mixing Live + Balap Sound (Lomba SPL) yang materinya dipersiapkan oleh panitia. ACR juga turut menjadi sponsor acara tersebut dengan support tipe speaker terbarunya, yaitu 15in PA-100152 Mk2 SW Fab dan 18in PA-100182 Mk3 SW Fab. Selain lomba-lomba, terdapat juga acara penggalangan dana untuk Mushola Darussalam</p><p></p><p>Di hari terakhir, acara ini juga dimeriahkan oleh penduduk setempat dalam acara live musik dangdut serta adanya UMKM lokal yang menjual kebutuhan makan dan minuman.</p><p></p><p><strong>Acara&nbsp;&amp;&nbsp;Bazar</strong></p><p></p><p>Pada stand ACR Rhyme Desibel, para pengunjung yang dapat mendengarkan langsung custom box damphoed (paraflex) yang menggunakan driver speaker terbaru dari serian double magnet: 18in PA 113188 SW Fab. Para pengunjung yang hadir antusias dan memberikan feedback yang positif</p><p></p><p>Pada demo produk untuk event kali ini, ACR Rhyme membawa 6 box RM 103 LA dan juga subwoofer RM 1283 SB. Untuk Line Array menggunakan aampli R4500 total 3 unit dan subwoofer menggunakan amplifier Rhyme tipe terbaru yaitu D17000 (kelas D) yang memiliki daya yang sangat besar.</p><p></p><p>Kombinasi sempurna dari RM 103 LA dan RM 1283 mampu memberikan suara yang clarity dan bass yang dalam sehingga cocok digunakan di area outdoor. Harga yang tergolong terjangkau membuat banyak pengunjung datang ke booth ACR Rhyme Desibel untuk mengetahui lebih dalam mengenai spesifikasinya. Adanya diskon khusus pembelian produk dengan tipe terbatas pada booth ACR juga semakin menunjang keramaian pada acara kali ini.</p><p></p><p>Berikut dokumentasinya:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01530-1024x683-1746776049381.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01534-1024x683-1746776055101.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01552-1024x683-1746776064591.jpg\"><p></p><p>Selengkapnya dapat dilihat pada Youtube Channel <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker - Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/WwMBj-lphiY?si=ak4vrvH1m-9fXr9f\" start=\"0\"></iframe></div>', '2024-06-02 17:00:00.000', 'admin', '2025-05-09 07:35:11.677', '2025-07-03 02:10:06.637', '', '', '<p>In 2024, ACR, Rhyme, and Desibel once again participated in an exhibition organized by PSTT in Tulungagung. This event is held annually, and this year marked the 7th edition of the Sound Parade. It took place at the Pulotondo village field on May 11–12, 2024, and was enlivened by various other sponsors.</p><p></p><p>The event also included several competitions, such as Live Mixing and Sound Racing (SPL competition), with materials prepared by the committee. ACR served as a sponsor for this event by supporting it with its newest speaker models: the 15in PA-100152 Mk2 SW Fab and the 18in PA-100182 Mk3 SW Fab. In addition to the competitions, a fundraising event was held for the Darussalam prayer hall.</p><p></p><p>On the final day, the event was enlivened by a live dangdut music performance by local residents and the presence of local MSMEs selling food and beverages.</p><p></p><p><strong>Exhibition &amp; Bazaar</strong></p><p>At the ACR Rhyme Desibel booth, visitors had the chance to listen to custom damphoed (paraflex) boxes equipped with the latest double magnet speaker driver: 18in PA 113188 SW Fab. The attendees were enthusiastic and provided positive feedback.</p><p></p><p>For the product demo at this event, ACR Rhyme brought 6 units of RM 103 LA and RM 1283 SB subwoofers. The Line Array was powered by three R4500 amplifiers, while the subwoofers were powered by Rhyme’s latest class D amplifier, the D17000, which delivers very high power.</p><p></p><p>The perfect combination of RM 103 LA and RM 1283 delivered clear sound and deep bass, making it well-suited for outdoor use. With an affordable price point, many visitors stopped by the ACR Rhyme Desibel booth to learn more about the specifications. A special discount for limited edition product purchases at the booth also added to the excitement of the event.</p><p></p><p>Here is the documentation:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01530-1024x683-1746776049381.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01534-1024x683-1746776055101.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01552-1024x683-1746776064591.jpg\"><p></p><p>For more details, you can visit the YouTube Channel: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker – Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/WwMBj-lphiY?si=ak4vrvH1m-9fXr9f\" start=\"0\"></iframe></div>', 'Sound System Exhibition – PSST (Paguyuban Sound System Tulungagung) on May 11–12, 2024', 'sound-system-exhibition-psst-paguyuban-sound-system-tulungagung-on-may-11-12-2024'),
('0d4c052c-1f54-446e-8bf0-44a3336965b9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - PAGUYUBAN SOUND SYSTEM JOMBANG (PSSJ)', 'review-paguyuban-sound-system-jombang-pssj', '<p>Paguyuban Sound System Jombang (PSSJ) merupakan sebuah komunitas yang bertujuan untuk mempererat dan saling silahturahi antar sound system di sekitar Kab. Jombang. Acara tersebut diselengarakan pada tanggal 24 – 25 April 2019 di The Metro Graha, Jl. Yos Sudarso, Tunggorono, Jombang, Kab. Jombang.</p><p></p><p>Acara berlangsung sukses dan lancar namun dari beberapa pendapat bahwa acara tahun ini pengunjung dan sponsor terlihat lebih ramai dari event sebelumnya. Pengunjung yang datang hanya sebagian besar merupakan dari peserta lomba dan warga daerah setempat yang penasaran tentang event ini.</p><p></p><p>Kami sebagai salah satu sponsor ikut memeriahkan acara dengan membuka stand dan mendemokan speaker line array milik RHYME Pro-AUDIO; RM 103 LA (10in double, 2-way) dan subwoofernya 128 SB MK4 (18in double), dengan konfigurasi 4x4 box.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190425_114218-e1560821387773-1746759975331.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140826-e1560821832726-1746759979234.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140850-e1560821426381-1746759983342.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140723-e1560821881797-1746759987428.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140733-e1560821856573-1746759998245.jpg\">', '2019-06-17 17:00:00.000', 'admin', '2025-05-09 03:06:40.502', '2025-07-03 03:22:57.607', '', '', '<p>The Paguyuban Sound System Jombang (PSSJ) is a community aimed at strengthening relationships and fostering connections among sound system enthusiasts in the Jombang Regency area. The event was held on April 24–25, 2019, at The Metro Graha, Jl. Yos Sudarso, Tunggorono, Jombang, Jombang Regency.</p><p></p><p>The event ran successfully and smoothly, with feedback indicating that this year’s event saw a larger turnout of visitors and sponsors compared to the previous year. Most of the attendees were competition participants and local residents who were curious about the event.</p><p></p><p>As one of the sponsors, we contributed to the excitement of the event by setting up a booth and showcasing RHYME Pro-AUDIO’s line array speakers: RM 103 LA (10in double, 2-way) and the 128 SB MK4 subwoofer (18in double), with a 4x4 box configuration.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190425_114218-e1560821387773-1746759975331.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140826-e1560821832726-1746759979234.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140850-e1560821426381-1746759983342.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140723-e1560821881797-1746759987428.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190424_140733-e1560821856573-1746759998245.jpg\">', 'Review - PAGUYUBAN SOUND SYSTEM JOMBANG (PSSJ)', 'review-paguyuban-sound-system-jombang-pssj'),
('0e997491-8579-48c0-9283-ad029c8ed2d3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'KESERUAN ACR RHYME DESIBEL DI ACARA PRO AVL INDONESIA EXPO 2024', 'keseruan-acr-rhyme-desibel-di-acara-pro-avl-indonesia-expo-2024', '<p>PRO AVL Indonesia Expo merupakan pameran audio dan lighting terbesar di Indonesia. Acara ini diadakan di JIEXPO Kemayoran, Jakarta pada tanggal 29-31 Oktober 2024 dan dihadiri oleh berbagai macam brand dari berbagai macam negara; seperti JBL, Saramonic, Lampro, dll. Pada kesempatan kali ini, Sinar Baja Electric menjadi salah satu perusahaan produk speaker dari Indonesia yang mengikuti acara tersebut. Sinar Baja Electric membawa brand-brand yang sudah tidak asing lagi di telinga para pecinta audio: ACR, Rhyme serta Desibel.</p><p></p><p>Di acara kali ini pun, Sinar Baja Electric juga menampilkan produk-produk terbaru yang menjadi keunikan dari tiap brandnya dari tweeter, speaker 8 inch , 12 inch hingga 18inch. Pengunjung juga bisa mendengarkan demo sound untuk sound system dari Rhyme. Berikut list speaker yang dibawakan:</p><p></p><p><strong>ACR FABULOUS SERIES</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3-1746781553782.png\"><p></p><p><strong>ACR BLACK SERIES</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2-1746781564956.png\"><p></p><p><strong>DESIBEL</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4-1746781580005.png\"><p></p><p><strong>RHYME</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image (1)-1746781589452.png\"><p></p><p>Di booth indoor hari pertama, Rhyme meriliskan produk terbarunya: RM 1284 SB. System ini menggunakan speaker 18 inch 113188 SW FAB SERIES sebanyak 2 pcs. Sama seperti serian sebelumnya, RM 1283 SB, sistem ini juga dapat diinstall secara horisontal dan vertikal. Material yang digunakan juga menggunakan Birch Plywood dari Rusia yang kualitasnya sudah tidak diragukan lagi dari kalangan pecinta sound system. Pada area ini banyak dari pengunjung yang mendengarkan secara langsung demo dari RM 1284 SB dan RM 126 LA.</p><p></p><p>Pada bagian outdoor, Rhyme menjadi satu-satunya brand yang melakukan demo sound Line Array dan Subwoofer. Rhyme membawakan 6 pcs RM 226 LA yang didrive dengan amplifier R4500 dan R7000, serta 8 pcs RM 1283 SB Mk1 yang didrive dengan amplifier R 17000-D</p><p></p><p>“Menurut saya Rhyme ini produk lokal yang paling baik. Dia punya bassnya punch, mid highnya juga lantang, artikulasi jelas, dan bass nya mantap. Menurut saya Rhyme menang untuk lokal,” ujar Bapak Ir. Tjandra Ghozalli, pemimpin redaksi majalah Audiopro.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MRwXuKJN2sE?si=e4iNeNDRk-m1ScKL\" start=\"0\"></iframe></div><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MNBXBDlQE2k?si=6uXYDHq0jV0lg5tn\" start=\"0\"></iframe></div>', '2024-11-11 17:00:00.000', 'admin', '2025-05-09 09:07:26.370', '2025-07-03 01:43:18.050', '', '', '<p>PRO AVL Indonesia Expo is the largest audio and lighting exhibition in Indonesia. The event was held at JIEXPO Kemayoran, Jakarta, from October 29–31, 2024, and attended by a wide range of brands from various countries such as JBL, Saramonic, Lampro, and others. On this occasion, Sinar Baja Electric was proud to be one of the Indonesian speaker manufacturers participating in the event. Sinar Baja Electric showcased its well-known audio brands: ACR, Rhyme, and Desibel.</p><p></p><p>During the exhibition, Sinar Baja Electric also introduced its latest products that represent the uniqueness of each brand—from tweeters, 8-inch, 12-inch, to 18-inch speakers. Visitors also had the opportunity to enjoy sound system demos from Rhyme.</p><p>Below is the list of speakers showcased:</p><p></p><p><strong>ACR FABULOUS SERIES</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3-1746781553782.png\"><p></p><p><strong>ACR BLACK SERIES</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2-1746781564956.png\"><p></p><p><strong>DESIBEL</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4-1746781580005.png\"><p></p><p><strong>RHYME</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image (1)-1746781589452.png\"><p></p><p>On the first day at the indoor booth, Rhyme launched its newest product: RM 1284 SB. This system uses two 18-inch 113188 SW FAB SERIES speakers. Just like its predecessor, the RM 1283 SB, this system can also be installed both horizontally and vertically. The cabinet is made of Russian Birch Plywood, a material whose quality is well-regarded among sound system enthusiasts. Many visitors listened to live demos of the RM 1284 SB and RM 126 LA in this area.</p><p></p><p>In the outdoor area, Rhyme stood out as the only brand performing Line Array and Subwoofer sound demos. Rhyme showcased 6 units of RM 226 LA, driven by R4500 and R7000 amplifiers, and 8 units of RM 1283 SB Mk1, driven by the R17000-D amplifier.</p><blockquote><p></p><p>“In my opinion, Rhyme is the best local product. It has punchy bass, strong mid-highs, clear articulation, and solid low-end. I think Rhyme is the winner among local brands,”<br>said Mr. Ir. Tjandra Ghozalli, Editor-in-Chief of Audiopro Magazine.</p><p></p></blockquote><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MRwXuKJN2sE?si=e4iNeNDRk-m1ScKL\" start=\"0\"></iframe></div><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MNBXBDlQE2k?si=6uXYDHq0jV0lg5tn\" start=\"0\"></iframe></div>', 'THE EXCITEMENT OF ACR RHYME DESIBEL AT THE PRO AVL INDONESIA EXPO 2024', 'the-excitement-of-acr-rhyme-desibel-at-the-pro-avl-indonesia-expo-2024'),
('11b437d2-2da4-4acb-beb1-6c239845bc64', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Laporan Pameran Sound System – PSDS Demak 29 - 30 JULI 2023', 'laporan-pameran-sound-system-psds-demak-29-30-juli-2023', '<p>Komunitas Paguyuban Rental Sound System Demak mengadakan Pameran Sound System pada tanggal 29 - 30 Juli 2023. Pameran ini bertujuan &nbsp;menjalin keakraban dan saling berbagi pengalaman antar anggota ,produsen/vendor perlengkapan audio.</p><p></p><p>Tahun 2023 ini Pameran dilaksanakan di Desa Wisata Candisari, Kec. Mraggen, Kab. Demak, Jawa Tengah.Pameran dimeriahkan dengan sponsor-sponsor serta rental-rental yang berada di sekitaran Kab. Demak &amp; Kab. Semarang. Sponsor / peserta yang ikut yaitu : Fest, Harddwell, Borneo, Hz- Pro, Dexo, Zetapro, JK Acoustic, SPL, dan Rhyme. Selain itu juga ada 20 Rental yang ikut baik dalam kelas Ground Stack atau Hajatan.</p><p></p><p>Untuk peserta / rental juga ada diadakan lomba nilai SPL tertinggi dengan lagu wajib yang sudah disediakan oleh pihak panitia. Para sponsor juga mendapatkan kesempatan untuk mendemokan speaker terbaiknya. Sehingga tidak kalah dengan para peserta rental.</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Para pengunjung yang hadir sangat antusias untuk datang ke lapak serta menghadiri demo sound produk dari tiap – tiap sponsor yang hadir. Dalam stand ACR, terdapat promo – promo menarik seperti bonus merchandise (kaos &amp; topi) di setiap pembeliannya, serta penjualan barang lelang. Juga sekaligus launching dan perkenalan produk terbaru dari ACR series yaitu Fabulous 113188 (double magnet).</p><p></p><p>Pada kesempatan kali ini kami bekerjasama dengan salah satu pengguna dan pengemar produk ACR - Rhyme yaitu Bang Jack (MJM Pro) yang membantu menjualkan speaker-speaker ACR. Bang Jack mampu menjual beberapa produk ACR sperti 6in - 18in tipe Fabulous serta 18700 Deluxe juga.</p><p></p><p>Pada kesempatan kali ini, ACR-RHYME membawa line array Rhyme RM 103 LA sebanyak 6 box, Rhyme subwoofer RM 1283 SB sebanyak 6 box. Penampilan speaker Rhyme ini banyak mendapat pujian dari pengunjung baik warga Demak maupun pengunjung luar Demak. Suara dan bentuk karakter yang dihasilkan oleh speaker Rhyme ini sangat OKE dan hasil suara juga nyaman serta tidak pecah untuk di dengar di telinga baik dari dekat atau dari jarak jauh.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSDS-Demak-1-1746771551843.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230729164719_01-1024x576-1746771557093.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG202307301151401-1024x768-1746771563096.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230730120426-1024x768-1746771574046.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230729102635-1024x768-1746771581827.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG202307291028501-1024x768-1746771589220.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG2023072910271311-1024x768-1746771597066.jpg\">', '2023-08-13 17:00:00.000', 'admin', '2025-05-09 06:20:02.165', '2025-07-03 02:16:00.284', '', '', '<p>The Paguyuban Rental Sound System Demak community held a Sound System Exhibition on July 29-30, 2023. The exhibition aimed to foster camaraderie and share experiences among members, audio equipment manufacturers, and vendors.</p><p></p><p>In 2023, the exhibition was held at Desa Wisata Candisari, Mraggen District, Demak Regency, Central Java. The event was enlivened by sponsors and rental companies from around Demak and Semarang regencies. Sponsors and participants included Fest, Harddwell, Borneo, Hz-Pro, Dexo, Zetapro, JK Acoustic, SPL, and Rhyme. Additionally, 20 rental companies participated, either in the Ground Stack or Hajatan classes.</p><p></p><p>For participants/rentals, a competition was held for the highest SPL score using a mandatory song provided by the committee. Sponsors were also given the opportunity to demo their best speakers, competing alongside the rental participants.</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>Visitors were very enthusiastic about visiting the booths and attending product sound demos from each sponsor. At the ACR booth, attractive promotions were offered, such as bonus merchandise (t-shirts &amp; hats) with every purchase and items for auction sale. The event also featured the launch and introduction of the latest ACR series product, the Fabulous 113188 (double magnet).</p><p></p><p>On this occasion, we collaborated with one of the users and fans of ACR-Rhyme products, Bang Jack (MJM Pro), who helped sell ACR speakers. Bang Jack successfully sold several ACR products ranging from 6in to 18in Fabulous types and the 18700 Deluxe as well.</p><p></p><p>For this event, ACR-RHYME brought 6 boxes of Rhyme RM 103 LA line array and 6 boxes of Rhyme RM 1283 SB subwoofer. The Rhyme speaker performance received much praise from visitors, both locals from Demak and visitors from outside Demak. The sound and character produced by the Rhyme speakers were excellent, with a comfortable and clear sound that did not distort when heard both up close and from a distance.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSDS-Demak-1-1746771551843.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230729164719_01-1024x576-1746771557093.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG202307301151401-1024x768-1746771563096.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230730120426-1024x768-1746771574046.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20230729102635-1024x768-1746771581827.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG202307291028501-1024x768-1746771589220.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG2023072910271311-1024x768-1746771597066.jpg\">', 'Sound System Exhibition Report – PSDS Demak, July 29–30, 2023', 'sound-system-exhibition-report-psds-demak-july-29-30-2023'),
('1531e09d-6048-4303-a879-ffa3374fd798', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Cara Registrasi My SBE', 'cara-registrasi-my-sbe', '<p>Aplikasi My SBE merupakan aplikasi yang dapat membantu kalian untuk melihat toko -&nbsp; toko yang menjual produk dari Sinar Baja Electric. Dalam aplikasi tersebut juga terdapat katalog ACR, Legacy, Prestige, hingga Curve. Bagi para pecinta speaker, kalian wajib untuk mendownload aplikasi ini.</p><h4>Berikut cara untuk registrasi pada aplikasi tersebut:</h4><ol><li><p>Download aplikasi <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;pli=1\">My SBE</a> pada Play Store</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1690942016-1-1746770287659.jpg\"><ol start=\"2\"><li><p>Pilih menu Daftar pada My SBE</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2-477x1024-1746770319848.jpg\"><ol start=\"3\"><li><p>Isi data diri yang diperlukan beserta password</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3-482x1024-1746770336337.jpg\"><ol start=\"4\"><li><p>Setelah berhasil daftar, kalian sudah dapat menggunakan aplikasi tersebut</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4-pop-up-1746770352115.jpg\"><p>Jika ingin melihat lebih detail, bisa buka tautan video dibawah ini:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/ph0X6JcGz9E?si=gdrzH1L3rMKXpRfd\" start=\"0\"></iframe></div>', '2023-05-09 17:00:00.000', 'admin', '2025-05-09 05:59:40.960', '2025-07-03 02:19:18.415', '', '', '<p>The My SBE app is an application that helps you find stores selling products from Sinar Baja Electric. The app also contains catalogs for ACR, Legacy, Prestige, and Curve. For speaker enthusiasts, you must download this app.</p><p></p><p><strong>Here is how to register on the app:</strong></p><ol><li><p>Download the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;pli=1\">My SBE app</a> from the Play Store.</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1690942016-1-1746770287659.jpg\"><ol start=\"2\"><li><p>Choose \"Daftar\" in My SBE app</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2-477x1024-1746770319848.jpg\"><ol start=\"3\"><li><p>Fill in the required personal data along with a password.</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3-482x1024-1746770336337.jpg\"><ol start=\"4\"><li><p>After successfully registering, you can start using the application.</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4-pop-up-1746770352115.jpg\"><p>If you want to see more details, you can open the video link below:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/ph0X6JcGz9E?si=gdrzH1L3rMKXpRfd\" start=\"0\"></iframe></div>', 'How to Register for My SBE', 'how-to-register-for-my-sbe'),
('18c8daa5-42c0-4308-a24e-0821cad3b235', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'MENJADI SPONSOR TUNGGAL, ACR RHYME DESIBEL MEMERIAHKAN ACARA PSSLT DI LAMPUNG TIMUR', 'menjadi-sponsor-tunggal-acr-rhyme-desibel-memeriahkan-acara-psslt-di-lampung-timur', '<p>Tim ACR Rhyme Desibel kembali mengikuti event parade sound system yang diadakan di Lampung Timur pada bulan Juli 2025. Acara yang diadakan oleh Paguyuban Sound System Lampung Timur ini berlokasi di Lapangan Merdeka Desa Hargomulyo 66. Sebagai sponsor tunggal, acara ini banyak dihadiri oleh seluruh warga di lampung timur. Komunitas juga mengajak para rental sound untuk ikut memeriahkan acara dengan mengikuti lomba-lomba yang diadakan seperti lomba SPL hingga lomba battle.</p><p></p><p>Dengan dihadiri oleh 40 peserta, beberapa rental tersebut memenangkan lomba dan rata-rata adalah pengguna dari ACR Fabulous dari 12in hingga 18in. Juara 1 Rigging dimenangkan oleh Trisula Audio yang menggunakan 18in 127187 SW Fab sebagai subwoofer di box parathel. “Suara jernih, keras. Pemakaian sudah 3 tahunan.”, ujar pemilik rental dari Trisula Audio. Juara 1 Groundstage dimenangkan oleh MDC Music, dan juara 1 Battle dimenangkan oleh Tantra Music</p><p></p><p>Beberapa peserta lain juga menggunakan produk dari ACR, seperti ZBM Audio yang menggunakan 18in 127187 SW Fab sebagai subwoofer, Alamba Audio menggunakan 18in 113183 Mk3 sebagai subwoofer di box CBS Nagasari dan untuk arraynya menggunakan 12in 75125 M Fab, Azzhara Audio menggunakan 18in 127187 SW Fab sebagai subwoofer di box Martin, Arta Plus menggunakan 12in array 3060 M Fab sebagai middle. “Middlenya kerasa banget. Semoga Fabulous makin jaya, pokoknya maju terus.” ujar pemilik rental Arta Plus.</p><p></p><p>Sinar Baja Electric juga mensupport beberapa hadiah untuk para pemenang, antara lain CD 44B Desibel, 6in array 1550 M Fab ACR Series, hingga 12in 100122 W Fab yang merupakan produk terbaru dari Fabulous yang paling banyak ditunggu oleh kalangan pecinta ACR.</p><p></p><p>Pada area lapak, ACR bekerja sama dengan salah satu dealer resmi ACR, yaitu JS Electric untuk menampilkan produk-produk unggulannya mulai dari ACR, hingga Legacy. Rhyme juga mendemokan 126 LA sebanyak 6 pcs dan 1284 SB sebanyak 8 pcs. Pada penghujung acara, tim beserta pengunjung beramai-ramai membongkar RM 1284 SB untuk mengetahui driver speaker yang digunakan</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/4WhAqfrAtKk?rel=1\" start=\"0\"></iframe></div>', '2025-07-22 17:00:00.000', 'admin', '2025-08-08 07:20:36.634', '2025-08-08 07:20:36.632', '', '', '<p>The ACR Rhyme Desibel team once again participated in the sound system parade event held in East Lampung in July 2025. The event, organized by the East Lampung Sound System Association, took place at Lapangan Merdeka, Hargomulyo 66 Village. As the sole sponsor, the event was attended by the entire community of East Lampung. The community also invited sound rental companies to enliven the event by participating in competitions such as the SPL contest and battle competitions.</p><p></p><p>With 40 participants in attendance, several of these rentals won competitions, and most of them were users of ACR Fabulous, ranging from 12 inches to 18 inches. First place in the Rigging category was won by Trisula Audio, which used the 18-inch 127187 SW Fab as a subwoofer in a Parathel box. “Clear, loud sound. We’ve been using it for about 3 years,” said the owner of Trisula Audio. First place in the Groundstage category went to MDC Music, and first place in the Battle category was won by Tantra Music.</p><p></p><p>Several other participants also used ACR products, such as ZBM Audio, which used the 18-inch 127187 SW Fab as a subwoofer; Alamba Audio, which used the 18-inch 113183 Mk3 as a subwoofer in a CBS Nagasari box and the 12-inch 75125 M Fab for the array; Azzhara Audio, which used the 18-inch 127187 SW Fab as a subwoofer in a Martin box; and Arta Plus, which used the 12-inch array 3060 M Fab as the midrange. “The midrange really stands out. Hopefully, Fabulous will continue to thrive; just keep moving forward,” said the owner of Arta Plus.</p><p></p><p>Sinar Baja Electric also supported the event by providing several prizes for the winners, including the CD 44B Desibel, the 6-inch array 1550 M Fab ACR Series, and the 12-inch 100122 W Fab, which is Fabulous’ latest and most anticipated product among ACR enthusiasts.</p><p></p><p>In the booth area, ACR collaborated with one of its official dealers, JS Electric, to showcase its flagship products ranging from ACR to Legacy. Rhyme also demonstrated six units of the 126 LA and eight units of the 1284 SB. At the end of the event, the team and visitors gathered to dismantle the RM 1284 SB to see the speaker driver used.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/4WhAqfrAtKk?rel=1\" start=\"0\"></iframe></div>', 'BECOMING THE SOLE SPONSOR, ACR RHYME DESIBEL LIVENS UP THE PSSLT EVENT IN EAST LAMPUNG', 'becoming-the-sole-sponsor-acr-rhyme-desibel-livens-up-the-psslt-event-in-east-lampung'),
('1cd76fa8-5669-4c84-ab01-1173680575c1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - SEMARAK KOLABORASI SOUND SYSTEM KEDIRI (PSS-JATIM, PSSJK, SSC)', 'review-semarak-kolaborasi-sound-system-kediri-pss-jatim-pssjk-ssc', '<p>Acara Parade Sound System dan Demo Produk merupakan event yang diselengarakan oleh Paguyuban Sound System Jawa Timur (PSS-Jatim) yang sudah dilaksanakan setiap tahunnya, di tahun ini dilaksanakan di Kota Kediri. Acara ini juga merupakan acara gabungan dari PSS-Jatim, Komunitas Sound System Jenangan Kediri (PSSJK) , dan Sound System Comunnity (SSC). Acara &nbsp;ini diselengarakan tanggal &nbsp;07 – 08 Maret yang berlokasi di Lapangan terbuka, di Kecamatan Grogol, Kab. Kediri.</p><p></p><p>Acara berlangsung lancar namun H-1 dan Hari H sempat diguyur hujan sehingga area jadi sedikit basah sehingga agak kesulitan dalam proses persiapannya. Tetapi Pengunjung yang datang memang lumayan tetapi tidak seramai tahun lalu. Kami diundang sebagai salah satu sponsor dengan beberapa sponsor lainnya seperti Sound Queen, SPL Audio, Trendy ATV, dan Rhyme Pro-Audio.</p><p></p><p>Produk yang kami demokan yaitu RM 103 LA (10in single, 2-way) dan Subwoofer RM 1283 SB (18in double), dengan konfigurasi 6x4 Box. Serta kami menggunakan Amplifier Rhyme R-4500 sebanyak 3 &nbsp;untuk mengangkat line array dan Amplifier Rhyme R-7000 sebanyak 4 (system Bride) untuk mengangkat subwoofernya.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSS-04-1024x768-1746762572904.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104900-1746762580549.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104914-1746762586994.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSS-09-1024x768-1746762593784.jpg\">', '2020-04-28 17:00:00.000', 'admin', '2025-05-09 03:50:01.644', '2025-07-03 03:18:01.322', '', '', '<p>The Sound System Parade and Product Demo is an annual event organized by the East Java Sound System Community (PSS-Jatim). This year, it was held in the city of Kediri. The event was a collaboration between PSS-Jatim, the Sound System Community of Jenangan Kediri (PSSJK), and the Sound System Community (SSC). It took place on March 7–8 at an open field in the Grogol District, Kediri Regency.</p><p></p><p>The event ran smoothly, although both the day before and the event day were hit by rain, which made the area slightly wet and caused some difficulties during setup. Visitor turnout was decent, though not as crowded as the previous year. We were invited as one of the sponsors, along with other sponsors such as Sound Queen, SPL Audio, Trendy ATV, and Rhyme Pro-Audio.</p><p></p><p>The products we demoed included the RM 103 LA (10in single, 2-way) line array and the RM 1283 SB (18in double) subwoofer, in a 6x4 box configuration. We used three Rhyme R-4500 amplifiers to power the line array and four Rhyme R-7000 amplifiers (bridged system) to power the subwoofers.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSS-04-1024x768-1746762572904.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104900-1746762580549.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104914-1746762586994.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PSS-09-1024x768-1746762593784.jpg\">', 'Review – SOUND SYSTEM COLLABORATION IN KEDIRI (PSS-JATIM, PSSJK, SSC)', 'review-sound-system-collaboration-in-kediri-pss-jatim-pssjk-ssc');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('21d1971e-bc9b-4ff6-92ea-004b98aaad07', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'PRODUK LOKAL KEBANGGAAN INDONESIA: ACR RHYME DESIBEL HADIR DI JAVME 2024', 'produk-lokal-kebanggaan-indonesia-acr-rhyme-desibel-hadir-di-javme-2024', '<p>Tanggal 27 – 30 November 2024, Jakarta Audio Video Music Expo (JAVME) 2024 mengadakan pameran pertamanya di JIEXPO Kemayoran, Jakarta. Pameran B2B ini dihadiri oleh berbagai macam industri audio, musik hingga video dari berbagai negara. Selain itu, acara ini juga menampilkan kegiatan <em>business forum</em> yang diadakan di salah satu hall-nya.</p><p></p><p>Sinar Baja Electric, speaker dari Indonesia dengan tagline 100% Karya Anak Bangsa, membawa brand ACR Rhyme Desibel untuk menampilkan produk-produk terbarunya dan mengundang banyak perhatian dari seluruh pengunjung yang ada. Tidak hanya dibagian indoor, pada bagian outdoor pun juga menampilkan RM 226 LA dan RM 1283 SB yang memiliki kualitas suara dan performa yang tidak kalah dari brand luar. Berikut tipe-tipe yang ditampilkan selama pameran:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1746859093015.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1-1746859100476.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2-1746859122510.png\"><p></p><p><strong>Desibel</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3-1746859136222.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4-1746859148229.png\"><p></p><p>Pada tanggal 29 November 2024, tim Sinar Baja Electric mendapatkan kesempatan untuk menjadi pembicara di <em>business forum</em> yang telah disediakan oleh tim JAVME. Acara tersebut juga dihadiri oleh HSBS (Himpunan Soundsystem Bandung Selatan) yang ikut aktif dalam mengajukan beberapa pertanyaan dan keluhan dari pengguna produk ACR, salah satunya terkait harga Fabulous yang lebih mahal dibandingkan dengan produk kompetitor. “Fabulous merupakan line up tertinggi dari ACR. Jadi kalau membandingkan dengan brand lain jangan dari harganya saja, tetapi dari spesifikasinya juga.” ujar Yonathan, salah satu tim marketing dari Sinar Baja Electric.</p><p></p><p>ACR baru saja meluncurkan brand line up terbarunya, yaitu ACR Black Series yang terdiri dari tweeter hingga 18inch. Brand ini memiliki harga yang lebih murah tetapi dengan standar kualitas dari Sinar Baja Electric. “Teman-teman bisa mencoba brand line up terbaru dari kami. Jangan lupa kita produk Indonesia, sparepart selalu ready, mau servis tinggal dibawa ke pabrik kami di Surabaya dan akan kembali seperti baru.” tambah Yonathan.</p><p></p><p>HSBS juga ikut hadir ke booth indoor dan outdoor dari Sinar Baja Electric. Di bagian outdoor juga melakukan test sound pada produk-produk terbaru dari Rhyme</p><p></p><p>“Mudah-mudahan HSBS akan menjadi satu mitra terutama untuk produk sound system yang ada di Indonesia. Kita bandingkan dengan produk-produk luar lebih baik kita menggunakan produk sendiri asli Indonesia,” kata ketua HSBS</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06043-1024x683-1746859200063.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06021-1-1024x683-1746859216367.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06086-1024x683-1746859220386.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/KcS5yUyGQtg?si=J5BOcNgHm_Co6Djf\" start=\"0\"></iframe></div>', '2024-12-10 08:00:00.000', 'admin', '2025-05-10 06:40:05.274', '2025-07-03 01:37:46.980', '', '', '<p>From November 27 to 30, 2024, the Jakarta Audio Video Music Expo (JAVME) 2024 held its first-ever exhibition at JIEXPO Kemayoran, Jakarta. This B2B exhibition was attended by a wide range of industries, including audio, music, and video from various countries. In addition, the event also featured a business forum held in one of the exhibition halls.</p><p></p><p>Sinar Baja Electric, a proudly Indonesian speaker manufacturer with the tagline \"100% Made in Indonesia\", brought its brands ACR, Rhyme, and Desibel to showcase their latest products—drawing significant attention from all visitors. Not only in the indoor area, but the outdoor demo area also featured the RM 226 LA and RM 1283 SB, which delivered impressive sound quality and performance, comparable to international brands.</p><p>Below are the types of products displayed during the exhibition:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1746859093015.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1-1746859100476.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2-1746859122510.png\"><p></p><p><strong>Desibel</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3-1746859136222.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4-1746859148229.png\"><p></p><p>On November 29, 2024, the Sinar Baja Electric team had the opportunity to be a speaker at the business forum provided by the JAVME team. The event was also attended by HSBS (South Bandung Sound System Association), who actively raised several questions and concerns from ACR product users—one of which was about the Fabulous series being more expensive compared to competitor products. “Fabulous is ACR’s highest lineup. So if you’re comparing it to other brands, don’t just look at the price—compare the specifications as well,” said Yonathan, a member of Sinar Baja Electric’s marketing team.</p><p></p><p>ACR recently launched its newest lineup, the ACR Black Series, which ranges from tweeters to 18-inch drivers. This lineup is more affordable but still maintains the quality standards of Sinar Baja Electric. “Friends can try out our newest product lineup. And don’t forget—we are an Indonesian brand. Spare parts are always available, and if you need service, just bring it to our factory in Surabaya and it’ll be like new again,” Yonathan added.</p><p></p><p>HSBS also visited both the indoor and outdoor booths of Sinar Baja Electric. At the outdoor area, they participated in a sound test of the latest products from Rhyme.</p><p></p><blockquote><p>“Hopefully, HSBS will become a key partner—especially for sound system products in Indonesia. Rather than using imported products, it’s better we support and use our own local products made in Indonesia,” said the chairman of HSBS.</p></blockquote><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06043-1024x683-1746859200063.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06021-1-1024x683-1746859216367.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT06086-1024x683-1746859220386.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/KcS5yUyGQtg?si=J5BOcNgHm_Co6Djf\" start=\"0\"></iframe></div>', 'INDONESIA\'S PROUD LOCAL PRODUCT: ACR RHYME DESIBEL PRESENT AT JAVME 2024', 's-proud-local-product-acr-rhyme-desibel-present-at-javme-2024'),
('29f3f8bc-7fa9-4db8-ae99-557f7ca9448a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - FESTIVAL SOUND SYSTEM JENANGAN KEDIRI #3', 'review-festival-sound-system-jenangan-kediri-3', '<p>Pameran sound system yang ke-3 oleh Komunitas di Kab. Kediri terselenggara sangat meriah dan lancar serta acara yang tertata rapi oleh pihak panitia dari PSSJK&nbsp; di Lapangan Desa Menang, Kec. Pagu, Kab. Kediri. Pameran ini dilaksanakan pada tanggal 5 – 6 Oktober 2019, yang bertemakan “Bersama Kita Saudara” dengan maksud untuk meningkatkan rasa solidaritas dan berbagi pengalaman antar sound system se-Kab. Kediri.</p><p></p><p>Kemeriahan pameran tersebut didukung penuh oleh antusiasme pengunjung dan masyarakat sekitar baik pada siang hari maupun dimalam hari. Peserta yang ikut dalam perlombaan cukup banyak juga, mereka datang dari berbagai daerah disekitar Kota Kediri, selain peserta terdapat sponsor dan kami adalah salah satu sponsor yang berpartisipasi mendukung acara tersebut. Selama 2 hari pameran berlangsung stand bazar ACR terus menerus didatangi oleh pengunjung dan untuk Produk RHYME, kami mendemokan produk Line Array 10in double (RM 103 LA) dan Subwoofer 18in double (RM 1283 SB)&nbsp; serta Amplifier kami R-4500 (untuk&nbsp; Mid-High) dan R-7000 (untuk Low / Subwoofer). Pengunjung banyak yang memberi nilai positif dan menilai bahwa produk dari RHYME sangat bagus dan berkualitas, tidak kalah dengan produk-produk dari Importir.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-02-1024x683-1746762275543.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104414-1746762279846.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-12-1024x498-1746762283895.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-01-e1574999763703-355x1024-1746762286967.jpg\">', '2019-11-27 17:00:00.000', 'admin', '2025-05-09 03:44:58.525', '2025-07-03 03:18:42.440', '', '', '<p>The 3rd sound system exhibition organized by the community in Kediri Regency was held successfully and festively, with the event well-organized by the committee from PSSJK at the Menang Village Field, Pagu District, Kediri Regency. The exhibition took place on October 5–6, 2019, with the theme “Together We Are Brothers,” aiming to strengthen solidarity and share experiences among sound system enthusiasts throughout Kediri Regency.</p><p></p><p>The excitement of the exhibition was fully supported by the enthusiasm of visitors and the local community, both during the day and at night. A large number of participants joined the competition, coming from various areas around the city of Kediri. In addition to participants, there were also sponsors, and we were one of the sponsors supporting the event. Throughout the two-day exhibition, the ACR booth was constantly visited by attendees. For RHYME products, we demoed the 10-inch double Line Array (RM 103 LA) and the 18-inch double Subwoofer (RM 1283 SB), along with our Amplifiers: R-4500 (for Mid-High) and R-7000 (for Low/Subwoofer). Visitors gave positive feedback and noted that RHYME products are excellent and high-quality, comparable to imported products.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-02-1024x683-1746762275543.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104414-1746762279846.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-12-1024x498-1746762283895.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Kediri-01-e1574999763703-355x1024-1746762286967.jpg\">', 'Review – Jenangan Kediri Sound System Festival #3', 'review-jenangan-kediri-sound-system-festival-3'),
('2ce3bf26-1ea4-4029-aebe-6d18e5ee1012', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'PRODUK LOKAL KARYA ANAK BANGSA: ACR RHYME DESIBEL, TAMPIL DI ACARA PSS JATIM EXHIBTION 3 2024', 'produk-lokal-karya-anak-bangsa-acr-rhyme-desibel-tampil-di-acara-pss-jatim-exhibtion-3-2024', '<p>PPSJ Exhibition 3 pada tahun 2024 ini diadakan di Porong, tepatnya di SunCity Biz Porong – Siodarjo. Acara ini diadakan selama 2 hari dari tanggal 21-22 Desember 2024, dan dihadiri oleh brand-brand ternama dari luar negeri hingga Indonesia. Sebagai salah satu speaker buatan lokal terbesar se-Indonesia, Sinar Baja Electric ikut hadir di acara ini dengan membawa beberapa brand, mulai dari ACR, Rhyme, hingga Desibel.</p><p></p><p>Tiap brand membawa produk unggulan yang menjadi ciri khas dari produk tersebut. Berikut tipe-tipe yang ditampilkan selama pameran:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image (1)-1746859537023.png\"><p></p><p><strong>ACR Excellent Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1 (1)-1746859555152.png\"><p></p><p><strong>ACR Deluxe Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2 (1)-1746859567421.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3 (1)-1746859575352.png\"><p></p><p><strong>Desibel</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4 (1)-1746859587276.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-6-1746859600349.png\"><p></p><p>Di area demo, Rhyme secara eksklusif menampilkan produk terbarunya, yaitu RM 226 LA sebanyak 6 pcs, dan RM 1284 SB sebanyak 8 pcs dengan menggunakan power amplifier R17000-D. Dengan live demo berdurasi 5-8 menit per sesinya, tampilan sound system lokal ini tidak kalah memukau dibandingkan dengan brand lainnya.</p><p></p><p>Acara ini juga menyelenggarakan lomba Mixing yang diadakan di hari pertama dan lomba Glerrity yang diadakan di hari kedua. Sebanyak 15 peserta terlihat antusias dan semangat dalam mengikuti lomba tersebut.</p><p></p><p>“Hasilnya bagus. Saya suka ACR karena dipakai di box yang berbeda hasilnya tetap bagus. Untuk kedepannya mau coba speaker 18in yang terbaru.”, kata Aufar, pemilik TJ Audio, salah satu peserta lomba di PSSJ</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h36m20s822-1024x576-1746859625435.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h27m52s209-1024x576-1746859628918.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h28m58s756-1024x576 (1)-1746859707250.png\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/5wpqMoavK6M?si=9x3OUIN0CfUWr6YI\" start=\"0\"></iframe></div>', '2024-12-27 08:00:00.000', 'admin', '2025-05-10 06:46:56.412', '2025-07-03 01:37:22.600', '', '', '<p>PSSJ Exhibition 3 in 2024 was held in Porong, specifically at SunCity Biz Porong – Sidoarjo. The event took place over two days, from December 21 to 22, 2024, and was attended by prominent brands from both international and Indonesian markets. As one of the largest local speaker manufacturers in Indonesia, Sinar Baja Electric participated in the exhibition by showcasing several of its brands, including ACR, Rhyme, and Desibel.</p><p></p><p>Each brand brought its flagship products, highlighting the unique features that define their identity. Below are the types of products displayed during the exhibition:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image (1)-1746859537023.png\"><p></p><p><strong>ACR Excellent Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1 (1)-1746859555152.png\"><p></p><p><strong>ACR Deluxe Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-2 (1)-1746859567421.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-3 (1)-1746859575352.png\"><p></p><p><strong>Desibel</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-4 (1)-1746859587276.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-6-1746859600349.png\"><p></p><p>In the demo area, Rhyme exclusively showcased its latest products, namely 6 units of RM 226 LA and 8 units of RM 1284 SB, powered by the R17000-D amplifier. With live demos lasting 5–8 minutes per session, this local sound system setup proved just as impressive as those from other well-known brands.</p><p></p><p>The event also featured a Mixing Competition on the first day and a Glerrity Competition on the second day. A total of 15 participants enthusiastically took part in the competitions.</p><p></p><blockquote><p>“The results are great. I like ACR because even when used in different enclosures, the outcome is still excellent. Moving forward, I plan to try the newest 18-inch speaker,”<br>said Aufar, owner of TJ Audio, one of the competition participants at PSSJ.</p></blockquote><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h36m20s822-1024x576-1746859625435.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h27m52s209-1024x576-1746859628918.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/vlcsnap-2024-12-27-13h28m58s756-1024x576 (1)-1746859707250.png\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/5wpqMoavK6M?si=9x3OUIN0CfUWr6YI\" start=\"0\"></iframe></div>', 'LOCAL PRODUCT BY THE NATION’S YOUTH: ACR RHYME DESIBEL, FEATURED AT THE PSS JATIM EXHIBITION 3 2024', 'local-product-by-the-nation-s-youth-acr-rhyme-desibel-featured-at-the-pss-jatim-exhibition-3-2024'),
('2f5b5041-7770-4dce-bb5e-08a69fe57d56', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Merchandise Eksklusif Untuk Kalian Para Juara ACR', 'merchandise-eksklusif-untuk-kalian-para-juara-acr', '<p>Pada bulan September 2023, ACR membuat event khusus untuk pemenang lomba Sound System yang menggunakan produk ACR di wilayah manapun. Event ini bertujuan untuk menunjukkan bahwa speaker dalam negeri tidak kalah dengan produk dari luar negeri. Berikut cara pemenang lomba untuk mendapatkan merchandise dari ACR:</p><p></p><p>Follow Instagram dan Like Facebook ACR</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design1-1-1746774780294.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design-1-1746774783144.jpg\"><p></p><p>Posting foto speaker beserta piala kalian melalui Instagram atau Facebook</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ParaJuaraACR-1024x776-1746774804885.png\"><p>*Foto salah satu pemenang lomba yang menggunakan speaker ACR</p><p></p><p>Pastikan kalian juga memposting foto piagam dan piala (foto harus terlihat jelas)</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/a-1746774838481.jpg\"><p>*Foto piagam dan piala salah satu pemenang lomba yang menggunakan speaker ACR</p><p></p><p>Sertakan foto system yang menggunakan speaker ACR</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/a1-1746774884441.jpg\"><p>*Foto speaker dalam system salah satu pemenang lomba yang menggunakan speaker ACR</p><p></p><ul><li><p>Tag Instagram atau Facebook ACR Speaker &amp; sertakan hashtag #ParaJuaraACR pada caption</p></li></ul><p>Tim ACR akan memilih secara acak 1 akun setiap bulannya dan me-repost foto pemenang ACR ke akun social milik ACR. Setelah itu, tim akan langsung menghubungi pemenang untuk mengirimkan merchandise dari ACR. Selamat mengikuti!</p>', '2024-01-29 17:00:00.000', 'admin', '2025-05-09 07:15:15.116', '2025-07-03 02:12:54.305', '', '', '<p>In September 2023, ACR organized a special event for winners of Sound System competitions who used ACR products in any region. This event aimed to show that local speakers are just as good as international products. Here’s how winners can receive merchandise from ACR:</p><p></p><p>Follow ACR on Instagram and Like ACR on Facebook.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design1-1-1746774780294.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design-1-1746774783144.jpg\"><p></p><p>Post a photo of your speaker along with your trophy on Instagram or Facebook</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ParaJuaraACR-1024x776-1746774804885.png\"><p>*Photo of one of the competition winners using ACR speakers</p><p></p><p>Make sure you also post a photo of the certificate and trophy (the photo must be clearly visible).</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/a-1746774838481.jpg\"><p>*Photo of the certificate and trophy of one of the competition winners using ACR speakers</p><p></p><p>Include a photo of the system using ACR speakers.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/a1-1746774884441.jpg\"><p>*Photo of the speaker system used by one of the competition winners featuring ACR speakers</p><p></p><ul><li><p>Tag ACR Speaker’s Instagram or Facebook account &amp; include the hashtag #ParaJuaraACR in the caption.</p></li></ul><p>The ACR team will randomly select 1 account each month and repost the winner’s photo on ACR’s official social media account. After that, the team will contact the winner directly to send out ACR merchandise. Good luck!</p>', 'Exclusive Merchandise for You, the ACR Champions!', 'exclusive-merchandise-for-you-the-acr-champions'),
('30621014-ff63-49af-88c1-09930fe11fc4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Laporan Pameran Sound System – PSPT PATI 12 – 13 AGUSTUS 2023', 'laporan-pameran-sound-system-pspt-pati-12-13-agustus-2023', '<p>Pada tahun 2023 ini PSPT Pati mengadakan acara parade sound system yang digelar rutin tahunan, Pada Tahun 2023 ini digelar di Lapangan Pulau Sprapat – Juwana , Pati – Jawa Tengah. Kegiatan ini dilakukan pada tanggal 12 – 13 Agustus &nbsp;2023. Pameran parade sound sistem ini juga dimeriahkan oleh beberapa sponsor lainnya yang melakukan demo produk mereka masing - masing. Selain parade sound dan demo, terdapat juga lomba – lomba yang dilakukan oleh tim panitia PSPT Pati. Yaitu mulai dari kelas Bisnis Class &amp; Executive Class.</p><p></p><p>Terdapat 2 kategori kelas yang dilombakan, mulai dari Clarity/ Live Mixing hingga adu SPL. Materi lagu yang dilombakan sudah disiapkan oleh panitia kurang lebih sekitar 4-5 menit. Peserta yang ikut lomba mencapai 64 rental. Untuk Bisnis class diberikan klasifikasi yaitu :18” sebanyak 8 pcs, 15” sebanyak 4 pcs, Mid sebanyak 8 pcs, dan TW menyesuaikan. Sedangkan untuk Executive Class diberikan klasifikasi yaitu : 18” sebanyak 12 pcs, 15” sebanyak 4 pcs, Mid sebanyak 12 pcs, dan TW menyesuaikan.</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Para pengunjung yang hadir juga banyak pada hari minggunya baik ke lapak ACR maupun lapak lainya yang melihat barang – barang yang dipajang diarea lapak, juga terdapat barang baru seperti Fabulous 18inch double Magnet 113188, serta pengenalan produk brand baru Desibel. Juga terdapat display untuk produk baru seperti 6” 1550 Fabulous &amp; 10” 75105 Fabulous.</p><p></p><p>Pada Event PSPT Pati ini, ACR-RHYME membawa sejumlah speaker system untuk didemokan, yaitu&nbsp; membawa 6 box Line Array RM 103 LA (double 10”) serta membawa box custom (Horn Loaded) sebanyak 4 Box yang berisikan Fabulous 113186 double / box nya. Lalu Rhyme tipe RM 103 LA &nbsp;dijalankan dengan menggunakan Ampli R4500 sebanyak 3 box. Dan untuk subwoofer nya menggunakan R7000 sebanyak 2 box Ampli</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2-1746772182108.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1-1746772187447.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5-1746772194429.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4-1746772200472.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6-1746772205568.jpg\">', '2023-08-19 17:00:00.000', 'admin', '2025-05-09 06:30:12.758', '2025-07-03 02:15:21.803', '', '', '<p>In 2023, PSPT Pati held its annual sound system parade event at Pulau Sprapat Field – Juwana, Pati – Central Java, on August 12–13, 2023. The exhibition was enlivened by several other sponsors who showcased and demoed their products. In addition to the parade and demo sessions, the PSPT Pati committee also organized competitions, including Business Class and Executive Class categories.</p><p></p><p>There were two main competition classes: Clarity/Live Mixing and SPL battle. The tracks used for the competition were provided by the committee, each lasting around 4–5 minutes. A total of 64 sound rental teams participated.</p><p></p><ul><li><p>Business Class specifications: 8 pcs of 18”, 4 pcs of 15”, 8 pcs of midrange, and tweeters as needed.</p></li><li><p>Executive Class specifications: 12 pcs of 18”, 4 pcs of 15”, 12 pcs of midrange, and tweeters as needed.</p></li></ul><p><strong>Exhibition &amp; Booths</strong></p><p>On Sunday, many visitors came to the ACR booth and others to view the products on display. Among the highlights were the newly launched 18” Fabulous double magnet 113188, the introduction of the new Desibel brand, and displays of new products like the 6” 1550 Fabulous and 10” 75105 Fabulous.</p><p></p><p>At the PSPT Pati event, ACR-RHYME showcased a complete speaker system demo setup, including 6 RM 103 LA line array boxes (double 10”) and 4 custom horn-loaded boxes equipped with Fabulous 113186 double drivers per box. The RM 103 LA line arrays were powered by 3 units of R4500 amplifiers, while the subwoofers used 2 units of R7000 amplifiers.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2-1746772182108.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1-1746772187447.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5-1746772194429.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4-1746772200472.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6-1746772205568.jpg\">', 'Sound System Exhibition Report – PSPT Pati, August 12–13, 2023', 'sound-system-exhibition-report-pspt-pati-august-12-13-2023'),
('332f1c03-cde5-4428-8631-e1bb8087fe85', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Parade Syawalan Sound System Yogyakarta', 'parade-syawalan-sound-system-yogyakarta', '<p>ACR Speaker dan Rhyme Pro-Audio akan hadir untuk Kota Yogyakarta dan sekitarnya, dalam acara Sound System Syawalan Yogyakarta 2019.</p><ul><li><p>Tanggal 26 Juni - 27 Juni 2019</p></li><li><p>Di Halaman Parkir Stadion Sultan Agung Bantul.</p></li></ul><p>Ada promo-promo yang bisa Anda dapatkan dr Produk ACR Speaker&nbsp;dan Rhyme Pro-Audio akan membawa speaker-speaker terbaiknya.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-Syawalan-Jogja-2019-e1560824342220-1746760117496.jpeg\">', '2019-06-17 17:00:00.000', 'admin', '2025-05-09 03:08:48.718', '2025-07-03 03:23:27.792', '', '', '<p>ACR Speaker and Rhyme Pro-Audio will be present in Yogyakarta and surrounding areas at the 2019 Yogyakarta Sound System Syawalan event.</p><ul><li><p>Date: June 26 – June 27, 2019</p></li><li><p>Location: Parking Area of Sultan Agung Stadium, Bantul</p></li></ul><p>There will be special promotions available on ACR Speaker products, and Rhyme Pro-Audio will showcase its best speakers.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-Syawalan-Jogja-2019-e1560824342220-1746760117496.jpeg\">', 'Syawalan Sound System Parade Yogyakarta', 'syawalan-sound-system-parade-yogyakarta'),
('362f6cd2-5562-4f7c-bd0c-d9a1b978f9b8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Syawalan Komunitas Rental Sound System Yogyakarta', 'syawalan-komunitas-rental-sound-system-yogyakarta', '<p><strong>Syawalan Komunitas Rental Sound System Yogyakarta</strong></p><ul><li><p><em>Tanggal : 20 - 21 Juli 2016</em></p></li><li><p><em>Lokasi :&nbsp;Stadion Sultan Agung, Pacar Jetis, Bantul, Yogyakarta</em></p></li></ul><p><strong>ACR dan Rhyme</strong> berpartisipasi dalam acara <strong><em>Syawalan</em></strong> yang diadakan oleh <em>Komunitas Rental Sound System Yogyakarta</em> setiap tahunnya.</p><p>Datang dan dapatkan promo-promo menarik dari kami !</p>', '2016-12-31 17:00:00.000', 'admin', '2025-05-09 01:42:11.488', '2025-07-03 03:28:06.703', '', '', '<p><strong>Syawalan of Yogyakarta Rental Sound System Community</strong></p><ul><li><p>Date: 20 – 21 July 2016</p></li><li><p>Location: Sultan Agung Stadium, Pacar Jetis, Bantul, Yogyakarta</p></li></ul><p><strong>ACR and Rhyme</strong> are participating in the <strong>Syawalan </strong>event organized annually by the Yogyakarta Rental Sound System Community.</p><p>Come and get exciting promotions from us!</p>', 'Syawalan of the Yogyakarta Sound System Rental Community', 'syawalan-of-the-yogyakarta-sound-system-rental-community'),
('448ab82a-ec90-45fc-bbc8-21a428fd605c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'KOLABORASI EKSLUSIF: SINAR BAJA ELECTRIC DENGAN BREWOG', 'kolaborasi-ekslusif-sinar-baja-electric-dengan-brewog', '<p>Semakin berkembangnya dunia sound system di Indonesia, Sinar Baja Electric mengajak kerjasama dengan berbagai macam influencer untuk memperkenalkan speaker lokal buatan Indonesia, mulai dari Youtuber, Tiktokers, hingga pemilik rental. Di tahun 2025 ini, Sinar Baja Electric berkesempatan untuk bekerjasama dengan pemilik rental terkenal: Brewog Audio.</p><p></p><p>Brewog adalah pemilik rental sound system sekaligus YouTuber dari Blitar yang piawai dalam merakit sound system untuk acara karnaval. Setelah bertahun-tahun di dunia sound system, beliau memiliki kompleks ruko sound system dan lighting yang berlokasi di Jl. Jawa, Togongan I, Kabupaten Blitar. Di ruko-ruko tersebut menjual berbagai macam brand-brand terkemuka. Beliau juga bekerja sama dengan Sinar Baja Electric untuk membantu memperkenalkan brand-brand lokal seperti ACR, Desibel, hingga Rhyme.</p><p></p><p>Pada bulan Februari 2025, Brewog berkunjung ke pabrik Sinar Baja Electric untuk mengetahui proses pembuatan speaker dalam bentuk driver hingga box system. Bersama tim Sinar Baja Electric, Brewog berkeliling dari pabrik Sinar Baja Electric Kertosono, Surabaya, Pasuruan. “Ternyata ya lengkap, lokal tapi punya segalanya.” ujar Brewog.</p><p></p><p>Berikut dokumentasinya:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lV3jhRbIeL0?si=sXWSH4xFCaZgq6l-\" start=\"0\"></iframe></div>', '2025-03-07 08:00:00.000', 'admin', '2025-05-10 06:52:26.858', '2025-07-03 01:34:13.609', '', '', '<p>As the sound system industry continues to grow in Indonesia, Sinar Baja Electric is collaborating with a variety of influencers to promote locally-made Indonesian speakers. These collaborations include YouTubers, TikTok creators, and rental business owners. In 2025, Sinar Baja Electric has the opportunity to work with a well-known rental owner: Brewog Audio.</p><p></p><p>Brewog is a sound system rental owner and YouTuber from Blitar, known for his expertise in building sound systems for carnival events. After years of working in the sound system industry, he has established a complex of sound and lighting shops located on Jl. Jawa, Togongan I, Blitar Regency. These shops sell various well-known brands. He also partners with Sinar Baja Electric to help promote local brands such as ACR, Desibel, and Rhyme.</p><p></p><p>In February 2025, Brewog visited the Sinar Baja Electric factories to learn about the speaker manufacturing process—from the driver stage to the box system. Alongside the Sinar Baja Electric team, Brewog toured the facilities in Kertosono, Surabaya, and Pasuruan. \"Turns out it’s all complete—local but has everything,\" said Brewog.</p><hr><p></p><p>Here’s the documentation of his visit:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lV3jhRbIeL0?rel=1\" start=\"0\"></iframe></div>', 'EXCLUSIVE COLLABORATION: SINAR BAJA ELECTRIC WITH BREWOG', 'exclusive-collaboration-sinar-baja-electric-with-brewog'),
('44bddf6f-18f6-409f-b5d0-4b67895b92e8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2015', 'smex-2015', '<p><strong>RHYME &amp; ACR akan hadir dalam pameran audio :</strong></p><h3><strong>SMEX \"Surabaya Music Expo\"</strong></h3><ul><li><p><em>Tanggal :&nbsp;19 - 22 Maret 2015</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li></ul><p>Disini anda bisa melihat dan menyentuh bahkan mendengarkan semua type RHYME dan ACR FABULOUS series yang didisplay di booth kami yang berada didalam Exihibition Hall, Dan Dengarkan demo produk terbaru RHYME&nbsp;<strong>RM 126 LA,Dual 12″ 3way, Line Array Elements</strong>&nbsp;di halaman depan Exhibition Hall.</p><p>Kami juga mengeluarkan type baru :</p><ul><li><p><strong>15\" PA 100155 SW</strong> Fabulous by ACR</p></li><li><p><strong>15\" PA 75155 W</strong> Fabulous by ACR</p></li><li><p><strong>8\" ARRAY 20601</strong> M Fabulous by ACR</p></li><li><p><strong>RM 126 LA,</strong>&nbsp;Dual 12″ 3way, Line Array Elements (RHYME)</p></li></ul><p>adapun promo-promo yang kami tawarkan :</p><ul><li><p><strong>Beli 10 bayar 9</strong>, untuk produk ACR</p></li><li><p><strong>Beli 5 bayar 4</strong>, untuk produk RHYME</p></li></ul><p>Datang lah di Booth kami dan dapatkan promo-promo menarik !</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/poster-smex2015-1746754841188.jpg\">', '2015-02-13 17:00:00.000', 'admin', '2025-05-09 01:40:48.725', '2025-07-03 03:28:17.834', '', '', '<p><strong>RHYME &amp; ACR will be present at the audio exhibition:</strong></p><h3><strong>SMEX \"Surabaya Music Expo\"</strong></h3><ul><li><p>Date: 19 – 22 March 2015</p></li><li><p>Location: Exhibition Hall Grand City, Surabaya</p></li></ul><p>Here, you can see, touch, and even listen to all RHYME and ACR FABULOUS series types displayed at our booth inside the Exhibition Hall. Also, listen to the demo of RHYME’s latest product, <strong>RM 126 LA</strong>, <strong>Dual 12″ 3-way Line Array Elements, </strong>at the front yard of the Exhibition Hall.</p><p>We are also releasing new types:</p><ul><li><p><strong>15\" PA 100155 SW</strong> Fabulous by ACR</p></li><li><p><strong>15\" PA 75155 W</strong> Fabulous by ACR</p></li><li><p><strong>8\" ARRAY 20601</strong> M Fabulous by ACR</p></li><li><p><strong>RM 126 LA,</strong> Dual 12″ 3-way Line Array Elements (RHYME)</p></li></ul><p>Our special promotions include:</p><ul><li><p><strong>Buy 10, pay for 9</strong> – for ACR products</p></li><li><p><strong>Buy 5, pay for 4</strong> – for RHYME products</p></li></ul><p>Visit our booth and enjoy our special promotions!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/poster-smex2015-1746754841188.jpg\">', 'SMEX 2015', 'smex-2015'),
('46c15eb7-45cb-405c-9937-8816da142a16', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pameran Sound System – KSTB Komunitas Sound Sistem Tretan Bangkalan (Bangkalan Horeg Festival 2024) Pada 25 – 26  MEI 2024', 'pameran-sound-system-kstb-komunitas-sound-sistem-tretan-bangkalan-bangkalan-horeg-festival-2024-pada-25-26-mei-2024', '<p>Kali ini, KSTB – Bangkalan mengadakan parade sound system dengan tema Horeg, yang digelar pada 25-26 Mei 2024 di Sinjay Residence. Para partisipan yang hadir harus mengikuti syarat utama dengan membawakan speaker subwoofer 18in terbaiknya sebanyak 16 pcs. Event kali ini tergolong sangat spesial, karena dilengkapi dengan hiburan musik bergenre lagu Dj serta lighting show yang diadakan pada malam hari.</p><p></p><p><strong>Acara&nbsp;&amp;&nbsp;Bazar</strong></p><p></p><p>Pada lapak, ACR membawa barang display yang berisikan tipe-tipe ACR Series yang banyak diminita oleh para peserta seperti 18in 127187 SW Fab, 18in 113188 SW Fab double magnet, dan juga 18in 113186 SW Fab dengan max power 2000 watt. Desibel membawakan produk unggulannya yaitu 18in 451006 Desibel. Untuk Rhyme membawa RM 81 LA, RM 151 FSB, serta box custom dhampoed (paraflex) yang menggunakan driver 18in 113188 SW Fab</p><p></p><p>Untuk demo product pada event kali ini, ACR Rhyme membawa 6 box RM 126 LA yang berisikan 3-way line array diatur dengan menggunakan mode Triamp dan di drive menggunakan amplifier Rhyme R4500 . Lalu untuk subwoofer , Rhyme membawa 8 box RM 1283 SB disusun berdiri dan juga menggunakan amplifier tipe terbaru dari Rhyme yaitu Amplifier D17000 dengan kelas D berisi 2 channel.</p><p></p><p>Saat live demo berlangsung, pemgunjung yang ada dalam acara tersebut antusias dengan suara dari speaker buatan Sinar Baja Electric. Mereka bergabung untuk mendengarkan serta merekam suaranya. Speaker buatan dari Indonesia ini juga memberikan kesan yang mendalam pada salah satu komunitas, TJ Audio, yang ikut berpartisipasi dalam acara tersebut, \"Kesannya oke, mau di gebe-geber gimanapun, alhamdullilah, tidak pernah <em>brojol</em>,\" kata salah satu anggota TJ Audio yang saat itu menggunakan box Supali beriis 18in 127187 SW Fab</p><p></p><p>Berikut dokumentasinya:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01893-1024x683-1746779982731.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01971-1024x683-1746779988814.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01881-1024x683-1746779995725.jpg\"><p></p><p>Selengkapnya dapat dilihat pada Youtube Channel <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker – Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/91nNNsX9WdY?si=BCJwOdETauIyyRta\" start=\"0\"></iframe></div>', '2024-06-26 17:00:00.000', 'admin', '2025-05-09 08:40:38.396', '2025-07-03 02:09:27.034', '', '', '<p>This time, KSTB – Bangkalan held a sound system parade with the theme <em>Horeg</em>, which took place on May 25–26, 2024, at Sinjay Residence. All participants were required to bring their best 16 pcs of 18in subwoofers as the main condition for entry. This event was particularly special as it featured DJ music performances and a lighting show held in the evening.</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>At their booth, ACR displayed some of the most sought-after models among participants, such as:</p><ul><li><p>18in 127187 SW Fab</p></li><li><p>18in 113188 SW Fab (double magnet)</p></li><li><p>18in 113186 SW Fab with a maximum power of 2000 watts</p></li></ul><p>Desibel featured its flagship 18in 451006 Desibel, and Rhyme showcased:</p><ul><li><p>RM 81 LA</p></li><li><p>RM 151 FSB</p></li><li><p>A custom dhampoed (paraflex) box powered by the 18in 113188 SW Fab driver</p></li></ul><p></p><p>For the product demo, ACR Rhyme brought:</p><ul><li><p>6 RM 126 LA boxes with a 3-way line array system configured in Triamp mode, powered by the Rhyme R4500 amplifier</p></li><li><p>8 RM 1283 SB subwoofer boxes, stacked vertically and powered by Rhyme’s latest D17000 amplifier, a 2-channel Class D unit</p></li></ul><p></p><p>During the live demo, visitors showed strong enthusiasm for the sound produced by speakers made by Sinar Baja Electric. Many gathered to listen and record the performance. The Indonesian-made speakers left a strong impression on one of the participating communities, TJ Audio, which used a Supali box loaded with 18in 127187 SW Fab.</p><blockquote><p><em>“The impression is great. No matter how hard we push it, thank God, it never blew out,”</em> said one of the TJ Audio members.</p></blockquote><p></p><p>Here is the documentation:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01893-1024x683-1746779982731.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01971-1024x683-1746779988814.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT01881-1024x683-1746779995725.jpg\"><p></p><p>For more details, you can visit the YouTube Channel: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker – Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/91nNNsX9WdY?si=BCJwOdETauIyyRta\" start=\"0\"></iframe></div>', 'Sound System Exhibition – KSTB (Komunitas Sound Sistem Tretan Bangkalan) at Bangkalan Horeg Festival 2024 on May 25–26, 2024', 'sound-system-exhibition-kstb-komunitas-sound-sistem-tretan-bangkalan-at-bangkalan-horeg-festival-2024-on-may-25-26-2024'),
('4e6f3e3f-7315-4688-ad89-7a161101b08f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Speaker Terbaru Dari Deluxe ACR Series: 18in 18710 DLX & 15in 15710 DLX', 'speaker-terbaru-dari-deluxe-acr-series-18in-18710-dlx-15in-15710-dlx', '<p>Setelah meluncurkan double magnet dan double demper dari serian Fabulous: 18in PA-113188 SW FAB dan berhasil mendapatkan respon positif serta memikat banyak hati pecinta speaker di seluruh Indonesia, Sinar Baja Electric kembali meluncurkan produk terbaru untuk Deluxe Series. Terdapat 2 tipe &nbsp;yang telah di pasarkan, yaitu 18in 18710 DLX yang diluncurkan pada bulan Agustus 2023, serta 15in 15710 DLX yang diluncurkan pada bulan September 2023</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18710_manual-removebg-preview-1-1746773809240.png\"><p>18\" 18710 DLX</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/artikel-15710-DLX1-1746773827678.png\"><p>15\" 15710 DLX</p><p></p><p>Dari tampilan luar, kedua speaker ini memiliki warna chassis yang sama, yaitu silver. Chassis ini terbuat dari bahan aluminium die cast khusus sehingga frame menjadi kokoh.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1-1746773853051.png\"><p>Kedua tipe ini sama-sama memiliki voice coil 4 inch, serta triple surround yang membuat jangkauan suaranya menjadi jauh dan lebar.</p><p></p><p>Speaker ini sengaja dirancang untuk menjadikan speaker lokal berkualitas dengan harga yang lebih murah, sehingga mampu bersaing &nbsp;dengan produk-produk dari luar.</p><p></p><p>Berikut spesifikasi lengkap dari <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/18710-dlx\">18in 18710 DLX</a> dan <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/15710-dlx\">15in 15710 DLX</a></p>', '2023-10-02 17:00:00.000', 'admin', '2025-05-09 07:00:10.662', '2025-07-03 02:14:21.825', '', '', '<p>After launching the double magnet and double damper speaker from the Fabulous Series — the 18in PA-113188 SW FAB — and receiving positive responses while capturing the hearts of speaker enthusiasts across Indonesia, Sinar Baja Electric has once again introduced new products for the Deluxe Series.</p><p>Two new models have been released: the 18in 18710 DLX, launched in August 2023, and the 15in 15710 DLX, launched in September 2023.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18710_manual-removebg-preview-1-1746773809240.png\"><p>18\" 18710 DLX</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/artikel-15710-DLX1-1746773827678.png\"><p>15\" 15710 DLX</p><p></p><p>From the outside, both speakers have the same chassis color, which is silver. The chassis is made from a special aluminum die-cast material, making the frame sturdy and durable.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1-1746773853051.png\"><p>Both of these models feature a 4-inch voice coil and triple surround, which allows for a wider and farther sound projection.</p><p></p><p>These speakers are specifically designed to provide high-quality local speaker options at more affordable prices, making them competitive with imported products.</p><p></p><p>Below are the complete specifications for the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/18710-dlx\">18in 18710 DLX</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/15710-dlx\">15in 15710 DLX</a>:</p>', 'Latest Speakers from the ACR Deluxe Series: 18in 18710 DLX & 15in 15710 DLX', 'latest-speakers-from-the-acr-deluxe-series-18in-18710-dlx-15in-15710-dlx');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('515a0b1c-a011-4aeb-9e4d-7890397ee713', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System oleh Komunitas Lamongan (PASLAB)', 'review-pameran-sound-system-oleh-komunitas-lamongan-paslab', '<p>Pameran Sound System yang diselenggarakan oleh komunitas sound system di daerah Lamongan - Jawa Timur berjalan lancar dengan kondisi dan situasi baru yaitu menggunakan masker serta menjalankan protokol kesehatan. Pameran ini berlangsung selama 2 hari, pada tanggal 13 dan 14 November 2021 dengan jumlah 4 sponsor, yaitu Rhyme, SPL Audio, JK Akustic, dan STX Pro. Pameran ini juga mengajak temen-temen Rental untuk bisa melakukan silahturahimi antar rental sound serta melakukan bakti sosial terhadap anak yatim dengan memberikan dana santunan.</p><p></p><p>Pengunjung yang datang cukup antusias meskipun hujan datang serta lokasi lapangan yang banyak genangan karena 2 hari berturut-turut sudah diguyur hujan. Produk speaker ACR juga banyak dicari oleh pengunjung seperti tipe 10in dan 12in Array Fabulous. Kemudian untuk produk system Rhyme juga dapat komentar yang positif serta merasa bangga jika produk lokal tidak kalah bagus dengan produk import.</p><p></p><p>Produk yang dipakai untuk Demo yaitu Line Array 10in double (RM 103 LA) dengan Subwoofer 18in double (RM 1283) serta di dukung oleh semua power dari Rhyme Professional Audio (R4500 dan R7000). Selain itu, ada juga Rhyme Mini dengan single 8in (RM 81 LA) ditambah subwoofer flying 15in single (RM 151 FSB), dan untuk Subwoofernya 18in single horn loaded.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00930-1024x576-1746763909546.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00921-1024x576-1746763916353.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111115-1746763922461.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00948-1024x576-1746763928635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111132-1746763939427.png\">', '2021-11-28 17:00:00.000', 'admin', '2025-05-09 04:12:21.629', '2025-07-03 03:16:15.233', '', '', '<p>The Sound System Exhibition organized by the sound system community in the Lamongan area of East Java ran smoothly under new conditions, with attendees wearing masks and following health protocols. The exhibition took place over two days, on November 13 and 14, 2021, with four sponsors: Rhyme, SPL Audio, JK Akustic, and STX Pro. The event also encouraged rental crews to foster relationships among one another and participate in a social service initiative by donating funds to orphans.</p><p></p><p>Despite the rain and waterlogged field caused by two consecutive days of rainfall, visitor turnout remained enthusiastic. ACR speaker products were in high demand, especially the 10in and 12in Array Fabulous models. Rhyme system products also received positive feedback, with many expressing pride in the fact that local products could match the quality of imported ones.</p><p></p><p>The products used for the demo included the 10in double Line Array (RM 103 LA) with 18in double Subwoofers (RM 1283), supported by Rhyme Professional Audio power amplifiers (R4500 and R7000). Additionally, the Rhyme Mini system with a single 8in (RM 81 LA) and a flying single 15in subwoofer (RM 151 FSB) was featured, along with a single horn-loaded 18in subwoofer.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00930-1024x576-1746763909546.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00921-1024x576-1746763916353.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111115-1746763922461.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00948-1024x576-1746763928635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111132-1746763939427.png\">', 'Review – Sound System Exhibition by Lamongan Community (PASLAB)', 'review-sound-system-exhibition-by-lamongan-community-paslab'),
('5202d2cd-f77c-4422-b31b-59f49fd26982', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Highlight Event Sound System 2022', 'highlight-event-sound-system-2022', '<p>Berikut cuplikan tiap - tiap Event yang kami lakukan selama Tahun 2022. Semoga di Tahun berikutnya dapat melaksanakan event yang lebih banyak dan lebih menarik lagi.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1.-Sdrjo-1-1746769691859.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124332-min-1746769705116.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2.-Tgalek-1-1746769718432.jpg\"><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3.-Jmbg-1-1746769728626.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124351-min-1746769735524.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4.-Grsik-1-1746769748478.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124408-min-1746769758891.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5.-Jmbr-4-1024x683-1746769769192.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124427-min-1746769781829.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6.-Madura-1-1746769794176.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/7.-Psruan-1-1746769802986.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124452-min-1746769815796.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/8.-Pati-1-1746769827614.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124510-min-1746769837932.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/9.-Demak-1-1746769850243.jpg\">', '2023-02-23 17:00:00.000', 'admin', '2025-05-09 05:47:38.214', '2025-07-03 02:20:08.318', '', '', '<p>Here is a glimpse of each event we held throughout 2022. Hopefully, in the coming year, we can organize even more events that are more exciting and engaging.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1.-Sdrjo-1-1746769691859.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124332-min-1746769705116.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/2.-Tgalek-1-1746769718432.jpg\"><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3.-Jmbg-1-1746769728626.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124351-min-1746769735524.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4.-Grsik-1-1746769748478.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124408-min-1746769758891.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5.-Jmbr-4-1024x683-1746769769192.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124427-min-1746769781829.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6.-Madura-1-1746769794176.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/7.-Psruan-1-1746769802986.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124452-min-1746769815796.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/8.-Pati-1-1746769827614.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 124510-min-1746769837932.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/9.-Demak-1-1746769850243.jpg\">', '2022 Sound System Event Highlights', '2022-sound-system-event-highlights'),
('52effe72-b0e7-4cae-945d-bfeb60451bac', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SPAREPART ACR YANG TERSEDIA DI DEALER RESMI', 'sparepart-acr-yang-tersedia-di-dealer-resmi', '<p>Sebagai perusahaan speaker lokal, CV. Sinar Baja Electric menyediakan jasa servis kepada seluruh pengguna ACR speaker. Pengguna dapat mengirimkan speakernya ke Jl. Margomulyo no 5, Surabaya dan menghubungi admin servis ke 0811 3382 830. Proses servis ini membutuhkan waktu 5 hari kerja.</p><p></p><p>Selain menyediakan jasa servis, dealer resmi Sinar Baja Electric juga menjual voice coil hingga recone kit beberapa tipe speaker yang memudahkan pengguna di luar pulau jawa untuk servis sendiri. Berikut listnya:</p><p></p><p></p><p><strong>VOICE COIL/SPUL</strong></p><ul><li><p>10in PA-10880-Mk3 EXCEL ACR SERIES</p></li><li><p>10in ARRAY 2560 M FAB ACR SERIES</p></li><li><p>12in PA-12880 Mk3 EXCEL ACR SERIES</p></li><li><p>12in ACR 1230 BLACK</p></li><li><p>12in 1238-PC ACR CLASSIC NEW</p></li><li><p>12in 1240-PA ACR CLASSIC</p></li><li><p>12in ACR-1225 NEW</p></li><li><p>12in ARRAY 3060 M FAB ACR SERIES</p></li><li><p>12in PA-75125 M FAB ACR SERIES</p></li><li><p>12in ACR-15200 NEW</p></li><li><p>15in ACR-15600BL/15in ACR-15500 BL PL</p></li><li><p>15in PA-15900-Mk1 PRE ACR SERIES</p></li><li><p>15in PA-15890-Mk IV EXCEL ACR SERIES</p></li><li><p>18in PA-18900-MkI PRE ACR SERIES</p></li><li><p>18in PA-18890-MkIV EXCEL ACR SERIES</p></li><li><p>21in AX-21800-Mk1 BLACK GRAND ACR</p></li><li><p>15in PA-75155 W-MK I FAB ACR SERIES</p></li><li><p>15in PA-100152 -MK I SW FAB ACR SERIES</p></li><li><p>15inPA-113156 SW FAB ACR SERIES</p></li><li><p>18inPA-100182-Mk3 SW FAB ACR SERIES</p></li><li><p>18inPA-113182-MK II SW FAB ACR SERIES</p></li><li><p>18inPA-113183 -MK II SW FAB ACR SERIES</p></li><li><p>21inPA-113212 SW FAB ACR SERIES</p></li><li><p>15in PA-15838 EXCEL ACR SERIES</p></li><li><p>18in PA-18838 EXCEL ACR SERIES</p></li><li><p>15in 15700-MK I DLX ACR SERIES</p></li><li><p>18in 18700-MK I DLX ACR SERIES</p></li><li><p>15in 15737 DLX ACR SERIES</p></li><li><p>18inPA-113186 SW FAB ACR SERIES</p></li><li><p>18inPA-100187 SW FAB ACR SERIES</p></li><li><p>18inPA-113187 SW FAB ACR SERIES</p></li><li><p>18inPA-113188 SW FAB ACR SERIES</p></li><li><p>18inPA-127187/21in PA-127212 SW FAB</p></li></ul><p></p><p><strong>RECONE KIT</strong></p><ul><li><p>CD 250C1-08 (CD 1) ACR / CD 250C1-08F-MK I ACR</p></li><li><p>CD 250T1-08F-MK I ACR</p></li><li><p>CD 440T1-08 (CD 4)</p></li><li><p>CD 380C1-08 (CD 6) ACR</p></li><li><p>CD 340T1N-08 (CD7/9)/CD340T1B-08F-Mk1</p></li><li><p>CD 250P1-08 (CD10)/CD 250P1B-08F FAB</p></li><li><p>CD 750TR15B-08 FABULOUS BY ACR</p></li><li><p>CD14 FABULOUS BY ACR</p></li><li><p>CD 650TR15B-08F FAB ACR SERIES</p></li><li><p>CD 440PK1-04N FAB ACR SERIES</p></li><li><p>CD 440K1B-08F FAB ACR SERIES</p></li><li><p>CD 440PK1B-08F FAB ACR SERIES</p></li><li><p>10in ARRAY 2560 M FAB ACR SERIES</p></li><li><p>10in ARRAY 6510-Mk1 M FAB ACR SRS</p></li><li><p>12in ARRAY 3060 M FAB ACR SERIES</p></li><li><p>15in PA-75155 W-Mk1 FAB ACR SERIES</p></li><li><p>15in PA-15900 PRE NEW ACR SERIES</p></li><li><p>15inPA-15890 EXC PRO BY ACR</p></li><li><p>21in AX-21800 BLACK GRAND ACR</p></li><li><p>15in 15700 DLX ACR SERIES</p></li><li><p>18in18700 DLX ACR SERIES</p></li><li><p>15in 15737 DLX ACR SERIES</p></li><li><p>15in PA-15838 EXCEL ACR SERIES</p></li><li><p>18in PA-18838 EXCEL ACR SERIES</p></li><li><p>15inPA-100152-Mk1 SW FAB ACR SERIES</p></li><li><p>18inPA-127187 SW FAB ACR SERIES</p></li><li><p>18inPA-100182-Mk3 SW FAB ACR SERIES</p></li><li><p>18inPA-113182-Mk2 SW FAB ACR SERIES</p></li><li><p>18inPA-113183-Mk2 SW FAB ACR SERIES</p></li><li><p>18inPA-113188 SW FAB ACR SERIES</p></li><li><p>21inPA-113212 SW FAB ACR SERIES</p></li></ul><p></p><p>List dealer resmi ada di app My SBE, dan aplikasi tersebut tersedia di Play Store. Bagi pelanggan yang ingin membeli spare part secara online bisa membeli di tokopedia/shopee rekanan kami: Graha Sarana Audio</p>', '2025-04-25 07:00:00.000', 'admin', '2025-05-10 06:55:00.398', '2025-07-03 01:33:48.103', '', '', '<p>As a local speaker manufacturer, CV. Sinar Baja Electric provides repair services for all ACR speaker users. Users can send their speakers to Jl. Margomulyo no 5, Surabaya and contact the service admin at 0811 3382 830. The repair process takes approximately 5 working days.</p><p>In addition to repair services, official dealers of Sinar Baja Electric also sell voice coils and recone kits for several types of speakers, making it easier for users outside Java Island to perform repairs themselves. Below is the list:</p><p></p><p></p><p><strong>VOICE COIL/SPUL</strong></p><ul><li><p>10in PA-10880-Mk3 EXCEL ACR SERIES</p></li><li><p>10in ARRAY 2560 M FAB ACR SERIES</p></li><li><p>12in PA-12880 Mk3 EXCEL ACR SERIES</p></li><li><p>12in ACR 1230 BLACK</p></li><li><p>12in 1238-PC ACR CLASSIC NEW</p></li><li><p>12in 1240-PA ACR CLASSIC</p></li><li><p>12in ACR-1225 NEW</p></li><li><p>12in ARRAY 3060 M FAB ACR SERIES</p></li><li><p>12in PA-75125 M FAB ACR SERIES</p></li><li><p>12in ACR-15200 NEW</p></li><li><p>15in ACR-15600BL/15in ACR-15500 BL PL</p></li><li><p>15in PA-15900-Mk1 PRE ACR SERIES</p></li><li><p>15in PA-15890-Mk IV EXCEL ACR SERIES</p></li><li><p>18in PA-18900-MkI PRE ACR SERIES</p></li><li><p>18in PA-18890-MkIV EXCEL ACR SERIES</p></li><li><p>21in AX-21800-Mk1 BLACK GRAND ACR</p></li><li><p>15in PA-75155 W-MK I FAB ACR SERIES</p></li><li><p>15in PA-100152 -MK I SW FAB ACR SERIES</p></li><li><p>15inPA-113156 SW FAB ACR SERIES</p></li><li><p>18inPA-100182-Mk3 SW FAB ACR SERIES</p></li><li><p>18inPA-113182-MK II SW FAB ACR SERIES</p></li><li><p>18inPA-113183 -MK II SW FAB ACR SERIES</p></li><li><p>21inPA-113212 SW FAB ACR SERIES</p></li><li><p>15in PA-15838 EXCEL ACR SERIES</p></li><li><p>18in PA-18838 EXCEL ACR SERIES</p></li><li><p>15in 15700-MK I DLX ACR SERIES</p></li><li><p>18in 18700-MK I DLX ACR SERIES</p></li><li><p>15in 15737 DLX ACR SERIES</p></li><li><p>18inPA-113186 SW FAB ACR SERIES</p></li><li><p>18inPA-100187 SW FAB ACR SERIES</p></li><li><p>18inPA-113187 SW FAB ACR SERIES</p></li><li><p>18inPA-113188 SW FAB ACR SERIES</p></li><li><p>18inPA-127187/21in PA-127212 SW FAB</p></li></ul><p></p><p><strong>RECONE KIT</strong></p><ul><li><p>CD 250C1-08 (CD 1) ACR / CD 250C1-08F-MK I ACR</p></li><li><p>CD 250T1-08F-MK I ACR</p></li><li><p>CD 440T1-08 (CD 4)</p></li><li><p>CD 380C1-08 (CD 6) ACR</p></li><li><p>CD 340T1N-08 (CD7/9)/CD340T1B-08F-Mk1</p></li><li><p>CD 250P1-08 (CD10)/CD 250P1B-08F FAB</p></li><li><p>CD 750TR15B-08 FABULOUS BY ACR</p></li><li><p>CD14 FABULOUS BY ACR</p></li><li><p>CD 650TR15B-08F FAB ACR SERIES</p></li><li><p>CD 440PK1-04N FAB ACR SERIES</p></li><li><p>CD 440K1B-08F FAB ACR SERIES</p></li><li><p>CD 440PK1B-08F FAB ACR SERIES</p></li><li><p>10in ARRAY 2560 M FAB ACR SERIES</p></li><li><p>10in ARRAY 6510-Mk1 M FAB ACR SRS</p></li><li><p>12in ARRAY 3060 M FAB ACR SERIES</p></li><li><p>15in PA-75155 W-Mk1 FAB ACR SERIES</p></li><li><p>15in PA-15900 PRE NEW ACR SERIES</p></li><li><p>15inPA-15890 EXC PRO BY ACR</p></li><li><p>21in AX-21800 BLACK GRAND ACR</p></li><li><p>15in 15700 DLX ACR SERIES</p></li><li><p>18in18700 DLX ACR SERIES</p></li><li><p>15in 15737 DLX ACR SERIES</p></li><li><p>15in PA-15838 EXCEL ACR SERIES</p></li><li><p>18in PA-18838 EXCEL ACR SERIES</p></li><li><p>15inPA-100152-Mk1 SW FAB ACR SERIES</p></li><li><p>18inPA-127187 SW FAB ACR SERIES</p></li><li><p>18inPA-100182-Mk3 SW FAB ACR SERIES</p></li><li><p>18inPA-113182-Mk2 SW FAB ACR SERIES</p></li><li><p>18inPA-113183-Mk2 SW FAB ACR SERIES</p></li><li><p>18inPA-113188 SW FAB ACR SERIES</p></li><li><p>21inPA-113212 SW FAB ACR SERIES</p></li></ul><p></p><p>The list of official dealers can be found in the My SBE app, which is available on the Play Store. Customers who wish to purchase spare parts online can order through our partner stores on Tokopedia or Shopee, under the name Graha Sarana Audio.</p>', 'ACR SPARE PARTS AVAILABLE AT OFFICIAL DEALERS', 'acr-spare-parts-available-at-official-dealers'),
('55812775-c65b-4022-a04a-029aeec38e18', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR BAGI-BAGI THR MELALUI EVENT ACR JINGLE COMPETITION 2025!', 'acr-bagi-bagi-thr-melalui-event-acr-jingle-competition-2025', '<p>Dalam menyambut bulan suci Ramadhan di tahun 2025, ACR kembali bagi-bagi THR dalam event ACR Jingle Competition. Sama seperti tahun sebelumnya, ACR mengajak para Pecinta ACR dan pendukung produk lokal untuk mengikuti event remix lagu yang diselenggarakan pada tanggal 12 Feb – 12 Maret 2025 ini.</p><p></p><p>Berikut syarat dan ketentuannya:</p><p></p><ol><li><p>Peserta&nbsp;mengupload&nbsp;2&nbsp;file:&nbsp;</p><ul><li><p>Video&nbsp;ke&nbsp;Youtube&nbsp;pribadi</p></li><li><p>Audio&nbsp;ke&nbsp;wa&nbsp;admin&nbsp;(0812.3183.3504)&nbsp;dengan&nbsp;format&nbsp;file:&nbsp;WAV&nbsp;/&nbsp;FLAC</p></li></ul></li><li><p>Isi&nbsp;audio&nbsp;dalam&nbsp;video&nbsp;youtube&nbsp;=&nbsp;audio&nbsp;yang&nbsp;dikirim&nbsp;ke&nbsp;wa&nbsp;admin</p></li><li><p>Genre&nbsp;lagu&nbsp;EDM&nbsp;yang&nbsp;mengandung&nbsp;minimal&nbsp;2&nbsp;instrumen&nbsp;tradisional&nbsp;</p></li><li><p>Video&nbsp; memakai&nbsp; bingkai/&nbsp; frame&nbsp; yang&nbsp; telah&nbsp; disediakan,&nbsp; serta&nbsp; berisi&nbsp;&nbsp;produk&nbsp;/&nbsp; event&nbsp; yang&nbsp; berkaitan&nbsp; dengan&nbsp;ACR&nbsp;</p></li><li><p>Durasi&nbsp;minimal&nbsp;2&nbsp;menit&nbsp;dan&nbsp;maksimal&nbsp;5&nbsp;menit</p></li><li><p>Dalam&nbsp;remix&nbsp;lagu&nbsp;terdapat&nbsp;kata- kata&nbsp; ACR&nbsp;SPEAKER&nbsp; (boleh&nbsp; diletakkan&nbsp; di&nbsp;awal/&nbsp; tengah/&nbsp; hingga&nbsp; akhir&nbsp;video)</p></li><li><p>Format&nbsp;judul&nbsp;video:&nbsp;Jingle&nbsp;ACR&nbsp;–&nbsp;Nama&nbsp;peserta&nbsp;(Contoh:&nbsp;Jingle&nbsp;ACR&nbsp;–&nbsp;Sinarbaja)</p></li><li><p>Menunjukkan&nbsp;brand&nbsp;selain&nbsp;ACR&nbsp;dalam&nbsp;video&nbsp;otomatis&nbsp;akan&nbsp;gugur</p></li><li><p>Jika&nbsp;tidak&nbsp;mengikuti&nbsp;salah&nbsp;satu&nbsp;ketentuan&nbsp;yang&nbsp;disebutkan&nbsp; maka&nbsp;peserta&nbsp;akan&nbsp;gugur</p></li></ol><p></p><p><strong>JADWAL&nbsp;&amp;&nbsp;TANGGAL</strong></p><p></p><ol><li><p>Waktu&nbsp;upload&nbsp;video&nbsp;dan&nbsp;audio&nbsp;ada&nbsp;12&nbsp;Februari&nbsp;–&nbsp; 12 &nbsp;Maret&nbsp; 2025 &nbsp;menggunakan&nbsp; format&nbsp; yang &nbsp;sudah &nbsp;ditentukan</p></li><li><p>Waktu&nbsp;penilaian:&nbsp;17&nbsp;Maret&nbsp;2025</p></li><li><p>Pengumuman&nbsp; pemenang:&nbsp; 19&nbsp; Maret &nbsp;2025&nbsp; melalui &nbsp;sosmed &nbsp;IG &nbsp;@acrspeaker</p></li><li><p>Penyerahan&nbsp;hadiah:&nbsp;25&nbsp;Maret&nbsp;2025</p></li></ol><p></p><p><strong>HADIAH&nbsp;&amp;&nbsp;APRESIASI</strong></p><ol><li><p>Jingle&nbsp;yang&nbsp;dibuat&nbsp;akan&nbsp;diputar&nbsp;saat&nbsp;ACR&nbsp;melakukan&nbsp;demo&nbsp;sound&nbsp;system</p></li><li><p>Semua&nbsp;peserta&nbsp;mendapatkan&nbsp;piala&nbsp;dan&nbsp;merchandise&nbsp;eksklusif&nbsp;dari&nbsp;ACR</p></li><li><p>Pemenang&nbsp;akan&nbsp;mendapatkan&nbsp;uang&nbsp;tunai:</p><ul><li><p>Juara&nbsp;1:&nbsp;Rp&nbsp;2.500.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-</p></li><li><p>Juara&nbsp;2:&nbsp;Rp&nbsp;2.000.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-</p></li><li><p>Juara&nbsp;3:&nbsp;Rp&nbsp;1.500.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-</p></li><li><p>Harapan&nbsp;1:&nbsp;Rp&nbsp;500.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-</p></li><li><p>Harapan&nbsp;2:&nbsp;Rp&nbsp;300.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-</p></li><li><p>Harapan&nbsp;3:&nbsp;Rp&nbsp;200.000,-&nbsp;+&nbsp;Voucher&nbsp;belanja&nbsp;speaker&nbsp;Rp&nbsp;500.000,-<em>(pph&nbsp;ditanggung&nbsp;penyelenggara)</em></p></li></ul></li></ol><p></p><p><strong>KRITERIA&nbsp;PENILAIAN</strong></p><p><strong>Dari&nbsp;Youtube&nbsp;(30%)</strong></p><ul><li><p>Viewer&nbsp;(15%)</p></li><li><p>Like (15%)</p></li></ul><p></p><p><strong>Dari&nbsp;Tim&nbsp;(70%)</strong></p><ul><li><p>Editing&nbsp;(10%)</p></li><li><p>Kreatifitas&nbsp;video&nbsp;(15%)</p></li><li><p>Kualitas&nbsp;rekaman&nbsp;audio&nbsp;(20%)</p></li><li><p>Aransement&nbsp;lagu&nbsp;(25%)</p></li></ul>', '2025-02-06 08:00:00.000', 'admin', '2025-05-10 06:51:01.262', '2025-07-03 01:36:25.849', '', '', '<p>To celebrate the holy month of Ramadan in 2025, ACR is once again giving out THR (holiday bonuses) through the ACR Jingle Competition event. Just like the previous year, ACR invites all ACR enthusiasts and supporters of local products to join this exciting remix competition, running from February 12 to March 12, 2025.</p><p></p><p>Terms &amp; Conditions:</p><p></p><ol><li><p>Participants must upload 2 files:</p><ul><li><p>A video on their personal YouTube channel</p></li><li><p>The audio file sent via WhatsApp to the admin at 0812.3183.3504, using one of the following formats: WAV or FLAC</p></li></ul></li><li><p>The audio used in the YouTube video must be the same as the audio sent via WhatsApp.</p></li><li><p>The song must be in EDM genre and include at least two traditional Indonesian instruments.</p></li><li><p>The video must use the official frame provided and showcase ACR products or events.</p></li><li><p>Duration: minimum 2 minutes, maximum 5 minutes</p></li><li><p>The remix must include the words \"ACR SPEAKER\" (can appear at the beginning, middle, or end).</p></li><li><p>Video title format: <code>Jingle ACR – Participant’s Name</code> (Example: <em>Jingle ACR – Sinarbaja</em>)</p></li><li><p>Showing or mentioning any brand other than ACR will result in disqualification.</p></li><li><p>Failure to follow any of the listed rules will also lead to disqualification.</p></li></ol><p><strong>TIMELINE</strong></p><ol><li><p>Submission Period (YouTube &amp; WhatsApp): February 12 – March 12, 2025</p></li><li><p>Judging Date: March 17, 2025</p></li><li><p>Winner Announcement: March 19, 2025 via Instagram <a target=\"_new\" rel=\"noopener\" class=\"\" href=\"https://www.instagram.com/acrspeaker\">@acrspeaker</a></p></li><li><p>Prize Distribution: March 25, 2025</p></li></ol><p><strong>PRIZES &amp; RECOGNITION</strong></p><ol><li><p>Selected jingles will be played at ACR sound system demo events.</p></li><li><p>All participants will receive a trophy and exclusive ACR merchandise.</p></li><li><p>Winners will receive cash prizes as follows:</p></li></ol><table class=\"border-collapse table-auto w-full my-4\" style=\"min-width: 75px\"><colgroup><col style=\"min-width: 25px\"><col style=\"min-width: 25px\"><col style=\"min-width: 25px\"></colgroup><tbody><tr><th colspan=\"1\" rowspan=\"1\"><p>Rank</p></th><th colspan=\"1\" rowspan=\"1\"><p>Cash Prize</p></th><th colspan=\"1\" rowspan=\"1\"><p>Speaker Shopping Voucher</p></th></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>1st Place</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 2,500,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>2nd Place</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 2,000,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>3rd Place</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 1,500,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Honorable 1</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Honorable 2</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 300,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr><tr><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Honorable 3</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 200,000</p></td><td class=\"border border-gray-300 p-2\" colspan=\"1\" rowspan=\"1\"><p>Rp 500,000</p></td></tr></tbody></table><blockquote><p><em>Note: All taxes (PPH) will be covered by the organizer.</em></p></blockquote><p></p><p></p><p><strong>JUDGING CRITERIA</strong></p><p><strong>From YouTube (30% total):</strong></p><ul><li><p>Views: 15%</p></li><li><p>Likes: 15%</p></li></ul><p></p><p><strong>From the ACR Team (70% total):</strong></p><ul><li><p>Video Editing: 10%</p></li><li><p>Video Creativity: 15%</p></li><li><p>Audio Recording Quality: 20%</p></li><li><p>Song Arrangement: 25%</p></li></ul>', 'ACR GIVES AWAY THR THROUGH THE ACR JINGLE COMPETITION 2025 EVENT!', 'acr-gives-away-thr-through-the-acr-jingle-competition-2025-event'),
('56f899df-fce7-42a3-a38c-e3b661dacf26', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR SOUND KARNAVAL KEMBALI DIBUKA UNTUK MEMPERINGATI HUT RI KE 80!', 'acr-sound-karnaval-kembali-dibuka-untuk-memperingati-hut-ri-ke-80', '<p>Setelah sukses pertama kali diadakan pada HUT RI Ke-79 tahun 2024, sebagai brand speaker lokal kebanggaan Indonesia, akan menjadikan event ini sebagai agenda tahunan untuk memperingati kemerdekaan Indonesia.</p><p>ACR mengajak seluruh tim sound system yang menggunakan produk ACR untuk mengikuti event ini. Event ini bertujuan untuk meningkatkan kecintaan para masyarakat pada produk-produk lokal yang berkualitas, serta meningkatkan kreativitas dari para masyarakat.</p><p>&nbsp;</p><p>Hadiah yang didapat untuk setiap rental:</p><p>- Voucher belanja ACR senilai Rp 100.000,-</p><p>- Merchandise berupa totebag dan topi Fabulous</p><p>&nbsp;</p><p>Berikut ketentuan yang berlaku:</p><p>- Follow Instagram dan Facebook ACR Speaker</p><p>- Upload video sound system beserta moment karnaval ke Reels IG ataupun Facebook</p><p>- Jangan lupa tag ke instagram dan facebook @acrspeaker</p><p>- Kirimkan tipe speaker ACR yang digunakan ke DM / Wa Admin di 0812.3183.3504</p><p>&nbsp;</p><p>Voucher belanja hanya berlaku di Official Showoom Sinar Baja Electric Surabaya. Untuk pembelian diluar area Surabaya bisa menghubungi admin showroom di 0812.1733.4084. Voucher berlaku hingga tahun 2025. Segera daftarkan tim rentalmu dan jadilah bagian dari perayaan kemerdekaan bersama Speaker ACR!!</p><p></p><p></p><p>ACR Sound Karnaval Telah Dibuka!!</p><p>&nbsp;</p><p>Segera daftarkan tim rentalmu dan jadilah bagian dari perayaan kemerdekaan bersama Speaker ACR!!</p><p>&nbsp;</p><p>#ACRSoundKarnaval #acrspeaker #rhymeproaudio #rhymeaudio #sinarbajaelectric #surabaya #indonesia #pecintaacr #HUTRI #karnavalsoundsystem #soundsystemindonesia #iloveacr #pecintaacr</p><p></p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IG Story Karnaval Merdeka 2025-1754098687690.webp\">', '2025-07-31 17:00:00.000', 'mkt', '2025-08-02 02:08:25.067', '2025-08-20 06:22:28.756', '', '', '<p>After successfully being held for the first time during the 79th Independence Day celebration in 2024, as a proud local speaker brand of Indonesia, this event will become an annual agenda to commemorate Indonesia’s independence.</p><p>ACR invites all sound system teams that use ACR products to participate in this event. This event aims to increase public appreciation for high-quality local products, as well as to enhance the creativity of the community.</p><p></p><p><strong>Prizes for each rental team:</strong></p><ul><li><p>ACR shopping voucher worth Rp 100,000</p></li><li><p>Merchandise in the form of a Fabulous tote bag and cap</p><p></p></li></ul><p><strong>Terms and conditions:</strong></p><ul><li><p>Follow ACR Speaker on Instagram and Facebook</p></li><li><p>Upload a video of the sound system along with the carnival moment to IG Reels or Facebook</p></li><li><p>Don’t forget to tag @acrspeaker on Instagram and Facebook</p></li><li><p>Send the ACR speaker type used via DM / WhatsApp to Admin at 0812.3183.3504</p><p></p></li></ul><p>The shopping voucher is only valid at the Official Sinar Baja Electric Showroom in Surabaya. For purchases outside the Surabaya area, you can contact the showroom admin at 0812.1733.4084. The voucher is valid until 2025. Register your rental team immediately and be a part of the independence celebration with ACR Speakers!!</p><p></p><p></p><hr><p><strong>ACR Sound Carnival is Now Open!!</strong></p><p>Register your rental team immediately and be a part of the independence celebration with ACR Speakers!!</p><hr><p><strong>#ACRSoundKarnaval #acrspeaker #rhymeproaudio #rhymeaudio #sinarbajaelectric #surabaya #indonesia #pecintaacr #HUTRI #karnavalsoundsystem #soundsystemindonesia #iloveacr #pecintaacr</strong></p><hr><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IG Story Karnaval Merdeka 2025-1754100502762.webp\">', 'ACR Sound Carnival is back to celebrate the 80th Anniversary of Indonesian Independence!', 'acr-sound-carnival-is-back-to-celebrate-the-80th-anniversary-of-indonesian-independence'),
('59716828-6312-4d64-a697-27b79e0beb52', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'PALENTS 2014', 'palents-2014', '<p><strong>RHYME &amp; ACR akan hadir dalam pameran audio :</strong></p><h3><strong>PALENTS <em>\"Pro-audio, Lighting &amp; Entertainment Technology Show\"</em></strong></h3><ul><li><p><em>Tanggal : 30 Oktober - 02 Nopember 2014</em></p></li><li><p><em>Lokasi : Hall C JIExpo (Jakarta International Expo) Jakarta</em></p></li></ul><p>Disini anda bisa melihat dan menyentuh bahkan mendengarkan semua type RHYME dan ACR FABULOUS series yang didisplay di booth kami yang berada didalam Exihibition Hall, Dan Dengarkan demo Line Array kami di halaman depan Exhibition Hall.</p><p>Kami juga mengeluarkan type baru yakni :</p><ul><li><p><strong>RM 102 LA,</strong>&nbsp;Dual 10″ 2way, Line Array&nbsp;Elements</p></li><li><p><strong>RM 2252 M,&nbsp;</strong>Dual 15″ 2Way, Full Range</p></li><li><p><strong>RM 1282 SB,</strong>&nbsp;Dual 18″ Subwoofer</p></li></ul><p>Datang lah di Booth kami dan dapatkan promo-promo menarik !</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PALENTS-dan-JMX-1746754363722.jpg\">', '2014-07-22 17:00:00.000', 'admin', '2025-05-09 01:32:46.884', '2025-07-03 03:28:51.422', '', '', '<p><strong>RHYME &amp; ACR will be participating in the audio exhibition:</strong></p><p><strong>PALENTS \"Pro-audio, Lighting &amp; Entertainment Technology Show\"</strong></p><ul><li><p>Date: October 30 – November 2, 2014</p></li><li><p>Location: Hall C, JIExpo (Jakarta International Expo), Jakarta</p></li></ul><p></p><p>Here you can see, touch, and even listen to all RHYME and ACR FABULOUS series models displayed at our booth inside the Exhibition Hall. Also, don’t miss our <strong>Line Array demo</strong> outside the Exhibition Hall.</p><p>We are also launching new models:</p><ul><li><p><strong>RM 102 LA</strong> – Dual 10″ 2-way, Line Array Elements</p></li><li><p><strong>RM 2252 M</strong> – Dual 15″ 2-way, Full Range</p></li><li><p><strong>RM 1282 SB</strong> – Dual 18″ Subwoofer</p></li></ul><p><strong>Visit our booth and enjoy exciting promotional offers!</strong></p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/PALENTS-dan-JMX-1746754363722.jpg\">', 'PALENTS 2014', 'palents-2014'),
('597548ea-ff25-4eee-b701-0ef185fe1ce3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '\"KLINIK RHYME\" - East Java', 'klinik-rhyme', '<p><strong>Hadiri Klinik RHYME di 9&nbsp;kota Jawa Timur, Jawa&nbsp;Tengah dan Lampung!</strong></p><p>Datang dan ikuti Demo Klinik RHYME <strong>(UNDANGAN GRATIS)</strong></p><ul><li><p><strong>METRO - LAMPUNG - 27 Oktober 2014</strong><br>Lokasi: Prasasti Garden Jl. Yos Sudarso. Kota Metro- Lampung Jam 11:00-13:00 (undangan bisa di dapat di Toko RamaSwara Bp. Achin)</p></li><li><p><strong>PATI - JAWA TENGAH - 5 November 2014</strong><br>Lokasi: Stadion Joyo Kusumo Pati, Jam 11:00-13:00 (Undangan bisa di dapat melalui toko Matahari pati atau toko SAN pati, toko garuda juwana, toko murni kudus)</p></li><li><p><strong>BOJONEGORO - JAWA TIMUR - 6 November 2014</strong><br>Lokasi: Lap Bong Cino Gunungsari, Baureno-Bojonegoro. Jam 11:00-13:00 (Undangan bisa di dapat melalui Toko Aneka Baureno Bp.H Karsun)</p></li><li><p><strong>PROBOLINGGO - JAWA TIMUR - 10 November 2014</strong><br>Lokasi: Probolinggo, Jam 11:00-13:00 (undangan bisa di dapat melalui toko Jimmy Probolinggo)</p></li><li><p><strong>JEMBER - JAWA TIMUR - 11 November 2014</strong><br>Lokasi: GOR PKPSO-Ged Serba Guna, Jember. Jam 10:00-12:00 (undangan bisa didapat melalui Purba Sound Bpk Cip, Bp Deni kartika sound system)</p></li><li><p><strong>JAJAG (BANYUWANGI) - JAWA TIMUR - 12 November 2014</strong><br>Lokasi: Banyuwangi-jajag, Jam 11:00-13:00 (undangan bisa didapat melalui Toko Lyliana Jajag)</p></li><li><p><strong>BATU (MALANG) - JAWA TIMUR - 24 November 2014</strong><br>Lokasi: Lap Parkir stadion Brantas, Batu-malang. Jam 11:00-13:00 (undangan bisa di dapat melalui Himalaya music Bp Faton, toko anugrah jl gatot subroto malang)</p></li><li><p><strong>BLITAR - JAWA TIMUR - 26 November 2014</strong><br>Lokasi: Lap PIPP Parkir makam Bung Karno, Blitar. jam 11:00-13:00 (undangan bisa di dapat memalui studio musik merapi blitar, toko Sumber terang Jl sultan agung, Toko Sanjaya jl cemara)</p></li><li><p><strong>KEDIRI - JAWA TIMUR - 27 November 2014</strong><br>Lokasi: Taman Tirtoyoso (Utara Stadion Brawijaya), Kediri. jam 11:00-13:00. (undangan bisa di dapat melalui Bp Herlambang 085736380555, Toko Cahaya Jl. HOS Cokroaminito, Boentoro music Jl joyoboyo)</p></li></ul><p>Kami mendemokan produk terbaru dari RHYME dan ACR, adapun promo-promo menarik dari kami.</p><p>Menangkan juga&nbsp;<strong><em>Door Prize&nbsp;</em></strong>undian menarik!!!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-jawa-timur-1746754737831.jpg\">', '2014-10-10 17:00:00.000', 'admin', '2025-05-09 01:39:02.613', '2025-07-03 03:28:26.214', '', '', '<p><strong>Attend the RHYME Clinic in 9 Cities across East Java, Central Java, and Lampung!</strong></p><p>Come and join the RHYME Clinic Demo (FREE INVITATION)</p><hr><p><strong>METRO – LAMPUNG – 27 October 2014</strong><br>Location: Prasasti Garden, Jl. Yos Sudarso, Kota Metro – Lampung<br>Time: 11:00–13:00<br>(Invitations available at Toko RamaSwara, Mr. Achin)</p><hr><p><strong>PATI – CENTRAL JAVA – 5 November 2014</strong><br>Location: Stadion Joyo Kusumo, Pati<br>Time: 11:00–13:00<br>(Invitations available at Toko Matahari Pati, Toko SAN Pati, Toko Garuda Juwana, Toko Murni Kudus)</p><hr><p><strong>BOJONEGORO – EAST JAVA – 6 November 2014</strong><br>Location: Lap Bong Cino Gunungsari, Baureno – Bojonegoro<br>Time: 11:00–13:00<br>(Invitations available at Toko Aneka Baureno, Mr. H. Karsun)</p><hr><p><strong>PROBOLINGGO – EAST JAVA – 10 November 2014</strong><br>Location: Probolinggo<br>Time: 11:00–13:00<br>(Invitations available at Toko Jimmy Probolinggo)</p><hr><p><strong>JEMBER – EAST JAVA – 11 November 2014</strong><br>Location: GOR PKPSO – Multi-purpose Hall, Jember<br>Time: 10:00–12:00<br>(Invitations available via Purba Sound, Mr. Cip, Mr. Deni – Kartika Sound System)</p><hr><p><strong>JAJAG (BANYUWANGI) – EAST JAVA – 12 November 2014</strong><br>Location: Jajag – Banyuwangi<br>Time: 11:00–13:00<br>(Invitations available at Toko Lyliana Jajag)</p><hr><p><strong>BATU (MALANG) – EAST JAVA – 24 November 2014</strong><br>Location: Parking Lot, Brantas Stadium, Batu – Malang<br>Time: 11:00–13:00<br>(Invitations available at Himalaya Music – Mr. Faton, Toko Anugrah – Jl. Gatot Subroto, Malang)</p><hr><p><strong>BLITAR – EAST JAVA – 26 November 2014</strong><br>Location: PIPP Parking Lot, Bung Karno’s Grave, Blitar<br>Time: 11:00–13:00<br>(Invitations available at Merapi Music Studio, Toko Sumber Terang – Jl. Sultan Agung, Toko Sanjaya – Jl. Cemara)</p><hr><p><strong>KEDIRI – EAST JAVA – 27 November 2014</strong><br>Location: Tirtoyoso Park (North of Brawijaya Stadium), Kediri<br>Time: 11:00–13:00<br>(Invitations available via Mr. Herlambang 085736380555, Toko Cahaya – Jl. HOS Cokroaminoto, Boentoro Music – Jl. Joyoboyo)</p><hr><p>We will be demonstrating RHYME and ACR’s latest products along with exciting promotions.</p><p><strong>Win Exciting Door Prizes in Our Lucky Draw!</strong></p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-jawa-timur-1746754737831.jpg\">', '\"KLINIK RHYME\" - East Java', 'klinik-rhyme'),
('5b0268d5-d5cb-43af-8a8c-fe0845ddca41', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Road to SMEX 2017', 'road-to-smex-2017', '<p><strong>SMEX \"Surabaya Music Expo\"</strong></p><ul><li><p><em>Tanggal : 4&nbsp;- 7&nbsp;Mei 2017</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://surabayamusicexpo.com\">surabayamusicexpo.com</a></p></li></ul><p>Tahun ini Kami hadir dalam SMEX yang merupakan salah satu event pameran Pro Audio, Lighting dan Music terbesar di Indonesia. Dengan mengikuti Demo Line Array yang berlangsung di depan <em>Exihibition Hall Grand City&nbsp;</em>dan menghadirkan booth ACR dan RHYME, di sini anda dapat mendapatkan info dari produk-produk kami secara langsung.</p><p>Kami juga mengeluarkan beberpa tipe baru :</p><ul><li><p><strong>18\" PA 100182 MK-II SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>18\" PA 113182 MK-II SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>18\" PA 113183 MK-II SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>18\" PA 100187 SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>18\" PA 113187 SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>18\" PA 127187 SW</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>RM 128 SB MK-IV,</strong>&nbsp;Dual 18” Bass Reflex Subwoofer - RHYME</p></li><li><p><strong>RM 128 SB FLH,</strong>&nbsp;18” Front Horn Loaded Double Subwoofer&nbsp;- RHYME</p></li></ul><p>Datanglah di Booth kami dan dapatkan promo-promo menarik !</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smexr2017-1746755723066.jpg\">', '2017-04-18 17:00:00.000', 'admin', '2025-05-09 01:55:29.673', '2025-07-03 03:26:38.053', '', '', '<p><strong>SMEX \"Surabaya Music Expo\"</strong></p><ul><li><p>Date: May 4–7, 2017</p></li><li><p>Location: Exhibition Hall Grand City, Surabay</p></li><li><p>Website: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://surabayamusicexpo.com\">surabayamusicexpo.com</a></p></li></ul><p>This year, we are participating in SMEX, one of the largest Pro Audio, Lighting, and Music exhibitions in Indonesia. We are joining the Line Array Demo held in front of the Exhibition Hall Grand City and featuring our ACR and RHYME booths, where you can get direct information about our products.</p><p>We are also launching several new models:</p><ul><li><p><strong>18\" PA 100182 MK-II SW</strong> Fabulous by ACR</p></li><li><p><strong>18\" PA 113182 MK-II SW</strong> Fabulous by ACR</p></li><li><p><strong>18\" PA 113183 MK-II SW</strong> Fabulous by ACR</p></li><li><p><strong>18\" PA 100187 SW </strong>Fabulous by ACR</p></li><li><p><strong>18\" PA 113187 SW</strong> Fabulous by ACR</p></li><li><p><strong>18\" PA 127187 SW </strong>Fabulous by ACR</p></li><li><p><strong>RM 128 SB MK-IV, </strong>Dual 18” Bass Reflex Subwoofer – RHYME</p></li><li><p><strong>RM 128 SB FLH,</strong> 18” Front Horn Loaded Double Subwoofer – RHYME</p></li></ul><p>Visit our booth and get exciting promotional offers!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smexr2017-1746755723066.jpg\">', 'Road to SMEX 2017', 'road-to-smex-2017'),
('5c03f7bc-dec5-4c22-9c8a-0069bd36de39', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System oleh Komunitas Jawa Timur (PSS Jatim) Exhibition-2', 'review-pameran-sound-system-oleh-komunitas-jawa-timur-pss-jatim-exhibition-2', '<p>Pameran Sound System yang diselenggarakan oleh komunitas sound system seluruh Jawa Timur (PSSJ) pada tahun 2022 ini diselenggarakan pada tanggal 26 – 27 Maret 2022. Acara ini merupakan acara jilid ke-2 yang diadakan oleh PSSJ, yang dilakukan di Halaman Pasar Induk Puspa Agro, Sidoarjo. Pameran sound ini juga bertujuan menjalin tali silahturahmi antar sesama pecinta sound system dan sekaligus untuk menyambut bulan Ramadhan.</p><p></p><p>Acara ini didukung oleh beberapa sponsor sound system ternama dan hanya dibatasi 10 sponsorship. Sponsorship berkesempatan untuk mengikuti demo produk serta membuka lapak / stand untuk berjualan. Selain acara demo produk dari sponsor, juga terdapat acara lomba – lomba sound system yang menarik dan diikuti oleh sekitar 30 peserta sound (rental dan komunitas). Dengan beberapa kelas lomba diantaranya: Penilaian instalasi, Mixing (personal dan rental) , Glerrity (Clarity), serta Balap liar (Adu SPL).</p><p></p><p>Pengunjung yang datang cukup antusias dan cukup banyak hingga memenuhi area lapangan. Banyak pengunjung juga mendatangi stand ACR dan bisa melihat / mendapatkan informasi yang lengkap seputar speaker ACR Series. Dalam event ini juga memperkenalkan tipe terbaru dari ACR Series yaitu Excellent terbaru dengan Voice Coil 5inch tipe 188127.</p><p></p><p>Produk yang dipakai untuk Demo Rhyme yaitu Line Array dengan system 3-way RM 126 LA (1x 12inch, 2x 6inch, 3x Tweeter) sebanyak 6 box dengan Subwoofer 18in double (RM 1283) sebanyak 8 Box &nbsp;serta di dukung oleh semua power dari Rhyme Professional Audio (R4500, R7000, dan R5200). Selain itu, ada juga Rhyme Mini dengan single 8in (RM 81 LA) ditambah subwoofer flying 15in single (RM 151 FSB), dan untuk Subwoofernya 18in double RM 128 MKIII.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/126-x-1283-506x1024-1746764072590.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111408-1746764084838.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111420-1746764090341.png\">', '2022-03-29 17:00:00.000', 'admin', '2025-05-09 04:14:55.890', '2025-07-03 03:15:51.324', '', '', '<p>The Sound System Exhibition organized by the East Java-wide sound system community (PSSJ) in 2022 was held on March 26–27, 2022. This was the second event organized by PSSJ, taking place at the Main Market Yard of Puspa Agro, Sidoarjo. The purpose of this exhibition was to strengthen the bond among sound system enthusiasts and to welcome the month of Ramadan.</p><p></p><p>The event was supported by several well-known sound system sponsors and was limited to 10 sponsorships. Sponsors had the opportunity to participate in product demos and set up booths for sales. In addition to sponsor product demos, there were also various exciting sound system competitions, joined by around 30 participants (from rentals and communities). Competition categories included: installation assessment, mixing (personal and rental), glerrity (clarity), and wild race (SPL battle).</p><p></p><p>The visitors who attended were very enthusiastic and numerous, filling up the event area. Many visitors stopped by the ACR booth to view and receive complete information about ACR Series speakers. This event also introduced the newest type from the ACR Series, the latest Excellent model with a 5-inch voice coil, type 188127.</p><p></p><p>For the Rhyme product demo, a 3-way system line array RM 126 LA (1x 12-inch, 2x 6-inch, 3x tweeter) was used, totaling 6 boxes, along with eight 18-inch double subwoofer boxes (RM 1283), all powered by Rhyme Professional Audio amplifiers (R4500, R7000, and R5200). Additionally, the Rhyme Mini system with a single 8-inch (RM 81 LA) line array paired with a single 15-inch flying subwoofer (RM 151 FSB), and a double 18-inch subwoofer RM 128 MKIII was also featured.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/126-x-1283-506x1024-1746764072590.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111408-1746764084838.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111420-1746764090341.png\">', 'Review – Sound System Exhibition by East Java Community (PSS Jatim) Exhibition-2', 'review-sound-system-exhibition-by-east-java-community-pss-jatim-exhibition-2'),
('617a4f63-5d33-4456-82ff-7faba583b344', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Event \"Cek Sound Rhyme\"', 'cek-sound-rhyme', '<p>CV. Sinar Baja Electric selaku pabrik dari produk speaker RHYME biasanya sering mengikuti acara yaitu&nbsp;Pameran / ‘klinik’ yang biasa dilakukan secara rutin sepanjang tahun diberbagai kota khususnya di Jawa. Namun dalam kondisi pandemi ini, pameran masih belum diperbolehkan untuk menghindari kerumunan pengunjung.</p><p></p><p>Oleh karena itu, sebagai alternatifnya kami mengundang beberapa komunitas/ pemilik rental sound system untuk diberikan kesempatan mencoba speaker atau Demo speaker Rhyme di Pabrik CV. Sinar Baja Electric. Event ini dilakukan dengan prosedur protokol kesehatan yang ketat, dengan batasan peserta dan pemberian jadwal yang tertata.</p><p></p><p>Speaker Rhyme yang di-Demokan yaitu Line Array tipe RM 103 LA (double 10” 2-way) sebanyak 6 box dan Subwoofer tipe RM 1283 SB (18”&nbsp;double) sebanyak 4 box. Selain itu, dalam acara ini sekaligus launching dan memperkenalkan produk terbaru dari RHYME yaitu Line Array tipe RM 81 LA (Single 8” 2-way) &amp; RM 151 FSB (Single 15” Vented, Flying Subwoofer).</p><p></p><p>Para Peserta yang datang &nbsp;diperbolehkan membawa manajemen/dsp, mixer, dan power/ampli mereka sendiri. Sehingga dalam acara ini juga menjadi wadah untuk saling berbagi ilmu setting Line Array sesuai selera masing – masing tiap daerah dan tiap komunitas. Para Peserta juga diberi souvenir sebagai kenang – kenangan dari CV.Sinar Baja Electric dan memberikan harga khusus untuk barang – barang yang dilelang, mulai dari speaker box Rhyme , hingga speaker driver brand ACR, Legacy, dan desiBel. Di akhir acara peserta diajak berkeliling pabrik, melihat proses produksi speaker driver, pembuatan box, hingga produk siap untuk dijual.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20210615130330-1024x768-1746762881229.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105346-1746762889198.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105405-1746762895378.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_3360-1024x683-1746762901453.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105423-1746762910943.png\">', '2021-07-16 17:00:00.000', 'admin', '2025-05-09 03:55:22.118', '2025-07-03 03:17:02.015', '', '', '<p>CV. Sinar Baja Electric, as the manufacturer of RHYME speaker products, is usually active in participating in exhibitions or \"clinics\" held regularly throughout the year in various cities, especially across Java. However, due to the pandemic, exhibitions were still not permitted in order to avoid large crowds.</p><p></p><p>As an alternative, we invited several sound system communities and rental owners to have the opportunity to try out or demo Rhyme speakers directly at the CV. Sinar Baja Electric factory. This event was held under strict health protocols, with a limited number of participants and a well-organized schedule.</p><p></p><p>The Rhyme speakers demoed included the RM 103 LA line array (double 10” 2-way) with a total of 6 boxes, and RM 1283 SB subwoofers (18” double) with a total of 4 boxes. Additionally, the event served as the official launch and introduction of Rhyme\'s latest products: the RM 81 LA (Single 8” 2-way) line array and the RM 151 FSB (Single 15” Vented, Flying Subwoofer).</p><p></p><p>Participants were allowed to bring their own management/DSP units, mixers, and amplifiers/power units. This created a platform for participants to share knowledge and techniques for setting up line arrays based on the preferences of each region and community. Attendees were also given souvenirs as mementos from CV. Sinar Baja Electric and offered special prices on auctioned items, ranging from Rhyme speaker boxes to ACR, Legacy, and desiBel speaker drivers. At the end of the event, participants were invited to tour the factory to see the speaker driver production process, box manufacturing, and how the products are prepared for sale.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG20210615130330-1024x768-1746762881229.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105346-1746762889198.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105405-1746762895378.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_3360-1024x683-1746762901453.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105423-1746762910943.png\">', 'Review – \"Cek Sound Rhyme\" Event', 'cek-sound-rhyme');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('618043b8-e73b-4720-a5fb-c71cd21d99ef', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2019', 'smex-2019', '<p>Pameran Surabaya Music Expo (SMEX) yang diadakan di Exhibition Hall Grand City Surabaya, tanggal 25 – 28 Juli 2019 dibagi menjadi dua area. Area Outdoor menampilkan demo speaker Line Array, sedangkan pada bagian indoor terdapat stand-stand yang menampilkan dan menjual alat-alat musik , sound system, speaker pro-audio, dan lighting event.</p><p></p><p>Sinar Baja Electric hadir dengan mengeluarkan speaker driver ACR terbaru seperti Fabulous Series tipe 12in 65125 M Fab, CD 440PK1B-08F Fab, CD 440K1B-08F Fab, CD 340PK1B-08F Fab, CD 250P1B-08F Fab, dan beberapa ACR Series lainnya seperti 18in 188175 Excellent dan 12in 127150 Deluxe. Selain itu, kami juga membawa produk speaker system RHYME PROFESSIONAL AUDIO. mengeluarkan produk - produk baru diantaranya tipe B-Series, B-212 (12in single 2-way), B-215 (15in single 2-way), B-118 (18in single subwoofer). Serta tipe Karaoke Series (K-series), yaitu tipe RM 2110 M-K dan&nbsp; RM 112 SB-K (subwoofer aktif).</p><p></p><p>Pada pameran SMEX 2019 &nbsp;ini RHYME PROFESSIONAL AUDIO mendemokan speaker Line Array dengan RM 103 LA (Dual 10in 2-way) dan RM 1283 SB (Subwoofer, 18inch double). Selain itu juga dibagian dalam juga disediakan demo seperti seri RM 126 LA, RM 103 LA, RM 811 LA, RM 225 M-MK4 (Fullrange, 15in double), dan subwoofernya RM 1283 SB, RM 128 SB MK4, RM 115 SB.</p><p></p><p>Pengunjung yang datang tidak hanya untuk menikmati sound-sound yang ada melainkan terdapat juga untuk berbagi pengalaman dan sharing dalam menggunakan speaker produk ACR, Rhyme, dan brand-brand lainnya sehingga dapat menjadi motivasi bagi kami untuk menciptakan inovasi-inovasi produk loudspeaker terbaik.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_015-e1566965816780-1746760882193.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_014-e1566965794872-1746760892506.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_013-e1566965764684-1746760897082.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_012-e1566965741452-1746760902338.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_011-e1566965715316-1746760906051.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_009-e1566965678722-1746760918704.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_008-e1566965659839-1746760923484.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_007-e1566965641588-1746760928289.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_006-e1566965625642-1746760936007.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_005-e1566965564746-1746760942568.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_004-e1566965542202-1746760947916.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_003-e1566965524862-1746760957085.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_002-e1566965502201-1746760961783.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_001-e1566965477906-1746760966033.jpg\">', '2019-08-18 17:00:00.000', 'admin', '2025-05-09 03:22:47.884', '2025-07-03 03:20:56.656', '', '', '<p>The Surabaya Music Expo (SMEX) exhibition, held at the Grand City Surabaya Exhibition Hall from July 25–28, 2019, was divided into two areas. The outdoor area featured line array speaker demonstrations, while the indoor section showcased booths displaying and selling musical instruments, sound systems, pro-audio speakers, and event lighting.</p><p></p><p>Sinar Baja Electric participated by presenting its latest ACR speaker drivers, including the Fabulous Series with models like the 12in 65125 M Fab, CD 440PK1B-08F Fab, CD 440K1B-08F Fab, CD 340PK1B-08F Fab, CD 250P1B-08F Fab, and other ACR Series such as the 18in 188175 Excellent and 12in 127150 Deluxe. Additionally, we featured products from RHYME PROFESSIONAL AUDIO, launching new items including the B-Series: B-212 (12in single 2-way), B-215 (15in single 2-way), B-118 (18in single subwoofer), as well as the Karaoke Series (K-Series), including RM 2110 M-K and RM 112 SB-K (active subwoofer).</p><p></p><p>At SMEX 2019, RHYME PROFESSIONAL AUDIO demonstrated its line array speaker setup using the RM 103 LA (Dual 10in 2-way) and RM 1283 SB (18in double subwoofer). In the indoor section, additional demo units were also featured, including RM 126 LA, RM 103 LA, RM 811 LA, RM 225 M-MK4 (Full-range, 15in double), and subwoofers RM 1283 SB, RM 128 SB MK4, and RM 115 SB.</p><p></p><p>Visitors came not only to enjoy the available sound demos but also to share experiences and insights in using ACR, Rhyme, and other brand speakers, which serves as motivation for us to continue innovating and developing the best loudspeaker products.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_015-e1566965816780-1746760882193.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_014-e1566965794872-1746760892506.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_013-e1566965764684-1746760897082.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_012-e1566965741452-1746760902338.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_011-e1566965715316-1746760906051.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_009-e1566965678722-1746760918704.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_008-e1566965659839-1746760923484.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_007-e1566965641588-1746760928289.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_006-e1566965625642-1746760936007.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_005-e1566965564746-1746760942568.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_004-e1566965542202-1746760947916.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_003-e1566965524862-1746760957085.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_002-e1566965502201-1746760961783.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190728_001-e1566965477906-1746760966033.jpg\">', 'SMEX 2019', 'smex-2019'),
('71ec935e-491f-4b40-b5cb-8af80bc94d56', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'KEMERIAHAN ACR SOUND FESTIVAL VOLUME 1 DI DESA PULOTONDO BERSAMA PSTT', 'kemeriahan-acr-sound-festival-volume-1-di-desa-pulotondo-bersama-pstt', '<p>Bekerja sama dengan PSTT (Paguyuban Sound System Tulungagung Timur), ACR Sound Festival Volume 1 resmi dibuka pada 24 Juli malam hingga 26 Juli. Acara yang diadakan di lapangan Desa Pulotondo ini diikuti oleh 32 peserta, dengan 21 peserta adalah pengguna full speaker dari Sinar Baja Electric. Eventnya pun berbagai macam, antara lain: lomba SPL, lomba mixing, seminar dengan Cak Dodot yang merupakan sound man ternama yang senang membagi-bagikan ilmu, serta seminar dengan tim RnD dari Sinar Baja Electric, dan Amirudin dari La Morena.</p><p>&nbsp;</p><p>Seminar dengan Cak Dodot yang diadakan pada 24 Juli pk 20.00 - 23.00 ini mengundang banyak antusias dari para warga Tulungagung. Sebanyak lebih dari 200 orang menghadiri seminar tersebut. Antusias pengunjung semakin meningkat dengan banyaknya sesi tanya jawab yang diakhiri dengan bagi-bagi hadiah bagi yang aktif bertanya. “Pokok jangan sampai salah menggunakan. Contoh (box speaker) yang sudah ada seperti ini merupakan riset-riset yang sudah dikeluarkan, (dan) yang sudah diperjualbelikan oleh CV. Sinar Baja Electric. Dan ini bisa dipertanggungjawabkan (penggunaannya).” ujar Cak Dodot di sesi interview bersama tim Sinar Baja Electric.</p><p>&nbsp;</p><p>Pada tanggal 25-26 Juli diadakan lomba SPL dan mixing yang diadakan dari pagi hingga sore hari. Berikut daftar para pemenangnya: &nbsp;</p><p>&nbsp;</p><p><strong>Juara 1 Mixing: La Morena</strong></p><p>(Full produk SBE: 18in PA 127187 SW Fab, 12in PA 75124 W-N Fab, CD 650TR15B-08F Fab)<br><strong>Juara 2 Mixing: Alib Audio</strong></p><p>(18in PA 127187 SW Fab, 10in ARRAY 2560 M Fab)<br><br><strong>Juara 3 Mixing: JK Audio</strong></p><p>(Full produk SBE: 18in PA-113186 SW FAB</p><p>&nbsp;</p><p><strong>Juara 1 SPL: Para Jaya Audio</strong></p><p>(12in PA 75124 W-N Fab)</p><p><strong>Juara 2 SPL: La Morena</strong></p><p>(Full produk SBE: 18in PA 127187 SW Fab, 12in PA 75124 W-N Fab, CD 650TR15B-08F Fab)</p><p><strong>Juara 3 SPL: Surya Pro Audio</strong></p><p>(18in 113186 SW Fab, 12in PA 75125 M Fab)</p><p>&nbsp;</p><p><strong>Juara Terfavorit: Putra Naigel Audio</strong></p><p>(12in ARRAY 3060 M Fab, 12in 1240 Classic)</p><p><strong>Juara Ter-ACR: CRT Audio</strong></p><p>(Full Produk SBE: 18in PA 100187 SW Fab, 10in ARRAY 2560 M Fab, 12in ARRAY 3060 M Fab, CD 750TR15B-08)</p><p>&nbsp;</p><p>Selama 3 hari acara berlangsung, tim juga mengapresiasi kepada seluruh peserta yang telah menggunakan full produk dari Sinar Baja Electric dengan memberikan 1 pcs &nbsp;12in 12500-Mk1 Black, serta adanya pembagian doorprize untuk seluruh peserta</p><p>&nbsp;</p><p>Pada booth Sinar Baja Electric menampilkan produk-produk terbaru mulai dari ACR Deluxe hingga Fabulous. Untuk produk Rhyme yang ditampilkan berbagai macam mulai dari speaker line array, subwoofer, monitor, amplifier, hingga series terbarunya yakni Sphere Series. Di sisi kiri booth juga menyediakan test box free air yang dapat digunakan berbagai macam tipe speaker, serta box subwoofer. &nbsp;Tim Sinar Baja Electric juga mengundang salah satu dealer resmi Sumber Elektronik, yang memudahkan pengunjung untuk membeli speaker ACR setelah cek sound di box yang telah disediakan oleh tim Sinar Baja Electric.</p><p>&nbsp;</p><p>“Dari teman-teman kesannya bangga. Terima kasih untuk Sinar Baja Electric yang sudah memberikan yang lebih untuk kita semua. Mantep wes pokok’e.” ujar ketua dari PSTT, Bapak Yahya</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/J1OvTu65FnI?rel=1\" start=\"0\"></iframe></div>', '2025-08-14 17:00:00.000', 'admin', '2025-08-16 01:03:58.237', '2025-08-16 01:03:58.237', '', '', '<p>In collaboration with PSTT (Paguyuban Sound System Tulungagung Timur), ACR Sound Festival Volume 1 was officially opened on the night of July 24 until July 26. The event, held at the Pulotondo Village field, was joined by 32 participants, with 21 of them being full speaker users from Sinar Baja Electric. The events included: SPL competition, mixing competition, seminar with Cak Dodot, a well-known sound man who enjoys sharing knowledge, as well as a seminar with the RnD team from Sinar Baja Electric, and Amirudin from La Morena.</p><p>The seminar with Cak Dodot, held on July 24 from 20:00 – 23:00, attracted a lot of enthusiasm from the people of Tulungagung. More than 200 people attended the seminar. Visitor enthusiasm increased further with many Q&amp;A sessions that ended with prize giveaways for those who actively asked questions. “The main thing is not to use it wrongly. For example, the (speaker box) already available like this is the result of research already released and sold by CV. Sinar Baja Electric. And its usage can be accounted for.” said Cak Dodot in an interview session with the Sinar Baja Electric team.</p><p>On July 25–26, SPL and mixing competitions were held from morning until afternoon. Here is the list of winners:</p><p></p><p><strong>Mixing Winners</strong></p><ul><li><p>1st Place: La Morena<br>(Full SBE products: 18in PA 127187 SW Fab, 12in PA 75124 W-N Fab, CD 650TR15B-08F Fab)</p></li><li><p>2nd Place: Alib Audio<br>(18in PA 127187 SW Fab, 10in ARRAY 2560 M Fab)</p></li><li><p>3rd Place: JK Audio<br>(Full SBE products: 18in PA-113186 SW Fab)</p></li></ul><p><strong>SPL Winners</strong></p><ul><li><p>1st Place: Para Jaya Audio<br>(12in PA 75124 W-N Fab)</p></li><li><p>2nd Place: La Morena<br>(Full SBE products: 18in PA 127187 SW Fab, 12in PA 75124 W-N Fab, CD 650TR15B-08F Fab)</p></li><li><p>3rd Place: Surya Pro Audio<br>(18in 113186 SW Fab, 12in PA 75125 M Fab)</p></li></ul><p></p><p><strong>Favorite Winner:</strong> Putra Naigel Audio<br>(12in ARRAY 3060 M Fab, 12in 1240 Classic)</p><p><strong>ACR Winner:</strong> CRT Audio<br>(Full SBE products: 18in PA 100187 SW Fab, 10in ARRAY 2560 M Fab, 12in ARRAY 3060 M Fab, CD 750TR15B-08)</p><p></p><p>During the 3-day event, the team also gave appreciation to all participants who used full Sinar Baja Electric products by awarding 1 piece of 12in 12500-Mk1 Black, as well as distributing door prizes to all participants.</p><p>At the Sinar Baja Electric booth, the latest products were showcased ranging from ACR Deluxe to Fabulous. For the Rhyme products, various types were displayed, including line array speakers, subwoofers, monitors, amplifiers, and its newest series, the Sphere Series. On the left side of the booth, a free air test box was provided that could be used for various types of speakers, as well as subwoofer boxes. The Sinar Baja Electric team also invited one of the official dealers, Sumber Elektronik, making it easier for visitors to purchase ACR speakers after checking the sound in the box provided by the Sinar Baja Electric team.</p><p>“From the members, the impression is pride. Thank you to Sinar Baja Electric for giving more to all of us. Really great, that’s for sure.” said the chairman of PSTT, Mr. Yahya.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/J1OvTu65FnI?rel=1\" start=\"0\"></iframe></div>', 'THE FESTIVITY OF ACR SOUND FESTIVAL VOLUME 1 IN PULOTONDO VILLAGE WITH PSTT', 'the-festivity-of-acr-sound-festival-volume-1-in-pulotondo-village-with-pstt'),
('722b2424-41c8-4f02-a8d2-1ec37d37b0a3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'List Produk Yang Tidak Akan Diproduksi Lagi Pada Akhir Tahun 2023', 'list-produk-yang-tidak-akan-diproduksi-lagi-pada-akhir-tahun-2023', '<p>ACR mengeluarkan banyak series speaker mulai dari Black Magic, Excellent, Premier, Deluxe hingga series Fabulous. Produk dari tiap series ini akan terus berkembang mengikuti trend pasar. Karena perkembangan yang cepat ini membuat ACR untuk terus berinovasi memproduksi speaker baru yang berkualitas sesuai kebutuhan pasar sehingga ada beberapa type speaker yang akan discontinued.</p><p></p><p>Berikut list produk yang akan discontinued di 2024:</p><ol><li><p>AX 975 HT ACR</p></li><li><p>CD 340T1N-08 (CD 7-MKII)</p></li><li><p>10\" ARRAY 2560 M FAB (Perubahan design chassis)</p></li><li><p>12\" ARRAY 3060 M FAB (Perubahan design chassis)</p></li><li><p>12” PA 12880 MK III EXCEL</p></li><li><p>12” PA 75127 W-N FAB</p></li><li><p>15” PA-75157 W-N FAB</p></li><li><p>15” ACR-1567 W</p></li><li><p>18\" PA-113187 SW FAB</p></li><li><p>21” PA-113212 SW FAB</p></li><li><p>15\" PA-100152 Mk1 SW FAB (Perubahan desain heatsink)</p></li><li><p>18\" PA-100182 Mk2 SW FAB (Perubahan desain heatsink)</p></li></ol><p>Bentuk chassis untuk speaker tipe 10in ARRAY 2560 M FAB dan 12in ARRAY 3060 M FAB akan ada perubahan sedikit sehingga tampilan chassis tampak lebih elegan. Speaker tipe 18in PA-113187 SW FAB tidak akan diproduksi lagi karena sudah tergantikan dengan tipe baru. yaitu<a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-113188-sw-fab-by-acr\"> 18in 113188 SW FAB Double Magnet</a><em>.</em></p><p></p><p>Para Pecinta ACR tidak perlu khawatir, karena kami tetap berkomitmen pada kualitas dan kepuasan pelanggan. Tetap ikuti perkembangan produk-produk terbaru dari ACR melalui website, IG, Facebook dan Aplikasi My SBE.</p>', '2023-11-16 17:00:00.000', 'admin', '2025-05-09 07:04:20.157', '2025-07-03 02:14:01.887', '', '', '<p>ACR has released a wide range of speaker series, including Black Magic, Excellent, Premier, Deluxe, and Fabulous. Each of these product series continues to evolve according to market trends. Due to this rapid development, ACR continues to innovate and produce high-quality new speakers to meet market demands, which means some speaker types will be discontinued.</p><p></p><p>Below is the list of products to be discontinued in 2024:</p><ol><li><p>AX 975 HT ACR</p></li><li><p>CD 340T1N-08 (CD 7-MKII)</p></li><li><p>10\" ARRAY 2560 M FAB (Chassis design update)</p></li><li><p>12\" ARRAY 3060 M FAB (Chassis design update)</p></li><li><p>12” PA 12880 MK III EXCEL</p></li><li><p>12” PA 75127 W-N FAB</p></li><li><p>15” PA-75157 W-N FAB</p></li><li><p>15” ACR-1567 W</p></li><li><p>18\" PA-113187 SW FAB</p></li><li><p>21” PA-113212 SW FAB</p></li><li><p>15\" PA-100152 Mk1 SW FAB (Heatsink design update)</p></li><li><p>18\" PA-100182 Mk2 SW FAB (Heatsink design update)</p></li></ol><p>The chassis design of the 10in ARRAY 2560 M FAB and 12in ARRAY 3060 M FAB will be slightly updated to give a more elegant appearance. The 18in PA-113187 SW FAB will no longer be produced, as it has been replaced by the newer model: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-113188-sw-fab-by-acr\">18in 113188 SW FAB Double Magnet</a>.</p><p></p><p>ACR fans need not worry, as we remain committed to quality and customer satisfaction. Stay updated on the latest ACR products through our website, Instagram, Facebook, and the My SBE app.</p>', 'List of Products That Will Be Discontinued by the End of 2023', 'list-of-products-that-will-be-discontinued-by-the-end-of-2023'),
('7328ced0-9729-4804-bffd-14d74b39e080', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pameran TEXASS - Trenggalek 25 – 26 November 2023', 'pameran-texass-trenggalek-25-26-november-2023', '<p>Pada penghujung tahun 2023 ini, Paguyuban/komunitas dari Trenggalek mengadakan parade &nbsp;sound system yang bernama TEXASS (Trenggalek Expo Audio &amp; Sound System). Acara tersebut merupakan acara rutin tahunan mulai dari tahun 2016. Kegiatan ini diselenggarakan pada tanggal 25 – 26 November 2023. Pameran parade sound istem ini juga dimeriahkan oleh beberapa sponsor lainnya yang melakukan demo produk</p><p></p><p>Dalam parade sound system kali ini, terdapat 2 kategori lomba. Mulai dari perhitungan Clarity hingga perhitungan jumlah SPL. Juga terdapat 2 kelas lomba yang dibedakan dari jumlah speaker yang dilombakan. Jumlah peserta lomba dalam 2 hari tersebut mencapai sekitar 50 rental / peserta lomba. Dan pada hari terakhir, panitia memberikan tantangan yaitu menjatuhkan botol air mineral yang berisi ¼ botol dan diberi waktu 1 menit lagu untuk menjatuhkan nya, Para peseta menyiapkan banyak strategi mulai dari mengatur manajemen, memilih lagu, dll.</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Pada kesempatan kali ini, lapak ACR tampil sedikit berbeda karena membawa Box Sound System custom dengan konsep 4-Way. Dan, tentu saja semua berisi Driver komponen ACR series. Untuk Subwoofer menggunakan box Keong (Horn Loaded) double 18” menggunakan 18in Fabulous 113186, untuk Low menggunakan konsep box Planar Single 15” menggunakan&nbsp; Driver 15in Fabulous 100152 , Lalu untuk mid menggunakan 12in Fabulous 75125, dan yang terakhir menggunakan tweeter Fabulous CD 650TR15B-08F Fab. Semua sistem box custom tersebut menggunakan Amplifier Rhyme perpaduan antara R4500 dan juga Rhyme R7000 (untuk Subwoofer).</p><p></p><p>Dalam lapak tersebut juga diberikan kesempatan untuk melakukan demo sound system 4-way ACR Series. Terlihat banyak antusiasme pengunjung yang hadir untuk menyaksikan dan mendengarkan secara langsung dari kualitas suara dan tampilan dari box custom tersebut.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09679-1024x683-1746774428594.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09694-1024x683-1746774434341.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09706-1024x683-1746774442845.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09699-1024x683-1746774448635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09688-1024x683-1746774456991.jpg\">', '2023-11-29 17:00:00.000', 'admin', '2025-05-09 07:07:40.782', '2025-07-03 02:13:39.414', '', '', '<p>At the end of 2023, a community from Trenggalek held a sound system parade called TEXASS (Trenggalek Expo Audio &amp; Sound System). This event is an annual tradition that has been running since 2016. The parade took place on November 25–26, 2023. The exhibition was also enlivened by several other sponsors showcasing their product demos.</p><p></p><p>This year’s parade featured two competition categories: clarity assessment and SPL measurement. There were also two competition classes based on the number of speakers used. Over the course of two days, approximately 50 rentals/participants joined the competition. On the final day, the committee presented a challenge: knock over a ¼-filled mineral water bottle within one minute using a song. Participants came up with various strategies—adjusting system management, choosing the right song, and more.</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>This time, the ACR booth presented a slightly different concept by showcasing a custom 4-way sound system box, fully equipped with ACR series driver components. For the subwoofer, they used a double 18” horn-loaded \"Keong\" box with the 18in Fabulous 113186. For the low section, a planar single 15” box using the 15in Fabulous 100152. For the midrange, the 12in Fabulous 75125 was used, and finally, the tweeter used was the Fabulous CD 650TR15B-08F Fab. All these custom box systems were powered by Rhyme amplifiers—specifically a combination of the R4500 and Rhyme R7000 for the subwoofers.</p><p></p><p>The booth also offered a demo session for the 4-way ACR Series sound system. Many visitors showed great enthusiasm as they witnessed and listened firsthand to the sound quality and design of the custom speaker boxes.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09679-1024x683-1746774428594.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09694-1024x683-1746774434341.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09706-1024x683-1746774442845.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09699-1024x683-1746774448635.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09688-1024x683-1746774456991.jpg\">', 'TEXASS Exhibition – Trenggalek, November 25–26, 2023', 'texass-exhibition-trenggalek-november-25-26-2023'),
('74549efe-e669-4553-acc0-e28da03a316a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2017', 'smex-2017', '<p>CV Sinar Baja Electric kembali hadir meramaikan event Surabaya Music Expo (SMEX) 2017 yang diselenggarakan di Grand City Convex, Surabaya pada tanggal 4-7 Mei 2017. Dengan menampilkan produk andalan untuk pro-audio-nya RHYME professional audio dan speaker driver ACR Fabulous series.</p><p></p><p>Pada event ini kami memperkenalkan beberapa produk baru untuk subwoofer 18inch double RM 128 SB MKIV yang merupakan generasi baru dari seri sebelumnya (RM 128 SB MKIII), subwoofer 18inch double model front horn loaded RM 128 SB FLH, dan speaker 18inch subwoofer 127187 ACR Fabulous series. Spesifikasi produk dapat dilihat di <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.rhymeaudio.com\">www.rhymeaudio.com</a> dan <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.acrspeaker.com\">www.acrspeaker.com</a></p><p></p><p>Selain tahun-tahun sebelumnya, pada SMEX selalu menyajikan demo speaker line array di area outdoor. Tahun ini kami mendemokan Rhyme RM 126 LA (single 12” 3-way) dengan subwoofer combo 4 box RM 128 SB MKIV (18” bass reflex double subwoofer) dan RM 128 SB FLH (18” front horn loaded double subwoofer) untuk menghasilkan komposisi frekuensi suara yang lengkap&nbsp; dari low sampai high frekuensi</p><p></p><p>RHYME Professional Audio dan ACR Speaker merupakan produk lokal dari CV Sinar Baja Electric dengan standard internasional yang sudah diakui berbagai negara. Terbukti dengan banyaknya produk hasil buatan CV Sinar Baja Electric yang telah dieksport ke berbagai negara selama lebih dari 35 tahun.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smex-2017-1746755887679.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smex-2017-1-1746755892608.jpg\">', '2017-05-12 17:00:00.000', 'admin', '2025-05-09 01:58:15.052', '2025-07-03 03:26:28.934', '', '', '<p>CV Sinar Baja Electric once again participated in the Surabaya Music Expo (SMEX) 2017, held at Grand City Convex, Surabaya, from May 4–7, 2017. We showcased our flagship products from RHYME Professional Audio and ACR Fabulous Series speaker drivers.</p><p></p><p>At this event, we introduced several new products, including the RM 128 SB MKIV 18-inch double subwoofer—an updated generation of the previous RM 128 SB MKIII series—the RM 128 SB FLH front horn-loaded 18-inch double subwoofer, and the 18-inch subwoofer 127187 from the ACR Fabulous Series. Product specifications can be found at <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.rhymeaudio.com\">www.rhymeaudio.com</a> and <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://www.acrspeaker.com\">www.acrspeaker.com</a>.</p><p></p><p>As in previous years, SMEX featured outdoor line array speaker demonstrations. This year, we demonstrated the Rhyme RM 126 LA (single 12” 3-way) with a subwoofer combo of 4 boxes: RM 128 SB MKIV (18” bass reflex double subwoofer) and RM 128 SB FLH (18” front horn-loaded double subwoofer), delivering a full frequency range from low to high.</p><p></p><p>RHYME Professional Audio and ACR Speaker are local products from CV Sinar Baja Electric, built to international standards and recognized in many countries. This is evidenced by the extensive export history of CV Sinar Baja Electric\'s products to various countries for over 35 years.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smex-2017-1746755887679.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/smex-2017-1-1746755892608.jpg\">', 'SMEX 2017', 'smex-2017'),
('7d43bdf3-fb8b-49f4-b548-7f33c8797617', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL DI KSSL', 'acr-rhyme-desibel-di-kssl', '<p>Pada awal bulan Juli 2025 Komunitas Sound System Lumajang (KSSL) &nbsp;mengadakan acara Parade &amp; Battle Sound System dalam rangka bersih desa selok awar-awar. Dalam event kali ini komunitas juga mengajak para pemilik sound system, baik rumahan ataupun rental untuk mengikuti lomba mixing dan spl. Acara ini juga dimeriahkan dengan kehadiran para sponsor yang turut melakukan demo produk serta membuka lapak. Selain brand-brand luar, ACR Rhyme Desibel sebagai brand local dari CV. Sinar Baja Electric juga turut serta memeriahkan acara tersebut</p><p></p><p>Di area lapak, tim membawa berbagai macam produk dari serian ACR meliputi ACR Fabulous, Excellent, Deluxe, hingga Black Series. Tipe speaker yang dibawa pun beragam mulai dari tweeter seperti CD 440PK1B-08F Fab ACR, hingga CD 340T1-08N Excel ACR Series, untuk array mulai 6in hingga 8in, 12in, 15in hingga 18in PA-127188 SW Fab double magnet. Selain itu juga terdapat Desibel yang menarik perhatian dari pengunjung yang datang, seperti 15in 381006-Mk1 dan 18in 451006-Mk1 yang menjadi tipe best seller di Desibel.</p><p></p><p>Pada area demo, Rhyme juga banyak memukau pengunjung dengan menampilkan RM 126 LA sebanyak 6 box, dan RM 1284 SB sebanyak 8 pcs yang disusun secara horisontal. Untuk amplifier menggunakan R4500, R7000 serta R17000. Di kesempatan kali ini pun, tim juga berkolaborasi dengan Pak Amir dari La Morena yang mampu mengundang perhatian dari setiap pengunjung yang ada.</p><p></p><p>Dari para peserta yang tampil di acara tersebut, beberapa dari mereka merupakan pecinta ACR. Mulai dari 12in 12880 excellent hingga 18in 127187 SW Fab menjadi tipe favorit yang digunakan pada lomba kali ini. Salah satu dari sekian peserta, Dedi dari Agung Sound System, memenangkan Juara 1 Kategori Ombro menggunakan produk full ACR, “Full ori masih an, ada lek 6 tahunan paling. Saya suka banget dengan ACR, pecinta ACR”, ucapnya saat tim mengunjungi beliau. Untuk Juara 2 Mixing dan Juara 2 SPL kategori Bulit Up juga dimenangkan oleh salah satu pengguna ACR, yaitu Subadi dari 2 Putri Audio. “Untuk kualitas suara bagus dan mantap.”, ujar beliau yang sudah menggunakan speaker ACR selama 4 tahun</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/zUPVRAO2eNw?rel=1\" start=\"0\"></iframe></div>', '2025-07-11 17:00:00.000', 'admin', '2025-07-24 08:54:23.610', '2025-07-24 08:54:23.606', '', '', '<p>At the beginning of July 2025, the Lumajang Sound System Community (KSSL) held a Parade &amp; Battle Sound System event in celebration of the Selok Awar-Awar village cleansing ritual. In this event, the community also invited sound system owners—whether home users or rental services—to participate in a mixing and SPL competition. The event was further enlivened by the presence of sponsors who conducted product demonstrations and set up booths. In addition to international brands, ACR Rhyme Desibel, a local brand from CV. Sinar Baja Electric, also took part in the festivities.</p><p></p><p>At the booth area, the team showcased a wide range of products from the ACR series, including ACR Fabulous, Excellent, Deluxe, and Black Series. The types of speakers presented were also diverse, from tweeters such as the CD 440PK1B-08F Fab ACR to the CD 340T1-08N Excel ACR Series, and array speakers ranging from 6-inch to 8-inch, 12-inch, 15-inch, and even 18-inch PA-127188 SW Fab double magnet. Additionally, Desibel products caught the attention of many visitors, including the 15-inch 381006-Mk1 and 18-inch 451006-Mk1, which are the best-selling models in the Desibel line.</p><p></p><p>In the demo area, Rhyme captivated many visitors by showcasing 6 units of RM 126 LA and 8 units of RM 1284 SB, arranged horizontally. For amplifiers, they used R4500, R7000, and R17000. On this occasion, the team also collaborated with Mr. Amir from La Morena, whose presence drew significant attention from visitors.</p><p></p><p>Among the participants in the event, several were devoted fans of ACR. From the 12-inch 12880 Excellent to the 18-inch 127187 SW Fab, these were the favorite models used in the competition. One of the participants, Dedi from Agung Sound System, won 1st Place in the Ombro Category using all-ACR products. “Still all original, maybe around 6 years old at most. I really love ACR—I\'m a true ACR fan,” he said when the team visited him. 2nd Place in Mixing and 2nd Place in the SPL Built-Up Category were also won by an ACR user, Subadi from 2 Putri Audio. “The sound quality is excellent and solid,” said Subadi, who has been using ACR speakers for four years.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/zUPVRAO2eNw?rel=1\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL at KSSL', 'acr-rhyme-desibel-at-kssl'),
('7eaa2e57-2348-4ee2-af64-729ea41954d5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Road to SMEX 2018', 'road-to-smex-2018', '<p><strong>SMEX “Surabaya Music Expo”</strong></p><ul><li><p><em>Tanggal :&nbsp;3 – 6 Mei 2018</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://surabayamusicexpo.com/index.php/smex-2018\">http://surabayamusicexpo.com/index.php/smex-2018</a><a target=\"_blank\" rel=\"noopener\" href=\"http://surabayamusicexpo.com/index.php/smex-2018\"><br></a></p></li><li><p><strong>ACR &amp; RHYME booth No. 19</strong></p></li></ul><p>Tahun ini Kami hadir dalam SMEX yang merupakan salah satu event pameran Pro Audio, Lighting dan Music terbesar di Indonesia.&nbsp;Di sini kami akan mendemokan&nbsp;Line Array terbaru kami yang diselengarakan di bagian outdoor dan di indoor kami memamerkan semua produk baru kamu di&nbsp;booth ACR dan RHYME (No.19).</p><p></p><p>kunjungi booth kami, dapatkan promo menarik dan informasi secara langsung tentang produk-produk terbaru.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX18-1746755999318.jpg\">', '2018-04-04 17:00:00.000', 'admin', '2025-05-09 02:00:03.105', '2025-07-03 03:26:20.610', '', '', '<p><strong>SMEX “Surabaya Music Expo”</strong></p><ul><li><p>Date: May 3–6, 2018</p></li><li><p>Location: Exhibition Hall Grand City, Surabaya</p></li><li><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"http://surabayamusicexpo.com/index.php/smex-2018\">http://surabayamusicexpo.com/index.php/smex-2018</a></p><p></p></li><li><p><strong>ACR &amp; RHYME Booth No. 19</strong></p></li></ul><p>This year, we are participating in SMEX, one of the largest Pro Audio, Lighting, and Music exhibitions in Indonesia. Here, we will showcase our latest Line Array system in the outdoor section, while our newest products will be displayed indoors at the ACR and RHYME booth (No. 19).</p><p></p><p>Visit our booth to get exciting promotions and direct information about our latest products.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX18-1746755999318.jpg\">', 'Road to SMEX 2018', 'road-to-smex-2018'),
('7ef6abdb-a5b4-4899-8151-e7cff8b8b9ba', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Parade Sound System Komunitas Tulungagung (PSJTA)', 'parade-sound-system-komunitas-tulungagung-psjta', '<p>Rekan-rekan pecinta Sound System, jangan lewatkan Workshop dan Parade Sound System di Kota Tulungagung. ACR dan Rhyme ikut berpartisipasi untuk meramaikan acara dan membawa produk-produk terbarunya.</p><p></p><p>tanggal&nbsp;: 28 dan 29 Juli 2018<br>lokasi : GOR Lembupeteng, Tulungagung.</p><p></p><p>Silakan datang dan kunjungi tempat kami, jangan sampai ketinggalan !!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Klinik-Tulungagung-1746756540694.jpg\">', '2018-07-19 17:00:00.000', 'admin', '2025-05-09 02:09:03.438', '2025-07-03 03:24:36.301', '', '', '<p>Sound System enthusiasts, don’t miss the Workshop and Sound System Parade in the city of Tulungagung. ACR and Rhyme are participating to liven up the event and will be showcasing their latest products.</p><ul><li><p>Date: July 28–29, 2018</p></li><li><p>Location: GOR Lembupeteng, Tulungagung</p></li></ul><p>Feel free to come and visit our booth — don’t miss out!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Klinik-Tulungagung-1746756540694.jpg\">', 'Parade Sound System Komunitas Tulungagung (PSJTA)', 'parade-sound-system-komunitas-tulungagung-psjta'),
('7f4c316d-a60d-4676-8a2c-c5dbcaa675b3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'TELAH DIBUKA: ACR SOUND FESTIVAL VOLUME 1', 'telah-dibuka-acr-sound-festival-volume-1', '<p>Dengan semakin berkembangnya komunitas pecinta audio di seluruh Indonesia, ACR dari CV. Sinar Baja Electric mempersembahkan <strong>ACR Sound Festival 2025</strong>&nbsp;— sebuah perayaan besar untuk mengapresiasi dan membangkitkan rasa bangga terhadap produk audio lokal berkualitas.<br>Bekerja sama dengan PSTT (Paguyuban Sound System Tulungagung Timur), acara ini akan menghadirkan&nbsp;lomba SPL, lomba mixing, hingga demo produk eksklusif&nbsp;dari ACR.&nbsp;Event ini diadakan di Lapangan Desa Pilotondo, Tulungagung pada tanggal 26 - 27 Juli 2025.</p><p><strong>Hadiah Untuk Para Juara:</strong></p><p><strong>Juara Lomba Mixing</strong></p><p>Juara 1: 18in PA-127187 SW Fab</p><p>Juara 2: 15in 381006 Mk1 Desibel</p><p>Juara 3: 12in PA-75125 M Fab</p><p>&nbsp;</p><p><strong>Juara Lomba SPL</strong></p><p>Juara 1: 18in PA-113188 SW Fab</p><p>Juara 2: 12in PA-100122 W Fab</p><p>Juara 3: 15in 15100 BLACK</p><p>&nbsp;</p><p><strong>Spesifikasi Lomba:</strong></p><p>- Subwoofer (4 Mata)</p><p>- Mid + Tweeter (8 Mata)</p><p>- Tweeter (Bebas)</p><p>*Note:</p><p>1. Minimal 50% dari total speaker <strong>wajib</strong>&nbsp;menggunakan produk Sinar Baja Electric</p><p>2. Bagi yang menggunakan full SBE/ACR akan mendapatkan hadiah tambahan yang menarik</p><p>&nbsp;</p><p><strong>Syarat &amp; Ketentuan:</strong></p><p>- Peserta wajib mendaftar terlebih dahulu di app <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\"><strong>My SBE</strong></a>&nbsp;dan konfirmasi ke tim dengan menuliskan nama pengguna ke kontak yang tertulis dibawah ini. Semua peserta akan mendapatkan merchandise (topi, kaos, tas) serta piagam), dan para pemenang akan mendapatkan trophy eksklusif.</p><p>- Waktu pendaftaran 30 Juni - 20 Juli 2025</p><p>- Peserta akan didiskualifikasi apabila tidak mengikuti syarat dan ketentuan lomba</p><p>&nbsp;</p><p>Event ini juga akan dihadiri oleh salah satu pembicara ternama, Cak Dodot, yang membahas mengenai dasar-dasar audio pada tanggal 26 Juli 2025 pk 19.00. Untuk meningkatkan rasa antusias peserta, panitia juga menyiapkan hadiah untuk 3 pemberi pertanyaan terbaik. Seluruh event dibuka untuk umum dan tidak dipungut biaya apapun.</p><p></p><p><strong>Kontak pendaftaran:</strong><br>Yahya : 08123427535<br>Agung Jabon: 085736696131</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ACR Sound Fest Vol.1 (Pamflet A4) versi 1.3_11zon-1752253555091.webp\">', '2025-07-01 17:00:00.000', 'admin', '2025-07-02 08:28:40.972', '2025-07-11 17:06:19.048', '', '', '<p>With the growing community of audio enthusiasts across Indonesia, ACR from CV. Sinar Baja Electric proudly presents the ACR Sound Festival 2025 — a grand celebration to appreciate and inspire pride in high-quality local audio products.</p><p>In collaboration with PSTT (Paguyuban Sound System Tulungagung Timur), this event will feature SPL competitions, mixing contests, and exclusive product demos from ACR. The event will be held at the Pilotondo Village Field, Tulungagung, on July 26-27, 2025.</p><p><strong>Prizes for the Winners:</strong></p><p><strong>Mixing Competition Winners</strong><br>1st Place: 18in PA-127187 SW Fab<br>2nd Place: 15in 381006 Mk1 Desibel<br>3rd Place: 12in PA-75125 M Fab</p><p></p><p><strong>SPL Competition Winners</strong><br>1st Place: 18in PA-113188 SW Fab<br>2nd Place: 12in PA-100122 W Fab<br>3rd Place: 15in 15100 BLACK</p><p></p><p><strong>Competition Specifications:</strong></p><p>- Subwoofer (4 units)</p><p>- Mid + Tweeter (8 units)</p><p>- Tweeter (any)</p><p><em>Note:</em></p><ol><li><p>At least 50% of the total speakers must use products from Sinar Baja Electric</p></li><li><p>Participants using full SBE/ACR products will receive additional attractive prizes</p></li></ol><p><strong>Terms &amp; Conditions:</strong></p><p>- Participants must register first on the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\"><strong>My SBE app</strong></a> and confirm with the team by sending their username to the contact listed below. All participants will receive merchandise (hat, shirt, bag) and certificates, and winners will receive exclusive trophies.</p><p>- Registration period: June 30 - July 20, 2025</p><p>- Participants will be disqualified if they do not comply with the competition terms and conditions</p><p></p><p>This event will also feature a special speaker, Cak Dodot, who will discuss audio fundamentals on July 26, 2025, at 7:00 PM. To boost participant enthusiasm, the committee will give prizes to the top 3 best questions. The entire event is open to the public and free of charge.</p><p></p><p><strong>Registration contact:</strong><br>Yahya : 08123427535<br>Agung Jabon: 085736696131</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ACR Sound Fest Vol.1 (Pamflet A4) versi 1.3_11zon-1752253571156.webp\">', 'NOW OPEN: ACR SOUND FESTIVAL VOLUME 1', 'now-open-acr-sound-festival-volume-1'),
('7f6ed51e-cff4-4a4c-9513-075405e181af', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Paguyupan Sound System Jatim  (PSS Jatim) - Tuban', 'review-paguyupan-sound-system-jatim-pss-jatim-tuban', '<p>Acara Parade Sound System dan Demo Produk merupakan event yang diselengarakan oleh Paguyuban Sound System Jawa Timur (PSS-Jatim) yang sudah dilaksanakan setiap tahunnya, di tahun ini dilaksanakan di Kota Tuban. Acara tersebut diselengarakan pada tanggal 12 – 13 Maret yang berlokasi di Lapangan terbuka, di Kecamatan Merakurak, Kota Tuban.</p><p></p><p>Acara berlangsung sukses dan lancar namun dari beberapa pendapat bahwa acara tahun ini pengunjung dan sponsor terlihat berkurang dari event sebelumnya. Pengunjung yang datang hanya sebagian besar merupakan dari peserta lomba dan warga daerah setempat yang penasaran tentang event ini.</p><p></p><p>Kami sebagai salah satu sponsor ikut memeriahkan acara dengan membuka stand dan mendemokan speaker line array milik RHYME Pro-AUDIO; RM 126 LA (12in single, 3-way) dan subwoofernya 128 SB MK4 (18in double), dengan konfigurasi 4x3 box.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124415-e1555059481497-1746759836628.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124643-e1555059006817-1746759844861.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124214-e1555059031867-1746759852965.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190313_113143-e1555059086242-1746759859219.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190313_113349-e1555059147606-1746759865612.jpg\">', '2019-04-11 17:00:00.000', 'admin', '2025-05-09 03:02:01.847', '2025-07-03 03:23:48.491', '', '', '<p>The Sound System Parade and Product Demo event is an annual event organized by the East Java Sound System Association (PSS-Jatim), and this year it was held in Tuban City. The event took place on March 12–13 at an open field in the Merakurak District, Tuban City.</p><p></p><p>The event ran smoothly and successfully, although according to some feedback, the number of visitors and sponsors this year was lower compared to previous events. Most of the attendees were competition participants and local residents who were curious about the event.</p><p></p><p>As one of the sponsors, we participated by setting up a booth and demonstrating RHYME Pro-AUDIO’s line array speakers: RM 126 LA (12in single, 3-way) and its subwoofer 128 SB MK4 (18in double), with a 4x3 box configuration.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124415-e1555059481497-1746759836628.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124643-e1555059006817-1746759844861.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190312_124214-e1555059031867-1746759852965.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190313_113143-e1555059086242-1746759859219.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20190313_113349-e1555059147606-1746759865612.jpg\">', 'Review - Paguyupan Sound System Jatim (PSS Jatim) - Tuban', 'review-paguyupan-sound-system-jatim-pss-jatim-tuban'),
('849416fe-92ba-4119-94a6-2e92fa216f4e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2018', 'smex-2018', '<p>Seperti format sebelumnya, Pameran Surabaya Music Expo (SMEX) yang diadakan di Exhibition Hall Grand City Surabaya, tanggal 3-6 Mei 2018 dibagi menjadi dua area. Area Outdoor menampilkan demo speaker Line Array/FOH, sedangkan pada bagian indoor terdapat stand-stand yang menampilkan dan menjual alat-alat musik , sound system, speaker pro-audio, lighting and LED.</p><p></p><p>Sinar Baja Electric hadir dengan memajang speaker driver ACR terbaru Fabulous Series tipe 12” PA-75127, Subwoofer 15” PA-113156, dan beberapa tipe lainnya. Selain itu, kami juga membawa produk speaker system RHYME PROFESSIONAL AUDIO. Pada pameran SMEX 2018 ini RHYME PROFESSIONAL AUDIO memperkenalkan beberapa produk baru diantaranya Single subwoofer 15” RM 115 SB MKIV, Power amplifier class D R4500 dan R7000, speaker Line Array Dual 10inch 2-way (RM 103 LA) dan Subwoofer 18inch double RM 1283 SB yang di-demo-kan di area outdoor. Selain itu juga didemo-kan Line Array seri RM 126 LA single 12inch 3-way.</p><p></p><p>Pengunjung yang datang tidak hanya untuk menikmati sound-sound yang ada melainkan terdapat juga untuk berbagi pengalaman dan sharing dalam menggunakan speaker produk ACR, Rhyme, dan brand-brand lainnya sehingga dapat menjadi motivasi bagi kami untuk menciptakan inovasi-inovasi produk loudspeaker terbaik.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180503_120217-e1531533703276-1746756141405.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG_20180505_113025_HDR-e1531533825340-1746756146433.jpg\">', '2018-05-14 17:00:00.000', 'admin', '2025-05-09 02:02:36.260', '2025-07-03 03:26:12.784', '', '', '<p>As in the previous format, the Surabaya Music Expo (SMEX) exhibition held at the Grand City Surabaya Exhibition Hall from May 3–6, 2018, was divided into two areas. The outdoor area featured Line Array/FOH speaker demos, while the indoor area housed booths showcasing and selling musical instruments, sound systems, pro-audio speakers, lighting, and LED products.</p><p></p><p>Sinar Baja Electric participated by showcasing the latest ACR speaker drivers such as the Fabulous Series 12” PA-75127, the 15” subwoofer PA-113156, and several other models. Additionally, we brought speaker system products from RHYME PROFESSIONAL AUDIO. At the SMEX 2018 exhibition, RHYME PROFESSIONAL AUDIO introduced several new products including the single 15” subwoofer RM 115 SB MKIV, Class D power amplifiers R4500 and R7000, the dual 10-inch 2-way Line Array speaker (RM 103 LA), and the 18-inch double subwoofer RM 1283 SB, which were demoed in the outdoor area. The Line Array RM 126 LA single 12-inch 3-way series was also demonstrated.</p><p></p><p>Visitors came not only to enjoy the sound but also to share their experiences and exchange insights about using ACR, Rhyme, and other brands\' speaker products, serving as a motivation for us to continue innovating the best loudspeaker products.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180503_120217-e1531533703276-1746756141405.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/IMG_20180505_113025_HDR-e1531533825340-1746756146433.jpg\">', 'SMEX 2018', 'smex-2018');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('90aae0ae-48a3-4d87-a5a1-c39bd975d863', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pameran Sound System – PSSJ Jombang  18 – 19  MEI 2024', 'pameran-sound-system-pssj-jombang-18-19-mei-2024', '<p>Pada tahun 2024 ini PSSJ – Jombang mengadakan Parade Sound System yang digelar rutin tahunan. Di tahun 2024 ini merupakan parade sound jilid ke #3. Acara ini digelar di lapangan desa Banjarsari Jombang&nbsp;&nbsp;pada tanggal 18 – 19 Mei 2024.</p><p></p><p>Dalam acara ini dilakukan beberapa lomba diantaranya kategori mixing live + balap sound (Lomba SPL). Materi lagu live mixing yang digunakan disiapkan oleh panitia dengan genre lagu dangdut yang berisi total 12 channel. Ajang live mixing juga diselenggarakan untuk menilai kelihaian operator dalam menggunakan seluruh alat instrument music. Pada acara kali ini pun, tim juga ikut serta dalam mensponsori pemenang lomba dengan menghadiahkan 18in PA- 100182 Mk3 SW Fab, 18in 18710 DLX, hingga 15in 381006 Desibel</p><p></p><p><strong>Acara&nbsp;&amp;&nbsp;Bazar</strong></p><p></p><p>Lapak ACR kali ini membawa barang display dalam box custom dengan skema box damphoed (paraflex) yang menggunakan driver 18inch 113188 SW Fab. Selain itu, box ini didampingi oleh line array 8inch RM 81 LA sebanyak 2 box serta low pack line array Rm 151 FSB sebanyak 1 box yang disusun secara ground stack. Paduan dari keseluruhan speaker memberikan bass yang kuat dan dalam yang mampu menarik perhatian dari para pengunjung yang ada disana.</p><p></p><p>Untuk demo product pada event kali ini, ACR Rhyme membawa 6 box RM 126 LA yang berisikan 3-way line array diatur dengan menggunakan mode Tri-amp dan di drive menggunakan amplifier Rhyme R4500. Lalu untuk subwoofer , Rhyme membawa 6 box RM 1283 SB disusun berdiri dan juga menggunakan amplifier tipe terbaru dari Rhyme yaitu Amplifier D17000 dengan kelas D berisi 2 channel.</p><p></p><p>Berikut dokumentasinya:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1 (1)-1746776243619.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4 (1)-1746776248812.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3-1746776253184.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5 (1)-1746776258778.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6 (1)-1746776267580.jpg\"><p></p><p>Selengkapnya dapat dilihat pada Youtube Channel <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker - Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/wHjpHvHAWbA?si=7c1-mDSVmrS3Y5Gs\" start=\"0\"></iframe></div>', '2024-06-02 17:00:00.000', 'admin', '2025-05-09 07:38:13.961', '2025-07-03 02:10:46.693', '', '', '<p>In 2024, PSSJ – Jombang held its annual Sound System Parade, with this year marking the 3rd edition of the event. The parade took place at the village field of Banjarsari, Jombang, on May 18–19, 2024.</p><p></p><p>The event featured several competitions, including categories for live mixing and sound battle (SPL Competition). The live mixing material was prepared by the committee and featured dangdut music with a total of 12 channels. This segment aimed to assess the skills of audio operators in handling all musical instruments. During the event, the team also sponsored the competition by awarding prizes such as the 18in PA-100182 Mk3 SW Fab, 18in 18710 DLX, and 15in 381006 Desibel.</p><p></p><p><strong>Exhibition &amp; Bazaar</strong></p><p>At the ACR booth, a custom damphoed (paraflex) box equipped with the 18in 113188 SW Fab driver was showcased. This setup was accompanied by two RM 81 LA 8-inch line array boxes and one RM 151 FSB low-pack line array box arranged in a ground stack configuration. The overall speaker setup delivered powerful and deep bass, which attracted the attention of many visitors.</p><p></p><p>For the product demo, ACR Rhyme brought 6 RM 126 LA boxes featuring a 3-way line array system configured in Tri-amp mode and powered by the Rhyme R4500 amplifier. For subwoofers, 6 RM 1283 SB boxes were arranged vertically and powered by Rhyme’s latest Class D amplifier, the D17000, which comes with 2 channels.</p><p></p><p>Here is the documentation:</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1 (1)-1746776243619.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/4 (1)-1746776248812.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/3-1746776253184.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/5 (1)-1746776258778.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/6 (1)-1746776267580.jpg\"><p></p><p>For more details, you can visit the YouTube Channel: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.youtube.com/@acrspeaker-rhymeproaudio\">ACR Speaker – Rhyme Pro Audio</a></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/wHjpHvHAWbA?si=7c1-mDSVmrS3Y5Gs\" start=\"0\"></iframe></div>', 'Sound System Exhibition – PSSJ Jombang on May 18–19, 2024', 'sound-system-exhibition-pssj-jombang-on-may-18-19-2024'),
('91471f16-d96b-4f8b-b485-7a1bfc3ff96d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX SURABAYA 2024', 'smex-surabaya-2024', '<p>Surabaya Music Expo (SMEX) 2024 diadakan kembali pada 1-4 Agustus di Grand City Hall Surabaya. Acara kali ini dihadiri oleh brand-brand dari Indonesia, Eropa hingga Cina yang memproduksi lighting, LED screen, pro audio, hingga amplifier.</p><p></p><p>Acara ini dibagi menjadi 2 area, indoor yang digunakan untuk pameran, serta area outdoor yang digunakan untuk tes sound untuk Line Array dan Subwoofer dari setiap brand. Pada area outdoor, Sinar Baja Electric menampilkan produk terbaru Rhyme, yakni RM 226 LA sebanyak 6 pcs serta RM 1283 SB Mk-1 sebanyak 8 pcs. Pada RM 226 LA memakai system 3-way yang menggunakan komponen 2 pcs woofer 12in, 4 pcs 6in Array 5061 M Fab ACR Series, dan 2 pcs compression driver. Untuk RM 1283 SB Mk1 menggunakan 2 pcs 18in PA-113188 SW Fab yang memiliki double magnet dan double damper.</p><p></p><p>Setelah pengunjung mendengarkan tes sound, mereka dapat mengunjungi area indoor untuk melihat produk lainnya yang ditampilkan oleh setiap brand. Berikut list speaker yang dibawakan ACR Rhyme:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154637-1746780573122.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154648-1746780580275.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154657-1746780591946.png\"><p></p><p>Para pengunjung yang mendatangi booth ACR Rhyme memiliki rasa antusias yang tinggi karena produk yang ditampilkan adalah produk terbaru dari setiap brand. Pengunjung juga langsung mendatangi booth setelah mendengarkan secara langsung demo sound dari RM 226 LA dan RM 1283 SB Mk1. Mereka juga penasaran dengan prototype RM 103 LA yang masih menampilkan tekstur kayu yang kuat dan kokoh.</p><p></p><p>Pada bagian ACR, pengunjung antusias dengan produk-produk baru yang ditampilkan. Banyak dari pengunjung yang menanyakan harga untuk tipe baru yang akan dirilis. Tim ACR juga mengadakan event bagi-bagi voucher sebesar Rp 100.000,- yang dapat digunakan untuk pembelian ACR serian terbaru di Official Showroom Sinar Baja Electric, Surabaya. Berikut syarat untuk mendapatkan voucher:</p><p></p><ol><li><p>Follow Instagram ACR Speaker dan Youtube ACR Speaker - Rhyme Pro Audio</p></li><li><p>Buat IG feed/reels/story tentang event ACR Rhyme di SMEX 2024</p></li><li><p>Maksimal 1 akun mendapatkan 1 voucher</p></li><li><p>Pembelian produk khusus di Official Showroom Sinar Baja Electric Jl. Genteng Besar No 15A - Genteng, Surabaya</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03836-min-1-1320x880-min-1746780654711.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03844-1320x880-1746780661966.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture-1746780667662.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture1-1746780673659.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture2-1746780682375.jpg\"><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lkgVynI2v6U?si=pQfmLXC1dnJGxYwQ\" start=\"0\"></iframe></div>', '2024-08-08 17:00:00.000', 'admin', '2025-05-09 08:50:00.004', '2025-07-03 01:46:34.303', '', '', '<p>Surabaya Music Expo (SMEX) 2024 was held once again from August 1–4 at Grand City Hall Surabaya. This event was attended by brands from Indonesia, Europe, and China, showcasing lighting, LED screens, pro audio, and amplifiers.</p><p></p><p>The event was divided into two areas: an indoor area used for exhibitions, and an outdoor area used for sound testing of Line Arrays and Subwoofers from each brand. In the outdoor area, Sinar Baja Electric showcased the latest Rhyme products: 6 units of the RM 226 LA and 8 units of the RM 1283 SB Mk-1. The RM 226 LA features a 3-way system composed of 2 pcs of 12in woofers, 4 pcs of 6in Array 5061 M Fab ACR Series, and 2 pcs of compression drivers. The RM 1283 SB Mk1 uses 2 pcs of 18in PA-113188 SW Fab, which are equipped with double magnets and double dampers.</p><p></p><p>After listening to the sound test, visitors could head to the indoor area to view other products showcased by each brand. Below is the list of speakers brought by ACR Rhyme:</p><p></p><p><strong>ACR Fabulous Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154637-1746780573122.png\"><p></p><p><strong>ACR Black Series</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154648-1746780580275.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 154657-1746780591946.png\"><p></p><p>Visitors to the ACR Rhyme booth showed great enthusiasm, especially because the products displayed were the latest releases from each brand. Many came straight to the booth after listening to the live sound demo of the RM 226 LA and RM 1283 SB Mk1. They were also curious about the RM 103 LA prototype, which still featured a raw wood texture, appearing strong and solid.</p><p></p><p>At the ACR section, visitors were eager to explore the newly displayed products. Many inquired about the prices of the upcoming models. The ACR team also held a giveaway event offering vouchers worth Rp 100,000, which could be used to purchase the newest ACR series at the Official Sinar Baja Electric Showroom in Surabaya. Below are the terms to get the voucher:</p><p></p><ol><li><p>Follow ACR Speaker on Instagram and ACR Speaker – Rhyme Pro Audio on YouTube</p></li><li><p>Create an Instagram feed/reel/story about the ACR Rhyme event at SMEX 2024</p></li><li><p>A maximum of one voucher per account</p></li><li><p>Voucher valid for product purchases only at the Official Sinar Baja Electric Showroom, located at Jl. Genteng Besar No 15A – Genteng, Surabaya</p></li></ol><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03836-min-1-1320x880-min-1746780654711.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03844-1320x880-1746780661966.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture-1746780667662.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture1-1746780673659.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture2-1746780682375.jpg\"><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lkgVynI2v6U?si=pQfmLXC1dnJGxYwQ\" start=\"0\"></iframe></div>', 'SMEX SURABAYA 2024', 'smex-surabaya-2024'),
('92e0694a-2a02-412f-b576-2f54bf437ae5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Undian Poin My SBE 2023', 'undian-poin-my-sbe-2023', '<p>Pada quartal ke 3 tepatnya bulan September 2023, ACR mengadakan undian untuk para pecinta ACR. Undian tersebut adalah lomba mendapatkan poin terbanyak lewat aplikasi My SBE.</p><p></p><p>My SBE adalah aplikasi resmi milik ACR yang berisikan katalog, lokasi toko agen resmi di seluruh Indonesia, serta kumpulan artikel. Para pecinta ACR bisa mendapatkan info mengenai produk hingga kegiatan terbaru dari ACR melalui 1 aplikasi ini.</p><p></p><p>Berikut langkah-langkah untuk mengikuti Undian Poin My SBE 2023:</p><p></p><ul><li><p>Download app My SBE pada Play Store, lalu registrasi terlebih dahulu. Berikut <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/news/cara-registrasi-my-sbe\">cara registrasinya</a></p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1746772742070.jpg\"><ul><li><p>Pada halaman Beranda klik \"Pindai\" dan scan QR-Code yang ada pada speaker ACR. QR-Code biasanya terletak pada magnet atau yoke speaker</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-474x1024-1746772751991.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1746772756807.jpg\"><ul><li><p>Lalu pilih toko pembelian</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-520x1024-1746772768453.jpg\"><ul><li><p>Setelah memilih toko, maka akan muncul pop up message bahwa poin berhasil didapatkan. Banyaknya poin tergantung dari ukuran dan tipe speaker</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1746772780255.jpeg\"><ul><li><p>Jika QR Barcode sudah pernah discan sebelumnya maka akan muncul pop up message yang menyatakan voucher gagal di-scan</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1746772788535.jpg\"><ul><li><p>Poin yang berhasil didapatkan akan tersimpan pada \"Poin Anda\" di halaman Beranda. Untuk melihat riwayat scan, langsung klik pada kolom \"Poin Anda\"</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1692938364-478x1024-1746772798204.jpg\"><p>Undian Poin My SBE 2023 berjalan pada 1 September hingga 30 November 2023. Para pecinta ACR bisa men-scan QR-Code dari speaker ACR yang sudah lama dibeli. Pemenang dipilih dari 4 akun konsumen yang memiliki poin terbanyak, dan akan diumumkan pada 6 September 2023. Berikut list hadiah untuk para pemenang:</p><p>Juara 1 mendapatkan 1pcs <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-113188-sw-fab-by-acr\">18in PA-113188 SW FAB</a></p><p>Juara 2 mendapatkan 1 pcs <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-188127-excel-by-acr\">18in PA-188127 EXCEL</a></p><p>Juara 3 mendapatkan 1 pcs <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/18710-dlx\">18in 18710 DLX</a></p><p>Juara 4 mendapatkan 1 pcs <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/15710-dlx\">15in 15710 DLX</a></p>', '2023-09-06 17:00:00.000', 'admin', '2025-05-09 06:40:03.003', '2025-07-03 02:14:47.217', '', '', '<p>In the third quarter, specifically in September 2023, ACR held a special raffle for ACR enthusiasts. This raffle was a competition to earn the most points through the My SBE app.</p><p></p><p>My SBE is ACR’s official application that contains a product catalog, locations of official agents throughout Indonesia, and a collection of articles. ACR fans can access information about products and the latest activities from ACR all in one app.</p><p></p><p>Here are the steps to join the My SBE Points Raffle 2023:</p><p></p><ul><li><p>Download the My SBE app from the Play Store, then register first. Here\'s <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/news/cara-registrasi-my-sbe\">how to register</a>:</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1746772742070.jpg\"><ul><li><p>On the Home page, click \"Pindai\" and scan the QR Code found on the ACR speaker. The QR Code is usually located on the magnet or yoke of the speaker.</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-474x1024-1746772751991.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1746772756807.jpg\"><ul><li><p>Then choose the store</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-520x1024-1746772768453.jpg\"><ul><li><p>After selecting the store, a pop-up message will appear stating that the points have been successfully obtained. The number of points depends on the size and type of speaker</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1746772780255.jpeg\"><ul><li><p>If the QR Barcode has been scanned before, a pop-up message will appear stating that the voucher scan has failed.</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1746772788535.jpg\"><ul><li><p>Points successfully earned will be stored in the \"Poin Anda\" section on the Home page. To view the scan history, simply click on the \"Poin Anda\" section.</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1692938364-478x1024-1746772798204.jpg\"><p>The My SBE Points Raffle 2023 ran from September 1 to November 30, 2023. ACR fans could scan QR Codes from ACR speakers they had previously purchased. Winners were selected from the top 4 consumer accounts with the highest points and were announced on September 6, 2023. Here is the prize list for the winners:</p><p><strong>1st Place:</strong> 1 piece of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-113188-sw-fab-by-acr\">18in PA-113188 SW FAB</a><br><strong>2nd Place:</strong> 1 piece of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/pa-188127-excel-by-acr\">18in PA-188127 EXCEL</a><br><strong>3rd Place:</strong> 1 piece of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/18710-dlx\">18in 18710 DLX</a><br><strong>4th Place:</strong> 1 piece of <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/15710-dlx\">15in 15710 DLX</a></p>', 'My SBE Points Raffle 2023', 'my-sbe-points-raffle-2023'),
('967a7ef6-e45d-404d-9bf1-6e14627e1420', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Photo Competition \"Indonesia Merdeka\"', 'indonesia-merdeka', '<p><strong>Ayo ikuti Lomba Foto Indonesia Merdeka !&nbsp;</strong><br>dalam rangka menyambut HUT RI ke-69 ACR dan RHYME mengadakaan Lomba Foto&nbsp;dengan total hadiah <strong>Rp. 3 juta dan 30 hadiah hiburan.</strong></p><p></p><p>SYARAT &amp; KETENTUAN :</p><ul><li><p>Lomba dibuka untuk umum.</p></li><li><p>Foto bisa sendiri atau berkelompok dengan menunjukan&nbsp;aktivitas atau suasana acara 17 Agustus, dan HARUS ada&nbsp;image/property yang ber-khas ACR atau RHYME.</p></li><li><p>Karya foto memiliki nilai unik dan menarik.</p></li><li><p>Karya foto belum pernah memenangi lomba foto lain.</p></li><li><p>Foto tidak mengandung SARA dan PROMOSI produk lain.</p></li><li><p>Peserta hanya diperbolehkan mengirim 1 (satu) foto.</p></li><li><p>Peserta tidak diperbolehkan untuk mengedit foto,&nbsp;kecuali sebatas cropping.</p></li><li><p>Foto disimpan dalam format JPG.• Lomba dibuka untuk umum.</p></li><li><p>Foto bisa sendiri atau berkelompok dengan menunjukan&nbsp;aktivitas atau suasana acara 17 Agustus, dan HARUS ada&nbsp;image/property yang ber-khas ACR atau RHYME.</p></li><li><p>Karya foto memiliki nilai unik dan menarik.</p></li><li><p>Karya foto belum pernah memenangi lomba foto lain.</p></li><li><p>Foto tidak mengandung SARA dan PROMOSI produk lain.</p></li><li><p>Peserta hanya diperbolehkan mengirim 1 (satu) foto.</p></li><li><p>Peserta tidak diperbolehkan untuk mengedit foto,&nbsp;kecuali sebatas cropping.</p></li><li><p>Foto disimpan dalam format JPG.</p></li></ul><p>PENGUMPULAN FOTO :</p><ul><li><p>Pengumpulan foto selambat-lambatnya sampai tanggal&nbsp;10 September 2014.</p></li><li><p>Foto bisa dikirim dalam bentuk softcopy melalui email,&nbsp;ke info@sinarbajaelectric.com atau inbox ke FaceBook&nbsp;ACR dengan subject “Lomba Foto Indonesia Merdeka”.</p></li><li><p>Atau bisa dikirim dalam bentuk CD dalam amplop tertutup&nbsp;dengan subject “Lomba Foto Indonesia Merdeka”&nbsp;ke alamat :<br>CV. Sinar Baja Electtric<br>Jl. Margomulyo No. 5, Tandes Surabaya 60185<br>UP : Departemen Marketing (Bpk. Eric Mulyadi)</p></li><li><p>Lampirkan data diri; nama, alamat, nomor telepon, dan&nbsp;foto/fotocopy KTP. (untuk kirim softcopy ataupun kirim CD)</p></li></ul><p>PENGUMUMAN JUARA :</p><ul><li><p>Pemenang Lomba akan diumumkan pada tanggal&nbsp;17 September 2014 di FaceBook ACR&nbsp;<a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/acr.speaker\">https://www.facebook.com/acr.speaker</a> dan di Showroom&nbsp;Sinar Baja Electric Surabaya dan Jakarta.</p></li><li><p>Pemenang juga dihubungi secara langsung melalui telepon.</p></li><li><p>Keputusan Juri tidak bisa diganggu gugat dan panitia berhak&nbsp;mempublikasikan hasil karya pemenang.</p></li></ul><p>TOTAL HADIAH &nbsp;Rp 3 JUTA</p><ul><li><p><strong>Juara 1</strong> : Uang Tunai Rp 1,5 juta</p></li><li><p><strong>Juara 2</strong> : Uang Tunai Rp 1 juta</p></li><li><p><strong>Juara 3</strong> : Uang Tunai Rp 500 ribu</p></li></ul><p>info lebih lanjut : +6231 7480011, 7494222 (Bpk. Eric / Rizky)</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/LOMBA-FOTO-17-AGUSTUS-2-1746754499507.jpg\">', '2014-08-10 17:00:00.000', 'admin', '2025-05-09 01:35:06.839', '2025-07-03 03:28:42.720', '', '', '<p><strong>Join the “Indonesia Merdeka” Photo Contest!</strong><br>In celebration of Indonesia’s 69th Independence Day, ACR and RHYME are holding a photo contest with a total prize of <strong>Rp 3 million</strong> and <strong>30 consolation prizes</strong>.</p><hr><h3>TERMS &amp; CONDITIONS:</h3><ul><li><p>Open to the public.</p></li><li><p>Photos can feature individuals or groups, showing <strong>activities or atmosphere of the August 17th celebration</strong>, and <strong>must include a distinctive ACR or RHYME image/property</strong>.</p></li><li><p>Entries must be <strong>unique and interesting</strong>.</p></li><li><p>Submitted photos <strong>must not have won any previous photo competitions</strong>.</p></li><li><p>Photos must <strong>not contain elements of SARA (ethnicity, religion, race, intergroup) or promote other products</strong>.</p></li><li><p>Each participant may <strong>submit only one (1) photo</strong>.</p></li><li><p><strong>No editing</strong> is allowed other than <strong>cropping</strong>.</p></li><li><p>Photo format: <strong>JPG</strong>.</p></li></ul><hr><h3>PHOTO SUBMISSION DEADLINE:</h3><p><strong>No later than September 10, 2014</strong></p><p>Submit your photo in <strong>softcopy</strong> via:</p><ul><li><p><strong>Email</strong>: info@sinarbajaelectric.com</p></li><li><p><strong>Facebook Inbox</strong> (ACR page): with subject “Lomba Foto Indonesia Merdeka”</p></li></ul><p>Or send it in <strong>CD format</strong> (sealed envelope) with the subject:<br>“Lomba Foto Indonesia Merdeka” to:</p><p><strong>CV. Sinar Baja Electric</strong><br>Jl. Margomulyo No. 5, Tandes Surabaya 60185<br>Attn: Marketing Department (Mr. Eric Mulyadi)</p><p>Include your personal data:</p><ul><li><p>Full name</p></li><li><p>Address</p></li><li><p>Phone number</p></li><li><p>ID photo/copy (KTP)</p></li></ul><hr><h3>WINNER ANNOUNCEMENT:</h3><p><strong>September 17, 2014</strong><br>On ACR’s Facebook: <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/acr.speaker\">https://www.facebook.com/acr.speaker</a><br>And at <strong>Sinar Baja Electric showrooms</strong> in Surabaya and Jakarta.</p><p>Winners will also be contacted <strong>directly by phone</strong>.</p><p><strong>Judges’ decisions are final</strong> and the committee reserves the right to publish the winning works.</p><hr><h3>TOTAL PRIZES: Rp 3,000,000</h3><ul><li><p><strong>1st Prize</strong>: Rp 1,500,000</p></li><li><p><strong>2nd Prize</strong>: Rp 1,000,000</p></li><li><p><strong>3rd Prize</strong>: Rp 500,000</p></li></ul><p><strong>More info</strong>: +62 31 7480011 / 7494222 (Mr. Eric / Rizky)</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/LOMBA-FOTO-17-AGUSTUS-2-1746754499507.jpg\">', 'Photo Competition \"Indonesia Merdeka\"', 'indonesia-merdeka'),
('9814cd0c-402e-41e9-be60-cc5217e911b6', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'TAMPILAN PRODUK ACR RHYME DESIBEL YANG MEMUKAU PENGUNJUNG DI PSSS SEASON 4', 'tampilan-produk-acr-rhyme-desibel-yang-memukau-pengunjung-di-psss-season-4', '<p>Sinar Baja Electric kembali mengikuti event Parade Sound System Surabaya (PSSS) Season 4 untuk menampilkan produk-produk terbarunya. Event nguntir bareng dan ajang silahturahmi sound system ini diadakan pada 10-11 Mei di Wisata Balong Sumur Welut, Kecamatan Lakasantri Surabaya.</p><p><br>Di bagian lapak, ACR dan Desibel membawa produk-produk unggulannya, mulai dari best seller hingga yang terbaru, di antaranya: 18in PA-113188 SW Fab, 18in PA-127188 SW Fab, 15in 15710 DLX, 18in 18710 DLX, 15in 381006-Mk1 Desibel, 18in 451006-Mk1 Desibel, 15in ACR-15100 BLACK, dan 18in ACR-18100 BLACK. Tim juga membawa 12in PA-100122 W Fab yang paling banyak ditunggu oleh kalangan pecinta ACR, dan menjadi daya tarik para pengunjung.</p><p>Untuk bagian demo sound, Rhyme bekerja sama dengan Amir dari La Morena dan menampilkan 8 box RM 126 LA, serta 12 box custom paraflex (18in PA-113188 SW). Untuk dapur pacunya, pada tweeter dan mid nya didrive dengan amplifier R4500, midlownya menggunakan amplifier R7000, dan subwoofernya menggunakan amplifier R17000. Perpaduan dari RM 126 LA dan custom paraflex mengundang banyak pujian dari semua pengunjung yang datang.</p><p><br>“Ini produk lokal tapi sudah diakui oleh kalangan audio di seluruh Jawa Timur, bahkan di Indonesia. Produknya juga tidak kalah dengan produk-produk lain, dari Sinar Baja Electric.” ujar MC sebelum Rhyme melakukan demo sound. Banyak yang akhirnya datang ke booth untuk menanyakan lebih dalam mengenai tipe driver yang digunakan pada masing-masing sistem speaker.</p><p>Di acara ini, tim juga menemukan para pengunjung bahkan peserta lomba yang menggunakan driver ACR Speaker, mulai dari 8in ARRAY 2050 M Fab, 15in ACR-15600 BLACK hingga produk best seller yaitu 18in PA-127187 SW Fab. “Suaranya tebel, buat pemula enak.” ujar Empu Audio, salah satu peserta lomba yang tidak lama ini menggunakan produk ACR Speaker.</p><p><br>“Semoga semakin dekat dengan konsumen, soalnya memang produk lokal yang bisa dipercaya. Sudah dari dulu memakai (ACR Speaker), “ ujar HC Audio, salah satu peserta lomba yang sudah menggunakan produk ACR Speaker lebih dari 10 tahun. Tim juga tidak lupa memberikan merchandise gratis kepada para peserta dan pengunjung yang sudah loyal dengan produk-produk dari Sinar Baja Electric.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/dziB6o_JARE?si=vPvvmRuB7EoY2v3o\" start=\"0\"></iframe></div>', '2025-05-28 07:00:00.000', 'admin', '2025-07-11 16:18:40.465', '2025-07-15 01:08:47.289', '', '', '<p>Sinar Baja Electric once again participated in the Parade Sound System Surabaya (PSSS) Season 4 event to showcase its latest products. This “nguntir bareng” gathering and sound system networking event was held on May 10–11 at Wisata Balong Sumur Welut, Lakarsantri District, Surabaya.</p><p></p><p>At the booth, ACR and Desibel brought their flagship products, ranging from best-sellers to the newest items, including: 18in PA-113188 SW Fab, 18in PA-127188 SW Fab, 15in 15710 DLX, 18in 18710 DLX, 15in 381006-Mk1 Desibel, 18in 451006-Mk1 Desibel, 15in ACR-15100 BLACK, and 18in ACR-18100 BLACK. The team also brought the 12in PA-100122 W Fab, which was highly anticipated by ACR fans and attracted many visitors.</p><p>For the sound demo, Rhyme collaborated with Amir from La Morena and presented 8 RM 126 LA boxes and 12 custom paraflex boxes (18in PA-113188 SW). For amplification, the tweeter and mid were driven with the R4500 amplifier, the mid-low used the R7000 amplifier, and the subwoofer used the R17000 amplifier. The combination of RM 126 LA and custom paraflex received many compliments from the visitors.</p><p></p><p>“This is a local product, but it’s already recognized by the audio community throughout East Java, even in Indonesia. The products also compete well with others, from Sinar Baja Electric,” said the MC before Rhyme’s sound demo. Many people then came to the booth to ask more about the driver types used in each speaker system.</p><p>At this event, the team also found visitors and competition participants using ACR Speaker drivers, ranging from 8in ARRAY 2050 M Fab, 15in ACR-15600 BLACK, to the best-selling 18in PA-127187 SW Fab. “The sound is thick, great for beginners,” said Empu Audio, one of the participants who recently started using ACR Speaker products.</p><p></p><p>“Hopefully it gets closer to consumers, because this is a local product that can be trusted. I’ve been using (ACR Speakers) for a long time,” said HC Audio, one of the participants who has been using ACR Speaker products for more than 10 years. The team also handed out free merchandise to participants and visitors who have been loyal to products from Sinar Baja Electric.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/dziB6o_JARE?si=vPvvmRuB7EoY2v3o\" start=\"0\"></iframe></div>', 'STUNNING DISPLAY OF ACR RHYME DESIBEL PRODUCTS THAT AMAZED VISITORS AT PSSS SEASON 4', 'stunning-display-of-acr-rhyme-desibel-products-that-amazed-visitors-at-psss-season-4'),
('9b301710-76d0-4d96-b9b0-4b682aeeabac', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL Di Acara Paguyuban Sound System Pasuruan 2024', 'acr-rhyme-desibel-di-acara-paguyuban-sound-system-pasuruan-2024', '<p>ACR Rhyme Desibel kembali menghadiri acara di Paguyuban Sound System Pasuruan, Demo Sound &amp; Sharing Ke-9 pada tanggal 20-21 Juli 2024. Acara ini berlangsung di Lapangan Desa Randu Pitu Gempol - Pasuruan. Acara ini juga dihadiri oleh beberapa peserta yang mengikuti lomba dengan spesifikasi sound system yang memiliki speaker maksimal 12 pcs dengan tweeter tidak di hitung.</p><p></p><p><strong>Acara&nbsp;&amp;&nbsp;Bazar</strong></p><p>Lapak ACR juga membawakan berbagai macam tipe-tipe unggulan dari Fabulous hingga Deluxe, seperti: 18in 127187 SW Fab, 18in 113188 SW Fab double magnet, hingga 18in 18710 DLX ACR Series. Desibel juga membawakan produk unggulannya yaitu 18in 451006 Desibel. Untuk Rhyme membawa RM 81 LA, RM 151 FSB, serta box custom dhampoed (paraflex) yang menggunakan driver 18in 113188 SW Fab</p><p></p><p>Pada live demo, ACR Rhyme membawa 6 box RM 126 LA yang berisikan 3-way line array serta pada subwoofernya membawa 8 box RM 1283 SB. Pada RM 126 LA menggunakan amplifier R4500 dan R7000, dan pada RM 1283 SB menggunakan amplifier tipe terbaru yaitu D17000 dengan kelas D berisi 2 channel.</p><p></p><p>Salah satu pemenang lomba pada acara kali ini adalah pecinta ACR, Nanda Audio. Untuk middlenya menggunakan tipe 12in PA 75125 M Fab ACR Series, dan untuk subwoofernya menggunakan tipe 18in PA-127187 SW Fab ACR Series. \"Selama menggunakan produk ACR sejak tahun 2019 tidak pernah ada kendala sedikit pun.\", ucap salah satu anggotanya, Pak Umar. \"Pesan dan kesan saya terkait produk ACR, sebagai bangsa Indonesia, cintailah produk dalam negeri seperti kita mencintai diri sendiri.\" tambahnya.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03362-1-1320x880-1746780213857.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03304-1320x880-1746780223351.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03291-1024x1536-1746780229156.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/7IDFDc3JOEE?si=2KUI-vFZZCny3KXk\" start=\"0\"></iframe></div>', '2024-07-28 17:00:00.000', 'admin', '2025-05-09 08:44:19.075', '2025-07-03 02:08:00.410', '', '', '<p>ACR, Rhyme, and Desibel once again participated in the Paguyuban Sound System Pasuruan event, <em>Demo Sound &amp; Sharing Vol. 9</em>, held on July 20–21, 2024 at Lapangan Desa Randu Pitu Gempol – Pasuruan. The event also featured a sound system competition where each participant was limited to a maximum of 12 speakers (excluding tweeters).</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>At the event, the ACR booth showcased a wide range of top models from the Fabulous and Deluxe series, such as:</p><ul><li><p>18in 127187 SW Fab</p></li><li><p>18in 113188 SW Fab (double magnet)</p></li><li><p>18in 18710 DLX ACR Series</p></li></ul><p>Desibel brought its flagship 18in 451006 Desibel, while Rhyme displayed:</p><ul><li><p>RM 81 LA</p></li><li><p>RM 151 FSB</p></li><li><p>A custom “dhampoed” (paraflex) box using the 18in 113188 SW Fab driver</p></li></ul><p></p><p>For the live demo, ACR Rhyme presented:</p><ul><li><p>6 RM 126 LA boxes featuring a 3-way line array system</p></li><li><p>8 RM 1283 SB subwoofer boxes</p></li></ul><p>The RM 126 LA units were powered by R4500 and R7000 amplifiers, while the RM 1283 SB subwoofers used the latest D17000 amplifier, a 2-channel Class D model.</p><p></p><p>One of the winners of the competition was Nanda Audio, a loyal ACR user. For midrange, they used the 12in PA-75125 M Fab ACR Series, and for subwoofers, the 18in PA-127187 SW Fab ACR Series.</p><blockquote><p><em>“Since using ACR products in 2019, we’ve never had a single issue,”</em> said Mr. Umar, one of the team members.<br><em>“My message regarding ACR products: as Indonesians, let’s love local products the way we love ourselves.”</em> he added.</p></blockquote><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03362-1-1320x880-1746780213857.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03304-1320x880-1746780223351.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT03291-1024x1536-1746780229156.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/7IDFDc3JOEE?si=2KUI-vFZZCny3KXk\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL at the Pasuruan Sound System Community Event 2024', 'acr-rhyme-desibel-at-the-pasuruan-sound-system-community-event-2024'),
('a1bd6002-8dd7-4be8-9aa1-275ab3ba0f31', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'PERTAMA DI INDONESIA! Speaker Dengan Heatsink Diluar Terbaru dari ACR!', 'pertama-di-indonesia-speaker-dengan-heatsink-diluar-terbaru-dari-acr', '<p>Di awal tahun 2024 ini, CV. Sinar Baja Electric telah melakukan inovasi terbaru khususnya pada type speaker 15in 100152 Mk1 dan 18in 100182 Mk2 Fabulous. Kedua type tersebut mengalami perubahan dari sisi penampilan yaitu penambahan “Pendingin Speaker” atau yang disebut dengan “Heatsink” yang di letakkan di sisi luar motor speaker. Kedua speaker tersebut selain mengalami perubahan tampilan&nbsp; secara spesifikasi juga dikembangkan menjadi lebih baik. Type speaker tersebut menjadi 15in 100152 Mk2 FAB ACR dan 18in 100182 Mk3 FAB ACR</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture-1746775006843.jpg\"><p>*Tampilan heatsink dari 100152 Mk2 dan 100182 Mk3 ACR</p><p></p><p>Filosofi penggunaan “Heatsink” luar berawal dari ingin mempercantik&nbsp; tampilan dan mempertegas identitas speaker dari type ACR-Fabulous. Namun pada kenyataannya, setelah melalui proses development hingga pengujian speaker, ternyata manfaat dari “Heatsink” ini juga bisa mempercepat proses pendingingan pada area Motor Speaker baik saat speaker sedang bekerja maupun saat sudah tidak bekerja. Perubahaan suhu ini cukup signifikan jika dibandingkan speaker tanpa menggunakan “Heatsink”</p><p></p><p>Fitur dan spesifikasi lengkapnya bisa dilihat pada youtube berikut:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/0c_nnUWKIKY?si=uP3aOE0LRCDbl-Pu\" start=\"0\"></iframe></div>', '2024-02-25 17:00:00.000', 'admin', '2025-05-09 07:17:30.059', '2025-07-03 02:12:17.781', '', '', '<p>At the beginning of 2024, CV. Sinar Baja Electric introduced a new innovation specifically for the 15in 100152 Mk1 and 18in 100182 Mk2 Fabulous speaker types. Both models underwent a visual upgrade with the addition of a “Speaker Cooler” or “Heatsink,” which is placed on the outer side of the speaker motor. In addition to the visual enhancement, the specifications of both speakers were also improved. These updated models are now known as the 15in 100152 Mk2 FAB ACR and 18in 100182 Mk3 FAB ACR.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Capture-1746775006843.jpg\"><p><em>Heatsink appearance of the 100152 Mk2 and 100182 Mk3 ACR</em></p><p></p><p>The philosophy behind the use of an external “Heatsink” began with the intention of enhancing the speaker’s appearance and reinforcing the identity of the ACR-Fabulous series. However, during the development and testing phases, it was found that the “Heatsink” also provides a practical benefit — it helps accelerate the cooling process of the speaker motor area, both during operation and after use. The temperature difference is quite significant when compared to speakers that do not use a “Heatsink.”</p><p></p><p>Full features and specifications can be viewed on the following YouTube link:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/0c_nnUWKIKY?si=uP3aOE0LRCDbl-Pu\" start=\"0\"></iframe></div>', 'FIRST IN INDONESIA! The Latest Speaker with External Heatsink from ACR!', 'first-in-indonesia-the-latest-speaker-with-external-heatsink-from-acr'),
('a3c49ff1-199d-40e6-bbb6-166e4e1c1a54', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2014', 'smex-2014', '<p><strong>RHYME &amp; ACR akan hadir dalam pameran audio :</strong></p><h3><strong>SMEX \"Surabaya Music Expo\"</strong></h3><ul><li><p><em>Tanggal : 24 - 27 April&nbsp;2014</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li></ul><p>Disini anda bisa melihat dan menyentuh bahkan mendengarkan semua type RHYME dan ACR FABULOUS series yang didisplay di booth kami yang berada didalam Exihibition Hall, Dan Dengarkan demo Line Array kami di halaman depan Exhibition Hall.</p><p>Kami juga mengeluarkan type baru yakni :</p><ul><li><p><strong>RM 102 LA,</strong>&nbsp;Dual 10″ 2way, Line Array Elements</p></li><li><p><strong>RM 2252 M,&nbsp;</strong>Dual 15″ 2Way, Full Range</p></li><li><p><strong>RM 1282 SB,</strong>&nbsp;Dual 18″ Subwoofer</p></li></ul><p>Datang lah di Booth kami dan dapatkan promo-promo menarik !</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-1746753859815.jpg\">', '2014-03-09 17:00:00.000', 'admin', '2025-05-09 01:27:21.251', '2025-07-03 03:29:12.382', '', '', '<p><strong>RHYME &amp; ACR will be present at the audio exhibition:</strong></p><h3><strong>SMEX \"Surabaya Music Expo\"</strong></h3><p></p><ul><li><p>Date: April 24 – 27, 2014</p></li><li><p>Location: Exhibition Hall Grand City, Surabaya</p></li></ul><p>Here, you can see, touch, and even listen to all RHYME and ACR FABULOUS series types displayed at our booth inside the Exhibition Hall. Also, listen to our Line Array demo at the front yard of the Exhibition Hall.</p><p>We are also launching new models:</p><ul><li><p><strong>RM 102 LA</strong>, Dual 10″ 2-way, Line Array Elements</p></li><li><p><strong>RM 2252 M</strong>, Dual 15″ 2-way, Full Range</p></li><li><p><strong>RM 1282 SB</strong>, Dual 18″ Subwoofer</p></li></ul><p>Come to our booth and get exciting promotions!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-1746753859815.jpg\">', 'SMEX 2014', 'smex-2014');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('a70d005e-85b0-45ed-9263-48762e90180d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL DI PRO AVL 2025', 'acr-rhyme-desibel-di-pro-avl-2025', '<p>Pada tahun 2025 ini, Sinar Baja Electric kembali menghadiri PRO AVL 2025 yang diselenggarakan di JIEXPO, Kemayoran Jakarta. Event yang diselenggrakan pada tgl 9-11 Oktober 2025 ini banyak dihadiri oleh brand-brand ternama dari berbagai negara. Sebagai salah satu pabrik speaker terbesar di Asia Tenggara, SInar Baja Electric menjadi salah satu brand speaker Indonesia yang hadir di acara tersebut.</p><p></p><p><strong>Peluncuran Produk Terbaru ACR dan Rhyme</strong></p><p>Di bagian booth indoor, tim Sinar Baja Electric juga tidak menyiakan kesempatan selama acara Pro AVL untuk meluncurkan produk terbarunya. ACR menampilkan speaker driver dengan magnet neodymium mulai dari 8in 60086 W-N Fab, 10in 75106 W-N Fab, 12in 75126 W-N Fab, 15in 75156 W-N Fab. Tidak hanya itu saja, ACR juga menampilkan compression driver dengan 2 versi magnet ferrite dan neodymium serta 2  varian impedance, yaitu 8 ohm dan 16 ohm. Compression driver yang dibawa memiliki ukuran voice coil 65mm: CHR 6535B-8N0 Fab, dan CHR 6535B-16N0; serta 75mm: CHR CD 7535B-8F0 Fab. Setiap versi yang diluncurkan ini dapat dicocokkan untuk kebutuhan setiap pengguna. </p><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 1.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 2-1.JPG\"><p>Rhyme sendiri juga meluncurkan line up terbarunya, yaitu Xavier Series, yang memiliki arti kemegahan dengan perpaduan warna hitam dan emas yang elegan serta memiliki tampian futuristik. Xavier Series menghadirkan 2 tipe, yaitu XV 11510 SB Single: 15in Subwoofer, serta XV 1820 FR Single: 8in 2-way Fullrange. Untuk driver yang digunakan juga dari Fabulous serian dari ACR Speaker yang kualitas suaranya sudah tidak diragukan lagi. Bahan untuk membuat sound systemnya menggunakan material birchply wood dari Rusia, yang menjadi andalan speaker Rhyme karena kokoh dan tahan cuaca</p><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/MKT00056-1.JPG\"><p>Selain Xavier Series, Rhyme juga membawakan tipe subwoofer terbaru dari Sphere Series yaitu SP 11510 SB Single 15in Subwoofer, SP 11810 SB Single 18in Subwoofer, SP 21810 SB Double 18in Subwoofer. Berbeda dengan Xavier Series, Sphere Series sendiri memiliki perpaduan warna hitam dan ungu dan memiliki desain yang lebih terkesan minimalis</p><p></p><p><strong>Satu-satunya Line Array dan Subwoofer di Pro AVL</strong></p><p>Di tahun ini, Rhyme juga menjadi satu-satunya brand yang memasang line array dan subwoofer untuk melakukan check sound di halaman Pro AVL. Dengan membawa RM 126 LA dan RM 1284 SB, Rhyme tetap tampil memukau dan menarik banyak peminat dengan suaranya yang jernih. “Suaranya bener-bener jernih dan kencang sampai dada. Tidak membuat telinga sakit.”, ujar salah satu pengunjung setelah mendengarkan checksound dari Rhyme Pro Audio</p><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 3.jpg\"><p></p><p></p><p>Booth ACR RHYME DESIBEL tidak hanya dimeriahkan oleh para pengunjung yang datang ke booth, tetapi juga kepada para peserta dari sosial media yang ikut serta dalam Live Instagram ACR dan Speed Quiz Game Xavier Series di Instagram Rhyme. Event di sosial media ini berlangsung 3 hari selama acara di Pro AVL 2025, dan para pemenang di tiap event akan mendapatkan merchandise gratis dari Sinar Baja Electric.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/QKwL4rJuIHg?rel=1\" start=\"0\"></iframe></div><p></p><p></p><p></p>', '2025-10-13 17:00:00.000', 'mkt', '2025-10-20 07:03:59.474', '2025-10-20 07:03:59.474', '', '', '<pre><code>In 2025, Sinar Baja Electric again attended PRO AVL 2025, held at JIEXPO, Kemayoran, Jakarta. The event, held from October 9-11, 2025, was attended by many well-known brands from various countries. As one of the largest speaker manufacturers in Southeast Asia, Sinar Baja Electric was one of the Indonesian speaker brands present at the event.\n\nLaunch of New ACR and Rhyme Products\n\nIn the indoor booth, the Sinar Baja Electric team also took advantage of the opportunity during Pro AVL to launch its newest products. ACR showcased neodymium magnet speaker drivers ranging from the 8-inch 60086 W-N Fab, 10-inch 75106 W-N Fab, 12-inch 75126 W-N Fab, and 15-inch 75156 W-N Fab. Not only that, ACR also displays a compression driver with 2 versions of ferrite and neodymium magnets and 2 impedance variants, namely 8 ohms and 16 ohms. The compression driver carried has a voice coil size of 65mm: CHR 6535B-8N0 Fab, and CHR 6535B-16N0; and 75mm: CHR CD 7535B-8F0 Fab. Each version launched can be matched to the needs of each user.</code></pre><p></p><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 1-1.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 2-2.JPG\"><pre><code>Rhyme itself also launched its newest line up, namely the Xavier Series, which has the meaning of splendor with a combination of elegant black and gold and has a futuristic appearance. The Xavier Series presents 2 types, namely the XV 11510 SB Single: 15in Subwoofer, and the XV 1820 FR Single: 8in 2-way Fullrange. For the drivers used are also from the Fabulous series from ACR Speaker whose sound quality is undoubted. The material for making the sound system uses birchply wood from Russia, which is the mainstay of Rhyme speakers because it is sturdy and weather resistant</code></pre><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/MKT00056-2.JPG\"><pre><code>In addition to the Xavier Series, Rhyme also introduced the latest subwoofers from the Sphere Series: the SP 11510 SB Single 15-inch Subwoofer, the SP 11810 SB Single 18-inch Subwoofer, and the SP 21810 SB Double 18-inch Subwoofer. Unlike the Xavier Series, the Sphere Series features a black and purple color combination and a more minimalist design.\n\nThe Only Line Array and Subwoofer at Pro AVL\n\nThis year, Rhyme was also the only brand to install a line array and subwoofer for a sound check on the Pro AVL grounds. Bringing the RM 126 LA and RM 1284 SB, Rhyme continued to impress and attract many enthusiasts with its clear sound. \"The sound is really clear and loud, reaching right through to the chest. It doesn\'t hurt your ears,\" said one visitor after listening to the Rhyme Pro Audio sound check.</code></pre><img class=\"max-w-full rounded-md my-4\" src=\"https://acrspeaker.com/uploads/newsimages/PRO AVL - 3-1.jpg\"><pre><code>The ACR RHYME DESIBEL booth was not only enlivened by visitors who came to the booth, but also by participants from social media who took part in the ACR Live Instagram and Speed ​​Quiz Game Xavier Series on Instagram Rhyme. This social media event lasted 3 days during the Pro AVL 2025 event, and winners at each event will receive free merchandise from Sinar Baja Electric.</code></pre>', 'ACR RHYME DESIBEL AT PRO AVL 2025', 'acr-rhyme-desibel-at-pro-avl-2025'),
('a8598318-3ccf-4577-ae86-23f82cb4ccfc', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - PAGUYUBAN SOUND SYSTEM PASURUAN (PSSP)  KE VII', 'review-paguyuban-sound-system-pasuruan-pssp-ke-vii', '<p>Event yang diadakan oleh komunitas Sound System di Kab. Pasuruan merupaka kegiatan rutin tahunan dengan agenda untuk peningkatan dan mengembangkan bakat dari pada <em>soundman </em>serta terdapat sharing-sahring oleh pihak Panitia PSSP. Tahun ini adalah tahun ke-7 yang dilaksanakan pada tanggal 28 – 29 September 2019 di Lapangan Ds. Bulusari, Kec. Kejapanan Gempol, Kab. Pasuruan.</p><p></p><p>Event berlangsung sukses dan lancar, hanya saja terdapat kekurangan publikasi dan kesiapan dari pantia sehingga bila dibanding dengan event tahun sebelumnya dirasa lebih ramai dan lebih meriah. Tetapi secara keseluruhan berjalan sesuai jadwal ditambah pengunjung yang datang baik dari luar Kab. Pasuruan maupun warga sekitar.</p><p></p><p>Kami sebagai salah satu sponsorship ikut memeriahkan event tersebut dengan membuka stand (ACR Speaker) serta Demo Line Array dari produk RHYME Pro-Audio dengan konfigurasi 6x RM 103 LA (10in double 2-way) dan 4x RM 1283 SB (18in double Subwoofer).</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pasuruan-1-1024x498-1746762090443.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pasuruan-8-1-1024x498-1746762105988.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104047-1746762113097.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104102-1746762119180.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-Pasuruan-1024x501-1746762132095.jpeg\">', '2019-10-01 17:00:00.000', 'admin', '2025-05-09 03:42:14.142', '2025-07-03 03:19:26.819', '', '', '<p>The event held by the Sound System community in Pasuruan Regency is an annual routine activity aimed at improving and developing the talents of soundmen, as well as providing sharing sessions organized by the PSSP committee. This year marked the 7th edition of the event, held on September 28–29, 2019, at the Field of Bulusari Village, Kejapanan Gempol District, Pasuruan Regency.</p><p></p><p>The event ran successfully and smoothly, although there was a lack of publicity and preparedness from the committee, which made it feel less crowded and festive compared to the previous year’s event. However, overall, it went according to schedule, and many visitors attended, both from outside Pasuruan Regency and the surrounding community.</p><p></p><p>As one of the sponsors, we took part in enlivening the event by setting up a booth (ACR Speaker) and showcasing a Line Array demo from RHYME Pro-Audio products with a configuration of 6x RM 103 LA (10-inch double 2-way) and 4x RM 1283 SB (18-inch double Subwoofer).</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pasuruan-1-1024x498-1746762090443.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pasuruan-8-1-1024x498-1746762105988.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104047-1746762113097.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 104102-1746762119180.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-Pasuruan-1024x501-1746762132095.jpeg\">', 'Review – PAGUYUBAN SOUND SYSTEM PASURUAN (PSSP) Event VII', 'review-paguyuban-sound-system-pasuruan-pssp-event-vii'),
('a94159ee-246b-4835-9b59-12ae27d3099f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Speaker Double Magnet: 18in 113188 SW Fabulous', 'speaker-double-magnet-18in-113188-sw-fabulous', '<p>Tingginya minat beli speaker dari pecinta speaker seluruh Indonesia memberikan pandangan bagi Sinar Baja Electric untuk meluncurkan produk baru. Speaker tersebut adalah speaker Fabulous Series yang memiliki double magnet dan double demper, yaitu tipe 18in PA-113188 SW Fab. Speaker ini mempunyai kharateristik suara yang lantang.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18710_manual-removebg-preview-1746771184421.png\"><p>Double magnet memberikan jangkuan suara yang lebih luas dan suara yang lebih lantang. Dengan nominal power handling 1900 Watt dan program power 3800 Watt memberikan&nbsp; suara yang low tapi powerfull. Subwoofer yang memberikan karakter bass yang tinggi, membuat speaker ini cocok digunakan pada acara ruangan terbuka seperti hajatan, karnaval dan lain-lain.</p><p></p><p>Desain speaker didukung dari bahan berkualitas tinggi dengan chassis mewah berbahan <em>aluminium die cast</em> yang kokoh, serta warna hitam yang memberikan tampilan elegan.</p><p></p><p>Dalam rangka HuT RI 78th, Sinar Baja Electric memberikan full review speaker ini di Youtube resmi milik ACR Rhyme. Berikut videonya:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/VGB4jd9FNY0?si=0q7tx9gdKvG7qR1C\" start=\"0\"></iframe></div>', '2023-06-28 17:00:00.000', 'admin', '2025-05-09 06:13:40.602', '2025-07-03 02:17:12.354', '', '', '<p>The high demand for speakers from audio enthusiasts across Indonesia inspired Sinar Baja Electric to launch a new product. This speaker is from the Fabulous Series, featuring a double magnet and double damper, specifically the 18in PA-113188 SW Fab model. This speaker is characterized by its loud and powerful sound.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18710_manual-removebg-preview-1746771184421.png\"><p>The double magnet provides a wider sound range and louder volume. With a nominal power handling of 1900 Watts and a program power of 3800 Watts, it delivers a deep yet powerful sound. This subwoofer produces strong bass characteristics, making it suitable for outdoor events such as weddings, carnivals, and others.</p><p></p><p>The speaker design is supported by high-quality materials, featuring a sturdy aluminum die-cast chassis with a luxurious finish and an elegant black color.</p><p></p><p>In celebration of Indonesia’s 78th Independence Day, Sinar Baja Electric has provided a full review of this speaker on the official ACR Rhyme YouTube channel. Here is the video:</p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/VGB4jd9FNY0?si=0q7tx9gdKvG7qR1C\" start=\"0\"></iframe></div>', 'Double Magnet Speaker: 18in 113188 SW Fabulous', 'double-magnet-speaker-18in-113188-sw-fabulous'),
('abbaa6fc-2de5-4ce5-b901-37abac66bd39', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System – Tuban 17 – 18  JUNI 2023', 'review-pameran-sound-system-tuban-17-18-juni-2023', '<p>Pada tahun 2023 ini PSST Tuban mengadakan acara parade sound system yang digelar rutin tahunan, dan digelar di Lapangan Alas Dowo, Tuban. Kegiatan ini dilakukan pada tanggal 16 – 18 Juni 2023. Pameran parade sound ini juga dimeriahkan oleh sponsor lain yaitu SPL audio. Selain parade sound dan demo, terdapat juga lomba – lomba yang dilakukan, yaitu mulai dari kelas miniature hingga ‘gedeatur’. Dan yang dilombakan menjadi beberapa kelas dan kategori yaitu dari pengukuran SPL hingga live mixing (clarity). Materi lagu yang dilombakan sudah disiapkan oleh panitia kurang lebih sekitar 4-5 menit. Peserta yang ikut lomba mencapai 40 rental.</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Para pengunjung yang hadir juga banyak pada hari minggunya baik ke lapak ACR maupun lapak lainya yang melihat barang – barang yang dipajang diarea lapak, juga terdapat barang baru seperti Fabulous 18inch double Magnet 113188 serta pengenalan produk brand baru Desibel. Pengunjung juga banyak yang mengagumi produk ACR baik speaker dan Rhyme dimana suara yang dihasilkan dan kualitas yang diberikan sangat bagus dan enak di dengar.</p><p></p><p>Pada Event PSST Tuban ini ACR-RHYME tampil sedikit berbeda , karena tidak membawa produk sendiri khususnya pada subwoofernya. Karena menggandeng rental ternama asal Jombang yaitu La- Morena. Kami membawa box custom dari produk fabulous terbaru yaitu 113188 (double magnet), Rental tersebut membawa speaker subwoofer total 12box yang berisikan 18inch 113188 dan juga 18inch 127187. Lalu pada line array membawa Rhyme tipe RM 126 LA sebanyak 10box. Untuk amplifier yang dibawa yaitu Amplifier Rhyme R4500 dan juga R7000.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08905-3-e1688096973486-683x1024-1746771339688.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08933-1024x683-1746771346843.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08890-1024x683-1746771352401.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08919-2-1024x683-1746771358703.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08917-2-1024x683-1746771367501.jpg\">', '2023-06-29 17:00:00.000', 'admin', '2025-05-09 06:16:11.168', '2025-07-03 02:16:38.268', '', '', '<p>In 2023, PSST Tuban held its annual sound system parade at Lapangan Alas Dowo, Tuban, from June 16 to 18. The event was also enlivened by other sponsors, such as SPL Audio. Besides the sound parade and demos, there were various competitions ranging from the miniature class to ‘gedeatur’. The competitions included several classes and categories, such as SPL measurement and live mixing (clarity). The competition song material, prepared by the committee, lasted about 4–5 minutes. A total of 40 rental teams participated in the competitions.</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>Many visitors came on Sunday to visit both the ACR booth and other booths to see the products on display, including new items like the Fabulous 18-inch double magnet 113188 and the introduction of the new Desibel brand. Many visitors admired ACR and Rhyme products, appreciating the sound quality and the pleasant audio experience they provided.</p><p></p><p>At the PSST Tuban event, ACR-RHYME appeared a bit differently by not bringing their own subwoofer products. Instead, they collaborated with a well-known rental company from Jombang, La Morena. We brought custom boxes using the latest Fabulous product 113188 (double magnet). The rental company brought a total of 12 subwoofer boxes containing 18-inch 113188 and 18-inch 127187 drivers. For line arrays, they brought 10 boxes of the Rhyme RM 126 LA type. The amplifiers used were the Rhyme R4500 and R7000 models.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08905-3-e1688096973486-683x1024-1746771339688.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08933-1024x683-1746771346843.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08890-1024x683-1746771352401.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08919-2-1024x683-1746771358703.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08917-2-1024x683-1746771367501.jpg\">', 'Review – Sound System Exhibition – Tuban, June 17–18, 2023', 'review-sound-system-exhibition-tuban-june-17-18-2023'),
('aff2a97e-27ca-44ad-a534-d768de1365ea', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - DEMAK EXPO AUDIO IV', 'review-demak-expo-audio-iv', '<p>Paguyuban Sound System Demak &amp; sekitarnya (PSDS) adalah acara tahunan yang telah dilakukan oleh komunitas daerah Kab. Demak untuk meningkatkan tali silahturahmi dan mempererat antar sound system di sekitar Kab. Demak, Jawa Tengah. Acara ini merupakan acara ke-4 kalinya yang diselenggarakan pada tanggal 6 -7 September 2019 di Lapangan Desa Ngiri, Kec. Karangawen, Kab. Demak.</p><p></p><p>Acara berlangsung sukses dan lancar dengan antusiasme oleh masyarakat setempat. Sponsor dan peserta lomba juga ikut meramaikan acara tersebut ditambah panggung hiburan pada akhir acara. Kami sebagai salah satu sponsor mendemokan speaker line array dari RHYME Pro-AUDIO, yaitu RM 103 LA (dual 10in 2-way) dan Subwoofernya RM 1283 SB (18in double) dengan konfigurasi 6x4 box.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-2-e1568107675525-1746761298738.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-1-e1568107660275-1746761304853.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Demak-3-e1568107690737-1746761308748.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-8-e1568107576488-1746761313848.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-5-e1568107727760-1746761318631.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-4-e1568107706847-1746761322898.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-12-e1568107642543-1746761328204.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-11-e1568107620337-1746761332446.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-10-e1568107603646-1746761335971.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-7-e1568107551190-1746761341815.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-6-e1568107460811-1746761346479.jpg\">', '2019-09-09 17:00:00.000', 'admin', '2025-05-09 03:29:14.488', '2025-07-03 03:20:45.868', '', '', '<p>The Sound System Association of Demak &amp; surrounding areas (PSDS) is an annual event held by the local community in Demak Regency to strengthen ties and foster connections among sound system enthusiasts around Demak, Central Java. This was the 4th event, held on September 6–7, 2019, at Ngiri Village Field, Karangawen District, Demak Regency.</p><p></p><p>The event ran successfully and smoothly with enthusiastic participation from the local community. Sponsors and competition participants also contributed to the vibrancy of the event, along with an entertainment stage at the end. We, as one of the sponsors, showcased the line array speaker from RHYME Pro-AUDIO, namely RM 103 LA (dual 10in 2-way) and the RM 1283 SB (18in double) subwoofer, with a 6x4 box configuration.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-2-e1568107675525-1746761298738.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-1-e1568107660275-1746761304853.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Demak-3-e1568107690737-1746761308748.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-8-e1568107576488-1746761313848.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-5-e1568107727760-1746761318631.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-4-e1568107706847-1746761322898.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-12-e1568107642543-1746761328204.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-11-e1568107620337-1746761332446.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-10-e1568107603646-1746761335971.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-7-e1568107551190-1746761341815.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/demak-6-e1568107460811-1746761346479.jpg\">', 'Review - DEMAK EXPO AUDIO IV', 'review-demak-expo-audio-iv'),
('b2914258-a89a-4290-aaa7-d1f698fc071b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System Syawalan – Jogja 27 - 28  MEI 2023', 'review-pameran-sound-system-syawalan-jogja-27-28-mei-2023', '<p>Pada tahun 2023 ini Komunitas Rental Sound System D.I. Yogyakarta menjalankan Pameran Sound System dengan mengusung tema Syawalan. Tepatnya pada tanggal 27 – 28 Mei 2023. Pameran ini sempat vakum 3 tahun lamanya semenjak pandemic covid 19. Namun di tahun 2023 ini dengan persiapan yang matang akhirnya dapat digelar. Acara parade sound system ini dilakukan dilapangan Stadion Sultan Agung , Bantul. &nbsp;</p><p></p><p>Pameran atau acara ini juga dimeriahkan dengan sponsor-sponsor serta rental-rental yang berada di sekitaran Jogja hingga Jawa timur,Jawa Barat,sekitar Jawa Tengah. Jumlah sponsor / peserta yang ikut&nbsp; sekitar total 30 Lapak sponsor dan juga 22 Sponsor demo produk.</p><p></p><p>Untuk peserta juga ada diadakan lomba nilai SPL tertinggi dengan lagu wajib yang sudah disediakan oleh pihak panitia. Para sponsor juga mendapatkan kesempatan untuk mendemokan speaker terbaiknya. Sehingga tidak kalah dengan para peserta rental.</p><p></p><p>Para pengunjung yang hadir sangat antusias untuk datang ke lapak serta menghadiri demo sound produk dari tiap – tiap sponsor yang hadir. Dalam stand ACR, terdapat promo – promo menarik seperti bonus merchandise di setiap pembelian (kaos,topi,stiker,dll) serta penjualan barang lelang. Juga sekaligus launching dan perkenalan produk terbaru dari ACR series yaitu Fabulous 113188 (double magnet).</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p>Para pengunjung yang hadir sangat antusias untuk datang ke lapak serta menghadiri demo sound produk dari tiap – tiap sponsor yang hadir. Dalam stand ACR, terdapat promo – promo menarik seperti bonus merchandise di setiap pembelian (kaos,topi,stiker,dll) serta penjualan barang lelang. Juga sekaligus launching dan perkenalan produk terbaru dari ACR series yaitu Fabulous 113188 (double magnet).</p><p></p><p>Pada kesempatan kali ini, ACR-RHYME tampil sedikit berbeda, Membawa line array Rhyme RM 81 LA sebanyak 6 box, Rhyme flying sub RM 151 FSB sebanyak 2 box. Lalu untuk subwoofer memakai custom box RM 128 LH dengan isian Fabulous 113186 sebanyak 4 box (double 18in).</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08800-1024x684-1746770711198.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08803-1024x684-1746770717462.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08804-1024x684-1746770724536.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08799-684x1024-1746770730423.jpg\">', '2023-06-04 17:00:00.000', 'admin', '2025-05-09 06:05:34.672', '2025-07-03 02:18:57.671', '', '', '<p>In 2023, the Rental Sound System Community of D.I. Yogyakarta held a Sound System Exhibition with the theme \"Syawalan.\" The event took place on May 27–28, 2023. This exhibition had been on hiatus for 3 years due to the COVID-19 pandemic but was finally held again in 2023 after thorough preparations. The sound system parade was held at the Sultan Agung Stadium field in Bantul.</p><p></p><p>The exhibition was enlivened by sponsors and rental companies from around Yogyakarta, East Java, West Java, and Central Java. There were around 30 sponsor booths and 22 product demo sponsors participating.</p><p></p><p>A competition for the highest SPL score was also held using a mandatory song provided by the organizers. Sponsors had the opportunity to demo their best speakers, competing closely with the rental participants.</p><p></p><p>Visitors were very enthusiastic about visiting the booths and attending product sound demos from each sponsor present. At the ACR booth, there were attractive promotions such as bonus merchandise with every purchase (t-shirts, hats, stickers, etc.) as well as auction sales. The event also featured the launch and introduction of the latest product from the ACR series: the Fabulous 113188 (double magnet).</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p>Visitors were very enthusiastic about coming to the booths and attending sound demos from each sponsor. At the ACR booth, attractive promotions were offered, including bonus merchandise with every purchase (t-shirts, hats, stickers, etc.) as well as auction sales. The event also featured the launch and introduction of the latest product from the ACR series: the Fabulous 113188 (double magnet).</p><p></p><p>On this occasion, ACR-RHYME appeared a bit differently by bringing 6 boxes of the Rhyme RM 81 LA line array, 2 boxes of the Rhyme flying sub RM 151 FSB, and for subwoofers, custom boxes RM 128 LH filled with 4 boxes of Fabulous 113186 (double 18in).</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08800-1024x684-1746770711198.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08803-1024x684-1746770717462.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08804-1024x684-1746770724536.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08799-684x1024-1746770730423.jpg\">', 'Review – Syawalan Sound System Exhibition – Jogja, May 27–28, 2023', 'review-syawalan-sound-system-exhibition-jogja-may-27-28-2023'),
('b9a937cb-5a9b-492d-96ca-315fbffe44b9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System STB (Sound Tugu Bersaudara #2) - PSJT Trenggalek', 'review-pameran-sound-system-stb-sound-tugu-bersaudara-2-psjt-trenggalek', '<p>Pameran Sound System yang diselenggarakan oleh komunitas sound system di daerah Kabupaten Trenggalek dan sekitarnya ini diselenggarakan pada tanggal 4 – 5 Juni 2022. Acara ini merupakan acara jilid ke-2 yang diadakan oleh PSST, yang dilakukan di Lapangan Nglongsor , Tugu - Trenggalek. Pameran sound ini juga bertujuan menjalin tali silahturahmi antar sesama pecinta sound system dan sekaligus untuk berlomba tentang sound system.</p><p></p><p>Acara ini didukung oleh beberapa sponsor sound system ternama dan hanya dibatasi 4 sponsorship. &nbsp;Selain acara demo produk dari sponsor, juga terdapat acara lomba – lomba sound system yang menarik dan diikuti oleh sekitar total 46 peserta sound (rental dan komunitas). Dan dilanjutkan keesokan harinya diikuti 28 peserta umum (kabupaten Trenggalek dan sekitar). &nbsp;Juga terdapat lomba “uji nyali” dengan memperhitungkan adu SPL.</p><p></p><p>Juga terdapat peserta asal Kauman – Trenggalek yaitu rental PSJK yang menggunakan speaker Fabulous mulai dari subwoofer 18in 127187, Middle 12in 75125, serta tweeter CD440Pk1.</p><p></p><p>Dalam event ini juga memperkenalkan tipe terbaru dari ACR Series yaitu Excellent terbaru dengan Voice Coil 5inch tipe 188127. <br>Produk yang dipakai untuk Demo Rhyme yaitu Line Array RM 103 LA total 6 box dan juga membawa subwoofer RM 1283 SB sebanyak 6 box.<br>Selain itu, ada juga Rhyme Mini dengan single 8in (RM 81 LA) ditambah subwoofer flying 15in single (RM 151 FSB), dan untuk Subwoofernya 18in double RM 128 MKIII yang dipajang di lapak jualan ACR.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/WhatsApp-Image-2022-06-08-at-8.21.27-AM-1024x768-1746764375121.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111639-1746764380428.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot-2022-06-14-092235-1024x574-1746764385083.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111655-min-1746764416968.png\">', '2022-06-13 17:00:00.000', 'admin', '2025-05-09 04:20:23.276', '2025-07-03 03:15:02.397', '', '', '<p>The Sound System Exhibition organized by the sound system community in the Trenggalek Regency area and its surroundings was held on June 4–5, 2022. This was the second event organized by PSST, held at Nglongsor Field, Tugu - Trenggalek. The purpose of this sound exhibition was to foster relationships among fellow sound system enthusiasts and to compete in sound system-related contests.</p><p></p><p>The event was supported by several well-known sound system sponsors, limited to only 4 sponsorships. In addition to product demos from sponsors, there were also various exciting sound system competitions with a total of around 46 participants (rental and community-based). The following day, the event continued with 28 general participants from Trenggalek Regency and surrounding areas. There was also a “test of courage” competition that involved an SPL (Sound Pressure Level) battle.</p><p></p><p>One of the participants was from Kauman – Trenggalek, namely the PSJK rental, which used Fabulous speakers including 18in 127187 subwoofers, 12in 75125 midrange, and CD440Pk1 tweeters.</p><p></p><p>This event also introduced the latest type from the ACR Series, the new Excellent with a 5-inch voice coil, model 188127.<br>The equipment used for the Rhyme demo included 6 boxes of the RM 103 LA line array and 6 boxes of RM 1283 SB subwoofers.<br>Additionally, there was the Rhyme Mini with a single 8in (RM 81 LA) line array paired with a single 15in flying subwoofer (RM 151 FSB), and for subwoofers, the double 18in RM 128 MKIII was displayed at the ACR booth.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/WhatsApp-Image-2022-06-08-at-8.21.27-AM-1024x768-1746764375121.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111639-1746764380428.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot-2022-06-14-092235-1024x574-1746764385083.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 111655-min-1746764416968.png\">', 'Review – STB (Sound Tugu Bersaudara #2) Sound System Exhibition – PSJT Trenggalek', 'review-stb-sound-tugu-bersaudara-2-sound-system-exhibition-psjt-trenggalek'),
('ba438f34-c408-4ca1-b110-7de4ef9efba9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Undian Poin My SBE II 2025 Resmi DIbuka', 'undian-poin-my-sbe-ii-2025-resmi-dibuka', '<p>Khusus kalian yang sudah download app My SBE bisa memenangkan speaker gratis dengan men-scan barcode speaker ACR yang sudah kalian beli. Bagi kalian yang belum download bisa segera download app-nya!</p><p></p><p>Periode mulai 1 Sept - 30 Nov 2025 yaa. 5 pemenang dengan poin tertinggi akan diumumkan pada 3 Desember 2025</p><p>Juara 1: 18in PA-127188 SW Fab ACR Series</p><p>Juara 2: 18in PA-113182 MK II SW Fab ACR Series</p><p>Juara 3: 18in PA-188127 Excel ACR Series</p><p>Juara 4: 18in ACR- 18100 BLACK</p><p>Juara 5: 15in ACR-15100 BLACK</p><p></p><p><strong>SYARAT &amp; KETENTUAN:</strong></p><ul><li><p>Pemilik ataupun karyawan toko dilarang mengikuti event ini</p></li><li><p>SBE berhak <strong>mendiskualifikasi </strong>peserta apabila melakukan kecurangan</p></li><li><p>Poin tidak dihitung apabila alamat tidak terdeteksi GPS</p></li><li><p>Jika peserta melakukan pembelian dari distributor langsung, maka peserta tersebut dapat memilih opsi toko \"Showroom SBY\" saat melakukan scan produk, dan peserta <strong>wajib </strong>menghubungi admin marketing di 0812.3183.3504 untuk konfirmasi. Jika tidak ada konfirmasi maka peserta akan di <strong>diskualifikasi</strong></p></li></ul><p></p><p>Seluruh peserta bsia mendapatkan barcodenya pada speaker ACR, Legacy hingga Curve.Berikut penjelasan detailnya cara mendapatkan poin dari barcode:</p><ul><li><p>Download app My SBE pada Play Store, lalu registrasi terlebih dahulu. Berikut <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\">link app My SBE</a></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1734395172735.jpg\"></li><li><p>Pada halaman Beranda klik “Pindai” dan scan QR-Code yang ada pada speaker ACR. QR-Code biasanya terletak pada magnet atau yoke speaker</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-1734395208222.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1734395221064.jpg\"></li><li><p>Lalu pilih toko pembelian</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-768x1511-1734395255184.jpg\"></li><li><p>Setelah memilih toko, maka akan muncul pop up message bahwa poin berhasil didapatkan. Banyaknya poin tergantung dari ukuran dan tipe speaker</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1734395288378.jpeg\"></li><li><p>Jika QR Barcode sudah pernah discan sebelumnya maka akan muncul pop up message yang menyatakan voucher gagal di-scan</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1734395317133.jpg\"></li><li><p>Poin yang berhasil didapatkan akan tersimpan pada “Poin Anda” di halaman Beranda. Untuk melihat riwayat scan, langsung klik pada kolom “Poin Anda”</p></li></ul>', '2025-09-03 05:57:02.776', 'admin', '2025-09-03 06:18:58.618', '2025-09-11 00:35:13.232', '', '', '<p>Those of you who have downloaded the My SBE app can win a free speaker by scanning the barcode of the ACR speaker you purchased. If you haven\'t yet, download the app now!<br><br>The period is September 1 - November 30, 2025. The five winners with the highest points will be announced on December 3, 2025.<br><br>1st Place: 18in PA-127188 SW Fab ACR Series<br><br>2nd Place: 18in PA-113182 MK II SW Fab ACR Series<br><br>3rd Place: 18in PA-188127 Excel ACR Series<br><br>4th Place: 18in ACR-18100 BLACK<br>5th Place: 15in ACR-15100 BLACK<br><br>Terms &amp; Conditions:<br><br>Shop owners or employees are prohibited from participating in this event.<br><br>SBE reserves the right to disqualify participants for cheating.<br><br>Points will not be counted if the address is not detected by GPS.<br><br>If participants purchase directly from a distributor, they can select the \"SBY Showroom\" store option when scanning the product. Participants must contact the marketing admin at 0812.3183.3504 for confirmation. Failure to do so will result in disqualification.<br><br>All participants can get their barcodes on ACR, Legacy, and Curve speakers. Here\'s a detailed explanation of how to get points from barcodes:</p><ul><li><p>Download the My SBE app from the Play Store, then register first. Here is the link to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\">My SBE app.</a></p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1734395172735.jpg\"><ul><li><p>On the Home page, click “Pindai” and scan the QR Code located on the ACR speaker. The QR Code is usually found on the magnet or the yoke of the speaker.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-1734395208222.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1734395221064.jpg\"></li><li><p>Then select the store</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-768x1511-1734395255184.jpg\"></li><li><p>After selecting the store, a pop-up message will appear indicating that the points have been successfully earned. The number of points depends on the size and type of the speaker.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1734395288378.jpeg\"></li><li><p>If the QR barcode has been scanned before, a pop-up message will appear stating that the voucher scan has failed.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1734395317133.jpg\"></li><li><p>The points successfully earned will be saved under “Poin Anda” on the Home page. To view your scan history, simply click on the “Poin Anda” section.</p></li></ul>', 'My SBE II Points Draw is Officially Open', 'my-sbe-ii-points-draw-is-officially-open'),
('bdd4b075-9cdd-40cb-a10b-720010549a50', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Sound System Mojokerto (PSSM)', 'review-pameran-sound-system-mojokerto-pssm', '<p>Komunitas PSSM Mojokerto mengadakan acara dalam rangka menjalin keakraban dan saling berbagi pengalaman, pengetahuan antar anggota, produsen, maupun penggemar audio. Acara ini dilaksanakan pada tanggal 11-12 Maret 2023 di Lapangan daerah Gondang, Mojokerto.</p><p></p><p>Pameran atau acara ini juga dimeriahkan dengan 5 sponsor lainnya (SPL,JIC,DEXO,FEST,X-sys), serta peserta/ rental yang ikut &nbsp;sekitar total 27 peserta / rental. Peserta juga ada diadakan lomba nilai SPL tertinggi dengan lagu wajib yang sudah disediakan oleh pihak panitia dan sponsor juga mendapatkan kesempatan untuk mendemokan speaker terbaiknya.</p><p></p><p>Pada kesempatan kali ini , ACR-RHYME tampil sedikit berbeda , karena tidak membawa produk sendiri khususnya pada subwoofernya. Karena menggandeng rental ternama asal Jombang yaitu La- Morena.</p><p></p><p>Rental tersebut membawa speaker subwoofer total 20box yang berisikan 21inch 127212 dan juga 18inch 127187. Lalu pada line array membawa Rhyme tipe RM 156 LA sebanyak 6box. Untuk amplifier yang dibawa yaitu Amplifier Rhyme R4500 dan juga R7000.</p><p></p><p>Pengunjung juga banyak yang mengagumi produk ACR baik speaker dan Rhyme dimana suara yang dihasilkan dan kualitas yang diberikan sangat bagus dan enak di dengar.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06133-1024x576-1746770023199.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 125240-1746770032067.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06227-1024x576-1746770039288.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 125303-1746770047490.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06157-1024x576-1746770054042.jpg\">', '2023-04-03 17:00:00.000', 'admin', '2025-05-09 05:53:17.026', '2025-07-03 02:19:47.631', '', '', '<p>The PSSM Mojokerto community held an event aimed at fostering camaraderie and sharing experiences and knowledge among members, producers, and audio enthusiasts. This event was held on March 11–12, 2023, at a field in the Gondang area, Mojokerto.</p><p></p><p>This exhibition or event was also enlivened by 5 other sponsors (SPL, JIC, DEXO, FEST, X-sys), as well as around 27 participants/rentals. A competition was also held among the participants to achieve the highest SPL score using a mandatory song provided by the committee, and the sponsors also had the opportunity to showcase their best speakers.</p><p></p><p>On this occasion, ACR-RHYME appeared a little different, as they did not bring their own products, especially subwoofers. Instead, they collaborated with a well-known rental company from Jombang, namely La-Morena.</p><p></p><p>The rental brought a total of 20 subwoofer speaker boxes containing 21-inch 127212 and 18-inch 127187. For the line array, they brought 6 boxes of the Rhyme RM 156 LA type. The amplifiers they brought were the Rhyme R4500 and R7000 amplifiers.</p><p></p><p>Many visitors also admired ACR products, both speakers and Rhyme, for the excellent and pleasant sound quality they delivered.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06133-1024x576-1746770023199.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 125240-1746770032067.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06227-1024x576-1746770039288.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 125303-1746770047490.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/JIK06157-1024x576-1746770054042.jpg\">', 'Review – Sound System Exhibition Mojokerto (PSSM)', 'review-sound-system-exhibition-mojokerto-pssm'),
('bfee745b-51b3-427c-9080-722b30f1eb43', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'LOMBA KONTEN UNTUK PARA DEALER RESMI SBE', 'lomba-konten-untuk-para-dealer-resmi-sbe', '<p>Di awal kuartal 4 tahun 2024, tim Sinar Baja Electric membuat event lomba konten untuk para dealer resmi SBE. Tujuan dari lomba ini adalah meningkatkan kreatifitas konten serta membantu promosi akun mereka agar bisa mendapatkan calon pelanggan baru. Video konten wajib di upload ke salah satu akun sosmed (Youtube/TikTok) resmi toko tersebut. <strong>Berikut hadiah yang diberikan kepada para pemenang:</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1746781401464.png\"><p></p><p><strong>Syarat dan Ketentuan Lomba:</strong></p><ol><li><p>Peserta adalah seluruh <strong>toko yang terdaftar di app SBE Link</strong> serta menjual speaker driver ACR/Curve/Prestige/Legacy.</p></li><li><p>Untuk toko yang belum terdaftar bisa langsung <strong>mendaftar di app SBE Link</strong>, tersedia di Play Store.</p></li><li><p>Pilih salah satu akun <strong>(Youtube atau TikTok)</strong> untuk mengikuti lomba ini</p></li><li><p>Follow IG @legacy.speaker dan @acrspeaker</p></li><li><p>Buat &amp; upload video mengenaio review produk ACR/Curve/Prestige/Legacy ke sosmed akun Youtube/TikTok toko kalian (pilih salah satu)</p></li><li><p>Menyertakan tagar <strong>#BanggaProdukLokal #SinarBajaElectric</strong> pada deskripsi video</p></li><li><p>Kami akan memilih 6 pemenang: 3 pemenang Youtube dan 3 pemenang TikTok</p></li><li><p>Jadwal upload: 15 Oktober – 15 November 2024</p></li><li><p>Peserta akan didiskualifikasi jika tidak mengikuti ketentuan lomba yang ada dan melakukan kecurangan</p></li><li><p>Peserta dapat mendaftar melalui <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://docs.google.com/forms/d/e/1FAIpQLScibZLk1JwOv_Z5CDEIMbq8VmYXa3rR5EO5E80unYKTU8FuFw/viewform?usp=pp_url\">link</a> berikut.</p></li></ol><p><strong>Ketentuan Penilaian:</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1-1746781417978.png\"><p></p><p>Seluruh peserta akan mendapatkan merchandise eksklusif sebagai bentuk dari apresiasi usaha mereka dalam mengikuti lomba ini</p><p></p><p>Pemenang akan diumumkan pada 22 Nov 2024 melalui Instagram @acrspeaker dan @legacy.speaker</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_01-1746781465491.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_01_02-1746781469243.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_03-1746781472200.png\">', '2024-10-15 17:00:00.000', 'admin', '2025-05-09 09:04:14.614', '2025-07-03 01:43:51.674', '', '', '<p>At the beginning of the fourth quarter of 2024, the Sinar Baja Electric team organized a content competition event for official SBE dealers. The purpose of this competition was to encourage content creativity and help promote their accounts in order to attract potential new customers. Content videos were required to be uploaded to one of the store’s official social media accounts (YouTube or TikTok).</p><p><strong>Here are the prizes awarded to the winners:</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1746781401464.png\"><p></p><p><strong>Terms and Conditions of the Competition:</strong></p><ol><li><p>Participants must be <strong>stores registered in the SBE Link app</strong> and must sell speaker drivers from ACR, Curve, Prestige, or Legacy.</p></li><li><p>Stores that are not yet registered can <strong>sign up directly through the SBE Link app</strong>, available on the Play Store.</p></li><li><p>Choose one social media account <strong>(either YouTube or TikTok)</strong> to participate in the competition.</p></li><li><p>Follow the Instagram accounts <a target=\"_new\" rel=\"noopener\" class=\"\" href=\"https://www.instagram.com/legacy.speaker\">@legacy.speaker</a> and <a target=\"_new\" rel=\"noopener\" class=\"\" href=\"https://www.instagram.com/acrspeaker\">@acrspeaker</a>.</p></li><li><p>Create and upload a video reviewing ACR / Curve / Prestige / Legacy products to your store’s YouTube or TikTok account (choose one only).</p></li><li><p>Include the hashtags <strong>#BanggaProdukLokal</strong> and <strong>#SinarBajaElectric</strong> in the video description.</p></li><li><p>We will select 6 winners: 3 from YouTube and 3 from TikTok.</p></li><li><p>Upload period: October 15 – November 15, 2024</p></li><li><p>Participants will be disqualified if they do not follow the rules or are found to be cheating.</p></li><li><p>Participants can register through the following <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://docs.google.com/forms/d/e/1FAIpQLScibZLk1JwOv_Z5CDEIMbq8VmYXa3rR5EO5E80unYKTU8FuFw/viewform\">link</a>.</p></li></ol><p><strong>Judging Criteria:</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/image-1-1746781417978.png\"><p></p><p>All participants will receive exclusive merchandise as a token of appreciation for their efforts in joining this competition.</p><p></p><p>Winners will be announced on November 22, 2024 via Instagram: <a target=\"_new\" rel=\"noopener\" class=\"\" href=\"https://www.instagram.com/acrspeaker\">@acrspeaker</a> and <a target=\"_new\" rel=\"noopener\" class=\"\" href=\"https://www.instagram.com/legacy.speaker\">@legacy.speaker</a>.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_01-1746781465491.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_01_02-1746781469243.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/lomba-konten-distributor_03-1746781472200.png\">', 'CONTENT COMPETITION FOR OFFICIAL SBE DEALERS', 'content-competition-for-official-sbe-dealers');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('c2440561-efe3-4cf7-b5e5-10eb4160d867', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '\"KLINIK RHYME\" - West Java', 'klinik-rhyme', '<p><strong>Hadiri Klinik RHYME di 5 kota Jawa Barat !</strong></p><p>Bandung, Cianjur, Sukabumi, Tasikmalaya, Indramayu&nbsp;dapatkan tiketnya di:</p><ul><li><p><strong>BANDUNG</strong><br>toko Akai Electronic, Segi Tiga Mas Kosambi Blok D no.5-6 Bandung</p></li><li><p><strong>CIANJUR</strong><br>toko Gemaria II Electronic, Jl. Pasar Baru Ruko no.26 Cianjur</p></li><li><p><strong>SUKABUMI</strong><br>toko Sumber Elektro, Jl. Penjagalan No 1C-Sukabumi</p></li><li><p><strong>TASIKMALAYA</strong><br>toko MM Electronics, Jl. Nagarawangi no.80 Tasikmalaya</p></li><li><p><strong>INDRAMAYU</strong><br>toko Putra Kardaun, Jl. Raya Bulak Jatibarang – Indramayu</p></li></ul><p>Kami mendemokan produk terbaru dari RHYME dan ACR, adapun promo-promo menarik dari kami.</p><p>Menangkan juga&nbsp;<strong><em>Door Prize&nbsp;</em></strong>undian menarik!!!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-jawa-barat-1746754630298.jpg\">', '2014-08-12 17:00:00.000', 'admin', '2025-05-09 01:37:12.029', '2025-07-03 03:28:33.515', '', '', '<p><strong>Attend the RHYME Clinic in 5 Cities Across West Java!</strong><br><strong>Bandung, Cianjur, Sukabumi, Tasikmalaya, Indramayu</strong><br>Get your tickets at:</p><hr><p><strong>BANDUNG</strong><br>Akai Electronic Store, Segi Tiga Mas Kosambi, Blok D No.5–6, Bandung</p><p><strong>CIANJUR</strong><br>Gemaria II Electronic Store, Jl. Pasar Baru, Ruko No.26, Cianjur</p><p><strong>SUKABUMI</strong><br>Sumber Elektro Store, Jl. Penjagalan No.1C, Sukabumi</p><p><strong>TASIKMALAYA</strong><br>MM Electronics Store, Jl. Nagarawangi No.80, Tasikmalaya</p><p><strong>INDRAMAYU</strong><br>Putra Kardaun Store, Jl. Raya Bulak Jatibarang – Indramayu</p><hr><p>We will be showcasing the latest products from RHYME and ACR, along with exciting promotions.</p><p><strong>Win Exciting Door Prizes in Our Lucky Draw!</strong></p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-jawa-barat-1746754630298.jpg\">', '\"KLINIK RHYME\" - West Java', 'klinik-rhyme'),
('c28f421b-2ea7-4061-9ed1-27b88a1f20d9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Road to SMEX 2019', 'road-to-smex-2019', '<p><strong>SMEX “Surabaya Music Expo”</strong></p><ul><li><p><em>Tanggal :&nbsp;25 - 28 Juli 2019</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li><li><p><strong>ACR &amp; RHYME booth No. 45</strong></p></li></ul><p>SMEX hadir kembali.., Pameran Pro Audio, Lighting dan Music terbesar di Indonesia.&nbsp;Di sini kami akan mendemokan&nbsp;Line Array terbaik&nbsp;kami yang diselengarakan di bagian outdoor dan di indoor kami memamerkan semua produk unggulan kami di&nbsp;booth ACR dan RHYME (No.45).</p><p></p><p>Kunjungi booth kami, dapatkan harga promo menarik dan informasi secara langsung tentang produk-produk terbaru.<br>Don\'t missed !!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-SMEX-2019-e1564474806968-1746760704376.jpg\">', '2019-07-07 17:00:00.000', 'admin', '2025-05-09 03:18:36.918', '2025-07-03 03:21:05.661', '', '', '<p><strong>SMEX “Surabaya Music Expo”</strong></p><ul><li><p><strong>Date:</strong> July 25 – 28, 2019</p></li><li><p><strong>Location:</strong> Exhibition Hall Grand City, Surabaya</p></li><li><p><strong>ACR &amp; RHYME Booth No.:</strong> 45</p></li></ul><p>SMEX is back—the biggest Pro Audio, Lighting, and Music exhibition in Indonesia!<br>Here, we will be demonstrating our best Line Array systems in the outdoor area, and showcasing all our flagship products at the ACR and RHYME booth (No. 45) in the indoor section.</p><p></p><p>Visit our booth to enjoy special promotional prices and get direct information about our latest products.<br>Don\'t miss it!!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Poster-SMEX-2019-e1564474806968-1746760704376.jpg\">', 'Road to SMEX 2019', 'road-to-smex-2019'),
('c3da6918-c3af-474a-a266-afa15eb27d01', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Parade Syawalan Sound System Yogyakarta', 'parade-syawalan-sound-system-yogyakarta', '<p>ACR Speaker dan Rhyme Pro-Audio akan hadir untuk Kota Yogyakarta dan sekitarnya, dalam acara Sound System Syawalan Yogyakarta.</p><ul><li><p>Tanggal 4 Juli - 5 Juli 2018</p></li><li><p>Di Halaman Parkir Stadion Sultan Agung Bantul.</p></li></ul><p>ACR Speaker dan Rhyme Pro-Audio akan membawakan speaker-speaker terbaiknya.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/logo-Syawalan-Yogyakarta-2018-1746756253536.jpg\">', '2018-06-27 17:00:00.000', 'admin', '2025-05-09 02:04:15.091', '2025-07-03 03:26:03.164', '', '', '<p>ACR Speaker and Rhyme Pro-Audio will be present in Yogyakarta and surrounding areas for the Sound System Syawalan Yogyakarta event.</p><ul><li><p>Date: July 4 – July 5, 2018</p></li><li><p>Location: Parking Area of Sultan Agung Stadium, Bantul.</p></li></ul><p>ACR Speaker and Rhyme Pro-Audio will be showcasing their best speakers.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/logo-Syawalan-Yogyakarta-2018-1746756253536.jpg\">', 'Syawalan Sound System Parade Yogyakarta', 'syawalan-sound-system-parade-yogyakarta'),
('c3ff7ecf-7c7b-4450-8b07-ae1a2baa2c0a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL TAMPIL MEMUKAU DI ACARA GEBYAR KESENIAN BANTENGAN MALANG!', 'acr-rhyme-desibel-tampil-memukau-di-acara-gebyar-kesenian-bantengan-malang', '<p>Gebyar Kesenian Bantengan Malang mengundang Sinar Baja Electric menjadi salah satu sponsor untuk event ini. Sinar Baja Electric membawa brandnya yang sudah tidak asing lagi ditelinga para para penikmat audio, yaitu ACR Rhyme dan Desibel untuk mengikuti acara tersebut. Masing-masing brand kembali membawa produk-produk unggulannya dan menampilkan performa terbaiknya pada puncak acara</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Selain membawa produk unggulannya, ACR juga membawa produk-produk baru seperti serian dari Fabulous: 12in PA-100122 SW Fab hingga 18in PA-127188 SW FAB double magnet dengan desain cone terbaru; serta ACR Black Series: CD 251 BLACK, 10in ACR-10500 BLACK, 12in ACR-12500 BLACK hingga 18in ACR-18100 BLACK. Rhyme sendiri juga membawa serian terbarunya RM 26 LA, RM 1283 SB Mk1, hingga Amplifier R17000. Desibel membawakan 18in 451006-Mk1 Desibel dengan cone paper warna biru yang menjadi ciri khasnya. Banyak dari pengunjung yang antusias untuk menanyakan perbandingan dari serian lama dan baru.</p><p></p><p>Acara makin meriah saat masyarakat setempat membawa budaya kesenian tradisional khas Jawa Timur: Bantengan yang beranggotakan anak-anak muda yang berbakat.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05510-1-1024x1536-1746781733841.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05572-1024x1536-1746781737271.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05563-1320x880-1746781742275.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/ClkKLcx_JEg?si=CMS0yVLromjlIYGC\" start=\"0\"></iframe></div>', '2024-11-14 17:00:00.000', 'admin', '2025-05-09 09:09:27.566', '2025-07-03 01:38:56.821', '', '', '<p>Gebyar Kesenian Bantengan Malang invited Sinar Baja Electric to be one of the sponsors for this event. Sinar Baja Electric brought along its well-known audio brands—ACR, Rhyme, and Desibel—to participate in the celebration. Each brand showcased its flagship products and delivered their best performances during the event\'s highlight.</p><p></p><p><strong>Event &amp; Bazaar</strong></p><p></p><p>In addition to its flagship products, ACR also introduced new items such as models from the Fabulous Series: <em>12in PA-100122 SW Fab</em> to <em>18in PA-127188 SW FAB</em> double magnet with a new cone design. The ACR Black Series was also featured, including: <em>CD 251 BLACK</em>, <em>10in ACR-10500 BLACK</em>, <em>12in ACR-12500 BLACK</em>, and <em>18in ACR-18100 BLACK</em>. Rhyme brought its newest line-up: <em>RM 26 LA</em>, <em>RM 1283 SB Mk1</em>, and the <em>R17000 Amplifier</em>. Desibel presented the <em>18in 451006-Mk1</em> with its signature blue cone paper. Many visitors were enthusiastic to ask about the comparison between the new and previous series.</p><p></p><p>The event became even more festive when locals performed Bantengan, a traditional East Javanese cultural art, led by talented local youth.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05510-1-1024x1536-1746781733841.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05572-1024x1536-1746781737271.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05563-1320x880-1746781742275.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/ClkKLcx_JEg?si=CMS0yVLromjlIYGC\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL STUNS AT THE GEBYAR KESENIAN BANTENGAN EVENT IN MALANG!', 'acr-rhyme-desibel-stuns-at-the-gebyar-kesenian-bantengan-event-in-malang'),
('c4233b2f-e89e-42c1-b5ee-d4482edf8a89', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'PARA PECINTA ACR UNJUK KEMAMPUAN DI ACARA BANGKALAN SOUND RACING 2025', 'para-pecinta-acr-unjuk-kemampuan-di-acara-bangkalan-sound-racing-2025', '<p>Pada pertengahan Mei 2025, Komunitas Sound System Tretan Bangkalan (KSTB) menyelenggarakan acara Bangkalan Sound Racing 2025 di lapangan Utara Karapan Sapi Desa Petrah, Kec. Tanah Merah, Bangkalan. Berbagai macam brand hadir sebagai sponsor utama. Sebagai salah satu perusahaan driver terbesar di Asia Tenggara, Sinar Baja Electric juga hadir dengan menampikan ACR Rhyme Desibel sebagai brand utamanya. Acara ini dimulai dengan pembukaan dari panitia, dilanjutkan dengan demo sound dari sponsor, serta event mixing dan balap SPL dari peserta lomba.</p><p><br>Terdapat lebih dari 30 rental yang mengikuti lomba ini, dan dari beberapa rental tersebut, juara 1 hingga juara 3 lomba SPL didominasi oleh para pengguna ACR Speaker:</p><ul><li><p>Juara 1 Balap SPL : TJ Audio, menggunakan speaker 18in PA-127187 SW Fab.</p></li><li><p>Juara 2 Balap SPL : Safa Audio, menggunakan speaker 18in PA-127188 SW Fab.</p></li><li><p>Juara 3 Balap SPL : MB Audio,menggunakan speaker 18in PA-127188 SW Fab.</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/WhatsApp-Image-2025-05-18-at-2.52.55-PM-1024x768-1752250034945.webp\"><p>Setelah lomba diadakan, banyak dari para rental dan pengunjung mengunjungi lapak ACR Rhyme Desibel untuk bertanya mengenai spesifikasi produk. Tidak sedikit dari mereka bercerita tentang pengalaman mereka dalam menggunakan produk ACR Speaker.</p><p><br>“Saya suka sama Fabulous in dalam jangka panjang sehari (kualitas suara) tidak turun”, ujar pemilik rental Wijaya Audio, sekaligus ketua Paguyuban Sound System Madura. “Semoga ke depan makin maju, makin sukses, dan mengikuti perkembangan jaman. Saya senang sekali karena produk speaker yang kura-kura bisa mengikuti (perkembangan jaman). Karena Fabulous dulu hanya dipakai buat rental, tetapi sekarang bisa digunakan untuk lomba-lomba.” lanjut beliau. Beliau sudah menggunakan produk ACR Speaker sejak 2008 dan tidak mengalami kendala pada speakernya</p><p><br>Di acara kali ini, Rhyme tidak menampilkan demo sound dengan para sponsor lainnya. Para pengunjung masih bisa menikmati suara dari 2 box RM 225 M Mk4 dan 2 box custom paraflex (18in PA-113188 SW Fab) yang berada di depan lapak. Untuk menunjang suara dari sistem speakernya, Rhyme menggunakan amplifier unggulannya, yaitu: R4500, R7000, dan R17000. ACR Speaker dan Desibel juga membawa produk-produk unggulan dan terbaru yang banyak diminati oleh para pecinta ACR di Bangkalan, antara lain: 12in PA-100122 W Fab, 18in PA-113188 SW Fab, 18in PA-127188 SW Fab, 18in 18710 DLX, 15in 381006-Mk1 Desibel, 18in 451006-Mk1 Desibel, 15in ACR-15100 BLACK, dan 18in ACR-18100 BLACK.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08119-1024x683-1752250060275.webp\">', '2025-05-28 07:00:00.000', 'admin', '2025-07-11 16:11:13.146', '2025-07-15 01:08:59.315', '', '', '<p>In mid-May 2025, the Tretan Bangkalan Sound System Community (KSTB) held the Bangkalan Sound Racing 2025 event at the northern field of the Karapan Sapi arena in Petrah Village, Tanah Merah District, Bangkalan. Various brands participated as main sponsors. As one of the largest driver companies in Southeast Asia, Sinar Baja Electric was also present, showcasing ACR Rhyme Desibel as its main brand. The event began with an opening ceremony by the organizers, followed by sound demos from the sponsors, as well as a mixing event and SPL (Sound Pressure Level) racing competition for participants.</p><p>More than 30 rental companies participated in this competition, and among them, the 1st to 3rd place winners of the SPL race were dominated by users of ACR Speakers:</p><ul><li><p>1st Place SPL Race: TJ Audio, using 18in PA-127187 SW Fab speaker.</p></li><li><p>2nd Place SPL Race: Safa Audio, using 18in PA-127188 SW Fab speaker.</p></li><li><p>3rd Place SPL Race: MB Audio, using 18in PA-127188 SW Fab speaker.</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/WhatsApp-Image-2025-05-18-at-2.52.55-PM-1024x768-1752250034945.webp\"><p>After the competition, many rental companies and visitors came to the ACR Rhyme Desibel booth to ask about product specifications. Many of them shared their experiences using ACR Speaker products.</p><p></p><blockquote><p>“I really like the Fabulous series because over long-term use, even all day, the sound quality doesn\'t degrade,” said the owner of Wijaya Audio, who is also the chairman of the Madura Sound System Association.<br>“I hope ACR continues to grow, becomes more successful, and keeps up with the times. I’m very happy that our \'tortoise\' brand speaker can evolve with the times. The Fabulous series used to be only for rentals, but now it can be used in competitions too,” he added.<br>He has been using ACR Speaker products since 2008 and has never encountered any issues with the speakers.</p><p></p></blockquote><p>At this event, Rhyme did not perform a demo alongside the other sponsors. However, visitors could still enjoy the sound from two RM 225 M Mk4 boxes and two custom paraflex boxes (18in PA-113188 SW Fab) placed in front of the booth. To support the sound system, Rhyme used its top amplifiers: R4500, R7000, and R17000.</p><p><br>ACR Speaker and Desibel also brought their flagship and newest products, which attracted a lot of interest from ACR enthusiasts in Bangkalan, including:</p><ul><li><p>12in PA-100122 W Fab</p></li><li><p>18in PA-113188 SW Fab</p></li><li><p>18in PA-127188 SW Fab</p></li><li><p>18in 18710 DLX</p></li><li><p>15in 381006-Mk1 Desibel</p></li><li><p>18in 451006-Mk1 Desibel</p></li><li><p>15in ACR-15100 BLACK</p></li><li><p>18in ACR-18100 BLACK</p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08119-1024x683-1752250100540.webp\">', 'ACR ENTHUSIASTS SHOWCASE THEIR SKILLS AT BANGKALAN SOUND RACING 2025', 'acr-enthusiasts-showcase-their-skills-at-bangkalan-sound-racing-2025'),
('c6a06fa0-08c6-4513-a53d-b9f16c378015', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL DI ACARA PAGUYUBAN SOUND SYSTEM LAMPUNG TIMUR (PSSLT)', 'acr-rhyme-desibel-di-acara-paguyuban-sound-system-lampung-timur-psslt', '<p>Pada tanggal 23-24 Agustus 2024, tim ACR Rhyme Desibel eksklusif menghadiri acara di Paguyuban Sound System Lampung Timur (PSSLT). Acara ini berlangsung di Lapangan Desa Trimulyo 59. Acara yang hanya disponsori oleh Sinar Baja Electric ini dihadiri oleh beberapa peserta untuk mengikuti lomba SPL.</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Disini ACR dan Desibel membawakan tipe-tipe unggulannya, seperti 18in 113188 SW Fab double magnet hingga 18in 451006 Desibel. Untuk Rhyme membawa RM 81 LA, RM 151 FSB. Pada live demo, ACR Rhyme membawa 6 box RM 126 LA yang berisikan 3-way line array serta pada subwoofernya membawa 8 box RM 1283 SB. Kedua tipe tersebut menggunakan power unggulan milik Rhyme, yaitu amplifier R4500 dan R7000.</p><p></p><p>Tim PSSLT dan tim Sinar Baja Electric juga melakukan sharing bersama untuk menjawa pertanyaan atau keluhan dari tiap customer yang hadir dalam acara tersebut. Para customer antusias dengan banyak mengajukan pertanyaan-pertanyaan pada tiap brand yang ada mulai dari spesifikasi produk hingga servis speaker. Rasa antusias dari mereka semakin meningkat saat tim dari Sinar Baja Electric memperbolehkan membuka isi box dari RM 1283 SB.</p><p></p><p>Berikut dokumentasinya</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04383-2-1320x880-1746780927801.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04359-1320x880-1746780934856.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04388-1320x880-1746780939878.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/0cd30818-fc33-49d1-8d85-ad41f98c8e53-1-1320x1025-1746780947029.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MBOXwKIf0fc?si=dC3zyFj_3Gwi7E_n\" start=\"0\"></iframe></div>', '2024-09-10 17:00:00.000', 'admin', '2025-05-09 08:56:14.261', '2025-07-03 01:46:12.406', '', '', '<p>On August 23–24, 2024, the ACR Rhyme Desibel team exclusively attended an event held by the Paguyuban Sound System Lampung Timur (PSSLT). The event took place at the Trimulyo 59 Village Field. Sponsored solely by Sinar Baja Electric, the event was attended by several participants competing in the SPL competition.</p><p></p><p><strong>Event and Bazaar</strong></p><p></p><p>At the event, ACR and Desibel showcased their flagship models, such as the 18in 113188 SW Fab double magnet and the 18in 451006 Desibel. Rhyme presented the RM 81 LA and RM 151 FSB. During the live demo, ACR Rhyme brought 6 boxes of RM 126 LA, which is a 3-way line array system, along with 8 boxes of RM 1283 SB subwoofers. Both types were powered by Rhyme\'s top amplifiers: the R4500 and R7000.</p><p></p><p>The PSSLT team and the Sinar Baja Electric team also held a sharing session to answer questions and address concerns from customers who attended the event. Customers showed great enthusiasm by asking many questions about each brand, from product specifications to speaker servicing. Their excitement grew even more when the Sinar Baja Electric team allowed them to open the inside of the RM 1283 SB box.</p><p></p><p>Here is the documentation.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04383-2-1320x880-1746780927801.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04359-1320x880-1746780934856.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT04388-1320x880-1746780939878.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/0cd30818-fc33-49d1-8d85-ad41f98c8e53-1-1320x1025-1746780947029.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MBOXwKIf0fc?si=dC3zyFj_3Gwi7E_n\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL AT THE EAST LAMPUNG SOUND SYSTEM COMMUNITY (PSSLT) EVENT', 'acr-rhyme-desibel-at-the-east-lampung-sound-system-community-psslt-event'),
('c7692999-e520-43ad-8c0d-59eb1ababf5b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Suronan PSPT, Pati - Jawa Tengah', 'suronan-pspt-pati-jawa-tengah', '<p>Acara Suronan PSPT 2018 merupakan event yang diselengarakan oleh Paguyuban Sound System Pati Timur (PSPT) yang sudah terlaksana selama 3 tahun, di tahun ke-3 ini kepanitiaan dipegang oleh Bapak Ricky&nbsp;(Toko Matahari &amp; Toko Son’s) yang merupakan salah satu distributor ACR di daerah Pati dan sekitarnya. Acara tersebut diselengarakan pada tanggal 28 - 30 September yang berlokasi di Lapangan Pencikan desa Bumirejo, kecamatan Jawana.</p><p></p><p>Acara berlangsung cukup sukses dimana jumlah peserta dan sponsor meningkat dari tahun sebelumnya, serta antusias pengunjung yang cukup ramai memenuhi lokasi demo sound dan stand-stand sponsor. Kami sebagai salah satu sponsor ikut memeriahkan acara dengan membuka stand dan mendemokan speaker line array terbaru RHYME; RM 103 LA (10in double, 2-way) dan subwoofernya 128 SB MK4 (18in double), dengan konfigurasi 6x4 box.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104047-e1545894860925-1746756691207.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104033-e1545892367559-1746756700346.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_132934-e1545892098111-1746756705616.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104103-e1545894764189-1746756719790.jpg\">', '2018-12-21 17:00:00.000', 'admin', '2025-05-09 02:12:15.878', '2025-07-03 03:24:24.325', '', '', '<p>The Suronan PSPT 2018 event was organized by the Paguyuban Sound System Pati Timur (PSPT), which has been held for three years. In its third year, the organizing committee was led by Mr. Ricky (from Toko Matahari &amp; Toko Son’s), one of the ACR distributors in the Pati area and its surroundings. The event took place on September 28–30 at the Pencikan Field, Bumirejo Village, Juwana District.</p><p></p><p>The event was quite successful, with an increase in both participants and sponsors compared to the previous year, as well as high enthusiasm from visitors who filled the demo sound area and sponsor booths. As one of the sponsors, we supported the event by setting up a booth and demonstrating the latest line array speaker from RHYME: RM 103 LA (10in double, 2-way) and its subwoofer 128 SB MK4 (18in double), in a 6x4 box configuration.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104047-e1545894860925-1746756691207.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104033-e1545892367559-1746756700346.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_132934-e1545892098111-1746756705616.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180929_104103-e1545894764189-1746756719790.jpg\">', 'Suronan PSPT, Pati – Central Java', 'suronan-pspt-pati-central-java'),
('c87fd6c7-0379-4104-a73b-42fc363998d4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Best Seller di Kelasnya:  6in ARRAY 1550 dan 10in 75105 FAB', 'best-seller-di-kelasnya-6in-array-1550-dan-10in-75105-fab', '<p>Semakin bertambahnya peminat audio dan speaker di seluruh Indonesia, Sinar Baja Electric mengikuti perkembangan tersebut dengan meluncurkan berbagai macam produk, mulai dari speaker 6in, 8in, 10in, 12in, hingga 18in double magnet yang diluncurkan pada pertengahan tahun ini.</p><p></p><p>Dari semua tipe speaker tersebut, terdapat beberapa speaker yang banyak diminati dari awal peluncuran hingga akhir tahun ini. Speaker tersebut adalah 6in ARRAY 1550 M FAB serta 10in 75105 FAB.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1550-1746774542090.png\"><p>Speaker ini memiliki nominal power handling 200 watt dan sudah memiliki lapisan weather resistance pada conepapernya. Dengan lebar daerah frekuensi 170 Hz – 5000 Hz, speaker ini didesain agar mampu menghasilkan respon frekuensi yang berkarakter midrange.&nbsp; Speaker woofer ini memiliki coating cemedine pada gulungan voice coilnya yang membuat speaker mampu bertahan pada suhu yang tinggi</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/75105-1746774560453.png\"><p></p><p>Sama halnya dengan speaker 10in 75105 FAB ini, speaker dengan nominal power handling 300 watt ini memiliki magnet Ferrite dengan kualitas terbaik dan didesain dengan bantuan software agar memiliki daya magnet yang optimal. Speaker woofer ini memiliki coating cemedine pada gulungan voice coilnya yang membuat speaker mampu bertahan pada suhu yang tinggi</p><p></p><p>Speaker dari Sinar Baja Electric ini diproduksi dengan material kualitas terbaik sehingga mampu melengkapi kebutuhan konsumen. Sinar Baja Electric juga berkomitmen untuk meningkatkan kepuasan pelanggan dengan adanya Servis Center, jadi konsumen bisa melakukan servis langsung ke pabrik, dengan kualitas sesuai standard / seperti baru lagi. Syarat dan ketentuan servis ada pada kartu garansi di tiap produknya</p><p></p><p>Berikut spesifikasi lengkap dari <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/array-1550-m-fab\">6in ARRAY 1550 M</a> dan <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/75105-fab\">10in 75105 FAB</a></p>', '2023-12-07 17:00:00.000', 'admin', '2025-05-09 07:11:20.636', '2025-07-03 02:13:21.441', '', '', '<p>As the interest in audio and speakers continues to grow across Indonesia, Sinar Baja Electric has kept up with this development by launching a variety of products, ranging from 6-inch, 8-inch, 10-inch, 12-inch, to 18-inch double magnet speakers, released in mid-year.</p><p></p><p>Among all these speaker types, several have gained significant popularity from their initial launch until the end of the year. These include the 6-inch ARRAY 1550 M FAB and the 10-inch 75105 FAB.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/1550-1746774542090.png\"><p>This speaker has a nominal power handling of 200 watts and features a weather-resistant coating on its cone paper. With a frequency range of 170 Hz to 5000 Hz, it is designed to deliver a midrange-character frequency response. The woofer also includes cemedine coating on its voice coil winding, allowing it to withstand high temperatures.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/75105-1746774560453.png\"><p></p><p>Similarly, the 10-inch 75105 FAB speaker, with a nominal power handling of 300 watts, features a high-quality ferrite magnet and is designed using software assistance to achieve optimal magnetic strength. This woofer speaker is also equipped with cemedine coating on its voice coil winding, enabling it to withstand high temperatures.</p><p></p><p>This speaker from Sinar Baja Electric is manufactured using the highest quality materials to meet customer demands. Sinar Baja Electric is also committed to enhancing customer satisfaction through its Service Center, allowing customers to have their products serviced directly at the factory with quality restored to factory standards. Terms and conditions for service are listed on the warranty card included with each product.</p><p></p><p>Below are the complete specifications for the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/array-1550-m-fab\">6-inch ARRAY 1550 M</a> and the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://acrspeaker.com/en/products/75105-fab\">10-inch 75105 FAB</a>.</p>', 'Best Seller in Its Class: 6in ARRAY 1550 and 10in 75105 FAB', 'best-seller-in-its-class-6in-array-1550-and-10in-75105-fab'),
('ca644044-8529-47e9-832e-b99243d790ec', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'KUNJUNGAN PSST KE PABRIK SINAR BAJA ELECTRIC', 'kunjungan-psst-ke-pabrik-sinar-baja-electric', '<p>PSST berkunjung ke pabrik Sinar Baja Electric pada akhir bulan September 2024 dalam rangka tur pabrik dan cek sound. Sebanyak +- 50 anggota menghadiri acara tersebut. Pemilik dari Sinar Baja Electric, Bapak Hendro Sunjoto, ikut menyambut dan berbincang-bincang dengan anggota PSST.</p><p></p><p>Di lokasi acara, PSST disambut dengan goodie bag berisi merchandise yang telah disiapkan oleh tim marketing SBE, lalu dilanjut dengan tur pabrik. Para anggota dibagi menjadi 3 tim yang tiap anggotanya berisi 15-20 anggota. Mereka keliling dari area produksi hingga ke area gudang tempat semua speaker disimpan untuk dikirimkan ke distributor.</p><p></p><p>Pada siang harinya, dilakukan tes sound untuk tipe RM 226 LA, produk terbaru Rhyme, yang di drive dengan ampli R4500 dan R7000, dan RM 1283 Mk1 yang di drive dengan ampli terbaru R17000-D. Di sisi kiri terdapat prototype RM 1283 Mk1 yang belum di cat serta tidak ada metal mesh agar para anggota bisa melihat kualitas dari produk tersebut. Prototype ini juga dibuat two-way dengan RM 225 M Mk4 yang berfungsi sebagai full range. Para anggota yang awalnya hanya duduk diam semakin antusias hingga berjalan mendekati area sound system untuk melihat produk lebih dekat.</p><p></p><p>Di sela-sela tes sound, beberapa anggota mendekati area bazar yang menampilkan produk terbaru dari ACR, seperti black series, limited edition dari fabulous, hingga 18in dengan cone paper terbaru. Tim SBE juga menjawab pertanyaan-pertanyaan yang diajukan oleh tiap peserta saat mengisi form pendaftaran. Setelah menjawab beberapa pertanyaan, tim SBE juga membagikan doorprize berupa dari driver tweeter hingga subwoofer. Pada sesi ini, suasana semakin meriah karena tim SBE juga mengajak para anggota untuk ikut aktif dalam mengambil undiannya secara acak.</p><p></p><p>\"Kami sangat senang dan sangat berterima kasih banget, sehingga kita bisa mengetahui bagaimana sih proses produksi speaker dari Sinar Baja Electric yang menjawab keraguan kita saat ini bahwa produk dari Sinar Baja Electric benar-benar produk dalam negeri atau karya anak bangsa.\" ucap ketua PSST, Bapak Yahya pada akhir sesi acara tersebut.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-1-1320x745-1746781307709.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-4-1320x744-1746781311952.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-3-1320x743-1746781316026.jpg\"><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MdXTBWAba6I?si=aTWEXuPpNRXO3y6F\" start=\"0\"></iframe></div>', '2024-10-01 17:00:00.000', 'admin', '2025-05-09 09:01:41.010', '2025-07-03 01:45:00.442', '', '', '<p>At the end of September 2024, PSST (Persatuan Sound System Tradisional) visited the Sinar Baja Electric factory for a tour and sound testing session. Around 50 members attended the event. The owner of Sinar Baja Electric, Mr. Hendro Sunjoto, personally welcomed the PSST members and engaged in friendly discussions.</p><p></p><p>Upon arrival, the attendees received goodie bags filled with merchandise prepared by the SBE marketing team. The tour then commenced with members split into three groups, each consisting of 15–20 people, moving through the production area and warehouse where speakers are stored before shipment to distributors.</p><p></p><p>In the afternoon, a sound test was held featuring Rhyme’s latest RM 226 LA, powered by amplifiers R4500 and R7000, and the RM 1283 Mk1, driven by the newly launched R17000-D. On the left side, a prototype of the RM 1283 Mk1 was displayed without paint or metal mesh, allowing participants to closely examine its build quality. This prototype was also set up in a two-way configuration with RM 225 M Mk4 as the full-range driver. Initially seated quietly, participants grew increasingly excited and approached the sound system to get a better view.</p><p></p><p>During the breaks, several members visited the bazaar area, where ACR’s latest products were showcased — including the Black Series, Fabulous Limited Editions, and 18-inch speakers with new cone paper design. The SBE team also addressed questions collected through the event’s registration form.</p><p>To cap off the event, door prizes — ranging from tweeter drivers to subwoofers — were given out. The session became even more festive as participants were invited to actively draw their prizes.</p><p></p><blockquote><p><em>\"We are truly happy and very grateful to have learned firsthand how Sinar Baja Electric speakers are produced. It clears our doubts and affirms that these products are truly made in Indonesia — real works of the nation,\"</em> said Mr. Yahya, Chairman of PSST, during the closing remarks.</p></blockquote><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-1-1320x745-1746781307709.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-4-1320x744-1746781311952.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/pstt-3-1320x743-1746781316026.jpg\"><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/MdXTBWAba6I?si=aTWEXuPpNRXO3y6F\" start=\"0\"></iframe></div>', 'PSST VISIT TO SINAR BAJA ELECTRIC FACTORY', 'psst-visit-to-sinar-baja-electric-factory'),
('ca904304-de17-4f45-8b8f-c11f09a71099', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Pameran Nguntir Bareng Paguyuban Sound System Jombang #2', 'review-pameran-nguntir-bareng-paguyuban-sound-system-jombang-2', '<p>Paguyuban Sound System Jombang (PSSJombang) mengadakan pameran,demo sound serta lomba antar rental yang diadakan di Kec Tunggureno Jombang pada 18 – 19 Juni 2022. Acara ini merupakan acara kedua yang diadakan oleh PSSJombang. Acara pameran ini juga bertujuan untuk mempererat solidaritas teman – teman rental khususnya area Jombang sekitar, Juga menjadi ajang adu teknik (lomba mixing) serta kerapian sound system.</p><p></p><p>Dalam setiap kategori lomba pun, terdapat 3 juara utama yang juga akan mendapatkan hadiah mulai dari driver speaker, mixer, hingga power amplifier. Hadiah – hadiah lomba pun juga banyak mendapatkan support dari para sponsor, sehingga para peserta juga sangat antusias dalam mengikuti lomba – lomba tiap kategori yang diadakan oleh panitia.</p><p></p><p>Pengunjung dan peserta yang datang banyak dari area lokal Kota Jombang, hingga area Jawa Tengah. Lapak ACR juga banyak didatangi oleh pengunjung hingga para peserta, pengunjung dapat melihat dan juga mendapat informasi secara langsung tentang produk – produk ACR.</p><p></p><p>Selain lapak ACR, juga terdapat demo produk Rhyme yaitu dengan membawa produk terbaru Line array 8inch sebanyak 6pcs tipe RM 81 LA dan Line Array Fling Subwoofer 15inch tipe RM 151 FSB sebanyak 2 pcs. Untuk Subwoofer membawa 18inch double sebanyak 6box dengan tipe RM 1283 SB. Demo produk kali ini juga sekaligus mengenalkan produk baru dari Rhyme dengan menonjolkan karakter vokal yang kuat.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03341-1024x683-1746764786867.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112312-min-1746764791798.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03331-1024x683-1746764806422.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112344-min-1746764825257.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112411-min-1746764833460.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03347-1024x683-1746764889303.jpg\">', '2022-06-29 17:00:00.000', 'admin', '2025-05-09 04:26:55.384', '2025-07-03 02:20:30.390', '', '', '<p>The Jombang Sound System Community (PSSJombang) held an exhibition, sound demo, and competition among rental companies in Tunggureno District, Jombang, on June 18–19, 2022. This was the second event organized by PSSJombang. The purpose of this exhibition was to strengthen the solidarity of fellow rental crews, especially in the Jombang area and surroundings. It also served as a platform for technical competition (mixing contest) and sound system neatness.</p><p></p><p>In each competition category, there were three main winners who received prizes ranging from speaker drivers and mixers to power amplifiers. The prizes were largely supported by sponsors, which contributed to the participants’ high enthusiasm for competing in the various categories organized by the committee.</p><p></p><p>Visitors and participants came from the local Jombang area and even from Central Java. The ACR booth attracted a lot of attention from both visitors and participants. Visitors were able to see and receive direct information about ACR products.</p><p></p><p>In addition to the ACR booth, there was also a demo of Rhyme products, which included the latest 8-inch line array (6 units of RM 81 LA type) and 15-inch line array flying subwoofer (2 units of RM 151 FSB type). For the subwoofers, they brought six double 18-inch boxes, type RM 1283 SB. This product demo also served as an introduction to Rhyme’s new products, highlighting their strong vocal character.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03341-1024x683-1746764786867.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112312-min-1746764791798.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03331-1024x683-1746764806422.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112344-min-1746764825257.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 112411-min-1746764833460.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC03347-1024x683-1746764889303.jpg\">', 'Review – Nguntir Bareng Exhibition by Jombang Sound System Community #2', 'review-nguntir-bareng-exhibition-by-jombang-sound-system-community-2'),
('ccb266f1-f105-40df-a56e-5cfeaec0b6a2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Road to SMEX 2016', 'road-to-smex-2016', '<p><strong>SMEX \"Surabaya Music Expo\"</strong></p><ul><li><p><em>Tanggal : 8&nbsp;- 11 September&nbsp;2016</em></p></li><li><p><em>Lokasi : Exihibition Hall Grand City, Surabaya</em></p></li></ul><p>Tahun ini Kami hadir dalam SMEX yang merupakan salah satu event pameran Pro Audio, Lighting dan Music terbesar di Indonesia. Dengan mengikuti Demo Line Array yang berlangsung di depan <em>Exihibition Hall Grand City&nbsp;</em>dan menghadirkan booth ACR dan RHYME, di sini anda dapat mendapatkan info dari produk-produk kami secara langsung.</p><p>Kami juga mengeluarkan beberpa tipe baru :</p><ul><li><p><strong>6\" ARRAY 5061M</strong>&nbsp;Fabulous by ACR</p></li><li><p><strong>12\" PA- 75124 W-N</strong> Fabulous by ACR</p></li><li><p><strong>RM 212 M MK4,</strong>&nbsp;Single&nbsp;12″ 2way, Fullrange (RHYME)</p></li></ul><p>adapun promo-promo yang kami tawarkan :</p><p><strong>- Promo ACR&nbsp;:</strong></p><ul><li><p><strong><em>Pembelian 3 juta,</em></strong><em> gratis 1-pc CD 9B ACR atau&nbsp;2-pcs CD 2 ACR</em></p></li></ul><p><strong>- Promo RHYME :</strong></p><ul><li><p><strong>Paket A</strong> :&nbsp;8-pcs RM 10 LA MK3 dan 6-pcs RM 1282 SB + sepasang array frame, <strong>Hanya 124 juta</strong></p></li><li><p><strong>Paket B</strong>&nbsp;:&nbsp;8-pcs RM 102 LA dan 6-pcs RM 1282 SB + sepasang array frame, <strong>Hanya 106.3&nbsp;juta</strong></p></li><li><p><strong>Paket C</strong>&nbsp;:&nbsp;8-pcs RM 156-3F&nbsp;LA dan 6-pcs RM 1282 SB + sepasang array frame, <strong>Hanya 152.5 juta</strong></p></li><li><p><strong>Paket D</strong>&nbsp;:&nbsp;8-pcs RM 126 LA dan 6-pcs RM 18 LA SE + sepasang array frame, <strong>Hanya 199 juta</strong></p></li></ul><p>Datang lah di Booth kami dan dapatkan promo-promo menarik !</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/poster-SMEX-2016 (1)-1746755048555.jpg\">', '2017-02-01 17:00:00.000', 'admin', '2025-05-09 01:44:14.027', '2025-07-03 03:27:47.350', '', '', '<p><strong>SMEX \"Surabaya Music Expo\"</strong></p><ul><li><p>Date: 8 – 11 September 2016</p></li><li><p>Location: Exhibition Hall Grand City, Surabaya</p></li></ul><p>This year, we are participating in SMEX, one of the biggest Pro Audio, Lighting, and Music exhibitions in Indonesia. By taking part in the Line Array Demo held in front of the Grand City Exhibition Hall and presenting the ACR and RHYME booth, you can get direct information about our products.</p><p>We also launched several new types:</p><ul><li><p><strong>6\" ARRAY 5061M</strong> – Fabulous by ACR</p></li><li><p><strong>12\" PA-75124 W-N</strong> – Fabulous by ACR</p></li><li><p><strong>RM 212 M MK4</strong> – Single 12″ 2-way Fullrange (RHYME)</p></li></ul><p>Promotions we offer:</p><p><strong>– ACR Promo:</strong><br>Purchase of 3 million IDR gets 1 pc CD 9B ACR or 2 pcs CD 2 ACR free.</p><p><strong>– RHYME Promo Packages:</strong></p><ul><li><p><strong>Package A:</strong> 8 pcs RM 10 LA MK3 + 6 pcs RM 1282 SB + 1 pair array frame – Only 124 million IDR</p></li><li><p><strong>Package B:</strong> 8 pcs RM 102 LA + 6 pcs RM 1282 SB + 1 pair array frame – Only 106.3 million IDR</p></li><li><p><strong>Package C:</strong> 8 pcs RM 156-3F LA + 6 pcs RM 1282 SB + 1 pair array frame – Only 152.5 million IDR</p></li><li><p><strong>Package D:</strong> 8 pcs RM 126 LA + 6 pcs RM 18 LA SE + 1 pair array frame – Only 199 million IDR</p></li></ul><p>Come visit our booth and grab these exciting promotions!</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/poster-SMEX-2016 (1)-1746755048555.jpg\">', 'Road to SMEX 2016', 'road-to-smex-2016'),
('cd0b536c-e729-4944-afd9-798cfad31b43', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL DI ACARA NGUNTIR BARENG ANNIVERSARY KE-5 PPSSN', 'acr-rhyme-desibel-di-acara-nguntir-bareng-anniversary-ke-5-ppssn', '<p>Acara ini diadakan pada 27-29 September 2024 di Taman Candi Ngawi, Jawa Timur. Berbeda dengan acara sebelumnya yang menjadi sponsor tunggal, banyak brand-brand yang mensponsori acara ini</p><p></p><p><strong>Acara &amp; Bazar</strong></p><p></p><p>Karena tim memiliki misi memperkenalkan semua produk kepada seluruh pelanggan di seluruh Indonesia, maka pada acara kali ini pun tim juga membawakan tipe-tipe unggulan dari ACR (18in 113188 SW Fab double magnet), Desibel (18in 451006 Desibel), hingga Rhyme (RM 81 LA, RM 151 FSB). Pada live demo, Rhyme juga membawa 6 box RM 126 LA yang berisikan 3-way line array yang di drive dengan amplifier R4500 dan R7000. Serta pada subwoofernya membawa 8 box RM 1283 SB yang di drive dengan amplifier terbaru yaitu R17000-D</p><p></p><p>Acara ini juga dihadiri oleh 60 peserta yang mempresentasikan system speakernya dari subwoofer hingga line array. Adanya acara doorprize yang semakin memeriahkan acara nguntir kali ini. ACR dan Desibel juga memberikan hadiah doorprize berupa CD 250P1B-08F Fab ACR Series, CD 44 Desibel, beserta merchandise. Puncak acaranya terdapat orkesan dan jaranan dan dihadiri oleh seluruh peserta yang ada.</p><p></p><p>Berikut dokumentasinya</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design-768x1365-min-1746781169899.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05035-1320x880-1746781182959.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05058-1320x880-1746781187820.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05049-1320x880-1746781192880.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05052-1320x880-1746781200873.jpg\">', '2024-09-30 17:00:00.000', 'admin', '2025-05-09 08:58:32.844', '2025-07-03 01:45:41.800', '', '', '<p>The event was held on September 27–29, 2024, at Taman Candi Ngawi, East Java. Unlike previous events where Sinar Baja Electric was the sole sponsor, this time many brands sponsored the event.</p><p></p><p><strong>Event and Bazaar</strong></p><p></p><p>Because the team has a mission to introduce all products to customers across Indonesia, this time the team also brought featured models from ACR (18in 113188 SW Fab double magnet), Desibel (18in 451006 Desibel), and Rhyme (RM 81 LA, RM 151 FSB). For the live demo, Rhyme also brought 6 boxes of RM 126 LA consisting of a 3-way line array driven by the R4500 and R7000 amplifiers. For the subwoofers, they brought 8 boxes of RM 1283 SB powered by the latest amplifier, the R17000-D.</p><p></p><p>The event was also attended by 60 participants who presented their speaker systems, from subwoofers to line arrays. The door prize session added more excitement to this Nguntir event. ACR and Desibel also gave away door prizes such as CD 250P1B-08F Fab ACR Series, CD 44 Desibel, along with merchandise.</p><p>The highlight of the event featured traditional performances such as orkesan and jaranan, attended by all participants.</p><p></p><p>Here is the documentation.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Untitled-design-768x1365-min-1746781169899.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05035-1320x880-1746781182959.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05058-1320x880-1746781187820.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05049-1320x880-1746781192880.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05052-1320x880-1746781200873.jpg\">', 'ACR RHYME DESIBEL AT THE NGUNTIR BARENG EVENT FOR PPSSN’S 5TH ANNIVERSARY', 'acr-rhyme-desibel-at-the-nguntir-bareng-event-for-ppssn-s-5th-anniversary');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('cdc30f97-0bae-4d35-a111-c8cf5c1fad95', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Cek Sound Rhyme Bersama KS3', 'cek-sound-rhyme-bersama-ks3', '<p>Pada tanggal 12 Juni 2023 kemarin, Komunitas Sound System Semarang (KS3) mengunjungi Sinar Baja Electric dalam rangka kunjungan pabrik serta cek sound Rhyme Professional Audio. KS3 adalah komunitas tertua di kota Semarang dan memiliki anggota komunitas (member)&nbsp; hingga 50 tim. <br>Selain ingin cek sound Speaker Rhyme, mereka datang ke Sinar Baja karena mereka ingin mengetahui proses pembuatan speaker dan boxnya.</p><p></p><p>“Sangat bangga karena ada pabrik yang memproduksi speaker di Indonesia, khususnya di Surabaya. Jika tidak mampir ke sini, mungkin kami tidak tahu.”, kata Catur (Yoyok), salah satu dari anggota dari KS3.</p><p></p><p>Anggota KS3 juga ikut mendengarkan demo dari Speaker Rhyme, antara lain Line Array tipe RM 81 LA sebanyak 6 box dan Rm 81 FSB sebanyak 2 box , lalu untuk subwoofer menggunakan box custom yang berisi 18in double Fabulous 113186 sebanyak 6 box. Juga didemokan untuk RM 225 MK 3 dan juga subwoofer RM 1283 SB.</p><p></p><p>Di akhir acara, beberapa anggota KS3 melakukan tambahan cek sound yaitu dengan memainkan alat music secara live yaitu organ dan juga kendang, untuk bisa lebih menikmati dan mendemokan speaker Rhyme.</p><p></p><p>“Sinar Baja Electric ternyata membuat produk berupa speaker maupun box desain sendiri, dan di ekspor ke 40 negara. Luar biasa, dan kami baru tahu hari ini. Yang kami harapkan produk dari Sinar Baja ini lebih terkenal lagi. Terima kasih dari pihak Sinar Baja telah membuat kami bertambah pengetahuannya dengan diajak muter-muter ke seluruh pabrik, proses produksinya, dan juga demo produknya ternyata juga luar biasa. Kami anggap sangat luar biasa.”, kata Alpianto, ketua KS3.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08861-1024x683-1746771052743.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08867-1024x683-1746771057723.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08870_1-1024x697-1746771064083.jpg\">', '2023-06-21 17:00:00.000', 'admin', '2025-05-09 06:11:20.475', '2025-07-03 02:17:34.820', '', '', '<p>On June 12, 2023, the Semarang Sound System Community (KS3) visited Sinar Baja Electric for a factory tour and to check out Rhyme Professional Audio sound. KS3 is the oldest community in Semarang city and has up to 50 teams as members.</p><p></p><p>Besides wanting to test the sound of Rhyme speakers, they came to Sinar Baja Electric to learn about the process of making speakers and speaker boxes.</p><p></p><p>“We are very proud that there is a factory producing speakers in Indonesia, especially in Surabaya. If we hadn’t stopped here, we probably wouldn’t have known,” said Catur (Yoyok), one of the KS3 members.</p><p></p><p>KS3 members also listened to demos of Rhyme speakers, including 6 boxes of the Line Array RM 81 LA and 2 boxes of RM 81 FSB. For subwoofers, a custom box with 6 units of 18in double Fabulous 113186 was used. There were also demos of the RM 225 MK 3 and the RM 1283 SB subwoofer.</p><p></p><p>At the end of the event, several KS3 members added a live sound check by playing musical instruments live, such as an organ and drums, to better enjoy and demonstrate the Rhyme speakers.</p><p></p><p>“Sinar Baja Electric actually makes its own speaker and box designs, and exports to 40 countries. It’s amazing, and we only found out today. We hope Sinar Baja’s products become even more well-known. Thank you to Sinar Baja for increasing our knowledge by taking us on a tour around the factory, showing the production process, and the product demos were also extraordinary. We consider this truly remarkable,” said Alpianto, the head of KS3.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08861-1024x683-1746771052743.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08867-1024x683-1746771057723.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT08870_1-1024x697-1746771064083.jpg\">', 'Rhyme Sound Check with KS3', 'rhyme-sound-check-with-ks3'),
('ce044afd-1208-4595-9f4f-cd8dde23ddd8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'KLINIK & PARADE SOUND SYSTEM', 'klinik-parade-sound-system', '<p>KLINIK &amp; PARADE SOUND SYSTEM BERSAMA KOMUNITAS-KOMUNITAS RENTAL TAHUN 2016</p><p></p><p>Perkembangan sound system di Indonesia tidak lepas dari peranan komunitas sound system di daerah-daerah. Melalui event yang diadakan komunitas-komunitas sound system produsen juga antusias untuk turut bergabung dalam mendukung kemajuan sound system dalam negri. Sepanjang tahun 2016, CV Sinar Baja Electric melalui brand <em>ACR</em> dan <em>RHYME Professional Audio</em> melalui komunitas-komunitas sound system: Paguyuban Sound System Jawa Timur, Blora Sound System Community, Semarang Sound System Community, Komunitas Sound System Sragen, Komunitas Sound System Lumajang, Bojonegoro Sound System Community, dll berpartisipasi untuk sharing pengetahuan kami mengenai dunia sound system dengan konsumen produk sound system di berbagai daerah.</p><p></p><p>Antusiasme dan kecintaan para pengunjung dan peserta event terhadap sound system ini juga memacu kami selaku produsen untuk lebih aktif dalam event-event seperti ini kedepannya demi mengedukasi konsumen. Untuk foto-foto event silahkan klik fanpage facebook kami</p><p></p><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/pg/RHYME-Professional-Audio-205885429583828/photos/?tab=album&amp;album_id=624390787733288\">https://www.facebook.com/pg/RHYME-Professional-Audio-205885429583828/photos/?tab=album&amp;album_id=624390787733288</a></p>', '2017-02-19 17:00:00.000', 'admin', '2025-05-09 01:50:14.396', '2025-07-03 03:27:26.790', '', '', '<p>CLINIC &amp; SOUND SYSTEM PARADE WITH RENTAL COMMUNITIES IN 2016</p><p></p><p>The development of sound systems in Indonesia cannot be separated from the role of local sound system communities. Through events organized by these communities, manufacturers are also enthusiastic about joining and supporting the advancement of domestic sound systems. Throughout 2016, CV Sinar Baja Electric through the ACR and RHYME Professional Audio brands participated with various sound system communities such as: Paguyuban Sound System Jawa Timur, Blora Sound System Community, Semarang Sound System Community, Komunitas Sound System Sragen, Komunitas Sound System Lumajang, Bojonegoro Sound System Community, etc., to share our knowledge about the world of sound systems with consumers in various regions.</p><p></p><p>The enthusiasm and passion of visitors and participants in these events for sound systems also encourages us as manufacturers to be more active in such events in the future to help educate consumers. For event photos, please visit our Facebook fanpage:</p><p><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/pg/RHYME-Professional-Audio-205885429583828/photos/?tab=album&amp;album_id=624390787733288\">https://www.facebook.com/pg/RHYME-Professional-Audio-205885429583828/photos/?tab=album&amp;album_id=624390787733288</a></p>', 'SOUND SYSTEM CLINIC & PARADE', 'sound-system-clinic-parade'),
('cf2f72b2-03d2-4d8c-b75f-7545edc16f55', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pesona RM 226 LA dan RM 1283 SB Saat Tes Sound Di Pabrik Sinar Baja Electric Bersama PPSSN Ngawi', 'pesona-rm-226-la-dan-rm-1283-sb-saat-tes-sound-di-pabrik-sinar-baja-electric-bersama-ppssn-ngawi', '<p>Di akhir November 2024 ini, CV. Sinar Baja Electric didatangi oleh komunitas dari Ngawi: Perkumpulan Pengusaha Sound System Ngawi (PPSSN). Sebanyak +- 45 anggota mendatangi pabrik Sinar Baja Electric untuk tur pabrik dan cek sound produk terbaru dari Rhyme: RM 226 LA dan RM 1283 SB.</p><p></p><p>Acara ini diawali dengan cek sound yang berlokasi di area belakang pabrik. Seluruh anggota terlihat antusias dan langsung mendekati lokasi sistem speaker dan amplifier untuk mengetahui lebih jelas mengenai tipe produk yang digunakan. Acara dilanjutkan dengan kalimat pembuka dari tim marketing dan sesi tanya jawab singkat yang dijawab oleh Pak Amirudin dari La Morena. Bapak Hendro Sunjoto juga ikut menghampiri dan mengobrol bersama anggota PPSSN.</p><p></p><p>Tidak lama setelah itu, tim dari Sinar Baja Electric mengajak para anggota PPSSN untuk tur pabrik. Para anggota terlihat antusias saat melihat area yang memproduksi speaker ACR serta perakitan untuk sistem speaker Rhyme. Setelah puas keliling area pabrik, anggota dipersilahkan istirahat dan makan siang, lalu dilanjutkan dengan cek sound serta sesi tanya jawab lagi.</p><p></p><p>Pada puncak acaranya, tim mengadakan doorprize dari lokal brand Sinar Baja Electric seperti ACR, Desibel, Prodigy, hingga Legacy. Tipe-tipe yang dihadiahkan juga bermacam-macam, mulai dari tweeter hingga speaker 18inch.</p><p></p><p>\"Untuk hasilnya dari produk RM 226 LA nih <em>ciamik</em>, kita buat waktu di SMEX, kita buat waktu di Bantengan Tumpang kemarin. Clarity nya oke, kencengnya oke, bentuknya oke. Ini adalah produk terbaru dan terbaik dari Sinar Baja Electric,\" ucap Pak Amirudin dari La Morena</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05739-dengan-teks-1320x880-min-1746781947349.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05713-1320x880-1746781951124.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/y6Y8MsGmTS0?si=7e2OzLthSCDhcNHb\" start=\"0\"></iframe></div>', '2024-12-02 17:00:00.000', 'admin', '2025-05-09 09:11:50.580', '2025-07-03 01:38:17.826', '', '', '<p>At the end of November 2024, CV. Sinar Baja Electric was visited by a community from Ngawi: the Ngawi Sound System Entrepreneurs Association (PPSSN). Around 45 members came to the Sinar Baja Electric factory for a factory tour and to conduct a sound check of Rhyme’s latest products: RM 226 LA and RM 1283 SB.</p><p></p><p>The event began with a sound check held in the back area of the factory. All members were enthusiastic, immediately approaching the speaker and amplifier system area to learn more about the types of products being used. The event continued with opening remarks from the marketing team and a brief Q&amp;A session answered by Mr. Amirudin from La Morena. Mr. Hendro Sunjoto also joined in and had conversations with the PPSSN members.</p><p></p><p>Shortly afterward, the Sinar Baja Electric team invited PPSSN members for a factory tour. Members were excited to see the ACR speaker production area as well as the assembly area for Rhyme speaker systems. After the tour, members were invited to rest and have lunch, followed by another round of sound checking and Q&amp;A.</p><p></p><p>At the peak of the event, the team held a door prize giveaway featuring local brands from Sinar Baja Electric such as ACR, Desibel, Prodigy, and Legacy. The types of prizes varied, ranging from tweeters to 18-inch speakers.</p><p></p><blockquote><p>\"The result from the RM 226 LA product is excellent—we used it at SMEX and also at Bantengan Tumpang recently. The clarity is great, the power is great, the appearance is great. This is the latest and best product from Sinar Baja Electric,\" said Mr. Amirudin from La Morena.</p></blockquote><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05739-dengan-teks-1320x880-min-1746781947349.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT05713-1320x880-1746781951124.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/y6Y8MsGmTS0?si=7e2OzLthSCDhcNHb\" start=\"0\"></iframe></div>', 'The Charm of RM 226 LA and RM 1283 SB During Sound Testing at Sinar Baja Electric Factory with PPSSN Ngawi', 'the-charm-of-rm-226-la-and-rm-1283-sb-during-sound-testing-at-sinar-baja-electric-factory-with-ppssn-ngawi'),
('cf80881e-c822-4bf6-ad56-2d070aac85e3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Gebyar Hadiah SBE Link 2024', 'gebyar-hadiah-sbe-link-2024', '<p>CV. Sinar Baja Electric menggelar hadiah untuk para agen resmi yang menjual produk-produk dari CV. Sinar Baja Electric. Event ini diadakan khusus untuk agen resmi yang sudah terdaftar pada app SBE Link. Dalam SBE Link ini agen resmi bisa mendapatkan informasi mengenai katalog produk (ACR, Legacy, Curve), artikel, serta saldo voucher OB yang dapat diklaimkan berupa nilai tunai.</p><p>Berikut list hadiah yang agen resmi dapatkan dalam event kali ini:</p><p></p><p>Juara I: 4K UHD Smart TV (43 Inch)</p><p>Juara II: Kulkas 2 Pintu</p><p>Juara III: Air Fryer</p><p>Harapan I, II, III: Kipas Angin Ekslusif</p><p></p><p>Untuk mendapatkan hadiah-hadiah diatas, berikut syarat dan ketentuannya:</p><ol><li><p>Toko terdaftar pada app SBE Link dan sudah terverifikasi oleh SBE (Toko yang baru saja bergabung pada SBE Link dapat segera melakukan verifikasi lalu menghubungi admin kami)</p></li><li><p>Total Nilai Voucher OB tertinggi berhak mendapatkan hadiah yang ada</p></li><li><p>Periode perhitungan 1 Mei - 31 Juli 2024</p></li><li><p>Pengumuman pemenang 17 Agustus 2024</p></li><li><p>Pengiriman hadiah akhir Agustus 2024</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/KONSEP-2-Alt-1746775886167.png\"><p></p><p>Pada awal kuartal II tahun 2024 ini, CV. Sinar Baja Electric juga mengadakan event undian yang ditujukan khusus kepada end user di app <strong>MY SBE</strong>. Event tersebut adalah <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.instagram.com/p/C6faceYPXDn/?img_index=1\">Undian Survey Berhadiah</a> yang dilaksanakan pada 2 Mei - 15 Juni 2024.</p>', '2024-05-05 17:00:00.000', 'admin', '2025-05-09 07:31:53.789', '2025-07-03 02:11:04.848', '', '', '<p>CV. Sinar Baja Electric is holding a reward event for official agents who sell products from CV. Sinar Baja Electric. This event is exclusively for verified official agents registered in the SBE Link app. Through the SBE Link, agents can access product catalogs (ACR, Legacy, Curve), articles, and OB voucher balances that can be claimed as cash value.</p><p></p><p>Here are the prizes that official agents can win:</p><ul><li><p>1st Prize: 43” 4K UHD Smart TV</p></li><li><p>2nd Prize: 2-Door Refrigerator</p></li><li><p>3rd Prize: Air Fryer</p></li><li><p>Consolation Prizes (I, II, III): Exclusive Electric Fan</p></li></ul><p></p><p>Terms and Conditions:</p><ol><li><p>The store must be registered and verified in the SBE Link app (Newly joined stores must complete the verification process and contact our admin).</p></li><li><p>The winners will be determined based on the highest total OB voucher value.</p></li><li><p>Calculation period: May 1 – July 31, 2024</p></li><li><p>Winner announcement: August 17, 2024</p></li><li><p>Prize delivery: End of August 2024</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/KONSEP-2-Alt-1746775886167.png\"><p></p><p>At the beginning of Q2 2024, CV. Sinar Baja Electric also held a lucky draw event specifically for end users through the <strong>MY SBE app</strong>. This event, titled \"<a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.instagram.com/p/C6faceYPXDn/?img_index=1\">Undian Survey Berhadiah</a>\" (Survey Lucky Draw), was held from May 2 to June 15, 2024.</p>', 'SBE Link 2024 Grand Prize Giveaway', 'sbe-link-2024-grand-prize-giveaway'),
('cff8126a-3be6-44fe-abfa-f688e33e6e05', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Suroan Kota Gresik oleh Paguyuban Sound System Gresik (PSSG)', 'review-suroan-kota-gresik-oleh-paguyuban-sound-system-gresik-pssg', '<p>Acara Parade Sound System dan Demo Produk yang diselengarakan oleh Paguyuban Sound System Gresik&nbsp;(PSSG) di tahun ini dilaksanakan agak sedikit berbeda karena adanya wabah Corona yang terjadi saat ini. Event berjalan sesuai protokol kesehatan dengan memakai masker dan jaga jarak. Acara&nbsp;ini diadakan sekaligus untuk memperingati moment “Suroan” yang diselengarakan tanggal &nbsp;03 - 04 Oktober 2020&nbsp;yang berlokasi di Lapangan terbuka, di Kecamatan Manyar, Gresik.</p><p></p><p>Acara ini di support oleh beberapa sponsorship, yaitu SPL Audio, Rhyme Profesional Audio, dan JK Coustik serta sponsorship dari beberapa kelas bebas dari komunitas di daerah Gresik. Produk Rhyme yang didemokan RM 103 LA (10in single, 2-way) dan Subwoofer RM 1283 SB (18in double), dengan konfigurasi 6x6 Box. Serta kami menggunakan Amplifier Rhyme R-4500 sebanyak 3pcs untuk meng-drive line array dan Amplifier Rhyme R-7000 sebanyak 6pcs (system Bride) untuk meng-drive subwoofernya.</p><p></p><p>Acara berlangsung lancar di H-1 saat persiapan dan&nbsp;pada hari H pengunjung yang datang sangat berantusias akan tetapi dikarenakan jumlah pengunjung yang membludak sehingga jaga jarak tidak terkontrol sehingga acara tersebut dihentikan oleh pihak Kepolisian. Akan tetapi pembubaran tesebut dilakukan setelah demo produk sponsorship sehingga pengunjung tidak begitu kecewa karena sudah sempat mendengarkan produk-produk unggulan terutama produk milik Rhyme.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_9595-683x1024-1746762708822.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105133-1746762716224.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_9593-1024x683-1746762720775.jpg\">', '2020-11-11 17:00:00.000', 'admin', '2025-05-09 03:52:10.145', '2025-07-03 03:17:25.631', '', '', '<p>The Sound System Parade and Product Demo event organized by the Gresik Sound System Community (PSSG) this year was held a bit differently due to the ongoing COVID-19 pandemic. The event followed health protocols, including wearing masks and maintaining physical distance. It was also held to commemorate the “Suroan” moment on October 3–4, 2020, at an open field in the Manyar District, Gresik.</p><p></p><p>The event was supported by several sponsors: SPL Audio, Rhyme Professional Audio, and JK Coustik, along with additional sponsors from various open classes within the Gresik community. The Rhyme products demoed included the RM 103 LA (10in single, 2-way) and the RM 1283 SB (18in double) subwoofer, in a 6x6 box configuration. We used three Rhyme R-4500 amplifiers to power the line array and six Rhyme R-7000 amplifiers (bridged system) to drive the subwoofers.</p><p></p><p>The event ran smoothly during the preparation day (H-1), and on the main day, visitor turnout was very enthusiastic. However, due to an overwhelming crowd, social distancing could no longer be maintained, leading the police to shut down the event. Nonetheless, the dispersal occurred after the sponsor product demos had concluded, so visitors were not too disappointed as they had already experienced the highlight products, particularly those from Rhyme.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_9595-683x1024-1746762708822.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105133-1746762716224.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MG_9593-1024x683-1746762720775.jpg\">', 'Review – Suroan Gresik City Event by Gresik Sound System Community (PSSG)', 'review-suroan-gresik-city-event-by-gresik-sound-system-community-pssg'),
('d0ff061f-dc3f-4796-a054-7b13d118de9d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Kunjungan Pabrik Komunitas Probolinggo', 'review-kunjungan-pabrik-komunitas-probolinggo', '<p>Dalam rangka tetap menjalin silahturahmi dengan komunitas pecinta sound system di masa pandemi, CV Sinar Baja Electric dengan terbuka menyambut kunjungan dari Komunitas Probolinggo yang diadakan pada tanggal 13 Oktober 2021. Karena masih kondisi pandemi, kami juga tetap melaksanakan protokol kesehatan seperti memakai masker dan face shield, mencuci tangan sebelum memasuki area pabrik, memakai hand sanitizer, serta kami menyediakan swab antigen sebelum memasuki area pabrik.</p><p></p><p>Pada acara ini komunitas probolinggo dapat melihat demo line array Tipe RM 126 LA sebanyak 4 Box dan subwoofer RM 1283 SB sebanyak 4 box. Kami juga melakukan perkenalan produk baru line array yaitu tipe RM 81 LA dan RM 151 FSB. Dan juga, teman – teman Komunitas Probolinggo sangat antusias untuk berkeliling area pabrik, mulai dari produksi pembuatan box, chasis, hingga perakitan komponen speaker.</p><p></p><p>Kami juga membuka bazar yang menjual driver speaker ACR series dan speaker export, mulai dari komponen speaker hingga speaker monitor. Temen - temen Komunitas Probolinggo kami berikan doorprize dengan 3 hadiah yaitu speaker terbaru 15600+ , Speaker Rhyme MP-1, serta CD44 Desibel.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00491-1024x683-1746763050377.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00504-1024x683-1746763055889.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105709-1746763063755.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00505-1024x683-1746763071031.jpg\">', '2021-11-17 17:00:00.000', 'admin', '2025-05-09 03:58:01.585', '2025-07-03 03:16:39.000', '', '', '<p>In order to maintain good relations with the sound system enthusiast community during the pandemic, CV Sinar Baja Electric warmly welcomed a visit from the Probolinggo Community, held on October 13, 2021. As the pandemic was still ongoing, health protocols were strictly followed, including wearing masks and face shields, washing hands before entering the factory area, using hand sanitizer, and providing antigen swab tests before entry.</p><p></p><p>During the event, the Probolinggo community was able to witness a demo of the RM 126 LA line array (4 boxes) and RM 1283 SB subwoofers (4 boxes). We also introduced new line array products: the RM 81 LA and RM 151 FSB models. The Probolinggo community members were highly enthusiastic about touring the factory, exploring the box manufacturing area, chassis production, and speaker component assembly.</p><p></p><p>We also hosted a bazaar selling ACR Series speaker drivers and export speakers, ranging from speaker components to monitor speakers. As a gesture of appreciation, we provided door prizes to the Probolinggo Community, including three gifts: the newest 15600+ speaker, the Rhyme MP-1 speaker, and the CD44 Desibel.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00491-1024x683-1746763050377.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00504-1024x683-1746763055889.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 105709-1746763063755.png\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/DSC00505-1024x683-1746763071031.jpg\">', 'Review – Factory Visit by the Probolinggo Community', 'review-factory-visit-by-the-probolinggo-community'),
('dae7f5b9-4b4b-4891-ac0f-a7c417d96fd4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - EXPO & BAZAR SYURONAN PATI 2019', 'review-expo-bazar-syuronan-pati-2019', '<p>Event yang diadakan oleh Komunitas Sound System di daerah Pati, merupakan event rutin setiap tahun yang telah berjalan ke-2 kali. Event tersebut terselenggara dengan baik karena support penuh oleh Toko Son’s Audio (Toko Distributor ACR) dan dibantu oleh temen-temen Komuitas.</p><p></p><p>Event ini diadakan pada tanggal&nbsp; 20 – 22 September 2019 di Lapangan Desa Pekuwon, Kec. Juwingan, Kab. Pati, Jawa Tengah. Event pada Tahun ini bisa dibilang lebih ramai oleh peserta dan sponsorship yang ikut berpartisipasi dibanding pada tahun lalu, ditambah pengunjung dari warga sekitar juga ikut memeriahkan event sound system baik dari Demo Line Array maupun Stand Bazar.</p><p></p><p>Kami sebagai salah satu partisipan yang ikut mendukung event ini, dengan mendemokan speaker Line Array yaitu tipe RM 103 LA (10in double, 2-way) dengan Subwoofernya RM 1283 SB (18in double) serta Stand Bazar untuk speaker driver dari produk ACR (Fabulous, Excellent, Premier, Deluxe)</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pati-01-1024x498-1746761932883.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 103539-min-1746761936631.png\">', '2019-09-30 17:00:00.000', 'admin', '2025-05-09 03:38:59.272', '2025-07-03 03:19:44.588', '', '', '<p>The event organized by the Sound System Community in the Pati area, Central Java, is an annual agenda that has entered its second year. The event was successfully held thanks to the full support of Toko Son’s Audio (official ACR distributor in the region), along with assistance from fellow community members who actively contributed to the preparation and execution.</p><p></p><p>The event took place over three days, from September 20 – 22, 2019, at Pekuwon Village Field, Juwana District, Pati Regency, Central Java. Compared to the previous year, the number of participants and sponsors involved increased significantly. Local community enthusiasm was also very high, as seen from the large number of visitors attending both the Line Array demo and the available bazaar stands.</p><p></p><p>We took part in this event as one of the sponsors and participants, showcasing our flagship products such as the RM 103 LA Line Array (10 inch double, 2-way) and the RM 1283 SB Subwoofer (18 inch double). Additionally, we opened a bazaar stand featuring various ACR speaker driver variants such as Fabulous, Excellent, Premier, and Deluxe.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Pati-01-1024x498-1746761932883.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 103539-min-1746761936631.png\">', 'Review – Syuronan Expo & Bazaar Pati 2019', 'review-syuronan-expo-bazaar-pati-2019'),
('db43cd12-32f3-4236-a9a3-d93ba0f5b222', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Langkah Mengikuti Undian Poin My SBE', 'langkah-mengikuti-undian-poin-my-sbe', '<p>Setelah keberhasilan acara Undian Poin My SBE 2023, event ini akan diadakan setiap tahun oleh tim ACR. Event ini diperuntukkan kepada konsumen lama dan konsumen baru jika membeli produk ACR, Legacy, Curve berdasarkan periode yang ditetapkan, maka bisa mendapatkan hadiah. Hadiah tersebut didapat dari poin-poin yang sudah dikumpulkan dengan cara sebagai berikut:</p><p></p><ul><li><p>Download app My SBE pada Play Store, lalu registrasi terlebih dahulu. Berikut <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\">link app My SBE</a></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1734395172735.jpg\"></li><li><p>Pada halaman Beranda klik “Pindai” dan scan QR-Code yang ada pada speaker ACR. QR-Code biasanya terletak pada magnet atau yoke speaker</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-1734395208222.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1734395221064.jpg\"></li><li><p>Lalu pilih toko pembelian</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-768x1511-1734395255184.jpg\"></li><li><p>Setelah memilih toko, maka akan muncul pop up message bahwa poin berhasil didapatkan. Banyaknya poin tergantung dari ukuran dan tipe speaker</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1734395288378.jpeg\"></li><li><p>Jika QR Barcode sudah pernah discan sebelumnya maka akan muncul pop up message yang menyatakan voucher gagal di-scan</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1734395317133.jpg\"></li><li><p>Poin yang berhasil didapatkan akan tersimpan pada “Poin Anda” di halaman Beranda. Untuk melihat riwayat scan, langsung klik pada kolom “Poin Anda”</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1692938364-1734395340644.jpg\"></li></ul>', '2024-04-02 17:00:00.000', 'admin', '2024-12-17 00:29:17.488', '2025-07-03 02:11:57.169', '-', '-', '<p>After the success of the My SBE Points Lottery Event in 2023, this event will be held annually by the ACR team. This event is intended for both existing and new customers—if they purchase ACR, Legacy, or Curve products during the specified period, they can receive prizes. These prizes are obtained from points that have been collected in the following way:</p><p></p><ul><li><p>Download the My SBE app from the Play Store, then register first. Here is the link to the <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://play.google.com/store/apps/details?id=id.sbe.mysbe.customer&amp;hl=id\">My SBE app.</a></p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/App-My-SBE-di-Playstore-1734395172735.jpg\"><ul><li><p>On the Home page, click “Pindai” and scan the QR Code located on the ACR speaker. The QR Code is usually found on the magnet or the yoke of the speaker.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693810641-1-1734395208222.jpeg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/z1-1734395221064.jpg\"></li><li><p>Then select the store</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot_2023_09_04_13_29_00_671_id_gits_sinarbajaelectric_customer-768x1511-1734395255184.jpg\"></li><li><p>After selecting the store, a pop-up message will appear indicating that the points have been successfully earned. The number of points depends on the size and type of the speaker.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo16938095671-1734395288378.jpeg\"></li><li><p>If the QR barcode has been scanned before, a pop-up message will appear stating that the voucher scan has failed.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1693809567-1734395317133.jpg\"></li><li><p>The points successfully earned will be saved under “Poin Anda” on the Home page. To view your scan history, simply click on the “Poin Anda” section.</p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1692938364-1734395340644.jpg\"></li></ul>', 'Steps to Join the My SBE Points Raffle', 'steps-to-join-the-my-sbe-points-raffle'),
('dc38b661-a741-4ed1-84f7-8bcbcb3790f9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Perkenalan Produk Terbaru ACR Series (Fabulous & Excellent) di Syawalan Jogja 2023', 'perkenalan-produk-terbaru-acr-series-fabulous-excellent-di-syawalan-jogja-2023', '<p>Komunitas Sound System Jogja mengadakan pameran yang berlangsung selama 2 hari, yakni 27 dan 28 Mei 2023. Beberapa sponsor hadir untuk memeriahkan acara yang digelar ini. Sinar Baja Electric pun hadir dengan membawa beberapa produk-produknya yang membuat pengunjung antusias saat berkunjung ke booth. Berikut list produknya:</p><p></p><ul><li><p>18in 113188</p></li></ul><p></p><p>Speaker dengan double magnet ini merupakan produk terbaru dari Sinar Baja Electric. Speaker tipe Subwoofer ini mempunyai nominal power handling 1900 watt dan program power 3800 watt. Speaker ini juga memiliki double demper yang mampu menghasilkan respon frekuensi yang lebih rendah.</p><p></p><ul><li><p>10in 75105</p></li></ul><p></p><p>Produk yang release pada bulan Juli 2022 ini merupakan speaker Woofer. Tipe ini mempunyai nominal power handling 300 watt dan program power 600 watt. Tambahan damping glue pada surround cloth M-typenya, mampu menghasilkan respon frekuensi yang lebih halus.</p><p></p><ul><li><p>6in 1550</p></li></ul><p></p><p>Produk ini juga release pada bulan Juli 2022 bersamaan dengan 10in 75105. Speaker tipe Midrange ini mempunyai nominal power handling 200 watt dan program power 400 watt. Speaker dengan down roll surround dengan penambahan damping glue yang mampu menghasilkan respon frekuensi midrange</p><p></p><ul><li><p>10in 1880 MK3 Excel</p></li></ul><p></p><p>Speaker dengan tipe Woofer yang memiliki nominal power handling 200 watt dan program power 400 watt. Speaker ini memiliki daya magnet yang optimal yang didapat dari desain motor yang melalui hasil pengukuran FEA (Finite Element Analysis).</p><p></p><ul><li><p>12in 12880 MK3 Excel.</p></li></ul><p></p><p>Speaker Woofer ini memiliki spesifikasi hampir sama dengan tipe 1880. Speaker dengan conepaper weather resistance ini mempunyai nominal power handling 250 watt dan program power 500 watt. Speaker ini cocok diaplikasikan untuk indoor maupun outdoor.</p><p></p><ul><li><p>18in 188127 Excel</p></li></ul><p></p><p>Speaker dengan tipe Subwoofer ini memiliki voice coil yang mampu bertahan pada power handling tinggi. Speaker ini memiliki nominal power handling 1000 watt dan program power 2000 watt.</p><p></p><p>Antusias para pecinta ACR semakin meningkat saat mereka banyak melakukan down payment hingga membayar lunas pada produk-produk ini. Mereka juga berharap Sinar Baja Electric akan terus melakukan inovasi terhadap produk barunya, dan selalu bersaing dengan produk-produk dari luar negeri.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/produk-baru-di-Syawalan-Jogja_1-1746770895613.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/produk-baru-di-Syawalan-Jogja-1746770902870.jpg\">', '2023-06-06 17:00:00.000', 'admin', '2025-05-09 06:08:25.875', '2025-07-03 02:18:28.645', '', '', '<p>The Jogja Sound System Community held an exhibition for 2 days, on May 27 and 28, 2023. Several sponsors participated to enliven the event. Sinar Baja Electric also attended, bringing several of its products that attracted great enthusiasm from visitors at the booth. Here is the list of products:</p><p></p><ul><li><p>18in 113188</p><p>This speaker with a double magnet is the latest product from Sinar Baja Electric. This subwoofer type speaker has a nominal power handling of 1900 watts and a program power of 3800 watts. It also features a double damper capable of producing a lower frequency response.</p></li><li><p>10in 75105<br>Released in July 2022, this is a woofer type speaker. It has a nominal power handling of 300 watts and a program power of 600 watts. The addition of damping glue on the surround cloth M-type enables a smoother frequency response.</p></li><li><p>6in 1550<br>Also released in July 2022 alongside the 10in 75105, this midrange type speaker has a nominal power handling of 200 watts and a program power of 400 watts. It features a down roll surround with added damping glue that produces a midrange frequency response.</p></li><li><p>10in 1880 MK3 Excel<br>This woofer type speaker has a nominal power handling of 200 watts and a program power of 400 watts. It has optimal magnet power obtained through a motor design measured by FEA (Finite Element Analysis).</p></li><li><p>12in 12880 MK3 Excel<br>This woofer speaker has similar specifications to the 1880 type. Featuring weather-resistant conepaper, it has a nominal power handling of 250 watts and a program power of 500 watts. It is suitable for both indoor and outdoor applications.</p></li><li><p>18in 188127 Excel<br>This subwoofer type speaker has a voice coil capable of handling high power. It has a nominal power handling of 1000 watts and a program power of 2000 watts.</p></li></ul><p></p><p>The enthusiasm of ACR lovers increased as many made down payments and fully paid for these products. They also hope Sinar Baja Electric will continue innovating new products and remain competitive with foreign brands.</p><p></p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/produk-baru-di-Syawalan-Jogja_1-1746770895613.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/produk-baru-di-Syawalan-Jogja-1746770902870.jpg\">', 'Introduction of the Latest ACR Series Products (Fabulous & Excellent) at Syawalan Jogja 2023', 'introduction-of-the-latest-acr-series-products-fabulous-excellent-at-syawalan-jogja-2023'),
('e0d0b3c9-242a-4ce0-b503-6124fef487aa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR Jingle Competition 2024', 'acr-jingle-competition-2024', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Cover-jingle2-1-1024x1024-1746775134408.png\"><p></p><p>Di awal tahun 2024 ini, ACR membagi-bagikan THR dengan mengadakan ACR Jingle Competition. Kompetisi ini dibuat agar para Pecinta ACR dapat meremix lagu kesukaan mereka yang nantinya akan dimainkan oleh tim ACR saat melakukan demo di pameran-pameran</p><p></p><p>Berikut syarat dan ketentuannya:</p><p>·&nbsp; Tema video:</p><ol><li><p>DJ Remix Lagu Bebas (pop, dangdut,<br>keroncong, seruling, rock, pop rap, dll)</p></li><li><p>Video berisi logo Jingle &amp;<br>produk/event yang berkaitan dengan ACR</p></li><li><p>Durasi video minimum 4 menit</p></li></ol><p>·&nbsp; Dalam remix lagu terdapat kata-kata ACR SPEAKER (boleh dilettakn di awal, tengah, hingga akhir video)</p><p>·&nbsp; Video di-upload pada YouTube pribadi masing-masing peserta pada tanggal yang ditentukan</p><p>·&nbsp; Penilaian berdasarkan dari jumlah viewer video yang di-upload</p><p>·&nbsp; Format judul video: Jingle ACR - Nama Peserta. (Contoh: Jingle ACR - Sinarbaja)</p><p></p><p>*Jika tidak mengikuti salah satu ketentuan yang disebutkan maka peserta akan gugur</p><p>Setiap peserta yang mengikuti lomba ACR Jingle Competition akan mendapatkan sertifikat dan merchandise eksklusif dari ACR. Berikut hadiah untuk para pemenang:</p><p>JUARA 1: Rp 2.000.000,-</p><p>JUARA 2: Rp 1.500.000,-</p><p>JUARA 3: Rp 1.000.000,-</p><p>HARAPAN 1: Rp 500.000,-</p><p>HARAPAN 2: Rp 350.000,-</p><p>HARAPAN 3: Rp 250.000,-</p><p></p><p>Waktu upload video tgl 16-31 Maret 2014 dan dengan mengisi google form pendaftaran (<a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://forms.gle/WV8AFqdAq7wah17a8\">link</a>). Tim ACR akan melakukan penilaian pada 1 April 2024 dan pemenang akan diumumkan pada 3 Maret 2024</p>', '2024-02-25 17:00:00.000', 'admin', '2025-05-09 07:23:49.576', '2025-07-03 02:12:29.094', '', '', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Cover-jingle2-1-1024x1024-1746775134408.png\"><p></p><p>At the beginning of 2024, ACR distributed THR by holding the ACR Jingle Competition. This competition was created so that ACR lovers could remix their favorite songs which would later be played by the ACR team during demos at exhibitions.</p><p></p><p>Here are the terms and conditions:</p><ul><li><p>Video theme:</p><ol><li><p>DJ Remix of any genre (pop, dangdut, keroncong, flute, rock, pop rap, etc.)</p></li><li><p>The video must contain the Jingle logo &amp; products/events related to ACR</p></li><li><p>Minimum video duration is 4 minutes</p></li></ol></li><li><p>The remix must include the words ACR SPEAKER (can be placed at the beginning, middle, or end of the video)</p></li><li><p>The video must be uploaded on each participant’s personal YouTube channel on the specified dates</p></li><li><p>Judging is based on the number of video views uploaded</p></li><li><p>Video title format: Jingle ACR - Participant Name. (Example: Jingle ACR - Sinarbaja)</p></li></ul><p>*If one of the requirements mentioned is not followed, the participant will be disqualified</p><p></p><p>Each participant in the ACR Jingle Competition will receive a certificate and exclusive merchandise from ACR. Here are the prizes for the winners:</p><p>1st PLACE: Rp 2,000,000</p><p>2nd PLACE: Rp 1,500,000</p><p>3rd PLACE: Rp 1,000,000</p><p>CONSOLATION 1: Rp 500,000</p><p>CONSOLATION 2: Rp 350,000</p><p>CONSOLATION 3: Rp 250,000</p><p></p><p>Video upload period is March 16–31, 2014 and by filling out the registration Google Form (<a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://docs.google.com/forms/d/e/1FAIpQLSfjxMsDXw3kQsBHWskacsBOcTjhpaEvepcucFE9cgk9QeKMKA/viewform\">link</a>). The ACR team will carry out the judging on April 1, 2024, and the winners will be announced on April 3, 2024.</p>', 'ACR Jingle Competition 2024', 'acr-jingle-competition-2024'),
('e23fee2c-8a5b-491d-a5b7-0d04f8e5510f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Review - Parade Syawalan Sound System Yogyakarta', 'review-parade-syawalan-sound-system-yogyakarta', '<p>Event yang diadakan oleh Komunitas Sound System Yogyakarta ini bertemakan Ajang Silaturahmi dan Nostalgia Bareng Konco Audio.&nbsp; Konsep acara tersebut masih dengan tahun lalu yaitu lomba Fun SPL, demo produk dari komunitas , bazar produk dari sponsor dan panggung hiburan. Produk kita (RHYME) mendemokan produk line array RM 103 LA dan &nbsp;Subwoofer RM 1283 SB dengan konfigurasi&nbsp; 6x4 Box. Sponsor demo Line Array total berjumlah 15 sponsor yang ikut, yaitu diantaranya : RHYME, Trendy Audio, RDW, Sound Queen, Turbosound, Huper, GNA Music, N9 , Biema, Best, Wisdom, SPL Audio, JK Coustik dan Martin Coustik.</p><p></p><p>Pada acara bazar pengunjung sudah merasa antusias dengan adanya pameran Syawalan ini, untuk tahun ini bisa dikatakan meningkat baik dari pengunjung dan hasil penjualan driver speakernya. Produk yang laku terjual seperti 10in 2560, 12in (3060, 75125), 18in (100182, 127187, 113182), CD 4 dan 4B Excellent, serta Produk PRODIGY&nbsp; 15in (15600, 15900), 18in 18900 dan produk lainnya seperti 18in Deluxe, 18 Premier, 18in Excellent. Stand bazar lain yang ikut dalam bazar kurang lebih ada 30 stand yang datang dari Elmora Rosok, RDW, Sound Queen, Ashley, Angkasa Bandung, SPL, JK Coustic, CAF, Turbosound, Melodia Jogja, Kairos, Best Audio, JIC Fatur dan stand Lighting serta toko-toko di sekitar Yogyakarta.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-1-e1562840786305-1746760507385.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-2-e1562840714719-1746760521060.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-4-e1562840222995-1746760525936.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-5-e1562840163403-1746760531558.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-3-e1562840254629-1746760538829.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-9-e1562838835596-1746760543171.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-6-e1562840100545-1746760547925.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-12-e1562839850527-1746760553543.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-13-e1562839835583-1746760558606.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-11-e1562839883196-1746760564843.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-7-e1562815074590-1746760569044.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-15-e1562839766280-1746760572996.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-16-e1562840866238-1746760577681.jpg\">', '2019-07-05 17:00:00.000', 'admin', '2025-05-09 03:16:42.742', '2025-07-03 03:22:38.820', '', '', '<p>The event organized by the Yogyakarta Sound System Community carried the theme “Gathering and Nostalgia with Audio Friends.” The concept remained the same as the previous year, featuring a Fun SPL competition, product demos by the community, sponsor product bazaars, and entertainment stage shows. Our brand (RHYME) showcased the Line Array RM 103 LA and Subwoofer RM 1283 SB with a 6x4 box configuration. A total of 15 sponsors participated in the Line Array demo, including: RHYME, Trendy Audio, RDW, Sound Queen, Turbosound, Huper, GNA Music, N9, Biema, Best, Wisdom, SPL Audio, JK Coustik, and Martin Coustik.</p><p></p><p>At the bazaar, visitors were very enthusiastic about the Syawalan exhibition. This year showed improvement both in terms of visitor numbers and speaker driver sales. The best-selling products included 10in 2560, 12in (3060, 75125), 18in (100182, 127187, 113182), CD 4 and 4B Excellent, and PRODIGY Series 15in (15600, 15900), 18in 18900, along with other products like 18in Deluxe, 18in Premier, and 18in Excellent. Around 30 other bazaar stands also participated, including Elmora Rosok, RDW, Sound Queen, Ashley, Angkasa Bandung, SPL, JK Coustic, CAF, Turbosound, Melodia Jogja, Kairos, Best Audio, JIC Fatur, lighting stands, and local stores from the Yogyakarta area.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-1-e1562840786305-1746760507385.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-2-e1562840714719-1746760521060.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-4-e1562840222995-1746760525936.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-5-e1562840163403-1746760531558.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-3-e1562840254629-1746760538829.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-9-e1562838835596-1746760543171.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-6-e1562840100545-1746760547925.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-12-e1562839850527-1746760553543.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-13-e1562839835583-1746760558606.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-11-e1562839883196-1746760564843.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-7-e1562815074590-1746760569044.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-15-e1562839766280-1746760572996.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/SMEX-19-16-e1562840866238-1746760577681.jpg\">', 'Review – Syawalan Sound System Parade Yogyakarta', 'review-syawalan-sound-system-parade-yogyakarta'),
('e26f4597-57f9-4b76-9d58-a2c399779490', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Isi Survey dan Dapatkan Speakernya!', 'isi-survey-dan-dapatkan-speakernya', '<p>Dalam rangka untuk meningkatkan kepuasan pelanggan, tim ACR mengajak para pelanggan untuk membantu mengisi survey. Survey tersebut bisa didapatkan dalam app My SBE. Selain mengisi survey, pelanggan juga bisa mendapatkan kesempatan untuk memenangkan hadiah menarik dari ACR. Berikut daftar hadiahnya:</p><p></p><p>Pemenang I : 18in 100182 Mk3 Fab</p><p>Pemenang II: 15in 381006 Desibel</p><p>Pemenang III: 15in 15600 Hitam</p><p>Pemenang IV - XI: 12in ACR-1230 Hitam</p><p>Pemenang XII - XXXV : Sepasang 6in 638 Curve</p><p></p><p>Berikut cara mengikuti survey ini:</p><ol><li><p>Isi survei pada Google Form dengan mengklik banner dalam App My SBE</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1714707872-1746775742265.jpeg\"><ol start=\"2\"><li><p>Setelah mengisi Pengundian dilakukan secara acak</p></li><li><p>Event berlangsung: 2 Mei - 15 Juni 2024</p></li><li><p>Pemenang akan diumumkan di sosmed ACR &amp; aplikasi MySBE pada 21 Juni 2024</p></li><li><p>Pengiriman Hadiah: akhir Juni 2024</p></li></ol><p>Informasi selengkapnya dapat dilihat dalam <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.instagram.com/p/C6faceYPXDn/?img_index=1\">Instagram ACR</a></p>', '2024-05-02 17:00:00.000', 'admin', '2025-05-09 07:29:54.235', '2025-07-03 03:31:05.738', '', '', '<p>As part of its commitment to improving customer satisfaction, the ACR team invited customers to participate in a survey available through the My SBE app. In addition to providing valuable feedback, participants also had the chance to win exciting prizes from ACR. Here’s the list of prizes:</p><p>Prize List:</p><ul><li><p>1st Winner: 18in 100182 Mk3 Fab</p></li><li><p>2nd Winner: 15in 381006 Desibel</p></li><li><p>3rd Winner: 15in 15600 Black</p></li><li><p>4th – 11th Winners: 12in ACR-1230 Black</p></li><li><p>12th – 35th Winners: A pair of 6in 638 Curve</p></li></ul><p>How to join the survey:</p><ol><li><p>Fill out the Google Form by clicking the survey banner inside the My SBE App.</p></li></ol><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/photo1714707872-1746775742265.jpeg\"><ol start=\"2\"><li><p>After completing the survey, winners were selected randomly.</p></li><li><p>Event period: May 2 – June 15, 2024</p></li><li><p>Winners announcement: June 21, 2024 on ACR\'s social media and in the My SBE app</p></li><li><p>Prize delivery: End of June 2024</p><p></p></li></ol><p>For more information, please visit <a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.instagram.com/p/C6faceYPXDn/?img_index=1\">ACR’s official Instagram</a> page.</p>', 'Fill Out the Survey and Get a Free Speaker!', 'fill-out-the-survey-and-get-a-free-speaker');
INSERT INTO `news` (`id`, `brandId`, `title`, `slug`, `description`, `event_date`, `updatedBy`, `createdAt`, `updatedAt`, `link_placeholder`, `link_url`, `description_english`, `title_english`, `slug_english`) VALUES
('e2e93c39-95db-4f19-b80e-67775e8204b2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL DI ACARA PARADE SOUND #8 PSTT', 'acr-rhyme-desibel-di-acara-parade-sound-8-pstt', '<p>Parade Sound ke-8 di Tulungagung Timur ini kembali diadakan pada awal bulan Mei 2025 yang diadakan di Lapangan Desa Pulotondo Tulungagung, Jawa Timur. Acara ini dihadiri oleh para brand-brand ternama dari luar negeri hingga luar negeri. ACR Rhyme Desibel dari Sinar Baja Electric menjadi salah satau brand dalam negeri yang mengunjungi parade tersebut.</p><p></p><p>Pada lapak, ACR dan Desibel membawa driver-driver andalan dan baru saja rilis di tahun ini. ACR Fabulous membawa CD440PK1B-08F Fab, 6in ARRAY 5061 M Fab, 10in 75105 Fab, 18in PA-113188 SW Fab, 18in PA-127188 SW Fab, hingga 21in PA-127212 SW Fab. Excellent Series by ACR Speaker membawa 18in PA-188127 Excel. Deluxe Series by ACR Speaker membawa 18in 18710 DLX. ACR Black Series membawa 10in ACR -10500 BLACK hingga 18in ACR-18100 BLACK. Desibel speaker membawa CD 34 DESIBEL hingga 18in 451006-Mk1 DESIBEL.</p><p></p><p>Di area demo, Rhyme menampilkan Line Array unggulannya, yaitu RM 126 LA yang direnteng sebanyak 6 box, untuk subwoofernya khusus di parade sound ini menggunakan 4 box RM 1182 SB dan 6 box custom paraflex yang masing-masing berisi 18in PA-113188 SW. Untuk tweeter dan mid nya didrive dengan amplifier R4500, midlownya menggunakan amplifier R7000, dan subwoofernya menggunakan amplifier R17000. Bekerja sama dengan Amir dari La Morena, tampilan Rhyme memukau setiap pengunjung yang datang.</p><p></p><p>Tim juga menemukan beberapa pengguna ACR Speaker baik pengunjung dan peserta lomba di acara tersebut. “Menggunakan produknya Sinar Baja itu, kalau pertama kali dilihat sama orang rasanya wah gitu, jadi ada kayak kebanggaan tersendiri. Kalau dari segi suaranya konsisten lah sama suaranya.“ ucap Bagas Dwi, salah satu pengunjung yang menggunakan speaker ACR Speaker.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lf0vtFZxo-s?si=h9Ihzc5NVH1IcVtf\" start=\"0\"></iframe></div>', '2025-05-28 07:00:00.000', 'admin', '2025-07-11 16:22:28.272', '2025-07-15 01:08:37.132', '', '', '<p>The 8th Sound Parade in East Tulungagung was once again held in early May 2025 at the Pulotondo Village Field, Tulungagung, East Java. This event was attended by well-known brands from both domestic and international markets. ACR Rhyme Desibel from Sinar Baja Electric was one of the local brands that joined the parade.</p><p></p><p>At the booth, ACR and Desibel showcased their flagship and newly released drivers for the year. ACR Fabulous presented CD440PK1B-08F Fab, 6in ARRAY 5061 M Fab, 10in 75105 Fab, 18in PA-113188 SW Fab, 18in PA-127188 SW Fab, and 21in PA-127212 SW Fab. The Excellent Series by ACR Speaker featured 18in PA-188127 Excel. The Deluxe Series by ACR Speaker showcased 18in 18710 DLX. The ACR Black Series included 10in ACR-10500 BLACK up to 18in ACR-18100 BLACK. Desibel speaker displayed products from CD 34 DESIBEL to 18in 451006-Mk1 DESIBEL.</p><p></p><p>In the demo area, Rhyme presented its flagship Line Array, the RM 126 LA, arranged in 6 boxes. For the subwoofer section, specifically for this sound parade, they used 4 RM 1182 SB boxes and 6 custom paraflex boxes, each containing an 18in PA-113188 SW. The tweeter and mid were driven with R4500 amplifiers, mid-low with R7000, and the subwoofer with R17000. Collaborating with Amir from La Morena, Rhyme’s setup impressed every visitor who attended.</p><p></p><p>The team also encountered several ACR Speaker users, both visitors and competition participants at the event.</p><blockquote><p>“Using Sinar Baja’s products—when people see them for the first time, it feels impressive, so there’s a sense of pride. In terms of sound, it’s consistent,” said Bagas Dwi, one of the visitors who uses ACR Speaker products.</p></blockquote><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/lf0vtFZxo-s?si=h9Ihzc5NVH1IcVtf\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL AT THE PARADE SOUND EVENT #8 PSTT', 'acr-rhyme-desibel-at-the-parade-sound-event-8-pstt'),
('e351045a-59e5-4693-b225-3523f6e09101', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Grand Launching RHYME', 'grand-launching-rhyme', '<p><strong>Dapatkan undangannya dan Hadiri Launching 3 tipe baru dari RHYME :</strong></p><ul><li><p>tanggal :&nbsp;<strong>21 Mei 2014</strong></p></li><li><p>pukul &nbsp; &nbsp;:&nbsp;<strong>09.00 – selesai</strong></p></li><li><p>tempat &nbsp;:&nbsp;<strong>CV. Sinar Baja Electric, Jl. Margomulyo No.5, Surabaya</strong></p></li></ul><p><em>*untuk mendapatkan undangan, silahkan inbox ke&nbsp;</em><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/acrspeakers\"><em>https://www.facebook.com/acrspeakers</em></a></p><p><strong>Susunan Acara :</strong></p><ul><li><p>Seminar dengan judul&nbsp;<strong><em>“Setting Speaker dengan Smaart Live Software”</em></strong></p></li><li><p>Makan Siang</p></li><li><p>Demo 3 tipe baru dari RHYME ;&nbsp;<strong><em>RM 102 LA, RM 2252 SB, RM 1282 SB</em></strong></p></li><li><p>Penjualan ACR dan RHYME dengan&nbsp;<strong><em>HARGA PROMO</em></strong></p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-undangan-grand-launching-RHYME-1746754204317.jpg\">', '2014-05-09 17:00:00.000', 'admin', '2025-05-09 01:30:06.345', '2025-07-03 03:29:03.970', '', '', '<p><strong>Get your invitation and attend the Launching of 3 new types from RHYME:</strong></p><ul><li><p><strong>Date:</strong> May 21, 2014</p></li><li><p><strong>Time:</strong> 09.00 – finish</p></li><li><p><strong>Location:</strong> CV. Sinar Baja Electric, Jl. Margomulyo No.5, Surabaya</p></li></ul><p><em>To get an invitation, please inbox at: </em><a target=\"_blank\" rel=\"noopener noreferrer nofollow\" href=\"https://www.facebook.com/acrspeakers\"><em>https://www.facebook.com/acrspeakers</em></a></p><p></p><p><strong>Event Schedule:</strong></p><ul><li><p>Seminar titled <strong>“Speaker Setting with Smaart Live Software”</strong></p></li><li><p>Lunch</p></li><li><p>Demo of 3 new RHYME models: <strong>RM 102 LA, RM 2252 SB, RM 1282 SB</strong></p></li><li><p><strong>ACR and RHYME product sales at PROMO PRICES</strong></p></li></ul><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/sample-undangan-grand-launching-RHYME-1746754204317.jpg\">', 'Grand Launching RHYME', 'grand-launching-rhyme'),
('ef063af9-d4d5-42d5-9255-4270089c599c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Syawalan Komunitas Rental Sound System Yogyakarta 2018', 'syawalan-komunitas-rental-sound-system-yogyakarta-2018', '<p>“Syawalan Komunitas Rental Sound System Yogyakarta, Parade Sound &amp; Bazar 2018” merupakan Event yang diadakan oleh Komunitas Sound System Yogyakarta, bertemakan Ajang Silaturahmi dengan Konsep Acara; Lomba Fun SPL dari komunitas Rental Sound System sekitar, Demo Line Array dan Bazar Produk dari berbagai Sponsor, dan Panggung Hiburan Artis Daerah.</p><p></p><p>Stand bazar Kami mendemokan Ground Stage RM 103 LA (double) dengan Subwoofer RM 128 SB MK4 dan RM 212 MK4 (active) dengan Subwoofer RM 115 SB, dan mendisplay beberapa produk terbaik kami. Bazar kami dipenuhi&nbsp;pengunjung dari yang hanya melihat-lihat saja, membeli merchandise, sampai yang memborong beberapa produk. Total sponsor yang mengikuti Stand Bazar kurang lebih ada 30 Stand yang datang dari berbagai daerah.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_114251-e1531731955389-1746756384074.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_152100-e1531732008826-1746756396213.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_114316-e1531732635601-1746756405799.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180705_121143-e1531732730263-1746756412169.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180705_121114-e1531732784767-1746756427469.jpg\">', '2018-07-15 17:00:00.000', 'admin', '2025-05-09 02:07:15.072', '2025-07-03 03:25:42.603', '', '', '<p>“Syawalan of the Yogyakarta Sound System Rental Community, Sound Parade &amp; Bazaar 2018” was an event organized by the Yogyakarta Sound System Community, themed as a Gathering Moment, with the concept of a Fun SPL Competition from local sound system rental communities, Line Array Demos and Product Bazaars from various sponsors, and a Regional Artist Entertainment Stage.</p><p></p><p>At our bazaar stand, we showcased a Ground Stage setup with RM 103 LA (double) paired with Subwoofer RM 128 SB MK4 and RM 212 MK4 (active) paired with Subwoofer RM 115 SB, along with several of our best products on display. Our booth was crowded with visitors — from those who were just browsing, buying merchandise, to those purchasing several products. The total number of sponsors participating in the bazaar was approximately 30, coming from various regions.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_114251-e1531731955389-1746756384074.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_152100-e1531732008826-1746756396213.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180704_114316-e1531732635601-1746756405799.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180705_121143-e1531732730263-1746756412169.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/20180705_121114-e1531732784767-1746756427469.jpg\">', 'Syawalan of the Yogyakarta Sound System Rental Community 2018', 'syawalan-of-the-yogyakarta-sound-system-rental-community-2018'),
('ef95c954-0632-4d13-8924-93e5dde14ff4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Produk RHYME di Korea Selatan', 'produk-rhyme-di-korea-selatan', '<p>Gereja Yejung di Korea&nbsp;Selatan menggunakan Rhyme Pro-Audio ;<br>RM 811 LA, RM 2110 M, RM 212 M.MK4, &amp; RM 125 SB.MK3</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-06-e1553227421273-1746759601839.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-04-e1553227460865-1746759605492.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-10-e1553226996706-1746759611485.jpg\">', '2019-03-21 17:00:00.000', 'admin', '2025-05-09 03:00:17.983', '2025-07-03 03:24:04.806', '', '', '<p>Yejung Church in South Korea uses Rhyme Pro-Audio equipment, including the following models:<br>RM 811 LA, RM 2110 M, RM 212 M.MK4, and RM 125 SB.MK3.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-06-e1553227421273-1746759601839.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-04-e1553227460865-1746759605492.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Chapel-Seoul-Hanyoung-Unversity-10-e1553226996706-1746759611485.jpg\">', 'RHYME Products in South Korea', 'rhyme-products-in-south-korea'),
('f010a33a-c654-4049-902a-ca23571ea461', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'ACR RHYME DESIBEL MENGUNDANG ANTUSIASME PENGUNJUNG DI PSDS', 'acr-rhyme-desibel-mengundang-antusiasme-pengunjung-di-psds', '<p>Parade Sound Karnaval Jilid 8 yang diadakan oleh Paguyuban Sound System Demak (PSDS) di Lapangan Desa Candisari, Kab. Demak, Jawa Tengah ini dihadiri oleh berbagai macam brand loudspeaker yang sudah tidak asing lagi didengar oleh pecinta sound system, mulai dari lokalan, Cina, hingga Amerika. Sinar Baja Electric sebagai salah satu brand speaker lokal tertua juga ikut unjuk gigi dalam acara tersebut dengan membawa brand-brand terkemukanya, yaitu ACR, Rhyme serta Desibel.</p><p>&nbsp;</p><p>Acara yang diadakan pada tanggal 9 - 10 Agustus ini diikuti oleh lebih dari 20 peserta yang berasal dari daerah Demak dan sekitarnya. Para peserta dapat mengikuti lomba SPL dan Clarity. Yang berbeda dari parade sound pada umumnya adalah adanya demo sound karnaval yang memperbolehkan para rental unjuk kebolehan sound systemnya akan akan digunakan untuk memperingati HUT RI ke 80th. Dari sekian banyaknya peserta, lagi-lagi tim Sinar Baja Electric mendapatkan beberapa peserta yang menggunakan produk ACR yang menjadi produk louspeaker kebanggaan Indonesia. &nbsp;</p><p>&nbsp;</p><p>“Untuk box subwoofer memakai box CLA. Untuk suaranya terasa lebih padat dan keras.” ujar Ferry dari Dokar Audio saat menjelaskan box speaker yang digunakan pada speaker 18in PA-127187 SW Fab. Untuk speaker Line Array yang digunakan adalah tipe 10in ARRAY 2560 M Fab.”Suaranya lebih nendang, lebih tebel, dan lebih bersih.” lanjutnya lagi.</p><p>&nbsp;</p><p>“Istimewanya Fabulous dikasi power kecil bisa bunyi bisa bagus, apalagi dikasi power besar tambah mantap.” ujar Pak Salim dari BSM Audio, salah satu peserta demo sound karnaval. Beliau juga menggunakan produk amplifier dari Rhyme R26000-D dengan 4 channel dan memiliki power 6500 Watts. “Dulu dari saya pertama kali mengenai sound kalau tidak pakai ACR Fabulous tidak mau.” lanjut beliau. Beliau juga menjelaskan suara yang dihasilkan dari 18in PA-113182 SW Fab yang dipasangkan pada box double mini scoop. “Ini kan sound untuk live, menggunakan (box) mini scoop istimewa. Kerasa banget, bass nya langsung glerr, rendahnya tak akui (enak).”</p><p>&nbsp;</p><p>Untuk area demo, Sinar Baja Electric menampilkan RM 226 LA dan RM 1284 SB dengan power R17000, R4500, R7000 yang mengundang banyak kagum dan ketertarikan dari setiap pengunjung yang ada. Dengan bekerja sama dengan Amir dari La Morena, soundman andalan Sinar Baja Electric dari Jombang, terlihat seluruh pengunjung langsung menghampiri sound system Rhyme saat hendak dibunyikan. Mulai dari usia muda hingga tua, mereka terlihat menikmati sound yang dihasilkan oleh produk dari Sinar Baja Electric tersebut.</p><p>&nbsp;</p><p>Pada saat waktu istirahat demo sound dan lomba, para pengunjung terlihat berkumpul mengunjungi area lapak Sinar Baja Electric untuk mengetahui setiap produk yang dibawakan oleh ACR dan Desibel. ACR membawakan tipe tweeter hingga 18in dari Fabulous, Excellent, Deluxe, hingga Black Series. Tipe serain double magnet dari Fabulous, yaitu 18in PA-113188 SW Fab serta 18in PA-127188 SW Fab juga tidak luput dari perhatian para pengunjung yang ada disana. Untuk produk Desibel yang dibawakan juga mulai dari tweeter hingga tipe-tipe best seller seperti 15in 381006-Mk1 Desibel hingga 18in 451006-Mk1 Desibel.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/LvWKrN-weL4?rel=1\" start=\"0\"></iframe></div>', '2025-08-18 17:00:00.000', 'mkt', '2025-08-20 05:46:22.840', '2025-08-21 01:54:33.237', '', '', '<p>The Sound Parade Carnival Volume 8 organized by the Demak Sound System Association (PSDS) at the Candisari Village Field, Demak Regency, Central Java, was attended by various loudspeaker brands well known among sound system enthusiasts, ranging from local, Chinese, to American brands. Sinar Baja Electric, as one of the oldest local speaker brands, also showcased its leading brands: ACR, Rhyme, and Desibel.</p><p></p><p>The event, held on August 9–10, was joined by more than 20 participants from Demak and surrounding areas. Participants could take part in SPL and Clarity competitions. What made this parade different from most others was the sound carnival demo, allowing rental companies to demonstrate the sound systems that will later be used for Indonesia’s 80th Independence Day celebrations. Among the many participants, once again Sinar Baja Electric found several teams using ACR products, Indonesia’s proud loudspeaker brand.</p><p></p><p>“For the subwoofer box, we use the CLA box. The sound feels fuller and stronger,” said Ferry from Dokar Audio when explaining the speaker box used with the 18in PA-127187 SW Fab speaker. For the Line Array speakers, the type used was the 10in ARRAY 2560 M Fab. “The sound is punchier, thicker, and cleaner,” he added.</p><p></p><p>“What’s special about Fabulous is that even with low power it already sounds good, and with more power it’s even better,” said Mr. Salim from BSM Audio, one of the sound demo participants. He also used an amplifier product from Rhyme, the R26000-D, with 4 channels and 6500 Watts of power. “From the first time I got into sound, if it wasn’t using ACR Fabulous, I didn’t want it,” he continued. He also explained the sound produced by the 18in PA-113182 SW Fab paired with a double mini scoop box. “This is live sound, using a mini scoop box is special. You can really feel it—the bass hits right away, the lows are excellent,” he said.</p><p></p><p>In the demo area, Sinar Baja Electric showcased the RM 226 LA and RM 1284 SB powered by the R17000, R4500, and R7000 amplifiers, which drew admiration and interest from many visitors. With the support of Amir from La Morena, Sinar Baja Electric’s trusted soundman from Jombang, all visitors were immediately drawn to the Rhyme sound system when it was played. From young to old, everyone seemed to enjoy the sound produced by Sinar Baja Electric’s products.</p><p></p><p>During breaks from the sound demos and competitions, visitors were seen gathering around Sinar Baja Electric’s booth to learn more about the products showcased by ACR and Desibel. ACR presented tweeters up to 18in models from the Fabulous, Excellent, Deluxe, and Black Series. Double magnet models from the Fabulous line, such as the 18in PA-113188 SW Fab and 18in PA-127188 SW Fab, also drew attention from the visitors. For Desibel products, the lineup ranged from tweeters to best-selling models like the 15in 381006-Mk1 Desibel and 18in 451006-Mk1 Desibel.</p><p></p><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/LvWKrN-weL4?rel=1\" start=\"0\"></iframe></div>', 'ACR RHYME DESIBEL ATTRACTS VISITOR ENTHUSIASM AT PSDS', 'acr-rhyme-desibel-attracts-visitor-enthusiasm-at-psds'),
('f03ad14a-4de4-4425-950e-c725ef5e7bba', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'SMEX 2023', 'smex-2023', '<p>Surabaya Music Expo (SMEX) kembali mengadakan pameran di Exhibition Hall Grand City Surabaya, pada 3-6 Agustus 2023. Sama seperti acara SMEX pada tahun 2019, area dibagi menjadi 2, area indoor dan outdoor. Area outdoor digunakan untuk demo sound system line array terbaik milik perusahaan audio pro. Pada area indoor merupakan area pameran produk-produk speaker , lighting, dan music instrument.</p><p></p><p>Di area outdoor, Rhyme menampilkan speakernya yang terbaru: RM 226 LA sebanyak 6pcs. Dilengkapi dengan subwoofer RM 1283 LA sebanyak 8pcs. RM 226 LA di-launching pada event SMEX kali ini, speaker line array ini memakai system 3-way dengan komposisi speaker 2pcs mid-woofer 12in, 4pcs mid 5in, dan 2pcs compression driver. RM 1283 LA subwoofer double 18in dengan menggunakan komponen dari ACR FABULOUS 18in PA-127187 SW FAB. Selain mendengarkan demo di outdoor, pengunjung bisa memasuki area Exhibition Hall untuk melihat pameran. Disini pengunjung dapat mencoba produk-produk baru dan existing, check sound, dan berkonsultasi seputaran dunia audio pro.</p><p></p><p>Di stand indoor, SBE menampilkan speaker ACR, Rhyme serta SB Acoustic. Pada area ini, Sinar Baja Electric menampilkan booth dengan tema Indonesia, serta tampilan <em>homie</em> dan santai yang dapat memberikan pengalaman yang nyaman, sehingga pengunjung bisa leluasa dalam bertanya dan mencoba live demo pada speaker yang tim siapkan. Dan tak lupa ada merchandise yang dibagikan. Berikut list speaker yang dibawakan:</p><p></p><p><strong>ACR</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132249-1746771855432.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132304-1746771867514.png\"><p></p><p><strong>SB Acoustics</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132315-1746771877634.png\"><p></p><p>Para pengunjung yang mendatangi booth memiliki penasaran yang tinggi terhadap speaker terbaru dari Rhyme, serta ingin mengetahui driver apa yang digunakan saat demo berlangsung. Para pengunjung juga mendengarkan RM 1283 SB, RM 225 Mk5, RM 81 LA, dan RM 151 FSB. Speaker dari Rhyme ini mendapatkan respon yang positif dari pengunjung. Selain itu, ACR juga menampilkan produk terbaru dari Fabulous Series: 18in PA-113188 SW Fab yang memiliki double magnet, serta dari Deluxe Series: 18in 18710 DLX ACR Series.</p><p></p><p>Beberapa pengunjung yang pernah memakai ACR dan Rhyme juga memberikan testimoninya kepada Sinar Baja Electric, dan berharap produknya semakin berkembang dan mampu bersaing dengan produk dari luar negeri</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/RM-226-LA-1746771908386.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09008-1024x683-1746771916573.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09015-1024x683-1746771923898.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09009-1024x683-1746771931834.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18in-18710-SMEX-1746771951989.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09020-1-1024x683-1746771958609.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09063-edited-scaled-683x1024-1746771966059.jpg\">', '2023-08-14 17:00:00.000', 'admin', '2025-05-09 06:26:18.088', '2025-07-03 02:15:32.475', '', '', '<p>Surabaya Music Expo (SMEX) was held again at the Exhibition Hall Grand City Surabaya on August 3–6, 2023. Similar to the 2019 SMEX event, the area was divided into two: indoor and outdoor. The outdoor area was used for demoing the best line array sound systems from professional audio companies. The indoor area was for exhibiting speaker products, lighting, and musical instruments.</p><p></p><p>In the outdoor area, Rhyme showcased its latest speaker, the RM 226 LA, with 6 units. It was paired with 8 units of the RM 1283 LA subwoofer. The RM 226 LA was launched at this SMEX event; this line array speaker uses a 3-way system composed of 2 mid-woofer 12-inch speakers, 4 mid 5-inch speakers, and 2 compression drivers. The RM 1283 LA subwoofer is a double 18-inch using components from ACR FABULOUS 18in PA-127187 SW FAB. Besides listening to demos outdoors, visitors could enter the Exhibition Hall to see the exhibition. Here, visitors could try new and existing products, check sound, and consult about the professional audio world.</p><p></p><p>At the indoor booth, SBE displayed ACR, Rhyme, and SB Acoustic speakers. The booth featured an Indonesian theme with a cozy and relaxed atmosphere to provide a comfortable experience, allowing visitors to freely ask questions and try live demos of the speakers prepared by the team. Merchandise was also distributed. The following is the list of speakers presented:</p><p></p><p><strong>ACR</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132249-1746771855432.png\"><p></p><p><strong>Rhyme</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132304-1746771867514.png\"><p></p><p><strong>SB Acoustics</strong></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Screenshot 2025-05-09 132315-1746771877634.png\"><p></p><p>Visitors who came to the booth showed great curiosity about Rhyme’s latest speakers and wanted to know which drivers were used during the demo. They also listened to the RM 1283 SB, RM 225 Mk5, RM 81 LA, and RM 151 FSB. These Rhyme speakers received positive responses from the visitors. In addition, ACR showcased the latest products from the Fabulous Series: 18in PA-113188 SW Fab with double magnets, and from the Deluxe Series: 18in 18710 DLX ACR Series.</p><p></p><p>Some visitors who had previously used ACR and Rhyme also gave their testimonials to Sinar Baja Electric, expressing hopes that the products would continue to develop and be able to compete with foreign products.</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/RM-226-LA-1746771908386.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09008-1024x683-1746771916573.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09015-1024x683-1746771923898.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09009-1024x683-1746771931834.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/18in-18710-SMEX-1746771951989.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09020-1-1024x683-1746771958609.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/MKT09063-edited-scaled-683x1024-1746771966059.jpg\">', 'SMEX 2023', 'smex-2023'),
('f16a1fad-af57-4b85-bdf3-69564b4097a3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Coming Soon Speaker Lokal Harga Murah: ACR Black Series', 'coming-soon-speaker-lokal-harga-murah-acr-black-series', '<p>Sinar Baja Electric, perusahaan yang memproduksi speaker asli dari Indonesia, terus melakukan inovasi untuk memenuhi kebutuhan pasar. Banyaknya produk impor yang masuk ke pasar Indonesia tidak membuat Sinar Baja Electric patah semangat untuk fokus dalam memenuhi kebutuhan para pelanggan.</p><p></p><p>Di pertengahan kuartal 3 di tahun 2024 ini, Sinar Baja Electric meluncurkan serian ACR terbaru: Black Series. Serian ini diluncurkan untuk memenuhi kebutuhan pasar yang menginginkan harga speaker ACR murah tetapi dengan kualitas terbaik. Serian ini diperkirakan akan rilis pada bulan November 2024</p><p></p><p>Serian ini terdiri dari speaker compression driver, 10in, 12in, 15in hingga 18in. Tipe best seller speaker 15in 15500 dan 15in 15600 ikut dalam kategori Black Series. Keunggulan dari ACR Black Series ini adalah finishing ED Black yang terdapat pada yoke dan top plate yang membuatnya lebih unggul dari finishing lainnya karena lebih tahan terhadap korosi. Conepaper pada setiap driver juga dilapisi dengan weatherproof sehingga dapat digunakan pada area indoor maupun outdoor. Motor yang didesain dengan penambahan ventilasi khusus membuat setiap driver tidak ada kompresi udara, serta memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ACR-Black-series-convert_page-0001-1-576x1536-1746780800059.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/aem6WgyAvHY?si=YzBVdmTBb7-Aascv\" start=\"0\"></iframe></div>', '2024-08-08 17:00:00.000', 'admin', '2025-05-09 08:53:13.795', '2025-07-03 01:47:06.519', '', '', '<p>Sinar Baja Electric, a company that manufactures speakers proudly made in Indonesia, continues to innovate to meet market demands. Despite the influx of imported products into the Indonesian market, Sinar Baja Electric remains committed to focusing on fulfilling the needs of its customers.</p><p></p><p>In the middle of Q3 2024, Sinar Baja Electric launched its newest ACR lineup: the Black Series. This series was developed to meet the market’s demand for affordable ACR speakers without compromising on quality. It is expected to be released in November 2024.</p><p></p><p>The series includes compression drivers and speakers in sizes 10-inch, 12-inch, 15-inch, and 18-inch. The best-selling 15-inch models — 15500 and 15600 — are also part of the Black Series.<br>Key advantages of the ACR Black Series include:</p><ul><li><p>ED Black finishing on the yoke and top plate, which provides better corrosion resistance than conventional finishes.</p></li><li><p>Weatherproof conepaper, allowing for use in both indoor and outdoor environments.</p></li><li><p>Special ventilation design on the motor, which eliminates air compression and ensures airflow for effective cooling.</p></li></ul><p></p><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/ACR-Black-series-convert_page-0001-1-576x1536-1746780800059.jpg\"><div data-youtube-video=\"\"><iframe class=\"my-4 rounded overflow-hidden\" width=\"640\" height=\"480\" allowfullscreen=\"true\" autoplay=\"false\" disablekbcontrols=\"false\" enableiframeapi=\"false\" endtime=\"0\" ivloadpolicy=\"0\" loop=\"false\" modestbranding=\"false\" origin=\"\" playlist=\"\" rel=\"1\" src=\"https://www.youtube.com/embed/aem6WgyAvHY?si=YzBVdmTBb7-Aascv\" start=\"0\"></iframe></div>', 'Coming Soon: Affordable Local Speakers – ACR Black Series', 'coming-soon-affordable-local-speakers-acr-black-series'),
('f360ade0-a5d7-44f0-8575-7e564e8a7cc3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'Pemberitahuan', 'pemberitahuan', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Brosur-Info-Ganti-Desain-ACR-1024x725-1746762411844.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Brosur-Info-Ganti-Desain-Curve-1024x725-1746762414984.jpg\"><p>Informasi lebih lanjut bisa hubungi nomor telpon CV. Sinar Baja Electric</p>', '2019-11-28 17:00:00.000', 'admin', '2025-05-09 03:47:16.665', '2025-07-03 03:18:15.922', '', '', '<img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Brosur-Info-Ganti-Desain-ACR-1024x725-1746762411844.jpg\"><img class=\"max-w-full rounded-md my-4\" src=\"/uploads/newsimages/Brosur-Info-Ganti-Desain-Curve-1024x725-1746762414984.jpg\"><p>For more information, please contact the phone number of CV. Sinar Baja Electric</p>', 'Announcement', 'announcement');
