('00f66a6b-e1f9-47ec-b701-fdd479ab91b5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" ARRAY 8850 M (LIMITED EDITION)', 1, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 06:07:56.153', '2025-10-23 08:49:36.817', '<p><span style=\"color: rgb(35, 31, 32)\"><strong>1. Daya magnet optimal</strong></span></p><p><span style=\"color: rgb(35, 31, 32)\">Desain motor yang melalui hasil pengukuran FEA <em>(Finite Element Analysis)</em> memberikan daya magnet yang optimal.</span></p><ol start=\"2\"><li><p><span style=\"color: rgb(35, 31, 32)\"><strong>2. Minimum kompresi <em>(Low Compression)</em></strong></span></p></li></ol><p><span style=\"color: rgb(35, 31, 32)\">Motor dan <em>Chassis</em> didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</span></p><p><span style=\"color: rgb(35, 31, 32)\"><strong>3. <em>Weatherproof conepaper</em></strong></span></p><p><span style=\"color: rgb(35, 31, 32)\"><em>Conepaper</em> dengan material dasar UKP 100% dan dilapisi dengan lapisan <em>weatherproof</em> sehingga menghasilkan suara yang bagus dan cocok diaplikasikan untuk <em>indoor</em> maupun <em>outdoor</em></span></p><p><span style=\"color: rgb(35, 31, 32)\"><strong>4. Respon frekuensi yang halus</strong></span></p><p><span style=\"color: rgb(35, 31, 32)\"><em>Conepaper</em> dilengkapi <em>damping glue</em> pada <em>surround</em> memberikan hasil respon frekuensi yang halus.</span></p><p><strong>5. <em>Power handling</em> yang maksimal</strong></p><p>Gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada<em> power handling</em> tinggi</p><p><span style=\"color: rgb(35, 31, 32)\"><strong>6. <em>Chassis</em> Menggunakan Desain Khusus</strong></span></p><p><span style=\"color: rgb(35, 31, 32)\"><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast</em> yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis</em> menghasilkan transfer panas yang baik.</span></p>', 'array-8850-m-limited-edition', '4c38d6f3-dc10-4298-b5e7-e1fdaa8b1183', 'admin', 0, 'ACR Product - Fabulous Series', '', 'af0acdc1-8471-4e74-b0e4-49fe71ace80e', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor design, developed through Finite Element Analysis (FEA), delivers optimal magnetic power.</p></li><li><p><strong>2. Low Compression</strong><br>The motor and chassis are designed with special ventilation, eliminating air compression and allowing airflow that functions as a cooling system.</p></li><li><p><strong>3. Weatherproof Cone Paper</strong><br>The cone paper is made from 100% UKP material and coated with a weatherproof layer, producing excellent sound quality and making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The cone paper is equipped with damping glue around the surround, resulting in a smooth frequency response.</p></li><li><p><strong>5. Maximum Power Handling</strong></p></li><li><p>The voice coil winding is coated with a special coating, allowing it to withstand high temperatures, enabling the speaker to endure high power handling.</p></li><li><p><strong>6. Specially Designed Chassis</strong><br>The chassis is made from high-quality die-cast material and features a special design at the bottom that enables efficient heat transfer.</p></li></ul>'),
('02ec2ed7-1a43-482b-94d4-b365a54e2ba9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in PA-75155', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:17:15.040', '2025-10-24 08:39:24.834', '<p>-</p>', 'voice-coil-15in-pa-75155', '4b5277e1-c544-4e34-9f3d-dfb2a6f39027', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('03125a56-a42e-4b66-92fd-8a8f1277148e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 10in PA-10880-Mk3 EXCEL ACR SERIES', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-06-20 01:48:58.930', '2025-10-24 08:41:24.113', '<p>-</p>', 'voice-coil-10in-pa-10880-mk3-excel-acr-series', '2f892551-82f9-4b6e-ad41-283a5b011da4', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('040ea03e-c1cd-4f5b-b26b-c95d2c1ec463', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 113183 SW Mk2 FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:17:15.674', '2025-10-23 07:46:39.145', '<p><strong>1. Tahan Panas</strong></p><p>Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat<em> voice coil / Spool</em> mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p><em>Chassis </em>berbahan aluminium cor berventilasi menjadikan <em>speaker </em>mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Daya magnet lebih optimal</strong></p><p>Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA</em></p>', 'pa-113183-sw-mk2-fab-by-acr', '212f0473-4937-46ac-99eb-b2a8e26805b3', 'admin', 0, '', '', '92f7645d-7a98-495c-9d16-fdc3c2dad50a', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>The voice coil (spool) uses a non-conductive fiberglass former and advanced coil wire coating technology, allowing it to operate reliably at temperatures above 280°C.</p></li><li><p><strong>2. Robust and Low Compression Design</strong><br>The ventilated cast aluminum chassis provides maximum structural strength while minimizing air compression for better airflow and cooling.</p></li><li><p><strong>3. Optimized Magnetic Power</strong><br>The magnetic motor power is precisely engineered using FEA (Finite Element Analysis) software to ensure optimal magnetic performance.</p></li></ul>'),
('04bc761c-0067-4d6b-bf33-faa764a5428e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" 75105 FAB', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-18 03:08:05.930', '2025-10-23 06:21:16.115', '<p><strong>1. Chassis menggunakan desain khusus</strong></p><p>Chassis terbuat dari aluminium <em>die cast </em>yang kokoh,dan dilengkapi ventilasi udara untuk membuang udara panas.</p><p><strong>2. Minimum kompresi</strong></p><p>Motor dan Chassis didesain secara presisi dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. Respon frekuensi yang halus</strong></p><p>Tambahan <em>damping glue </em>pada <em>surround cloth M-type</em> dapat membantu menghasilkan respon frekuensi yang lebih halus.</p><p><strong>4. Conepaper tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga mampu bertahan di segala cuaca.</p><p><strong>5. Daya magnet optimal</strong></p><p>Menggunakan magnet <em>grade </em>terbaik dan di-desain menggunakan bantuan <em>software </em>simulasi terbaru, sehingga daya magnetnya lebih optimal.</p><ol start=\"6\"><li><p><strong>6. <em>Power handling</em> yang maksimal</strong> </p></li><li><p>Material gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat speaker dapat bertahan di suhu yang tinggi dan <em>power handling</em> tinggi sekalipun.</p></li></ol>', '75105-fab', 'ea1ef4f5-c5e3-44f8-82ca-95a170845e58', 'admin', 0, '', '', '5f8439ff-205c-487b-9a36-a6020360136e', 0, 0, '', '', 0, '<ul><li><p><strong>1. Specially Designed Chassis</strong><br>The chassis is made from sturdy aluminum die-cast and equipped with air vents to release hot air.</p></li><li><p><strong>2. Minimal Compression</strong><br>The motor and chassis are precisely designed with added special ventilation to eliminate air compression and provide airflow that acts as a cooling system.</p></li><li><p><strong>3. Smooth Frequency Response</strong><br>The addition of damping glue on the M-type surround cloth helps produce a smoother frequency response.</p></li><li><p><strong>4. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it durable in all weather conditions.</p></li><li><p><strong>5. Optimal Magnetic Power</strong><br>Uses high-grade magnets and is designed with the aid of the latest simulation software to achieve optimal magnetic strength.</p></li><li><p><strong>6. Maximum Power Handling</strong></p></li></ul><p>The voice coil winding material is coated with a special layer, allowing the speaker to withstand high temperatures and maintain performance even under high power handling conditions.</p>'),
('04d55c8c-487e-41a6-b8f2-1292e15a73c5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" 10500 BLACK', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-04-08 01:45:12.854', '2025-10-23 06:09:29.678', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal.</p><p><strong>2. Conepaper tahan terhadap cuaca</strong></p><p>Material <em>conepaper</em> dibuat berbahan dasar paper khusus yang diproses dengan metode <em>\"rigid nonpress\"</em> dan dilapisi dengan lapisan <em>weather resistance</em> sehingga speaker cocok diaplikasikan untuk <em>indoor</em> ataupun <em>outdoor</em>.</p><p><strong>3. Minim Kompresi</strong></p><p>Motor dan <em>chassis</em> didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type</em> dan dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p>', '10500-black', '4192b4e7-3db7-49f1-99de-2b0857bbcc44', 'admin', 0, '-', '', '4ef097cb-7682-43f2-8f2c-5a4da9ea8e22', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor design, developed through Finite Element Analysis (FEA), provides optimal magnetic power.</p></li><li><p><strong>2. Weather-Resistant Cone Paper</strong><br>The cone paper is made from a special type of paper processed using the \"rigid nonpress\" method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor applications.</p></li><li><p><strong>3. Minimal Compression</strong><br>The motor and chassis are designed with special ventilation, preventing air compression and allowing airflow to function as a cooling system.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The cone paper, paired with M-type cloth surround and damping glue on the surround, delivers a smooth frequency response.</p></li></ul>'),
('051458b6-7560-4554-bf16-386a2d76bf6e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 440T1-08 (CD 4) EXCELLENT BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-25 07:05:01.863', '2025-10-23 09:06:08.859', '<p><strong>- Sistem Motor <em>driver </em>rendah distorsi dan efisien.</strong></p><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEM </em>menghasilkan motor <em>driver </em>yang optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>- Frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi tinggi.</strong></p><p>Desain khusus <em>dome </em>berbahan <em>Titanium </em>dan desain khusus <em>horn point </em>melalui simulasi <em>FEM </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi.</p><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p><p>Desain<em> voice coil 1.75in (44.4 mm)</em> menggunakan <em>rectangular wire </em>dengan <em>exit throat 1in (25.4 mm) </em>pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-440t1-08-cd-4-excellent-by-acr', '26c0a917-b86e-4a09-9b03-aabe049c3284', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Low-Distortion and Efficient Driver Motor System</strong><br>The driver motor structure design uses a ferrite magnet and is simulated with FEM, resulting in an optimized motor driver that delivers low distortion and greater efficiency at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response at High Frequencies</strong><br>A specially designed titanium dome and custom horn point, developed through FEM simulation, produce a wider frequency response range (1000 Hz – 20000 Hz) with a flat response in the high-frequency range.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.75-inch (44.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('0647687f-a716-4895-b617-7aa74d4de0d7', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'HORN H-250 ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 04:28:24.551', '2025-10-23 09:11:44.110', '', 'horn-h-250-acr', '16c730a1-dfb4-4c47-88b8-b899c737575d', 'admin', 0, '', '', '', 0, 1, '', '639baccc-d156-4cd1-b0f8-1053a22b7d41', 0, ''),
('06b1039a-955f-4f3b-b220-2f92deadb83e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 750TR15B-08 FAB ACR SERIES', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:36:34.124', '2025-10-23 09:17:04.385', '<p>-</p>', 'recone-kit-cd-750tr15b-08-fab-acr-series', 'd1a6be9d-b0e4-46e8-a8f2-4cd0910aa2e5', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('0866c2bb-2ccd-4065-98ab-ee14a2034215', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18in 18710', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-10-22 08:38:18.406', '2025-10-24 08:42:29.233', '', 'voice-coil-18in-18710', 'edef30d8-902b-4ee7-ba29-0e3c85293154', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('08694c02-88c7-462c-a476-1c9cfb285168', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 18inPA-113186', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-10-22 06:53:37.716', '2025-10-24 08:45:40.648', '', 'recone-kit-18inpa-113186', 'f315e1dc-ce0c-4568-af2f-562dd1831642', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('0e16f2eb-3a97-4894-a7a7-f17dd2be1b11', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 44B Desibel', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-17 06:03:25.022', '2025-10-23 09:07:43.734', '<p><strong>- Sistem Motor <em>driver </em>rendah distorsi dan efisien.</strong></p><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>menghasilkan motor <em>driver </em>yang optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>- Sistem <em>Bolt </em>on untuk aplikasi dengan <em>Horn</em>.</strong></p><p>Dengan sistem <em>Bolt </em>on memberikan banyak pilihan dalam memilih jenis <em>Horn </em>yang akan dipakai dengan aplikasi pemasangan yang mudah.</p><p><strong>- Ideal untuk<em> Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p><p>Desain<em> voice coil 1.75in (44.4 mm)</em> dengan<em> exit throat 1in (25.4 mm)</em> pada<em> Compression Driver </em>sangat cocok dan ideal dipakai untuk<em> Compact 2-Way System &amp; Multi Driver Line Array System.</em></p>', 'cd-44b-desibel', '6c9d3700-b27f-4142-81d3-81daafab5d0a', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low-Distortion and Efficient Driver Motor System</strong><br>The driver motor structure design uses a ferrite magnet and is simulated with FEMM, resulting in an optimized motor driver with low distortion and greater efficiency at high frequencies.</p></li><li><p><strong>- Bolt-On System for Easy Horn Application</strong><br>The bolt-on system provides more flexibility in selecting different types of horns and allows for easier installation.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.75-inch (44.4 mm) voice coil with a 1-inch (25.4 mm) exit throat on the compression driver is highly suitable and ideal for compact 2-way systems and multi-driver line array systems.</p></li></ul>'),
('0fc61d5b-997e-4a57-8e11-f8f641872c63', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in 15700-MK I DLX', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:24:11.611', '2025-10-24 08:40:15.516', '<p>-</p>', 'voice-coil-15in-15700-mk-i-dlx', 'ca7534ca-9f3b-44ac-952f-dddff937174d', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('112428cd-9113-4f2c-89b1-947c4c35237f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 113182 Mk3 SW FAB BY ACR', 1, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:48:04.947', '2025-10-23 07:45:38.934', '<p><strong>1. Power handling &amp; SPL yang maksimal</strong></p><p>Material gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat speaker dapat bertahan di suhu dan <em>power handling</em> tinggi serta menjadikan speaker semakin <em>powerfull</em></p><p><strong>2. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast </em>yang kokoh, dilengkapi dengan <em>Heat sink </em>dan ventilasi udara untuk membuang udara panas sehingga mengurangi terjadinya kompresi</p><p><strong>3. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>yang mampu bertahan di segala cuaca sehingga speaker cocok digunakan untuk <em>indoor </em>ataupun <em>outdoor</em></p>', 'pa-113182-mk3-sw-fab-by-acr', '72a77053-e2a3-45d0-93a0-a785344434d3', 'admin', 0, 'ACR Product - Fabulous Series', '', '8f96cedd-5102-4dff-9285-621d56829ed9', 0, 0, '', '', 0, '<ol><li><p><strong>1. Maximum power handling &amp; SPL</strong></p></li></ol><p>The voice coil winding material is coated with a special coating, allowing the speaker to withstand high temperature and power handling while making the speaker more powerful</p><ol start=\"2\"><li><p><strong>2. Chassis with special design</strong></p></li></ol><p>The chassis is made of sturdy die-cast aluminum, equipped with a heat sink and air vents to release hot air, thereby reducing compression</p><ol start=\"3\"><li><p><strong>3. Weather-resistant conepaper</strong></p></li></ol><p>The conepaper is coated with a weather-resistant layer that can withstand all weather conditions, making the speaker suitable for both indoor and outdoor use</p>'),
('11f04df7-472e-4bde-8d22-f799a817ec8f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1230 BLACK', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:18:37.508', '2025-10-23 06:28:03.869', '<ul><li><p><strong>- Daya magnet yang optimal<em> (optimized magnet power)</em></strong></p></li><li><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>- <em>Respon frequency</em> yang lebar<em> (wide bandwidth frequency response)</em></strong></p></li><li><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk <em>speaker fullrange</em>.</p></li><li><p><strong>- Respon frekuensi yang halus <em>(Smooth Frequency Response)</em></strong></p></li><li><p><em>Conepaper </em>dengan <em>surround cloth M-type</em> dan dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p></li><li><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weather proof)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather proof</em> sehingga speaker cocok diaplikasikan untuk <em>indoor</em> ataupun <em>outdoor</em></p></li><li><p><strong>- Minimum kompresi<em> (Low compression)</em></strong></p></li><li><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p></li><li><p><strong>- Distorsi yang rendah <em>(Low distortion)</em></strong></p></li><li><p>Penambahan <em>coppercap </em>pada<em> head yoke</em> yang berfungsi untuk meminimalkan distorsi speaker.</p></li></ul>', '1230-black', 'd32946a1-766a-428c-a6ee-da6a56db5dfa', 'admin', 0, '', '', '26e5cf44-df29-491b-b625-274a6d66bda8', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to deliver optimal magnetic power.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is equipped with a \"whizzer cone,\" providing a wide operating frequency range and making it ideal for full-range speaker applications.</p></li><li><p><strong>- Smooth Frequency Response</strong><br>The conepaper, combined with M-type cloth surround and damping glue, results in a smooth frequency response.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and provide airflow that functions as cooling.</p></li><li><p><strong>- Low Distortion</strong><br>The addition of a copper cap on the head yoke helps minimize speaker distortion.</p></li></ul>'),
('14a26099-e7c3-4780-b92d-fc320b4a070a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 12900 PREMIER BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:31:29.437', '2025-10-23 06:54:54.222', '<ul><li><p>-<em> Multiple Roll-type design surround </em>menjadikan distorsi lebih rendah.</p></li><li><p>- <em>Voice coil </em>4 inchi dengan<em> “former” </em>yang mempunyai daya tahan terhadap suhu yang tinggi dan <em>power </em>yang besar.</p></li><li><p>- Ideal untuk <em>“bass reflex enclosures”</em> atau aplikasi <em>“midbass horn”</em>.</p></li><li><p>- <em>High Power 12\" Woofer / Midbass.</em></p></li></ul>', 'pa-12900-premier-by-acr', '8904cc2d-2aff-4965-a1b3-0ecd005e0e24', 'admin', 0, '', '', 'd61b79c7-d81a-458f-b6d4-4cb55bcb70aa', 0, 0, '', '', 0, '<ul><li><p>- Multiple roll-type surround design results in lower distortion.</p></li><li><p>- 4-inch voice coil with a former that withstands high temperatures and handles high power.</p></li><li><p>- Ideal for bass reflex enclosures or midbass horn applications.</p></li><li><p>- High-power 12\" woofer / midbass.</p></li></ul>'),
('14ff996b-dcd4-4dfc-982f-3d9e956e9287', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 15in PA-75155', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:43:18.263', '2025-10-24 08:44:42.999', '<p>-</p>', 'recone-kit-15in-pa-75155', 'd405a904-6165-49b2-b453-ee0dfde79b5c', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('169a9439-fd24-4a7f-9e22-09e978cc1b2d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 250P1-08 (CD10)/CD 250P1B-08F FAB', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:35:49.854', '2025-10-23 09:15:03.569', '<p>-</p>', 'recone-kit-cd-250p1-08-cd10', 'ee606d10-126e-434e-a153-1d8003798d9a', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('19985707-8bcd-4db5-ba43-cd917df23e38', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-100187', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:27:01.095', '2025-10-24 08:37:49.597', '<p>-</p>', 'voice-coil-18inpa-100187', 'cb2a071d-c085-4a86-b2fc-13273b00f77b', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('1a566671-2299-4fbc-b8c7-f2dc1824e81e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 18inPA-100182 Mk3 SW FAB', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:51:29.884', '2025-10-24 08:44:18.898', '<p>-</p>', 'recone-kit-18inpa-100182-mk3-sw-fab', '9fb3dd05-ec2d-4ba0-acc2-f52ae7310679', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('1bd49bb8-08ea-4893-80e9-48969dcf6b99', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 250P1B-08F FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:26:12.826', '2025-10-23 08:54:26.798', '<ul><li><p><strong>- Sistem Motor <em>Driver </em>Optimal</strong></p></li><li><p>Desain <em>Driver </em>Motor menggunakan magnet <em>ferrite </em>yang menggunakan <em>Ferrofluid </em>lebih tahan panas dan lebih stabil pada frekuensi tinggi.</p></li><li><p><strong>- <em>Range </em>frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi tinggi</strong></p></li><li><p>Desain khusus <em>Chamber </em>dan<em> Phase Plug </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (2000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi</p></li><li><p><strong>- <em>Output </em>suara yang jernih dan bersih</strong></p></li><li><p>Desain khusus<em> Dome Compression Driver</em> yang terbuat dari <em>Polyetherimide (PEI)</em> dan menggunakan <em>Former Kapton </em>menghasilkan suara yang jernih dan bersih pada frekuensi tinggi.</p></li></ul>', 'cd-250p1b-08f-fabulous', '5d2b34af-0f8b-4f1c-8125-76193d22a99d', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal Driver Motor System</strong><br>The driver motor design uses a ferrite magnet with Ferrofluid, providing better heat resistance and more stability at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response at High Frequencies</strong><br>A specially designed chamber and phase plug, optimized through FEA simulation, deliver a wider frequency response range (2000 Hz – 20000 Hz) and a flat response at high frequencies.</p></li><li><p><strong>- Clear and Clean Sound Output</strong><br>The specially designed compression driver dome, made from Polyetherimide (PEI) and using a Kapton former, produces clear and clean sound at high frequencies.</p></li></ul>'),
('1c6c5e17-af64-4c72-b814-f6dfdbf32caf', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" 618 CURVE', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 00:28:56.701', '2025-10-23 08:34:50.977', '<p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dibuat dengan menggunakan material khusus menghasilkan <em>conepaper </em>yang kuat dan memberikan suara yang prima. <em>Conepaper </em>juga dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- Frekuensi kerja yang lebar <em>(Wide Bandwidth)</em></strong></p><p>Desain <em>speaker </em>khusus yang menghasilkan frekuensi kerja yang lebar dari 52 Hz - 11700 Hz</p><p><strong>- Kompresi udara yang baik</strong></p><p><em>Conepaper </em>dilengkapi ventilasi pada area<em> inner diameter cone </em>memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada saat bekerja.</p>', '618-curve', '4de534ee-c8e9-4b3c-aa73-8be243500d72', 'admin', 0, '', '', '748405b5-4972-459c-80f3-6614505fe7cd', 0, 0, '', '', 0, '<ul><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is crafted from specially selected materials to ensure durability and deliver excellent sound quality. It is coated with a weatherproof layer, making it ideal for both indoor and outdoor applications.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using Finite Element Analysis (FEA), resulting in optimal magnetic force for improved speaker performance.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>Specially engineered speaker design delivers a wide working frequency range from 52 Hz to 11,700 Hz, ensuring clear and dynamic sound reproduction.</p></li><li><p><strong>- Efficient Airflow and Compression Control</strong><br>Ventilation on the inner diameter of the cone provides effective airflow, reducing air compression during operation and helping the speaker stay cool and stable.</p></li></ul>'),
('1c949022-1797-4e33-8136-2aa8ad9a5862', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 10in ARRAY 2560 M', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-06-20 03:03:18.269', '2025-10-24 08:41:35.184', '<p>-</p>', 'voice-coil-10in-array-2560-m', '8fbaf323-f08b-48aa-b072-19645dad1f01', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('1fb24dc6-4e48-4095-b65f-89699ff54cba', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1225-Mk1 NEW', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-26 05:56:03.450', '2025-10-23 06:27:21.235', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\" </em>dan dilapisi dengan lapisan <em>weather resistance</em> sehingga speaker cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Respon frekuensi yang lebar</strong></p><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em>.</p>', '1225-mk1-new', 'f072a9c7-b223-4ab4-8a3c-b1d1a0ab3857', 'admin', 0, '', '', '920ab217-6f70-4c48-98f3-25b54a8ebc39', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor design, developed using FEA (Finite Element Analysis) measurements, delivers optimal magnetic power.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from a special paper material processed with a \"rigid nonpress\" method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Wide Frequency Response</strong><br>The speaker design includes a \"whizzer cone,\" providing a wide operating frequency range, making it ideal for full-range speaker applications.</p></li></ul>'),
('2079cc2b-4278-4c7c-8a6e-281eac6fc4e1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" ARRAY 1550 M FAB', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 05:41:05.747', '2025-10-23 08:36:58.067', '<p><strong>1. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan<em> weather resistance</em> sehingga mampu bertahan di segala cuaca.</p><ol start=\"2\"><li><p><strong>2. Tahan panas</strong></p></li><li><p><em>Voice coil</em> speaker didesain menggunakan material <em>former glass </em>fiber dan spesial coating pada gulungan sehingga membuat speaker mampu bertahan pada suhu yang tinggi.</p></li></ol><p><strong>3. Minimum kompresi</strong></p><p>Desain motor yang didesain secara presisi dengan ventilasi udara sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. <em>Speaker midrange</em> yang istimewa</strong></p><p><em>Speaker </em>didesain dengan<em> down roll surround</em> dengan penambahan <em>damping glue </em>sehingga mampu menghasilkan respon frekuensi dan cocok untuk karakter <em>midrange</em>.</p>', 'array-1550-m-fab', '9093eb92-69ed-4fdf-93f1-8e27ee20d902', 'admin', 0, '', '', '7294e45f-fc61-40fe-a8df-e7668d35c024', 0, 0, '', '', 0, '<ul><li><p><strong>1. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it durable and reliable in all weather conditions.</p></li><li><p><strong>2. Heat Resistant</strong></p></li></ul><p>The speaker\'s voice coil is designed using a glass fiber former and a special coating on the winding, allowing the speaker to withstand high temperatures.</p><ul><li><p><strong>3. Low Air Compression</strong><br>The motor is precisely engineered with air ventilation, preventing air compression and ensuring efficient heat dissipation.</p></li><li><p><strong>4. Exceptional Midrange Performance</strong><br>Designed with a down-roll surround and enhanced with damping glue, the speaker provides excellent frequency response, making it ideal for midrange applications.</p></li></ul>'),
('207e98e1-2679-42bd-acce-48a8517ddb66', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in PA-15890', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:13:34.064', '2025-10-24 08:39:53.899', '<p>-</p>', 'voice-coil-15in-pa-15890', '1240b6d2-277f-44e5-9d25-09bf46f8857a', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('20dfee1c-d4f0-4d2b-83d4-aa272973964e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 38601 Desibel', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-17 06:54:16.640', '2025-10-23 07:19:24.565', '<p><strong>- Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Minim Kompresi</strong></p><p><em>Voice coil/spool </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p><strong>- Power Handling Yang Maksimal</strong></p><p>Gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat <em>voice coil</em> dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi</p>', '38601-desibel', '134988e8-d695-4c43-8aad-5b1db8dee0b3', 'admin', 0, '', '', '0fbea381-12d1-4960-9170-c1c4832d0416', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The speaker’s magnetic motor delivers optimal power, thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Low Compression</strong><br>The voice coil/spool is designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special layer, allowing it to withstand high temperatures, enabling the speaker to handle high power levels reliably.</p>'),
('2270248c-af8b-407b-944d-e55dc1c8e033', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 65125 M FAB BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 03:48:30.516', '2025-10-23 06:56:17.701', '<p><strong>1. Tahan panas dan minimum kompresi</strong></p><p>- <em>Voice coil </em>menggunakan <em>former bonder </em>yang mampu menambah ketahanan speaker terhadap suhu tinggi</p><p>- <em>Motor </em>dan <em>Chassis </em>didesain dengan ventilasi untuk mencegah adanya kompresi udara</p><p><strong>2. <em>Weatherproof</em></strong></p><p>- <em>Conepaper </em>sangat kuat dan tahan terhadap segala cuaca</p><p><strong>3. Kokoh</strong></p><p>- Chassis memiliki konstruksi yang kuat dan terbuat dari <em>aluminium diecast</em></p><p><strong>4. Daya Magnet Optimal</strong></p><p>- Daya motor <em>magnet speaker </em>yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p>', 'pa-65125-m-fab-by-acr', '5e83b911-ac22-40f2-a95c-66877d8997aa', 'admin', 0, '', '', 'f0b9f988-b318-405b-afc7-471d3a39c304', 0, 0, '', '', 0, '<ol><li><p><strong>1. Heat Resistant and Low Compression</strong></p></li></ol><ul><li><p>The voice coil uses a bonder former that enhances the speaker’s resistance to high temperatures.</p></li><li><p>The motor and chassis are designed with ventilation to prevent air compression.</p></li></ul><ol start=\"2\"><li><p><strong>2. Weatherproof</strong></p></li></ol><ul><li><p>The conepaper is highly durable and resistant to all weather conditions.</p></li></ul><ol start=\"3\"><li><p><strong>3. Sturdy Construction</strong></p></li></ol><ul><li><p>The chassis features a strong structure made from aluminum die-cast material.</p></li></ul><ol start=\"4\"><li><p><strong>4. Optimized Magnet Power</strong></p></li></ol><ul><li><p>The speaker’s magnetic motor delivers optimal power, designed using FEA (Finite Element Analysis) technology.</p></li></ul>'),
('22c288fe-fac2-4c1f-97ce-b5c57acf6cb6', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1240-Mk2 PA CLASSIC', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-27 09:03:16.098', '2025-10-23 06:33:57.340', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar paper khusus yang diproses dengan metode<em> \"rigid nonpress\" </em>dan dilapisi dengan lapisan <em>weather resistance</em> sehingga speaker cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Respon frekuensi yang lebar</strong></p><p>Desain speaker dilengkapi dengan<em> \"whizzer cone\" </em>memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em>.</p><p><strong>4. Minimum kompresi dan distorsi</strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin. Penambahan <em>coppercap </em>pada <em>head yoke </em>yang berfungsi untuk meminimalkan distorsi speaker dan menambah <em>SPL </em>di frekuensi tinggi.</p>', '1240-mk2-pa-classic', '86b63cba-44ee-4123-90e9-d391b98527e8', 'admin', 0, '', '', 'c1e1c955-28e5-4426-b8a2-e52675e4c799', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements, resulting in optimal magnetic power.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from a special paper material processed using the \"rigid nonpress\" method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Wide Frequency Response</strong><br>The speaker is equipped with a \"whizzer cone,\" providing a wide frequency range and making it ideal for full-range speaker applications.</p></li><li><p><strong>4. Low Compression and Distortion</strong><br>The motor features special ventilation to eliminate air compression and enable airflow for effective cooling. A copper cap is added to the head yoke to minimize speaker distortion and increase SPL at high frequencies.</p></li></ul>'),
('24015f87-6094-442d-a777-d4645c17a9dd', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 113156 SW FAB BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 01:04:55.593', '2025-10-23 07:28:28.352', '<ol><li><p><strong>1. Tahan Panas</strong></p></li><li><p>- Penambahan alat pendingin pada<em> t-yoke </em>untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil.</p></li><li><p>- Menggunakan <em>former </em>berbahan dasar<em> non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat<em> voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p></li><li><p><strong>2. Kokoh dan Minimum Kompresi</strong></p></li><li><p><em>- Chassis </em>berbahan aluminium cor berventilasi menjadikan <em>speaker </em>mempunyai kekuatan maksimum dan rendah kompresinya.</p></li><li><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p></li><li><p><em>- Double damper &amp; Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p></li><li><p><strong>4. Daya magnet lebih optimal</strong></p></li><li><p>- Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-design menggunakan teknologi dari <em>software FEA</em></p></li></ol>', 'pa-113156-sw-fab-by-acr', '35454058-87c5-48ac-8226-9272cf167f60', 'admin', 0, '-', '', '5c0365e2-7455-49f3-8490-099b7e262877', 0, 0, '', '', 1, '<ol><li><p><strong>1. Heat Resistant</strong></p></li></ol><ul><li><p>- A cooling device is added to the T-yoke to help maintain the speaker’s temperature, ensuring more stable performance.</p></li><li><p>- The voice coil uses a non-conductive fiberglass former and is coated with the latest wire technology, allowing it to operate even at temperatures above 280°C.</p></li></ul><ol start=\"2\"><li><p><strong>2. Sturdy and Low Compression</strong><br>- The ventilated cast aluminum chassis provides maximum strength while minimizing air compression.</p></li><li><p><strong>3. Stable with High Excursion</strong><br>- The combination of a double damper and triple round surround gives the speaker greater stability and higher cone excursion.</p></li><li><p><strong>4. Optimized Magnetic Power</strong><br>- The speaker’s magnetic motor power is optimized using advanced FEA (Finite Element Analysis) software design.</p></li></ol>'),
('253598b3-64bc-4c5d-9e69-98147cd6ff95', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" ARRAY 2560 M FAB BY ACR', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-18 03:12:23.169', '2025-10-23 06:21:55.804', '<p>- Sistem magnet <em>ferrite high flux </em>sampai dengan 12.300 Gauss.</p><p>- <em>Voice coil </em>menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>untuk meminimalkan <em>damping</em>.</p><ul><li><p>- Penambahan spesial coating pada <em>voice coil</em> sehingga lebih tahan panas.</p></li></ul><p>- Desain <em>voice coil </em>berventilasi untuk sirkulasi udara yang bagus dan mengurangi tekanan udara pada speaker.</p><p>- Lapisan anti air pada <em>conepaper</em>.</p>', 'array-2560-m-fab-by-acr', '79bab2c2-267c-480a-b7eb-ec46a02d759a', 'admin', 0, '', '', '340bdda0-eb1a-4ddb-90fc-dcf9c32e5762', 0, 0, '', '', 1, '<ul><li><p>- High-flux ferrite magnet system up to 12,300 Gauss.</p></li><li><p>- The voice coil uses a non-conductive fiberglass former to minimize damping.</p></li><li><p>- The addition of a special coating on the voice coil improves its heat resistance.</p></li><li><p>- Ventilated voice coil design provides good airflow and reduces air pressure within the speaker.</p></li><li><p>- Water-resistant coating on the conepaper.</p></li></ul>'),
('2583a96a-432f-4b73-8397-7fc93fe5df21', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 113186 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:22:50.053', '2025-10-23 07:47:10.784', '<p><strong>1. Tahan panas</strong></p><p>Penambahan alat pendingin pada <em>t-yoke </em>untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil. Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Distorsi rendah</strong></p><p>Adanya<em> ring aluminium</em> pada<em> t-yoke</em> yang berfungsi untuk meredam distorsi.</p><p><strong>3. Kokoh dan minimum kompresi</strong></p><p><em>Chassis </em>berbahan aluminium cor berventilasi menjadikan <em>speaker </em>mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>4. Stabil dan lintasan geraknya tinggi</strong></p><p><em>Double damper &amp; Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p><strong>5. Daya magnet lebih optimal</strong></p><p>Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-desain menggunakan teknologi dari<em> software FEA</em></p>', 'pa-113186-sw-fab-by-acr', '7077a650-e72d-4595-81df-1542c59f777c', 'admin', 0, '-', '', 'f317f9de-2993-419c-a321-0d4b80e22666', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>A cooling device is added to the T-yoke to maintain stable speaker temperature, ensuring consistent performance. The voice coil uses a non-conductive fiberglass former and advanced wire coating technology, enabling it to operate even at temperatures above 280°C.</p></li><li><p><strong>2. Low Distortion</strong><br>An aluminum ring is added to the T-yoke to suppress distortion, resulting in cleaner and more accurate sound.</p></li><li><p><strong>3. Robust and Low-Compression Design</strong><br>The ventilated cast aluminum chassis provides maximum structural strength while minimizing air compression, ensuring effective heat dissipation and improved durability.</p></li><li><p><strong>4. High Stability and Long Excursion</strong><br>Equipped with a double damper and triple round surround, the speaker delivers greater mechanical stability and allows for extended cone movement, enhancing dynamic range and sound output.</p></li><li><p><strong>5. Optimized Magnet Power</strong><br>The speaker’s magnetic motor is precisely engineered using FEA (Finite Element Analysis) software to achieve maximum magnetic efficiency and performance.</p></li></ul>'),
('26d69232-9408-4910-9dd0-ca7fac3d9e40', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 113156 Mk1 SW Fab', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-10-13 07:32:36.395', '2025-10-13 07:32:36.420', '<p>COMING SOON</p>', '113156-mk1-sw-fab', 'cd672ca1-6b4c-41aa-8989-3498d652aa24', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<p>COMING SOON</p>'),
('29dcf9ba-152f-41fa-8ab1-16c727d152c1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" 20381 Desibel', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-17 07:00:36.337', '2025-10-23 08:43:45.868', '<p><strong>1. Daya magnet yang optimal <em>(optimized magnet power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal.</p><p><strong>2. Minimum kompresi <em>(Low Compression)</em></strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. <em>Weather resistance conepaper</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p><p><strong>4. Respon frekuensi yang halus <em>(Smooth Frequency Response)</em></strong></p><p><em>Conepaper </em>dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>5. <em>Power handling</em> yang maksimal</strong></p><p>Gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p>', '20381-desibel', '4cc51c96-87b2-46c9-850b-984433da5220', 'admin', 0, '', '', '4e4bb8a2-0b2f-473f-85dc-8389b7da4ec2', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in an optimized magnetic force for maximum speaker efficiency.</p></li><li><p><strong>2. Low Compression</strong><br>The motor includes specialized ventilation that prevents air compression and allows proper airflow for effective cooling.</p></li><li><p><strong>3. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>Damping glue applied to the cone surround ensures a smooth and natural frequency response.</p></li><li><p><strong>5. Maximum Power Handling</strong><br>The voice coil winding is coated with a special layer, allowing it to withstand high temperatures so the speaker can perform reliably even under high power handling conditions.</p></li></ul>'),
('29f14786-161b-420b-bacc-9429d03946e3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-127188', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-10-22 08:41:00.688', '2025-10-24 08:42:18.286', '', 'voice-coil-18inpa-127188', 'b34e0126-2717-418d-bf38-3a8fdfb349d8', 'admin', 0, '', '', '', 0, 0, '', '', 0, '');
INSERT INTO `product` (`id`, `brandId`, `name`, `isFeatured`, `isArchived`, `sizeId`, `createdAt`, `updatedAt`, `description`, `slug`, `specId`, `updatedBy`, `isNewProduct`, `featuredDesc`, `series`, `thieleSmallParameter2OhmId`, `isCeiling`, `isHorn`, `ceilingSpecId`, `hornSpecId`, `haveSparepart`, `description_english`) VALUES
('2a92c8a3-00bb-44a9-97ac-97b70c0a2f6a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 381006 Desibel', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-17 07:07:40.269', '2025-10-23 07:16:32.100', '<p><strong>- Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>- <em>Weatherproof conepaper</em></strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar UKP 100% SR 18° + KPK (Kapuk) yang diproses dengan metode <em>\'rigid non-press\'</em> dan dilapisi dengan lapisan <em>weatherproof </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik</p><p><strong>- Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p><strong>- <em>Power Handling </em>Yang Maksimal</strong></p><p><em>Voice coil wire</em> menggunakan material <em>EISVW </em>dan gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p><p><strong>- <em>Chassis </em>Menggunakan Desain Khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik</p>', '381006-desibel', '90a98850-8471-42a3-8a21-14b02b4bc51b', 'admin', 0, '', '', 'd295680b-7096-445f-b070-f34afe3dcb71', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The magnetic motor delivers optimal power thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is made from a blend of 100% UKP SR 18° and KPK (Kapok fiber), processed using a rigid non-press method and coated with a weatherproof layer—making it highly durable in all weather conditions and capable of producing superior sound quality.</p></li><li><p><strong>- Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and provide airflow that functions as an effective cooling system.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil wire uses EISVW material, and the winding is coated with a special layer, enabling the voice coil to withstand high temperatures. This allows the speaker to maintain performance even under high power handling conditions.</p><ul><li><p><strong>- Special Chassis Design</strong><br>The robust chassis is made from high-quality die-cast material and features a specially designed lower section that enhances heat dissipation.</p></li></ul>'),
('2aa2d13d-90e8-4ca8-98bd-04796675107e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA-127188 SW', 1, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:33:18.901', '2025-10-23 08:32:03.537', '<p><strong>1. Tahan panas dan minimum kompresi</strong></p><p>Penggunaan material dan teknologi<em> ISV (Interleaved Sandwich Voice Coil) </em>pada<em> voice coil </em>mampu menambah ketahanan <em>speaker </em>terhadap suhu tinggi, ditambah ventilasi pada motor dan <em>chasis </em>untuk sirkulasi udara yang lebih baik.</p><p><strong>2. Distorsi yang rendah</strong></p><p>Penambahan<em> aluminium ring </em>pada<em> head yoke </em>yang berfungsi mengurangi distorsi pada <em>speaker</em>, sehingga suara terdengar lebih bersih.</p><p><strong>3. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance</em> sehingga mampu bertahan di segala cuaca.</p><p><strong>4. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>terbuat dari<em> aluminium die cast </em>yang kokoh, dan dilengkapi <em>heat sink </em>dan ventilasi udara untuk membuang udara panas.<br><strong>5. Respon frekuensi rendah</strong></p><p>Desain <em>double spider </em>serta jangkauan gerak yang lebih dalam mampu menghasilkan respon frekuensi yang lebih rendah.</p>', 'pa-127188-sw', '4bb01a80-4b0b-4869-a0ba-493c51d5854d', 'admin', 0, 'ACR Product - Fabulous Series', '', 'fed1425f-7a95-439f-9e61-2e462191be83', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant and Low Compression</strong><br>The use of ISV (Interleaved Sandwich Voice Coil) technology enhances the speaker’s durability under high temperatures. Ventilation in the motor and chassis ensures better airflow, effectively reducing heat buildup and air compression.</p></li><li><p><strong>2. Low Distortion</strong><br>An added aluminum ring on the head yoke minimizes speaker distortion, resulting in cleaner and clearer sound output.</p></li><li><p><strong>3. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it durable and reliable in all weather conditions.</p></li><li><p><strong>4. Specially Designed Chassis</strong><br>Constructed from sturdy aluminum die-cast material, the chassis includes a heat sink and air vents to efficiently release trapped heat and maintain performance stability.</p></li><li><p><strong>5. Extended Low-Frequency Response</strong><br>A double spider design combined with deeper cone excursion enables the speaker to deliver richer and deeper low-frequency sound.</p></li></ul>'),
('2b374781-2d6a-4633-88be-422f23a086f6', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 250T1-08F Mk1 BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:26:56.337', '2025-10-23 08:55:32.738', '<p><strong>- Sistem Motor <em>Driver </em>Optimal</strong></p><p>Desain <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang menggunakan <em>Ferrofluid </em>lebih tahan panas dan lebih stabil pada frekuensi tinggi.</p><p><strong>- <em>Ripple </em>frekuensi respon lebih <em>smooth </em>dan <em>flat </em>pada frekuensi tinggi</strong></p><p>Desain khusus <em>Phase Plug </em>dan <em>Horn Adapter </em>melalui simulasi <em>FEA </em>menghasilkan <em>ripple </em>frekuensi respon yang <em>smooth </em>dan <em>flat </em>pada frekuensi tinggi</p><p><strong>- <em>Output </em>suara istimewa</strong></p><p>Desain khusus <em>Dome </em>yang terbuat dari <em>Titanium </em>dan menggunakan <em>Former Aluminium SV </em>menghasilkan respon yang bagus pada frekuensi tinggi dengan karakteristik suara yang khas.</p>', 'cd-250t1-08f-mk1-by-acr', 'c143d1bc-04b0-4172-a43d-c37ce9d54684', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal Driver Motor System</strong><br>The driver motor design uses a ferrite magnet with Ferrofluid, providing better heat resistance and more stability at high frequencies.</p></li><li><p><strong>- Smoother and Flatter Frequency Response Ripple at High Frequencies</strong><br>A specially designed phase plug and horn adapter, optimized through FEA simulation, result in a smooth and flat frequency response ripple at high frequencies.</p></li><li><p><strong>- Exceptional Sound Output</strong><br>A specially designed dome made from titanium and using an aluminum SV former delivers excellent high-frequency response with a distinctive sound character.</p></li></ul>'),
('2bd62366-34b2-4635-83f3-e9b0c5367a8f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in ARRAY 3060 M', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:09:56.465', '2025-10-24 08:40:48.851', '<p>-</p>', 'voice-coil-12in-array-3060-m', '140c3e3f-c6e1-4f6e-8fc0-c2fb89e50f59', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('3121422f-ef4c-4b7a-b6af-76e04040ba0f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 15753 W-Mk1 EXCEL BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 07:46:20.374', '2025-10-23 07:29:56.478', '<ul><li><p><strong>- Kompresi udara yang lebih baik</strong></p></li><li><p>Motor sistem didesain dengan lubang ventilasi untuk mengurangi kompresi udara dan menghasilkan sirkulasi udara sebagai pendingin.</p></li><li><p><strong>- Tahan Panas</strong></p></li><li><p><em>Voice coil</em> menggunakan bahan non konduktor dengan <em>coating </em>khusus sehingga mampu menangani panas yang tinggi dan <em>power </em>yang besar.</p></li><li><p><strong>- Material <em>Conepaper </em>khusus</strong></p></li><li><p><em>Conepaper </em>dibuat dengan material pilihan dengan <em>coating </em>khusus sehingga dapat menghasilkan warna suara yang bagus.</p></li></ul>', 'pa-15753-w-mk1-excel-by-acr', '70c4f494-5824-456b-91be-b986b63fdd23', 'admin', 0, '', '', '44b92746-0a20-4d7a-ba18-bc486ccac1d8', 0, 0, '', '', 0, '<ul><li><p><strong>- Improved Air Compression</strong><br>The motor system is designed with ventilation holes to reduce air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>- Heat Resistant</strong><br>The voice coil uses non-conductive material with a special coating, enabling it to withstand high temperatures and handle high power.</p></li><li><p><strong>- Special Conepaper Material</strong><br>The conepaper is made from selected materials with a special coating, producing a rich and high-quality sound character.</p></li></ul>'),
('319177f2-abf3-4cb9-b3f0-87316d2bfa7e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 100182 Mk3 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 02:11:00.814', '2025-10-23 07:43:21.851', '<p><strong>1. Power handling &amp; SPL yang maksimal</strong></p><p>Material gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat speaker dapat bertahan di suhu dan <em>power handling</em> tinggi serta menjadikan speaker semakin <em>powerfull</em></p><p><strong>2. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast</em> yang kokoh, dan dilengkapi ventilasi udara untuk membuang udara panas.</p><p><strong>3. Frekuensi kerja yang lebar</strong></p><p>Desain <em>speaker </em>dirancang secara khusus yang menghasilkan frekuensi kerja yang lebar, serta membuat lebih fleksibel dalam menentukan <em>crossover</em>.</p><p><strong>4. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga mampu bertahan di segala cuaca.</p>', 'pa-100182-mk3-sw-fab-by-acr', '872cc527-95de-4880-a772-5da04ff618a7', 'admin', 0, '', '', 'afa0d883-1c3a-4be2-859f-d1884214f32a', 0, 0, '', '', 1, '<ol><li><p><strong>1. Maximum Power Handling &amp; SPL</strong><br>The voice coil winding material is coated with a special layer, allowing the speaker to withstand high temperatures and high power handling—making the speaker more powerful and efficient.</p></li></ol><p><strong>2. Special Chassis Design</strong><br>The chassis is made from sturdy aluminum die-cast material and equipped with air vents to release excess heat, enhancing durability and thermal performance.</p><ul><li><p><strong>3. Wide Operating Frequency Range</strong><br>The speaker is specially designed to deliver a broad frequency response, offering greater flexibility in crossover configuration and sound reproduction.</p></li><li><p><strong>4. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, enabling it to withstand all weather conditions and ensuring long-lasting performance.</p></li></ul>'),
('31ea9e4a-c96a-4c42-b8be-22bdb65d8dd9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-113182-MK II SW FAB ACR SERIES', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:20:28.264', '2025-10-24 08:37:41.178', '<p>-</p>', 'voice-coil-18inpa-113182-mk-ii-sw-fab-acr-series', '3bedacbd-d74e-4cfe-a4f4-f979e47dbb9e', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('321177fa-546f-4592-a58c-93c156015f99', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-113188', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:28:06.640', '2025-10-24 08:37:15.862', '<p>-</p>', 'voice-coil-18inpa-113188', '4fdbf1de-a5f4-433a-843d-0001d930aa51', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('32687763-0c0d-4dad-a850-3c87429d0478', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" 648 CURVE BLACK', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 00:38:05.761', '2025-10-23 08:36:14.074', '', '648-curve-black', 'ce94e6a3-cd09-4307-9482-6a5a2878fa39', 'admin', 0, '', '', 'e33077a6-15f8-48b9-8a01-b25d39803fcf', 0, 0, '', '', 0, ''),
('330ed4b5-625f-4f99-9139-9f409ea9d7f3', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 30H120SRW38B-Mk1 ACR PRO', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-26 04:07:25.556', '2025-10-23 06:49:23.318', '<p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Kokoh</strong></p><p>Menggunakan <em>chassis plat </em>dengan desain yang baru sehingga memiliki konstruksi yang lebih kokoh</p>', '30h120srw38b-mk1-acr-pro', '8c1dae4e-2f34-43ac-a1bf-b467d970fed6', 'admin', 0, '', '', '710a50ea-a509-43e6-bd48-ca797bcb2fb1', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to deliver optimal magnetic power.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>- Sturdy Construction</strong><br>Built with a newly designed metal chassis plate, giving the speaker a more robust and durable structure.</p></li></ul>'),
('343c2b20-95b3-4cec-a62b-deff9bedffd9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" C-1018-HW CURVE', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-17 07:38:40.086', '2025-10-23 06:24:22.506', '<ul><li><p><strong>- Daya magnet yang optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p></li><li><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weather Resistance Conepaper)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p></li><li><p><strong>- Frekuensi respon yang lebar<em> (Wide bandwidth frequency response)</em></strong></p></li><li><p>Desain speaker dilengkapi dengan<em> \"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk<em> speaker fullrange.</em></p></li></ul>', 'c-1018-hw-curve', 'aa85fba5-2044-4496-98bc-1a28a14a99fd', 'admin', 0, '', '', '0255a39a-1b0d-44a0-8c33-abf6d2fd9a0e', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor design, developed using FEA (Finite Element Analysis), delivers optimal magnetic power.</p></li><li><p><strong>- Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker design includes a \"whizzer cone,\" providing a wide operating frequency range, making it highly suitable for full-range speaker applications.</p></li></ul>'),
('38b3ca56-22ac-4c88-ac00-0cd14f4810db', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" ARRAY 5061-Mk1 M FAB', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 05:46:31.933', '2025-10-23 08:38:03.375', '<p><strong>1. Daya magnet yang optimal dan tahan panas</strong></p><p>Pemilihan material magnet <em>neodymium </em>yang ringan dan tahan panas serta desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal.</p><ol start=\"2\"><li><p><strong>2. Minimum kompresi <em>(Low Compression)</em></strong></p></li><li><p>Motor dan <em>Chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p></li><li><p><strong>3. Distorsi yang rendah</strong></p></li><li><p>Penambahan<em> aluminium ring </em>pada <em>head yoke </em>memberikan hasil distorsi yang sangat rendah.</p></li><li><p><strong>4. <em>Chassis </em>menggunakan desain khusus</strong></p></li><li><p><em>Chassis </em>yang kokoh terbuat dari material <em>aluminium diecast </em>dan dilengkapi desain ventilasi khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik</p></li><li><p><strong>5.<em> Conepaper </em>tahan terhadap cuaca <em>(Weather Resistance Conepaper)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather Resistance</em> sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor</em> ataupun <em>outdoor </em>serta dapat menghasilkan suara yang lebih baik.</p></li><li><p><strong>6. <em>Speaker midrange </em>yang istimewa</strong></p></li><li><p><em>Speaker </em>driver yang sangat cocok digunakan untuk karakter <em>midrange </em>karena mampu menghasilkan suara yang detail dan natural pada frekuensi <em>mid</em>.</p></li></ol>', 'array-5061-mk1-m-fab', '508800e0-ba5d-4e38-a3d0-9bbe020c35a5', 'admin', 0, '-', '', '21c8c397-cf8d-4d74-855e-9b500a8dc270', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimized and Heat-Resistant Magnet Power</strong><br>Lightweight and heat-resistant neodymium magnet material is selected, and the motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>2. Low Compression</strong><br>The motor and chassis are designed with dedicated ventilation, preventing air compression and providing airflow for effective cooling.</p></li><li><p><strong>3. Low Distortion</strong><br>An aluminum ring added to the head yoke significantly reduces distortion, delivering cleaner sound output.</p></li><li><p><strong>4. Specially Designed Chassis</strong><br>The robust chassis is made of diecast aluminum and features a custom ventilation system at the bottom for efficient heat transfer.</p></li><li><p><strong>5. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use while enhancing sound quality.</p></li><li><p><strong>6. Outstanding Midrange Speaker</strong><br>This speaker driver is ideal for midrange applications, delivering natural and detailed sound reproduction in the mid frequencies.</p></li></ul>'),
('390b37b3-4997-440d-bbdb-4fc6198a7c73', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-100182 Mk3 Sw Fab', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:19:20.147', '2025-10-24 08:37:56.040', '<p>-</p>', 'voice-coil-18inpa-100182-mk3-sw-fab', '717f007d-8828-4d63-bca7-da02bee5c363', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('3c2403f6-1855-4619-93e7-af6d3cfd8d3e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" ARRAY 6510 M-Mk1 FAB BY ACR', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-18 05:34:05.080', '2025-10-23 06:22:32.362', '<p><strong>1. Daya magnet yang optimal dan tahan panas <em>(Optimized magnet power and heat resistant)</em></strong></p><p>Pemilihan <em>material magnet neodymium</em> yang ringan dan tahan panas sampai suhu yang sangat tinggi dan pemilihan design yang optimal melalui hasil pengukuran FEA)</p><p><strong>2. Chassis menggunakan desain khusus (Excellent chassis design)</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari <em>material diecast </em>yang bagus dan dilengkapi dengan desain ventilasi udara dan <em>Ribs Heatsink</em> pada <em>chassis</em>, untuk meredam panas.</p><p><strong>3. Smooth Frequency Response</strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type </em>dan dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><ol start=\"4\"><li><p>4. <strong><em>Maximum Power Handling</em></strong></p></li><li><p>Proses gulung <em>voice coil</em> dilengkapi dengan proses pengeleman dengan spesial coating memberikan hasil <em>power handling </em>yang sangat tinggi.</p></li></ol>', 'array-6510-m-mk1-fab-by-acr', '634cc9ae-2c6a-4772-9917-418ea9c9ee91', 'admin', 0, '', '', 'eda9bda0-8111-425e-a11a-40e09750cb9d', 0, 0, '', '', 1, '<ul><li><p><strong>1. Optimized Magnet Power and Heat Resistance</strong><br>Uses lightweight neodymium magnet material that is heat-resistant up to extremely high temperatures, with an optimized design based on FEA (Finite Element Analysis) results.</p></li><li><p><strong>2. Excellent Chassis Design</strong><br>A highly durable chassis made from quality die-cast material, featuring air ventilation and ribbed heatsinks to dissipate heat effectively.</p></li><li><p><strong>3. Smooth Frequency Response</strong><br>The conepaper, combined with M-type cloth surround and damping glue on the surround, delivers a smooth frequency response.</p></li><li><p><strong>4. Maximum Power Handling</strong></p></li></ul><p>The voice coil winding process is reinforced with a special coating and adhesive application, resulting in exceptionally high power handling capability.</p>'),
('3ce8d5ab-dae3-42c7-b8eb-0e98330e98b6', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 75157 W-N FAB BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-28 07:06:10.415', '2025-10-23 07:36:46.663', '<p><strong>1. Daya magnet yang optimal dan tahan panas.</strong></p><p>Pemilihan material<em> magnet neodymium</em> yang ringan dan tahan panas sampai suhu yang sangat tinggi dan pemilihan design yang optimal melalui hasil pengukuran <em>FEA.</em></p><p><strong>2. Minimum kompresi.</strong></p><p><em>Voice coil/spool</em> dan <em>motor part </em>didisain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. Distorsi yang rendah.</strong></p><p>Penambahan <em>cooper cap </em>pada kepala <em>T-yoke</em> memberikan hasil distorsi yang sangat rendah.</p><p><strong>4. Maksimum <em>power handling</em></strong></p><p>Kawat <em>Voice coil</em> menggunakan material unggulan <em>(APISVCAW)</em> memberikan hasil <em>power handling </em>yang sangat tinggi dan massa yang ringan untuk efisiensi yang lebih bagus.</p><p><strong>5. Material <em>Conepaper </em>khusus.</strong></p><p><em>Conepaper </em>dibuat tahan terhadap cuaca dengan metode <em>rigid non press</em> serta menggunakan material khusus yang dikombinasikan dengan karbon menghasilkan <em>conepaper </em>yang sangat kuat, kokoh, dan ringan memberikan kualitas suara yang prima.</p><p><strong>6.<em> ISV : Interleaved Sandwich Voice coil</em></strong></p><p>Teknologi <em>ISV </em>memberikan transfer panas yang sangat baik dan menurunkan temperatur kerja <em>voice coil.</em> Keunggulan lain dari teknologi <em>ISV </em>adalah menambah daya tahan terhadap panas dan menjadikan <em>speaker </em>mampu bertahan pada level <em>power </em>yang sangat tinggi.</p><p><strong>7. <em>Chassis </em>menggunakan desain khusus.</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari <em>material diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang sangat baik</p>', 'pa-75157-w-n-fab-by-acr', '7ceedac5-da6c-419f-85bf-4207b2385a35', 'admin', 0, '', '', 'ebe268a9-e8e1-49d3-bfcd-ba20beba7c10', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal and Heat-Resistant Magnetic Power</strong><br>Uses lightweight neodymium magnets that can withstand extremely high temperatures. The magnet design is optimized through FEA (Finite Element Analysis).</p></li><li><p><strong>2. Minimum Compression</strong><br>The voice coil/spool and motor parts are designed with special ventilation to eliminate air compression and provide effective airflow for cooling.</p></li><li><p><strong>3. Low Distortion</strong><br>A copper cap is added to the T-yoke, resulting in extremely low distortion levels.</p></li><li><p><strong>4. Maximum Power Handling</strong><br>The voice coil wire uses premium material (APISVCAW), which offers very high power handling and low mass for improved efficiency.</p></li><li><p><strong>5. Special Conepaper Material</strong><br>The conepaper is weather-resistant, made using the rigid non-press method, and combines special materials with carbon. This results in a very strong, durable, and lightweight cone that delivers excellent sound quality.</p></li><li><p><strong>6. ISV: Interleaved Sandwich Voice Coil</strong><br>ISV technology provides excellent heat transfer and reduces the operating temperature of the voice coil. It also enhances heat resistance, allowing the speaker to perform reliably at very high power levels.</p></li><li><p><strong>7. Specially Designed Chassis</strong><br>The chassis is made from high-quality die-cast material and features a special design on the bottom to ensure excellent heat dissipation.</p></li></ul>'),
('3d44f2c8-1ae0-4485-bcc6-2a38ce60f87c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in PA-15838 EXCEL ACR SERIES', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:22:42.662', '2025-10-24 08:40:05.472', '<p>-</p>', 'voice-coil-15in-pa-15838-excel-acr-series', '74c4721e-daea-48c6-95b5-6c3142e8dec0', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('3d77e350-b924-4578-8e9a-0a9f901c9d9c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1238-PC Classic NEW', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-25 09:11:07.101', '2025-10-23 06:31:55.330', '<p><strong>- Daya magnet optimal<em> (Optimized magnet power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weather resistance)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p><p><strong>- Respon frekuensi lebar <em>(wide bandwidth frequency response)</em></strong></p><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em>.</p><p><strong>- Minimum kompresi <em>(Low Compression)</em></strong></p><p>Motor didisain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p>', '1238-pc-classic-new', '7a8ad9d5-1ab8-4b67-b1ae-aec420af2de4', 'admin', 0, '', '', '3399f479-9de3-493f-8176-75eb5ba4d574', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis) to deliver optimized magnetic performance.</p></li><li><p><strong>- Weather Resistance</strong><br>The conepaper is coated with a weather-resistant layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is equipped with a <em>whizzer cone</em>, providing a wide frequency range, making it ideal for full-range speaker use.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li></ul>'),
('425f92fa-ce30-420e-b165-b244ca12b753', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 251 BLACK', 1, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-26 03:31:03.428', '2025-10-23 08:56:24.916', '<p><strong>1. Sistem motor <em>driver </em>optimal</strong></p><p>Desain sistem motor <em>driver </em>menggunakan magnet <em>ferrite </em>dengan penambahan <em>Ferrofluid </em>yang lebih tahan panas dan lebih stabil di frekuensi tinggi.</p><p><strong>2. Frekuensi respon lebih lebar dan <em>flat</em></strong></p><p>Desain khusus <em>Horn Adaptor </em>dan <em>Phase Plug </em>melalui simulasi <em>FEA </em>menghasilkan frekuensi respon yang lebih flat pada frekuensi tinggi dengan sedikit distorsi.</p><p><strong>3. <em>Output </em>suara yang jernih</strong></p><p>Desain khusus <em>Dome Compression Driver </em>yang terbuat dari <em>Polyethylene Naphthalate (PEN)</em> dan menggunakan <em>Former Kapton </em>menghasilkan suara yang jernih dan bersih pada frekuensi tinggi.</p>', 'cd-251-black', '855b9d1b-15a8-4a19-a474-d121b89d4f6a', 'admin', 0, 'ACR Product - Black Series', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Driver Motor System</strong><br>The driver motor system is designed using a ferrite magnet with the addition of Ferrofluid, providing better heat resistance and improved stability at high frequencies.</p></li><li><p><strong>2. Wider and Flatter Frequency Response</strong><br>A specially designed horn adapter and phase plug, optimized through FEA simulation, deliver a flatter frequency response at high frequencies with minimal distortion.</p></li><li><p><strong>3. Clear Sound Output</strong><br>The specially designed dome compression driver, made from Polyethylene Naphthalate (PEN) and using a Kapton former, produces clear and clean sound at high frequencies.</p></li></ul>'),
('42c75af2-2af0-4d21-a75e-beb6e0d32c82', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in ACR-1230', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:06:34.585', '2025-10-24 08:40:56.436', '<p>-</p>', 'voice-coil-12in-acr-1230', 'd6555b28-d644-4509-9f85-429b88ec26f4', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('439feefb-d2fc-453d-b2e1-96ef4b72e319', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18in PA-18838 EXCEL ACR SERIES', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:23:20.401', '2025-10-24 08:38:24.783', '<p>-</p>', 'voice-coil-18in-pa-18838-excel-acr-series', 'febfb81a-d47a-4e8f-8779-9703000a8bc1', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('441e4e3a-c2e0-4d72-9fdb-5f7e5c063e9b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 381006-Mk1 Desibel', 1, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-17 07:13:58.084', '2025-10-23 07:17:41.046', '<p><strong>1. Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>2. <em>Weatherproof conepaper</em></strong></p><p>Material <em>conepaper</em> dibuat berbahan dasar UKP 100% SR 18° + KPK (Kapuk) yang diproses dengan metode <em>“rigid non-press\"</em> dan dilapisi dengan lapisan <em>weatherproof </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik</p><p><strong>3. Minim kompresi</strong></p><p><em>Motor</em> dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. <em>Power handling</em> yang maksimal</strong></p><p><em>Voice coil wire </em>menggunakan material <em>EISVW </em>dan gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling </em>tinggi.</p><p><strong>5. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik.</p>', '381006-mk1-desibel', '74fcb8db-645a-42fe-8f9f-f58dac8abd73', 'admin', 0, 'Desibel Product', '', '376550e5-b8ac-4e5b-8531-a10f6b9b973e', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The speaker’s magnetic motor delivers optimal power, thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>2. Weatherproof Conepaper</strong><br>The conepaper is made from a base of 100% UKP SR 18° and KPK (Kapok fiber), processed using a rigid non-press method and coated with a weatherproof layer—making it durable in all weather conditions and capable of producing better sound quality.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and ensure proper airflow for effective cooling.</p></li><li><p><strong>4. Maximum Power Handling</strong></p></li></ul><p>The voice coil wire is made from EISVW material, and the winding is coated with a special layer, allowing the voice coil to withstand high temperatures. This ensures the speaker can perform reliably under high power handling conditions.</p><ul><li><p><strong>5. Special Chassis Design</strong><br>The highly durable chassis is made from quality die-cast material and features a specially designed bottom section for efficient heat dissipation.</p></li></ul>'),
('448917b8-5726-42da-9d21-690db3e9a30e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 21in AX-21800 Mk1 BLACK GRAND ACR', 0, 0, '656894ee-ab2f-45e7-ba96-51bcd09eb3b1', '2025-06-20 03:16:04.523', '2025-10-24 08:36:56.426', '<p>-</p>', 'voice-coil-21in-ax-21800-mk1-black-grand-acr', 'd9e24b8b-15fd-4c32-85ef-aa71a67cd9ba', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('456c32ea-9538-400f-a845-37d202b0dc60', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 440PK1-04N', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:38:45.379', '2025-10-23 09:16:01.970', '<p>-</p>', 'recone-kit-cd-440pk1-04n', '6239241f-ddf4-4596-aca2-9329aa58309c', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('4726f6e8-0467-426f-aa94-945092951712', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 100182 Mk2 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:11:40.815', '2025-10-23 07:42:18.949', '<ul><li><p><strong>- Desain <em>Chassis </em>yang Istimewa</strong></p></li><li><p><em>Chassis </em>terbuat dari material <em>diecast </em>yang baik dan dilengkapi dengan desain khusus pada bagian bawah sebagai pemindah panas yang sangat baik.</p></li><li><p><strong>- Sistem motor rendah distorsi dan lebih tahan panas</strong></p></li><li><p><em>Voice Coil Bonder </em>pada<em> voice coil</em> menambah ketahanan terhadap suhu tinggi dan desain motor khusus membuat distorsi <em>speaker </em>yang sangat rendah.</p></li><li><p><strong>- <em>Output </em>suara yang istimewa</strong></p></li><li><p>Penambahan <em>coating CLB </em>pada <em>conepaper </em>untuk tahan terhadap air dan kelembaban dan juga mampu memproduksi kualitas suara yang lebih baik.</p></li></ul>', 'pa-100182-mk2-sw-fab-by-acr', '619adcbe-30ce-4666-960b-c3cee5b0dd30', 'admin', 0, '', '', '4ca93472-2952-4870-9ad3-8270988a5b35', 0, 0, '', '', 0, '<ul><li><p><strong>- Exceptional Chassis Design</strong><br>The chassis is made from high-quality die-cast material and features a specially designed bottom section that acts as an excellent heat conductor, improving thermal performance.</p></li><li><p><strong>- Low-Distortion and Heat-Resistant Motor System</strong><br>The voice coil uses a bonder that enhances its resistance to high temperatures, while the specially designed motor significantly reduces speaker distortion.</p></li><li><p><strong>- Superior Sound Output</strong><br>A CLB coating is applied to the conepaper, making it resistant to water and humidity while also improving overall sound quality.</p></li></ul>'),
('4a2c8f6d-53ba-4ee1-b2df-2680fcce2981', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 1590 ACR BLACK MAGIC', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 09:20:09.413', '2025-10-23 07:15:53.171', '<p>1<em>. Voice Coil </em>menggunakan kawat<em> Copper Clad Aluminium </em>yang ringan sehingga menghasilkan <em>SPL </em>yang tinggi dan suara yang jernih. <em>Former </em>menggunakan <em>Till </em>yang mempunyai ketahanan terhadap panas dan <em>power </em>yang besar.</p><p>2. <em>Conepaper </em>menggunakan <em>Triple Roll Cloth </em>untuk menghasilkan suara lebih dinamis dengan <em>stroke </em>yang memadai.</p><p>3. <em>Chassis </em>berbahan<em> Aluminium diecast</em> yang sangat kokoh untuk menunjang kestabilan suara yang dihasilkan.</p><p>4. Sirkulasi udara yang terkompresi lebih terkontrol dengan adanya lubang ventilasi pada <em>driver</em>.</p>', '1590-acr-black-magic', 'e5707b35-e06a-4c0b-87e2-4f6ba8c4a8b4', 'admin', 0, '', '', '4d8ff390-d5a6-4e7c-b466-6337e4ab4dca', 0, 0, '', '', 0, '<ul><li><p>1. Voice Coil uses lightweight Copper Clad Aluminum wire, resulting in high SPL and clear sound. The former is made of Till material, known for its excellent heat resistance and high power handling.</p></li><li><p>2. Conepaper features a Triple Roll Cloth surround to produce more dynamic sound with adequate cone excursion.</p></li><li><p>3. Chassis is made from highly durable aluminum die-cast material to support stable sound performance.</p></li><li><p>4. Controlled Air Compression is achieved through ventilation holes in the driver, ensuring better airflow regulation.</p></li></ul>'),
('4a42604a-1965-43c3-9df1-9ee68deb8c97', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 250P1-08F (CD 10) ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:23:21.852', '2025-10-23 08:53:40.290', '<ul><li><p><strong>- Sistem Motor <em>Driver </em>optimal</strong></p></li><li><p>Desain <em>Driver </em>Motor menggunakan magnet <em>ferrite </em>yang menggunakan <em>Ferrofluid </em>lebih tahan panas dan lebih stabil pada Frekuensi tinggi.</p></li><li><p><strong>- <em>Range </em>frekuensi respon Lebih Lebar dan <em>Flat </em>pada frekuensi tinggi</strong></p></li><li><p>Desain khusus <em>Phase Plug </em>dan <em>Adapter Horn </em>melalui simulasi <em>FEM </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (2000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi</p></li><li><p><strong>- Output Suara yang Jernih dan Bersih</strong></p></li><li><p>Desain khusus <em>Dome Compression Driver</em> yang terbuat dari <em>Polyetherimide (PEI)</em> dan menggunakan <em>Former Kapton </em>menghasilkan suara yang jernih dan bersih pada frekuensi tinggi.</p></li></ul>', 'cd-250p1-08f-cd-10-acr', 'c6eab30c-2ff2-47f9-9e6b-37344a0d2d74', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal Driver Motor System</strong><br>The driver motor design uses a ferrite magnet with Ferrofluid, making it more heat-resistant and more stable at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response at High Frequencies</strong><br>A specially designed Phase Plug and Horn Adapter, optimized through FEM simulation, produce a wider frequency response range (2000 Hz – 20000 Hz) and a flat response at high frequencies.</p></li><li><p><strong>- Clear and Clean Sound Output</strong><br>A specially designed compression driver dome made of Polyetherimide (PEI) and using a Kapton former delivers clear and clean sound at high frequencies.</p></li></ul>'),
('4c2fbd93-7852-4c85-89bd-71608654e61b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in 1238-PC', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:07:23.071', '2025-10-24 08:41:17.178', '<p>-</p>', 'voice-coil-12in-1238-pc', '752f19c3-4036-475d-9dcf-6eee01add2e5', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('4dd3f161-ac55-4317-aea3-4ed3d8c043db', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" ARRAY 2050 M FAB BY ACR', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 05:55:37.449', '2025-10-23 08:47:02.776', '', 'array-2050-m-fab-by-acr', 'b160d7a7-9c1b-44b3-9747-c7a1f392fe29', 'admin', 0, '', '', 'b393309f-d0a3-45ae-9701-d28bf81a5bed', 0, 0, '', '', 0, ''),
('4e77e40b-5b43-46ad-9972-2e4fe9c63ba6', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 113186 Mk1 SW Fab', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-10-13 07:34:23.194', '2025-10-22 01:16:17.585', '<p>COMING SOON</p>', '113186-mk1-sw-fab', 'd6877fb2-7bcd-4ee6-85d1-9fe654d9817d', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<p>COMING SOON</p>'),
('51e1dc2b-bf70-4a50-9282-369f1565f6c4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15200-Mk1', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-27 09:18:24.776', '2025-10-23 07:09:20.932', '<p><strong>1. Daya <em>magnet </em>optimal</strong></p><p>Desain <em>motor </em>yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Material conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\" </em>dan dilapisi dengan lapisan <em>weather</em> <em>resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type </em>dan dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p>', '15200-mk1', 'e61f8097-3fce-47fb-85a9-ad2aefc22748', 'admin', 0, '', '', '9051bdf8-5ba2-40de-be0d-4f75a599abc7', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from special paper processed using a “rigid non-press” method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with additional ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The conepaper features an M-type cloth surround combined with damping glue on the surround, delivering a smooth frequency response.</p></li></ul>'),
('5252d835-bbbb-40de-8135-fae2dce4bd18', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 250C1-08 (CD 1) / CD 250C1-08F-Mk1 ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:30:49.692', '2025-10-23 09:14:51.081', '<p>-</p>', 'recone-kit-cd-250c1-08-cd-1', 'c5b9427f-ef7e-47de-9220-88f08e467e96', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('5294f505-9ffe-4d3e-b387-8e2ba2d9b6be', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 30601 Desibel', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-17 06:46:02.243', '2025-10-23 06:48:15.465', '<ul><li><p><strong>- Daya magnet optimal</strong></p></li><li><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p></li><li><p><strong>- <em>Weatherproof conepaper</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p></li><li><p><strong>- Minim Kompresi</strong></p></li><li><p><em>Voice coil/spool </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p></li><li><p><strong>- <em>Power Handling</em> Yang Maksimal</strong></p></li><li><p>Gulungan<em> voice coil </em>dilapisi dengan spesial coating membuat<em> voice coil</em> dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling </em>tinggi.</p></li></ul>', '30601-desibel', '3a8e6ab3-a395-4f6b-9304-e929d11503b4', 'admin', 0, '', '', '0b559916-bc6f-4a88-894d-0dbaa55c5471', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The speaker’s magnetic motor power is optimized through a design that uses FEA (Finite Element Analysis) technology.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Low Compression</strong><br>The voice coil/spool is designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special layer, enabling it to withstand high temperatures—allowing the speaker to operate reliably under high power handling conditions.</p>'),
('55a73278-a01e-467b-b592-ed6f2ce495e4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" 638 CURVE', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 00:33:36.400', '2025-10-23 08:35:24.453', '<p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dibuat dengan menggunakan material \"UKP 100%\" menghasilkan <em>conepaper </em>yang kuat dan memberikan suara yang prima. <em>Conepaper </em>juga dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal</p><p><strong>- Frekuensi kerja yang lebar <em>(Wide Bandwidth)</em></strong></p><p>Desain <em>speaker </em>khusus yang menghasilkan frekuensi kerja yang lebar dari 60 Hz - 11700 Hz</p><p><strong>- Kompresi udara yang baik</strong></p><p><em>Conepaper </em>dilengkapi ventilasi pada area<em> inner diameter cone </em>memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada saat bekerja.</p>', '638-curve', 'cb12c2e8-c376-4af6-b721-250cf88c1143', 'admin', 0, '', '', '112d828c-a0ed-4711-b5c6-d1c81db8c2c4', 0, 0, '', '', 0, '<ul><li><p><strong>- Weatherproof Conepaper</strong><br>Made from 100% UKP material, the conepaper is strong and capable of producing excellent sound quality. It is also coated with a weatherproof layer, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using Finite Element Analysis (FEA), resulting in optimized magnetic performance for improved speaker efficiency.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>A specially engineered speaker design delivers a wide operating frequency range from 60 Hz to 11,700 Hz, ensuring clear and detailed audio across the spectrum.</p></li><li><p><strong>- Efficient Airflow and Compression Control</strong><br>The conepaper includes ventilation around the inner diameter area, providing effective airflow to reduce air compression during operation and maintain performance stability.</p></li></ul>');
INSERT INTO `product` (`id`, `brandId`, `name`, `isFeatured`, `isArchived`, `sizeId`, `createdAt`, `updatedAt`, `description`, `slug`, `specId`, `updatedBy`, `isNewProduct`, `featuredDesc`, `series`, `thieleSmallParameter2OhmId`, `isCeiling`, `isHorn`, `ceilingSpecId`, `hornSpecId`, `haveSparepart`, `description_english`) VALUES
('56ac2bae-557c-4c9b-a970-dd938c6dff45', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 15890 Mk4 EXCEL BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 07:14:19.312', '2025-10-23 07:34:01.475', '<p><strong>1. Tahan Panas</strong></p><p>- <em>Voice Coil 4inch </em>dengan kawat pipih yang memberikan keunggulan berat yang ringan dan juga memiliki daya tahan terhadap suhu yang tinggi dan <em>power </em>yang besar.</p><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool</em> mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p>- <em>New Model Chassis </em>berbahan<em> aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p><p>- <em>Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p>-<em> Non Press Conepaper</em> dengan diberi lapisan <em>coating </em>pada bagian depan dan belakang, untuk memperoleh suara bass yang solid dan juga tahan terhadap cuaca.</p><p><strong>4. Daya magnet lebih optimal</strong></p><p>- Penentuan daya motor magnet speaker yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA.</em></p><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p>', 'pa-15890-mk4-excel-by-acr', '8b1a7b44-5e6b-4822-b868-323aad789535', 'admin', 0, '', '', '1c4a2286-1022-4c35-8cd0-c5dd11383b57', 0, 0, '', '', 1, '<ol><li><p><strong>1. Heat Resistant</strong></p></li></ol><ul><li><p>- The 4-inch voice coil uses flat wire, offering a lightweight advantage while providing excellent resistance to high temperatures and high power handling.</p></li><li><p>- It features a non-conductive fiberglass former and advanced coil wire coating technology, allowing the voice coil/spool to operate even at temperatures above 280°C.</p></li></ul><ol start=\"2\"><li><p><strong>2. Sturdy and Low Compression</strong></p></li></ol><ul><li><p>- The new model chassis is made from carefully engineered aluminum die-cast material, providing maximum strength and minimal compression.</p></li></ul><ol start=\"3\"><li><p><strong>3. Stable with High Excursion</strong></p></li></ol><ul><li><p>- The triple round surround enhances speaker stability and allows for greater cone excursion.</p></li><li><p>- The non-press conepaper is coated on both the front and back, resulting in solid bass performance and improved weather resistance.</p></li></ul><ol start=\"4\"><li><p><strong>4. Optimized Magnetic Power</strong></p></li></ol><ul><li><p>- The speaker\'s magnetic motor power is optimized using FEA (Finite Element Analysis) software design.</p></li><li><p>- Ventilation holes are included to allow airflow, helping to reduce excess heat buildup.</p></li></ul>'),
('58f8b46a-d38f-4f22-87b2-b8c450d51991', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" CS 605 ACR', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-28 05:47:58.575', '2025-10-23 08:39:36.813', '', 'cs-605-acr', '91cb0c23-ff66-413a-a1d7-0127b846ec6c', 'admin', 0, '', '', '', 1, 0, '4372c8d6-e34a-4a1b-abd9-54105f1e0d6f', '', 0, ''),
('59b6c998-dcbf-4d76-a8c2-2d38553e0196', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15inPA-113156', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:18:40.648', '2025-10-24 08:38:44.687', '<p>-</p>', 'voice-coil-15inpa-113156', '934161fa-8270-484e-b929-5eda587fa0d9', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('5a23680a-ca87-413b-9a05-48740f3632c2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'HORN H-225 ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:41:03.270', '2025-10-23 09:11:27.071', '', 'horn-h-225-acr', '54ce989a-e8be-4457-be9c-29473ba6774e', 'admin', 0, '', '', '', 0, 1, '', '05095d38-d63e-48a8-9238-b1d1c24ffaab', 0, ''),
('5abc04a5-28c3-45d1-9762-5ff7d4007be5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 340PK1B-08F FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:35:25.217', '2025-10-23 08:58:25.954', '<ul><li><p><strong>- Sistem motor <em>driver </em>rendah distorsi dan efisien.</strong></p></li><li><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>untuk menghasilkan <em>Compression Driver </em>yang rendah Distorsi dan lebih efisien pada Frekuensi tinggi.</p></li><li><p><strong>- Frekuensi respon lebih <em>flat </em>pada frekuensi tinggi dengan <em>output </em>suara yang khas.</strong></p></li><li><p>Desain khusus <em>dome </em>berbahan <em>PEEK </em>dan desain khusus <em>Horn Point </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon (1500 Hz - 20000 Hz) yang <em>flat </em>pada frekuensi tinggi dengan output suara yang khas</p></li><li><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p></li><li><p>Desain <em>Voice Coil 1.34in (34.4 mm)</em> menggunakan<em> rectangular wire </em>dengan <em>exit throat 1in (25.4 mm)</em> pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p></li></ul>', 'cd-340pk1b-08f-fabulous', '65ac78a2-e66e-4681-80d5-3845a69f46ac', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using a ferrite magnet and simulated with FEMM to produce a compression driver with low distortion and greater efficiency at high frequencies.</p></li><li><p><strong>- Flatter High-Frequency Response with Distinctive Sound Output</strong><br>The specially designed dome made from PEEK material and the custom Horn Point, simulated through FEA, produce a frequency response range (1500 Hz – 20000 Hz) that is flat at high frequencies with a distinctive sound character.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.34-inch (34.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for Compact 2-Way Systems and Multi-Driver Line Array Systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('5bb64d4f-8e7c-4e68-8956-5cc2a8eab07c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15750 BLACK', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-04-08 02:04:10.124', '2025-10-23 07:15:17.172', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\"</em> dan dilapisi dengan lapisan <em>weather resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dengan <em>surround cloth tripple-roll</em> dan dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.<br><strong>5. Power handling yang maksimal</strong></p><p>Gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil</em> dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada<em> power handling </em>tinggi</p>', '15750-black', '01322a13-5435-4455-8df6-248f4885361c', 'admin', 0, '-', '', '9dd02ca9-2910-46da-9154-bf77bcd2145b', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from special paper processed using the “rigid non-press” method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor applications.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with additional ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The conepaper features a triple-roll cloth surround with damping glue, delivering a smooth and refined frequency response.</p></li><li><p><strong>5. Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special layer, allowing it to endure high temperatures so the speaker can reliably handle high power levels.</p>'),
('5c93c2f1-a476-40ba-8e8b-46ec0ba1ecf9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" ACR 15500 BLACK PLATINUM', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-27 09:13:21.038', '2025-10-23 07:23:54.488', '<p><strong>- Daya magnet yang optimal<em> (optimized magnet power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- Respon frekuensi yang halus <em>(Smooth Frequency Response)</em></strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type </em>dan dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>- Minimum kompresi<em> (Low Compression)</em></strong></p><p><em>Motor </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p><strong>- <em>Dustcap aluminium </em>yang eksklusif<em> (Exclusive aluminium dustcap)</em></strong></p><p>Desain <em>dustcap </em>yang menggunakan material <em>aluminium </em>memberikan kesan eksklusif baik secara penampilan maupun suara sehingga cocok digunakan untuk <em>speaker Fullrange</em></p>', 'acr-15500-black-platinum', '07a115ce-5934-4d3c-9d34-fb9664ec521a', 'admin', 0, '', '', '64ce47db-7c37-4bea-b8bb-39f388c7372c', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimized magnetic performance.</p></li><li><p><strong>- Smooth Frequency Response</strong><br>The conepaper, combined with an M-type cloth surround and damping glue, delivers a smooth and balanced frequency response.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with additional ventilation to eliminate air compression and ensure airflow that functions as a cooling system.</p></li><li><p><strong>- Exclusive Aluminum Dustcap</strong><br>The aluminum dustcap design adds an exclusive look and enhances sound quality, making it ideal for full-range speaker applications.</p></li></ul>'),
('5dabf21f-822e-4bcd-b000-efb9e0da7531', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 440PK1B-08F FAB ACR SERIES', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:40:14.544', '2025-10-23 09:16:17.710', '<p>-</p>', 'recone-kit-cd-440pk1b-08f-fab-acr-series', 'ca2d2d9e-170c-4f8c-be02-261024460ad0', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('5e327134-832f-4c64-8f0b-da695106e9a8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 440T1-08 (CD 4)', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:32:47.138', '2025-10-23 09:16:37.146', '<p>-</p>', 'recone-kit-cd-440t1-08-cd-4', '6babc2cc-c18e-4bf9-a6d6-0cfb6698452c', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('6004ce5c-4e7b-49e0-8172-62a568487f5f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 380C1-08F (CD 6) ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:38:17.684', '2025-10-23 09:02:08.694', '<p><strong>- Sistem Motor <em>Driver </em>optimal.</strong></p><p>Desain <em>driver </em>motor menggunakan magnet <em>ferrite </em>melalui simulasi <em>FEM </em>untuk menghasilkan sistem motor yang optimal.</p><p><strong>- <em>Range </em>frekuensi respon optimal untuk <em>Mid High </em>frekuensi.</strong></p><p>Desain khusus <em>phase plug </em>dan<em> Adapter Horn</em> melalui simulasi <em>FEM </em>menghasilkan respon pada<em> Mid High</em> frekuensi lebih optimal dan <em>flat</em>.</p><p><strong>- Menghasilkan Suara Vokal yang jelas.</strong></p><p>Desain khusus <em>Dome </em>yang terbuat dari <em>Cloth </em>dan menggunakan<em> Former Nomex </em>menghasilkan suara vokal yang jelas dan memiliki karakteristik suara khas</p>', 'cd-380c1-08f-cd-6-acr', 'b8543f78-db7e-44c4-84e8-1a54240398ac', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Driver Motor System</strong><br>The driver motor is designed using a ferrite magnet and simulated with FEM to produce an optimized motor system.</p></li><li><p><strong>- Optimal Frequency Response Range for Mid-High Frequencies</strong><br>A specially designed phase plug and horn adapter, simulated with FEM, result in a more optimal and flat response in the mid-high frequency range.</p></li><li><p><strong>- Produces Clear Vocal Sound</strong><br>A specially designed dome made from cloth and a Nomex former delivers clear vocal output with distinctive sound characteristics.</p></li></ul>'),
('60a7ea10-d7bc-4c00-b4f1-edb2c6f87003', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1238-Mk1 PC ACR CLASSIC NEW', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-26 06:00:37.807', '2025-10-23 06:30:20.998', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\"</em> dan dilapisi dengan lapisan <em>weather resistance</em> sehingga speaker cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Respon frekuensi yang lebar</strong></p><p>Desain speaker dilengkapi dengan<em> \"whizzer cone\" </em>memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em>.</p><p><strong>4. Minimum kompresi dan distorsi</strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin. Penambahan <em>coppercap </em>pada<em> head yoke </em>yang berfungsi untuk meminimalkan distorsi speaker dan menambah <em>SPL </em>di frekuensi tinggi.</p>', '1238-mk1-pc-acr-classic-new', 'b790a1c2-3d3b-4b59-a263-a95c6871fa9d', 'admin', 0, '', '', 'e89e694c-a12a-453f-89a5-4c01e8c67486', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic power.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from a special paper material processed using the \"rigid nonpress\" method and coated with a weather-resistant layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>3. Wide Frequency Response</strong><br>The speaker is equipped with a \"whizzer cone,\" offering a wide frequency range and making it highly suitable for full-range speaker use.</p></li><li><p><strong>4. Low Compression and Distortion</strong><br>The motor is designed with special ventilation to eliminate air compression and allow airflow for cooling. A copper cap is added to the head yoke to minimize speaker distortion and boost SPL at high frequencies.</p></li></ul>'),
('6199296b-6dd6-41db-ad35-14ba2241e9e2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 21inPA-127212', 0, 0, '656894ee-ab2f-45e7-ba96-51bcd09eb3b1', '2025-10-22 06:57:17.498', '2025-10-24 08:45:54.445', '', 'recone-kit-21inpa-127212', 'b370ba1f-2d28-4d5d-8a84-06da872d17ba', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('62dfbe1b-9103-4f96-bfe7-672a6c5272e8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 65 Desibel', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-17 06:06:01.114', '2025-10-23 09:09:38.315', '<p><strong>- Desain Struktur Motor <em>Driver </em>yang optimal.</strong></p><p>Desain struktur motor menggunakan magnet <em>ferrite </em>yang di simulasikan dengan <em>FEMM </em>untuk menghasilkan sistem motor <em>driver </em>yang optimal.</p><p><strong>- <em>Range </em>Frekuensi <em>Response </em>yang lebar.</strong></p><p>Desain khusus <em>dome </em>yang terbuat dari bahan <em>Titanium </em>memungkinkan <em>Compression Driver </em>menghasilkan <em>range </em>frekuensi <em>response </em>yang lebih lebar (1000 Hz - 20000 Hz) dan lebih bagus pada area <em>high </em>frekuensi.</p><p><strong>- Ideal untuk <em>Compact 2-way system &amp; Multi Driver Line Array System</em></strong></p><p>Desain <em>Voice Coil 2.55in (65 mm)</em> dengan<em> Exit Throat 1.4in (35.6 mm) </em>pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk<em> Compact 2-way system &amp; Multi Driver Line Array System </em>yang menghasilkan kualitas suara lebih baik.</p>', 'cd-65-desibel', '916e486c-ce7b-444f-9ebd-f3eb8e84174c', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized Driver Motor Structure Design</strong><br>The motor structure design uses a ferrite magnet simulated with FEMM to produce an optimal driver motor system.</p></li><li><p><strong>- Wide Frequency Response Range</strong><br>The specially designed dome made of titanium allows the compression driver to deliver a wider frequency response range (1000 Hz – 20,000 Hz) with better performance in the high-frequency area.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 2.55-inch (65 mm) voice coil design with a 1.4-inch (35.6 mm) exit throat on the compression driver makes it highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering improved sound quality.</p></li></ul>'),
('62fa3e42-a4f1-47c3-8086-09e78d3920f1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" ARRAY 5061 M FAB BY ACR', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-18 05:50:56.315', '2025-10-23 08:37:36.137', '<p><strong>- Daya magnet yang optimal dan tahan panas</strong></p><p>Pemilihan material <em>magnet neodymium</em> yang tahan panas sampai suhu yang sangat tinggi dan pengukuran dengan menggunakan <em>FEA </em>sehingga design magnet adalah yang optimal.</p><p><strong>- Distorsi rendah</strong></p><p>Penambahan modul <em>ring aluminium </em>sehingga distorsinya sangat rendah.</p>', 'array-5061-m-fab-by-acr', '8a136969-1d8b-484f-9bbe-f9ba6175f348', 'admin', 0, '', '', 'eff5b234-4f00-49f3-aca1-3934330e9874', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized and Heat-Resistant Magnet Power</strong><br>The use of high-temperature-resistant neodymium magnet material, combined with FEA (Finite Element Analysis) simulations, results in an optimally designed and thermally stable magnet system.</p></li><li><p><strong>- Low Distortion</strong><br>An added aluminum ring module significantly reduces distortion, delivering cleaner and more accurate sound output</p></li></ul>'),
('63459b18-3038-45de-b12c-87e3470002df', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 340T1-08N (CD7-Mk3) EXCEL ACR SERIES', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:34:54.195', '2025-10-23 09:15:31.673', '<p>-</p>', 'recone-kit-cd-340t1-08n-cd7-mk3-excel-acr-series', '222db498-cff0-42dc-a849-b3f09a55e875', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('63a20696-b646-42dc-9c8a-6d50b1d9dc3b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 18inPA-127187', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:50:25.601', '2025-10-24 08:41:56.469', '<p>-</p>', 'recone-kit-18inpa-127187', 'c1b2e5aa-adf3-4c67-879f-e81c26bba2e8', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('686525b0-4d7a-4b26-a274-25dfc4b0e9aa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 157165 DELUXE BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 08:51:43.910', '2025-10-23 07:13:47.454', '<p><strong>1. <em>Power handling</em> yang maksimal <em>(Maximum power handling)</em></strong></p><p><em>Material voice coil wire</em> yang menggunakan <em>EISVW </em>dapat bertahan di suhu yang tinggi sehingga <em>speaker </em>mampu bertahan pada <em>power handling</em> yang tinggi.</p><p><strong>2. Material <em>conepaper </em>khusus<em> (Special conepaper material)</em></strong></p><p><em>Conepaper </em>terbuat dari bahan khusus yang tahan terhadap cuaca dan dibuat dengan metode <em>\'rigid non-press\'</em> menghasilkan <em>conepaper </em>yang kuat dan mampu menghasilkan suara yang istimewa.</p><p><strong>3. Desain <em>chassis </em>yang bagus<em> (Good Chassis design)</em></strong></p><p><em>Chassis </em>didesain dengan dilengkapi ventilasi udara pada bagian bawah sehingga mampu memberikan sirkulasi udara yang bagus dan berfungsi sebagai transfer panas.</p><p><strong>4. Kompresi udara yang lebih baik <em>(Better air compression)</em></strong></p><p><em>Driver </em>mempunyai sirkulasi udara yang baik sehingga memberikan kompresi udara yang baik juga.</p>', '157165-deluxe-by-acr', '81b5b595-431e-41ec-8295-8d3317ae63ee', 'admin', 0, '', '', '577eecdb-daf9-4b0b-a67c-3a02c2220b62', 0, 0, '', '', 0, '<ul><li><p><strong>1. Maximum Power Handling</strong><br>The voice coil wire uses EISVW material, which can withstand high temperatures, enabling the speaker to handle high power levels.</p></li><li><p><strong>2. Special Conepaper Material</strong><br>The conepaper is made from specially selected weather-resistant material and produced using the rigid non-press method, resulting in a strong cone capable of delivering excellent sound quality.</p></li><li><p><strong>3. Well-Designed Chassis</strong><br>The chassis is designed with bottom air vents, allowing for efficient airflow and effective heat dissipation.</p></li><li><p><strong>4. Improved Air Compression</strong><br>The driver features good airflow circulation, resulting in better air compression performance.</p></li></ul>'),
('68d707ea-0128-493d-9170-7c6107f1946e', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 100152 Mk2 SW FAB BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 04:19:53.649', '2025-10-23 07:27:28.235', '<p><strong>1. <em>Power handling &amp; SPL </em>yang maksimal</strong></p><p>Material gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat speaker dapat bertahan di suhu dan <em>power handling </em>tinggi serta menjadikan speaker semakin <em>powerfull</em></p><p><strong>2. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast</em> yang kokoh, dan dilengkapi ventilasi udara untuk membuang udara panas.</p><p><strong>3. Frekuensi kerja yang lebar</strong></p><p>Desain <em>speaker </em>dirancang secara khusus yang menghasilkan frekuensi kerja yang lebar, serta membuat lebih fleksibel dalam menentukan <em>crossover</em>.</p><p><strong>4. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance</em> sehingga mampu bertahan di segala cuaca.</p>', 'pa-100152-mk2-sw-fab-by-acr', 'd20adbb0-7b48-46e4-8e33-f93fa916866a', 'admin', 0, '', '', 'c91b75d6-6cfe-4207-a99c-a5d2e9eb0b70', 0, 0, '', '', 0, '<ul><li><p><strong>1. Maximum Power Handling &amp; SPL</strong></p></li></ul><p>The voice coil winding material is coated with a special layer, enabling the speaker to withstand high temperatures and high power handling, resulting in a more powerful speaker</p><ul><li><p><strong>2. Special Chassis Design</strong><br>The chassis is made from durable aluminum die-cast material and features air vents to release heat effectively.</p></li><li><p><strong>3. Wide Operating Frequency Range</strong><br>The speaker is specially designed to deliver a wide operating frequency range, providing greater flexibility in crossover configuration.</p></li><li><p><strong>4. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, allowing it to perform reliably in all weather conditions.</p></li></ul>'),
('68fc29d9-f30d-457b-a8bb-818a8a3c93c1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18in PA-18900 -MK I PRE ACR SERIES', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:14:17.817', '2025-10-24 08:38:07.946', '<p>-</p>', 'voice-coil-18in-pa-18900-mk-i-pre-acr-series', '869d46a5-4cae-4518-9c62-0e1a775ca3e9', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('6b245434-c624-43cd-91bd-339a07bda4c1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 51 Desibel', 1, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 07:28:31.395', '2025-10-23 09:08:07.681', '<p><strong>1. Sistem motor <em>driver </em>optimal &amp; rendah distorsi</strong></p><p>Desain struktur <em>driver </em>motor melalui simulasi <em>FEMM </em>menggunakan magnet <em>ferrite </em>menghasilkan medan magnet yg efektif untuk membuat motor <em>driver </em>optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>2. <em>Bandwidth </em>frekuensi respon lebih lebar dan lebih <em>flat</em></strong></p><p>Desain khusus <em>dome </em>berbahan <em>Titanium </em>dengan <em>annular phase plug </em>menghasilkan <em>Range </em>frekuensi respon yang lebih lebar (800 Hz - 20000 Hz) dan memiliki <em>ripple </em>frekuensi respon yang lebih <em>flat </em>pada <em>range high </em>frekuensi.</p><p><strong>3. Ideal untuk <em>compact 2-way system &amp; multi driver line array system</em></strong></p><p>Desain <em>voice coil 2in (51 mm)</em> menggunakan<em> rectangular wire</em> dengan <em>exit throat 1in (25.4 mm) </em>pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>compact 2-way system &amp; multi driver line array system</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-51-desibel', '629342b7-7e74-42b1-bff1-9db37367f0b3', 'admin', 0, 'Desibel Product', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimized &amp; Low-Distortion Driver Motor System</strong><br>The driver motor structure is designed using FEMM simulation and ferrite magnets to generate an effective magnetic field, resulting in an optimized motor driver with low distortion and higher efficiency at high frequencies.</p></li><li><p><strong>2. Wider and Flatter Frequency Response Bandwidth</strong><br>A specially designed titanium dome with an annular phase plug provides a wider frequency response range (800 Hz – 20,000 Hz) with a flatter frequency ripple in the high-frequency range.</p></li><li><p><strong>3. Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 2-inch (51 mm) voice coil design uses rectangular wire with a 1-inch (25.4 mm) exit throat, making this compression driver highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('6f7b2026-c40a-45f8-b29a-b1a5a856ee9f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 113182 Mk2 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:43:22.250', '2025-10-23 07:44:48.927', '<ol><li><p><strong>1. Desain <em>Chassis </em>yang Istimewa</strong></p></li><li><p><em>- Chassis </em>terbuat dari <em>material</em> <em>diecast </em>yang baik dan dilengkapi dengan desain khusus pada bagian bawah sebagai pemindah panas yang sangat baik.</p></li><li><p><strong>2. Sistem motor rendah distorsi dan lebih tahan panas</strong></p></li><li><p>- Motor didesign khusus dengan <em>FEA </em>simulasi sehingga sangat optimasi dan sangat rendah kompresi.</p></li><li><p>- <em>Voice Coil </em>dengan menggunakan bahan <em>Non Conduction Former</em> dan tambahan <em>coating </em>khusus untuk menambah ketahanan terhadap panas</p></li><li><p><strong>3. <em>Output </em>suara yang istimewa</strong></p></li><li><p>- Penambahan <em>coating inpact </em>dan <em>CLB </em>pada <em>conepaper </em>mampu memproduksi kualitas suara yang lebih baik dan tahan cuaca.</p></li></ol>', 'pa-113182-mk2-sw-fab-by-acr', '67d02a7f-94b7-42d7-9aff-155131990b18', 'admin', 0, '', '', '6ea78cef-cf08-4064-a174-c21e51ed7c92', 0, 0, '', '', 1, '<ul><li><p><strong>1. Exceptional Chassis Design</strong><br>- The chassis is made from high-quality die-cast material and features a specially designed bottom section that serves as an excellent heat conductor, effectively dissipating heat from the speaker system.</p></li><li><p><strong>2. Low-Distortion, Heat-Resistant Motor System</strong><br>- The motor is specially designed using FEA (Finite Element Analysis) simulation for optimal performance and minimal compression.</p></li><li><p>- The voice coil uses a non-conductive former and is enhanced with a special heat-resistant coating, making it highly durable under high-temperature conditions.</p></li><li><p><strong>3. Superior Sound Output</strong><br>- The conepaper is treated with Inpact and CLB coatings, which not only improve weather resistance but also enhance the overall sound quality.</p></li></ul>'),
