('7180d052-7682-4157-85e6-2fe3327904e8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 12500 BLACK', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-04-08 01:55:40.092', '2025-10-23 06:34:41.573', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar paper khusus yang diproses dengan metode <em>\"rigid nonpress\" </em>dan dilapisi dengan lapisan<em> weather resistance</em> sehingga speaker cocok diaplikasikan untuk indoor ataupun outdoor.</p><p><strong>3. Minim Kompresi</strong></p><p>Motor dan chassis didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dengan<em> surround cloth M-type</em> dan dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p>', '12500-black', 'c56ab620-8369-4d68-b16f-40a5be690f3a', 'admin', 0, '-', '', '62330bbc-5421-44e7-ab89-0c1164f2fc1a', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to achieve optimal magnetic power.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from a special paper material processed with the \"rigid nonpress\" method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Minimal Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The conepaper, combined with M-type cloth surround and damping glue, delivers a smooth frequency response.</p></li></ul>'),
('779c30c0-55c7-4b42-abe3-7d8a63e621ec', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 30H120SRW38B CURVE (PLS)', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-17 09:16:56.844', '2025-10-23 06:48:46.004', '<ul><li><p><strong>- Daya magnet yang optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>- <em>Conepaper </em>tahan terhadap cuaca<em> (Weatherproof conepaper)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p></li></ul>', '30h120srw38b-curve-pls', '8a7d85e8-30f7-4486-82e6-be52afa839d8', 'admin', 0, '', '', '969a6fc5-6ff0-468c-be13-70592e86a9fc', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to deliver optimal magnetic performance.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use.</p></li></ul>'),
('78211d91-8e40-4cc1-8718-c3cfcf29af77', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '21\" PA 113212 SW FAB BY ACR', 0, 0, '656894ee-ab2f-45e7-ba96-51bcd09eb3b1', '2025-03-28 07:13:10.540', '2025-10-23 08:33:18.537', '<p><strong>- Maksimum <em>Power handling</em></strong></p><p><em>Voice coil</em> menggunakan kawat type \"rectangular\" yang mempunyai densitas (masa jenis) yang lebih tinggi daripada kawat type \"round\" sehingga menjadikannya lebih efisien dan mampu menghasilkan BL yang tinggi. <em>Voice coil </em>juga dilapisi dengan spesial coating yang berfungsi untuk meningkatkan ketahanan terhadap panas sehingga speaker mampu bertahan pada <em>power handling</em> yang tinggi</p><p><strong>- <em>Chassis </em>menggunakan desain khusus dan material yang kokoh</strong></p><p><em>Chassis </em>terbuat dari material<em> aluminium diecast</em> yang kokoh dan didesain dengan ventilasi udara pada bagian bawah <em>chassis </em>menghasilkan<em> part chassis</em> yang kokoh dan mempunyai transfer panas yang baik</p><p><strong>- Minimum kompresi</strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang baik serta berfungsi sebagai pendingin<em> (cooler)</em></p><p><strong>- Desain <em>conepaper </em>khusus</strong></p><p><em>Conepaper </em>dibuat tahan terhadap cuaca dengan metode <em>\"rigid non press\"</em> serta menggunakan campuran material kertas khusus menghasilkan <em>conepaper </em>yang sangat kuat, kokoh, dan ringan memberikan kualitas suara yang prima</p><p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal</p>', 'pa-113212-sw-fab-by-acr', '359fb334-3fbd-4c37-ba3d-2b607e5192f1', 'admin', 0, '', '', '726ea748-daa2-4939-bb0a-4cc37bf9b026', 0, 0, '', '', 1, '<ul><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil uses a \"rectangular\" wire type, which has a higher density than \"round\" wire, making it more efficient and capable of generating a higher BL (force factor). Additionally, the voice coil is coated with a special layer that enhances heat resistance, enabling the speaker to withstand high power handling conditions.</p><p><strong>- Specially Designed and Sturdy Chassis</strong><br>The chassis is made from strong aluminum die-cast material and designed with air vents at the bottom, resulting in a durable structure with excellent heat transfer capabilities.</p><ul><li><p><strong>- Low Compression</strong><br>The motor is designed with dedicated ventilation to eliminate air compression, ensuring smooth airflow and functioning as an effective cooling system.</p></li><li><p><strong>- Special Conepaper Design</strong><br>The conepaper is weather-resistant and produced using a \"rigid non-press\" method combined with a special paper blend, resulting in a cone that is strong, durable, and lightweight—delivering premium sound quality.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor design is fine-tuned through FEA (Finite Element Analysis), ensuring optimal magnetic performance for enhanced speaker efficiency.</p></li></ul>'),
('7866c13e-035c-4dc4-a70d-0fbb643c8cef', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 100152 Mk1 SW FAB BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 04:10:32.128', '2025-10-23 07:26:40.041', '<p><strong>1. Desain <em>Chassis </em>yang Istimewa</strong></p><p><em>Chassis </em>terbuat dari <em>material diecast </em>yang baik dan dilengkapi dengan desain khusus pada bagian bawah sebagai pemindah panas yang sangat baik.</p><p><strong>2. Sistem motor rendah distorsi dan lebih tahan panas</strong></p><p><em>Voice Coil Bonder</em> pada<em> voice coil </em>menambah ketahanan terhadap suhu tinggi dan desain motor khusus membuat distorsi speaker yang sangat rendah.</p><p><strong>3. <em>Output</em> suara yang istimewa</strong></p><p>Penambahan<em> coating CLB </em>pada <em>conepaper </em>untuk tahan terhadap air dan kelembaban dan juga mampu memproduksi kualitas suara yang lebih baik</p>', 'pa-100152-mk1-sw-fab-by-acr', '6c9bed77-b266-4460-b6ec-37761189f0d2', 'admin', 0, '', '', '98d820e3-8f29-4f13-a036-a646c6ad291e', 0, 0, '', '', 1, '<ul><li><p><strong>1. Exceptional Chassis Design</strong><br>The chassis is made from high-quality die-cast material and features a specially designed bottom section that functions as an excellent heat sink.</p></li><li><p><strong>2. Low-Distortion, Heat-Resistant Motor System</strong><br>The voice coil uses a bonder that enhances heat resistance, while the specially designed motor significantly reduces speaker distortion.</p></li><li><p><strong>3. Outstanding Sound Output</strong><br>A CLB coating is applied to the conepaper, making it resistant to water and humidity while also enhancing overall sound quality.</p></li></ul>'),
('78a1f0c1-2448-4bbf-9659-573b7b69e8af', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15100 BLACK', 1, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-26 03:50:00.929', '2025-10-23 07:08:56.768', '<p><strong>1. Tahan panas</strong></p><p><em>Voice coil speaker </em>didesain menggunakan material <em>former glass fiber </em>dan kawat <em>coil </em>yang tahan panas sehingga membuat <em>speaker </em>mampu bertahan pada suhu yang tinggi.</p><p><strong>2. <em>Chassis </em>desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast </em>yang khusus dan kokoh.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>di-desain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Daya <em>magnet </em>yang optimal</strong></p><p>Menggunakan <em>magnet grade </em>terbaik dan di-desain menggunakan bantuan <em>software </em>simulasi terbaru, sehingga daya magnetnya optimal.</p><p><strong>5. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Material conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\'Full press\'</em> dan dilapisi dengan lapisan <em>weather resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p>', '15100-black', 'fbec9f6b-d8c9-4da9-b9f9-5a64ef54be61', 'admin', 0, 'ACR Product - Black Series', '', '79fe8807-b9e1-4c37-b0a0-20b234445f61', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant</strong><br>The speaker\'s voice coil is designed using a glass fiber former and heat-resistant coil wire, allowing the speaker to withstand high temperatures.</p></li><li><p><strong>2. Special Chassis Design</strong><br>The chassis is made from specially designed, durable aluminum die-cast material.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and ensure airflow for effective cooling.</p></li><li><p><strong>4. Optimal Magnetic Power</strong><br>Utilizes high-grade magnets and is designed with the help of advanced simulation software, resulting in optimal magnetic performance.</p></li><li><p><strong>5. Weather-Resistant Conepaper</strong><br>The conepaper is made from special paper processed using a “full press” method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li></ul>'),
('798761e0-42ae-4520-a1fe-63cbe64191a1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in PA-75124', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-10-22 07:40:48.903', '2025-10-24 08:43:16.640', '', 'voice-coil-12in-pa-75124', 'd59e8f84-80d6-4c34-9899-126c15034440', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('7afce057-6d0c-41a8-b916-0cd81d45e195', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15700 Mk1 DELUXE BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 07:20:36.581', '2025-10-23 07:10:30.135', '<p><strong>1. Tahan Panas</strong></p><p>- <em>Voice Coil 4inch</em> menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p>-<em> New Model Chassis</em> berbahan <em>aluminium diecast </em>di-<em>design </em>di secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p><p>- <em>Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p>- <em>Non Press Conepaper</em> dengan diberi lapisan <em>coating </em>pada bagian depan memberikan ketahanan terhadap cuaca.</p><p><strong>4. Daya magnet lebih optimal</strong></p><p>- Penentuan daya <em>motor magnet speaker </em>yang optimal karena di-design menggunakan teknologi dari <em>software FEA.</em></p><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p>', '15700-mk1-deluxe-by-acr', '9491e471-aca3-42c1-aa1e-9d6d381e7ea4', 'admin', 0, '', '', 'fbe7795a-3e4e-49ce-bb0e-a74a046cdd63', 0, 0, '', '', 1, '<ol><li><p><strong>1. Heat Resistant</strong></p></li></ol><ul><li><p>- The 4-inch voice coil uses a non-conductive fiberglass former and is coated with the latest wire technology, allowing it to operate at temperatures above 280°C.</p></li></ul><ol start=\"2\"><li><p><strong>2. Sturdy and Low Compression</strong></p></li></ol><ul><li><p>- The new model chassis is made from aluminum die-cast and precisely designed to provide maximum strength and minimal compression.</p></li></ul><ol start=\"3\"><li><p><strong>3. Stable with High Excursion</strong></p></li></ol><ul><li><p>- The triple round surround makes the speaker more stable and allows for greater cone excursion.</p></li><li><p>- The non-press conepaper is coated on the front side, providing weather resistance.</p></li></ul><ol start=\"4\"><li><p><strong>4. More Optimized Magnetic Power</strong></p></li></ol><ul><li><p>- The speaker’s motor power is optimized through design using FEA (Finite Element Analysis) software technology.</p></li><li><p>- Ventilation holes ensure proper airflow to help reduce excessive heat buildup.</p></li></ul>'),
('7c275671-704a-4849-a752-4ce212913e32', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 10in 75105', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-10-22 07:37:50.042', '2025-10-24 08:43:30.197', '', 'voice-coil-10in-75105', '91ddd29a-124b-41cb-8032-8530cb249cb3', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('7d781bdf-75c3-4605-a8e7-21aa1b5f3155', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1230-Mk1 BLACK', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-26 03:35:56.648', '2025-10-23 06:29:15.117', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal serta<em> finishing motor </em>yang anti karat karena melalui proses <em>electro platting.</em></p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar paper khusus yang diproses dengan metode <em>\"rigid nonpress\"</em> dan dilapisi dengan lapisan<em> weather resistance</em> sehingga speaker cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Respon frekuensi yang lebar</strong></p><p>Desain speaker dilengkapi dengan<em> \"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em>.</p><p><strong>4. Minimum kompresi dan distorsi</strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin. Penambahan <em>coppercap </em>pada<em> head yoke </em>yang berfungsi untuk meminimalkan distorsi speaker dan menambah <em>SPL </em>di frekuensi tinggi.</p>', '1230-mk1-black', '6d8c5c26-403e-4b90-9868-4477627e468b', 'admin', 0, '', '', '1db4e509-67fd-403d-9590-822be998aa3d', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis) to deliver optimal magnetic power, with an anti-rust finish achieved through an electroplating process.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from a special paper material processed using the \"rigid nonpress\" method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Wide Frequency Response</strong><br>The speaker design features a \"whizzer cone,\" providing a wide operating frequency range, making it ideal for full-range speaker applications.</p></li><li><p><strong>4. Low Compression and Distortion</strong><br>The motor includes special ventilation to eliminate air compression and provide airflow for cooling. A copper cap is added to the head yoke to minimize distortion and enhance SPL at high frequencies.</p></li></ul>'),
('7dcad190-ee8f-49d3-8d50-695fcde903b0', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 340T1-08F (CD 9) ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:30:53.167', '2025-10-23 08:59:33.729', '<p><strong>- Sistem motor <em>driver </em>rendah distorsi dan efisien.</strong></p><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEM </em>untuk menghasilkan<em> Compression Driver</em> yang rendah Distorsi dan lebih efisien pada Frekuensi tinggi.</p><p><strong>- <em>Range </em>frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi tinggi.</strong></p><p>Desain khusus dome berbahan <em>Titanium </em>dan desain khusus <em>Horn Point</em> melalui simulasi <em>FEM </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi</p><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em></strong></p><p>Desain <em>Voice Coil 1.34in (34.4 mm)</em> menggunakan <em>rectangular wire</em> dengan <em>exit throat 1in (25.4 mm) </em>pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk<em> Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-340t1-08f-cd-9-acr', '29ea9be3-c313-499a-b3e4-8d6234623293', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Low Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using a ferrite magnet and simulated with FEM to produce a compression driver with low distortion and higher efficiency at high frequencies.</p></li><li><p><strong>- Wider and Flatter High-Frequency Response Range</strong><br>A specially designed titanium dome and custom Horn Point, simulated through FEM, result in a wider frequency response range (1000 Hz – 20000 Hz) that remains flat at high frequencies.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.34-inch (34.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for Compact 2-Way Systems and Multi-Driver Line Array Systems, delivering cleaner and better sound quality.</p></li></ul>');
INSERT INTO `product` (`id`, `brandId`, `name`, `isFeatured`, `isArchived`, `sizeId`, `createdAt`, `updatedAt`, `description`, `slug`, `specId`, `updatedBy`, `isNewProduct`, `featuredDesc`, `series`, `thieleSmallParameter2OhmId`, `isCeiling`, `isHorn`, `ceilingSpecId`, `hornSpecId`, `haveSparepart`, `description_english`) VALUES
('7e1215e5-aefd-4c02-9e8c-8a6faa7a88fa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 18890 Mk4 EXCEL BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 07:29:18.942', '2025-10-23 07:52:08.692', '<p><strong>1. Tahan Panas</strong></p><p>- <em>Voice Coil 4inch</em> dengan kawat pipih yang memberikan keunggulan berat yang ringan dan juga memiliki daya tahan terhadap suhu yang tinggi dan <em>power </em>yang besar.</p><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p>- <em>New Model Chassis</em> berbahan <em>aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p><p>-<em> Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p>- <em>Non Press Conepaper</em> dengan diberi lapisan <em>coating </em>pada bagian depan dan belakang, untuk memperoleh suara bass yang solid dan juga tahan terhadap cuaca.</p><p><strong>4. Daya magnet lebih optimal</strong></p><p>- Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA.</em></p><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p>', 'pa-18890-mk4-excel-by-acr', '18230a9f-d951-435b-b554-4989d70fc213', 'admin', 0, '', '', '41998af0-9c57-4eb9-a417-8d0b9377ed47', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>- The 4-inch voice coil uses flat wire for reduced weight while maintaining high durability under extreme heat and power.</p></li><li><p>- It also features a non-conductive fiberglass former and advanced coil wire coating technology, allowing it to operate even at temperatures above 280°C.</p></li><li><p><strong>2. Robust and Low Compression</strong><br>- The new model chassis is precisely engineered from die-cast aluminum, offering maximum strength with minimal air compression for improved performance and cooling.</p></li><li><p><strong>3. High Stability and Long Excursion</strong><br>- A triple round surround ensures greater stability and allows for longer cone excursion.</p></li><li><p>- The non-press conepaper is coated on both the front and back, providing solid bass performance and weather resistance.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>- The speaker’s magnetic motor power is carefully calculated using FEA (Finite Element Analysis) software.</p></li><li><p>- Ventilation holes help reduce excess heat for better airflow and thermal management.</p></li></ul>'),
('7f6e21ff-64c0-438c-90ef-21dcbc16a723', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 440PK1B-08F FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:52:17.885', '2025-10-23 09:05:40.548', '<p><strong>- Sistem motor <em>driver </em>optimal &amp; rendah distorsi</strong></p><p>Desain struktur <em>driver </em>motor melalui simulasi <em>FEMM </em>menggunakan magnet <em>ferrite </em>menghasilkan medan magnet yg efektif untuk membuat motor <em>driver </em>optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>- Frekuensi respon lebih lebar dengan detail suara bagus pada frekuensi tinggi</strong></p><p>Desain khusus <em>dome </em>berbahan <em>PEEK (Polyether ether ketone) </em>dan desain khusus <em>Horn Point </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi sehingga menghasilkan detail suara yang bagus.</p><p><strong>- Ideal untuk <em>compact 2-way system &amp; multi driver line array system</em></strong></p><p>Desain <em>voice coil 1.74in (44.3 mm) </em>menggunakan<em> rectangular wire</em> dengan <em>exit throat 1in (25.4 mm) </em>pada<em> compression driver </em>sangat cocok dan ideal dipakai untuk<em> compact 2-way system &amp; multi driver line array system</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-440pk1b-08f-fabulous', 'aaf5a1de-b12a-4251-872d-b2df51c2dc83', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal &amp; Low-Distortion Driver Motor System</strong><br>The motor driver structure design, simulated using FEMM and utilizing a ferrite magnet, produces an effective magnetic field that makes the driver motor optimized, low in distortion, and more efficient at high frequencies.</p></li><li><p><strong>- Wider Frequency Response with Excellent High-Frequency Detail</strong><br>A specially designed dome made of PEEK (Polyether ether ketone) and a custom-designed Horn Point—developed through FEA simulation—deliver a wider frequency response range (1000 Hz – 20000 Hz) and flat response at high frequencies, resulting in excellent sound detail.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.74-inch (44.3 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver is highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('8088522a-861e-468d-91c1-72d24b6e0fbf', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 451006-Mk1 Desibel', 1, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-17 07:27:49.056', '2025-10-23 07:41:38.037', '<p><strong>1. Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi<em> FEA (Finite Element Analysis)</em></p><p><strong>2. <em>Weatherproof conepaper</em></strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar UKP 100% SR 18° + KPK (Kapuk) yang diproses dengan metode <em>\"rigid non-press\" </em>dan dilapisi dengan lapisan <em>weatherproof </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik</p><p><strong>3. Minim kompresi</strong></p><p>Motor dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Power handling yang maksimal</strong></p><p><em>Voice coil wire</em> menggunakan material <em>EISVW </em>dan gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p><p><strong>5. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik.</p>', '451006-mk1-desibel', '6cb1dd2c-2234-4945-8ba3-8aa48fb92e44', 'admin', 0, 'Desibel Product', '', '56f59bca-660f-4442-a46f-074ffb44cc21', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimized Magnet Power</strong><br>The speaker’s magnetic motor delivers optimal performance as it is designed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>2. Weatherproof Conepaper</strong><br>Crafted from 100% UKP SR 18° paper and KPK (Kapok) fiber, the conepaper is processed with a rigid non-press method and coated with a weatherproof layer, making it highly durable in all weather conditions and capable of producing superior sound quality.</p></li><li><p><strong>3. Low Compression Design</strong><br>The motor and chassis are designed with special ventilation features that eliminate air compression and ensure effective airflow for cooling.</p></li><li><p><strong>4. Maximum Power Handling</strong></p></li></ul><p>The voice coil wire is made from EISVW material, and the winding is coated with a special layer, allowing the voice coil to withstand high temperatures. This ensures the speaker can perform reliably under high power handling conditions.</p><ul><li><p><strong>5. Special Chassis Design</strong><br>Made from high-quality, durable diecast material, the chassis features a specially designed bottom section that enhances heat transfer and supports overall thermal stability.</p></li></ul>'),
('8324b4e4-17ef-4eb8-a522-953b83cc5d10', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 340T1-08N (CD 7-Mk3)', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-25 07:15:57.179', '2025-10-23 09:00:22.046', '<ul><li><p><strong>- Sistem motor <em>driver </em>rendah distorsi dan efisien.</strong></p></li><li><p>Desain struktur <em>driver </em>motor menggunakan Magnet <em>Neodymium </em>yang disimulasikan dengan <em>FEMM </em>untuk menghasilkan <em>SPL </em>tinggi namun rendah Distorsi dan lebih efisien pada <em>Compression Driver.</em></p></li><li><p><strong>- <em>Range </em>frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi Tinggi</strong></p></li><li><p>Desain khusus <em>Dome </em>berbahan <em>Titanium </em>dan desain khusus <em>Horn Point </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi.</p></li><li><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p></li><li><p>Desain <em>voice coil 1.34in (34.4 mm)</em> menggunakan <em>rectangular wire</em> dengan <em>exit throat 1in (25.4 mm)</em> pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk<em> Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p></li></ul>', 'cd-340t1-08n-cd-7-mk3', '77c3bdd6-aa6d-4a3c-8009-0dd1d9422089', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low-Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using Neodymium magnets and simulated with FEMM to produce high SPL with low distortion and greater efficiency in the compression driver.</p></li><li><p><strong>- Wider and Flatter Frequency Response Range at High Frequencies</strong><br>A specially designed titanium dome and horn point, simulated with FEA, deliver a wider frequency response range (1000 Hz – 20,000 Hz) with a flat response in the high-frequency range.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.34-inch (34.4 mm) voice coil design with rectangular wire and a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering clearer and higher-quality sound.</p></li></ul>'),
('848a7458-0ecc-4e5d-b3d1-be2c48488516', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18in PA-18890 Mk IV', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:15:16.577', '2025-10-24 08:38:16.294', '<p>-</p>', 'voice-coil-18in-pa-18890-mk-iv', '8764e0dd-eabf-4512-b02d-e07dec5ee7f9', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('84a5197e-ba4b-4683-8ec2-4ea16837b938', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 380C1-08 (CD 6) ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:33:34.654', '2025-10-23 09:15:42.848', '<p>-</p>', 'recone-kit-cd-380c1-08-cd-6-acr', '03431e68-943c-4fcf-b3bb-ae37e802160a', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('853ae030-6c87-48eb-ae76-580682f720ce', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1280 ACR BLACK MAGIC', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:24:09.961', '2025-10-23 06:46:54.770', '', '1280-acr-black-magic', '5e1d8bf5-8d6f-4228-a9b8-ef634a6b4890', 'admin', 0, '', '', 'aa0fff08-9c08-4af7-912b-20310a5ffd9f', 0, 0, '', '', 0, ''),
('855aaa4c-f2fd-4a1e-bfbd-fa2b7d72cc09', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" ARRAY 8388 M FAB (LIMITED EDITION)', 1, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 06:12:51.105', '2025-10-23 08:48:46.243', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran FEA <em>(Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><ol start=\"2\"><li><p><strong>2. Minimum kompresi <em>(Low Compression)</em></strong></p></li></ol><p>Motor dan <em>Chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dengan material dasar UKP 100% dan dilapisi dengan lapisan <em>weatherproof </em>sehingga menghasilkan suara yang bagus dan cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>5. <em>Power handling</em> yang maksimal</strong></p><p>Gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil</em> dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi</p><p><strong>6. <em>Chassis </em>Menggunakan Desain Khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik.</p>', 'array-8388-m-fab-limited-edition', '21d33adb-2a36-4b86-8351-2f2cccf530d0', 'admin', 0, 'ACR Product - Fabulous Series', '', 'b2e21620-ea9e-469b-a5d4-ce3354cc0d73', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimized Magnet Power</strong><br>The motor design, developed using FEA (Finite Element Analysis), delivers optimal magnetic force.</p></li><li><p><strong>2. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and provide effective airflow for cooling.</p></li><li><p><strong>3. Weatherproof Conepaper</strong><br>The conepaper is made from 100% UKP material and coated with a weatherproof layer, producing excellent sound quality and making it suitable for both indoor and outdoor use.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The conepaper is equipped with damping glue on the surround, delivering a smooth frequency response.</p></li><li><p><strong>5. Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special layer, allowing it to endure high temperatures so the speaker can reliably handle high power levels.</p><ul><li><p><strong>6. Specially Designed Chassis</strong><br>The extremely sturdy chassis is made from high-quality diecast material and features a specially designed bottom section for efficient heat transfer.</p></li></ul>'),
('857d7d96-62ec-4d6c-876f-aea4fa2309ce', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 15inPA-100152 Mk2 SW FAB', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:49:50.555', '2025-10-24 08:44:30.474', '<p>-</p>', 'recone-kit-15inpa-100152-mk2-sw-fab', '791ea19d-1885-47ba-8c01-587d992850a6', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('86b7105f-41d1-4bd3-b06b-9e4c7c9cdea1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 15900 Mk1 PRE BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 09:01:15.188', '2025-10-23 07:35:27.258', '<p><strong>1. Tahan Panas</strong></p><p>-<em> Voice Coil 4inch</em> dengan <em>sandwich technology </em>(gulungan didalam dan diluar <em>former</em>), memberikan kekuatan lebih terhadap daya tahan, baik terhadap suhu yang tinggi dan <em>power </em>yang besar.</p><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat<em> voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p>- <em>New Model Chassis</em> berbahan <em>aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p><p>- <em>Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p>- <em>Non Press Conepaper </em>dengan diberi lapisan <em>coating </em>pada bagian depan untuk memberi ketahanan terhadap cuaca.</p><p><strong>4. Daya magnet lebih optimal</strong></p><p>- Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA.</em></p><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p>', 'pa-15900-mk1-pre-by-acr', 'd2eca2c2-907f-47d7-8a08-e6cbda0d85f6', 'admin', 0, '', '', 'ca03de06-e4ee-4987-88d0-4194b16d101e', 0, 0, '', '', 1, '<ol><li><p><strong>1. Heat Resistant</strong></p></li></ol><ul><li><p>- The 4-inch voice coil uses sandwich technology (windings inside and outside the former), providing greater durability and resistance to both high temperatures and high power levels.</p></li><li><p>- Made with a non-conductive fiberglass former and the latest wire coating technology, the voice coil/spool can operate at temperatures above 280°C.</p></li></ul><ol start=\"2\"><li><p><strong>2. Sturdy and Low Compression</strong></p></li></ol><ul><li><p>- The new model chassis is made from precision-engineered aluminum die-cast material, ensuring maximum strength and minimal compression.</p></li></ul><ol start=\"3\"><li><p><strong>3. Stable with High Excursion</strong></p></li></ol><ul><li><p>- The triple round surround enhances the speaker’s stability and allows for greater cone excursion.</p></li><li><p>- The non-press conepaper is coated on the front side to improve weather resistance.</p></li></ul><ol start=\"4\"><li><p><strong>4. Optimized Magnetic Power</strong></p></li></ol><ul><li><p>- The speaker’s magnetic motor is optimally designed using FEA (Finite Element Analysis) software.</p></li><li><p>- Ventilation holes support airflow circulation, helping to reduce excessive heat buildup.</p></li></ul>'),
('86ef7728-81ba-49e7-a52d-19c12dff0781', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" 25H100SUWPP CURVE (PLS)', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-17 09:11:50.676', '2025-10-23 06:19:48.755', '<ol><li><p><strong>1. Conepaper tahan terhadap cuaca</strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>Weather Resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor </em>serta dapat menghasilkan suara yang lebih baik.</p></li><li><p><strong>2. Daya magnet optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>sehingga memberikan daya <em>magnet </em>yang optimal.</p></li><li><p><strong>3. Minimum kompresi</strong></p></li><li><p><em>Conepaper </em>didesain dengan ventilasi udara pada bagian <em>neck-cone</em> sehingga memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada speaker.</p></li></ol>', '25h100suwpp-curve-pls', '7ead09af-2c69-4a47-a7e4-9de35e241472', 'admin', 0, '', '', '451008cd-80e6-404b-8b0a-be1170b6db71', 0, 0, '', '', 0, '<ul><li><p><strong>1. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use, while also producing better sound quality.</p></li><li><p><strong>2. Optimal Magnetic Power</strong><br>The motor is designed using measurements from FEA (Finite Element Analysis), resulting in optimal magnetic power.</p></li><li><p><strong>3. Minimal Compression</strong><br>The conepaper is designed with air ventilation at the neck-cone area, providing good airflow and reducing air compression in the speaker.</p></li></ul>'),
('8c7d59a4-f6ce-4254-a6ba-a8d9580f736c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 188127 EXCEL BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 07:19:32.290', '2025-10-23 07:49:22.982', '<ol><li><p><strong>1. Power handling yang maksimal (Maximum power handling)</strong></p></li><li><p><em>Voice coil wire</em> menggunakan material <em>AISVW </em>dan gulungan <em>voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil</em> dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p></li></ol><p><strong>2. Minimum kompresi<em> (Low Compression)</em></strong></p><p>Motor dan <em>Chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. <em>Conepaper </em>tahan terhadap cuaca<em> (Weather resistance conepaper)</em></strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar <em>paper </em>berkualitas tinggi yang diproses dengan metode <em>\'rigid non-press\' </em>dan dilapisi dengan lapisan <em>weather resistance </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik.</p><p><strong>4. Daya magnet optimal<em> (Optimized magnet power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis)</em> sehingga memberikan daya magnet yang optimal.</p>', 'pa-188127-excel-by-acr', '8c0c11fa-8180-4365-b7bd-a9b1843df747', 'admin', 0, '', '', 'bb7dd28e-d891-495b-8498-0b3dd7f1b05d', 0, 0, '', '', 0, '<ol><li><p><strong>1. Maximum Power Handling</strong></p></li></ol><p>The voice coil wire is made from AISVW material, and the winding is coated with a special layer, allowing the voice coil to withstand high temperatures—enabling the speaker to perform reliably under high power handling conditions.</p><p><strong>2. Low Compression</strong><br>The motor and chassis are designed with special ventilation features to eliminate air compression and provide airflow that functions as a cooling system.</p><ul><li><p><strong>3. Weather-Resistant Conepaper</strong><br>Made from high-quality paper and processed using the rigid non-press method, the conepaper is coated with a weather-resistant layer, making it durable in all weather conditions and capable of delivering better sound quality.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis) simulation, resulting in optimal magnetic strength and performance.</p></li></ul>'),
('8cc0d31a-0b4b-4255-a492-46d4d122aaca', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 18737 DELUXE BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-25 08:35:25.487', '2025-10-23 07:39:25.533', '<ul><li><p>- Distorsi yang sangat rendah karena menggunakan <em>surround roll model \"M\".</em></p></li></ul><p>- <em>Voice coil </em>4 inchi yang memiliki <em>damping minimum </em>karena menggunakan <em>non-conducting former </em>dan kawat <em>coil </em>yang tahan panas.</p><p>- Penambahan lapisan anti air pada<em> cone paper </em>dan <em>dustcap </em>sehingga lebih tahan terhadap cuaca.</p><p>- <em>Chasis </em>berteknologi pendingin dengan penambahan sirip pada bagian bawah <em>chasis </em>untuk mengurangi panas dari <em>motor system.</em></p>', '18737-deluxe-by-acr', 'dd50e874-b808-4d5a-80a8-b73d8811d57f', 'admin', 0, '', '', '3e887b24-d89c-46de-8cdf-c756763daf1b', 0, 0, '', '', 0, '<ul><li><p>- Very Low Distortion Achieved by using an \"M\" roll-type surround.</p></li><li><p>- 4-Inch Voice Coil with Minimal Damping. Built with a non-conductive former and heat-resistant coil wire, the voice coil offers minimal damping and delivers stable, high-performance operation even at elevated temperatures.</p></li><li><p>- The cone paper and dustcap are coated with a water-resistant layer, making the speaker more durable and suitable for use in various weather conditions.</p></li><li><p>- The chassis features integrated cooling fins at the bottom, designed to effectively reduce heat buildup from the motor system and maintain optimal speaker performance.</p></li></ul>'),
('907faff9-c200-459e-9ef9-9db50bf7aa40', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 44 Desibel', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-17 05:59:37.847', '2025-10-23 09:03:27.025', '<ul><li><p><strong>- Sistem Motor <em>driver </em>rendah distorsi dan efisien.</strong></p></li><li><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>menghasilkan motor <em>driver </em>yang optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p></li><li><p><strong>- Sistem <em>Screw on </em>untuk aplikasi dengan <em>Horn</em>.</strong></p></li><li><p>Dengan sistem <em>Screw on </em>membuat aplikasi pemasangan dengan <em>Horn </em>lebih simple.</p></li><li><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p></li><li><p>Desain<em> voice coil 1.75in (44.4 mm) </em>dengan <em>exit throat 1in (25.4 mm) </em>pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></p></li></ul>', 'cd-44-desibel', 'd6b54d3b-6f81-45c4-a78f-7dd9276d7396', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using a ferrite magnet and simulated with FEMM, resulting in an optimized motor that is low in distortion and more efficient at high frequencies.</p></li><li><p><strong>- Screw-On System for Horn Applications</strong><br>The screw-on system makes horn installation simpler and more convenient.</p></li><li><p><strong>- Ideal for Compact 2-Way System &amp; Multi-Driver Line Array System</strong><br>The 1.75-inch (44.4 mm) voice coil design with a 1-inch (25.4 mm) exit throat on the compression driver is very suitable and ideal for use in Compact 2-Way Systems and Multi-Driver Line Array Systems.</p></li></ul>'),
('929e25d0-68db-40f7-ae1d-24c55309e03d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 440K1B-08F FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:42:27.713', '2025-10-23 09:04:01.339', '<ul><li><p><strong>- Sistem motor <em>driver </em>optimal &amp; rendah distorsi</strong></p></li><li><p>Desain struktur <em>driver </em>motor melalui simulasi <em>FEMM</em> menggunakan magnet <em>ferrite </em>menghasilkan medan magnet yg efektif untuk membuat motor <em>driver </em>optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p></li><li><p><strong>- Frekuensi respon lebih lebar dan memiliki karakter suara istimewa</strong></p></li><li><p>Desain khusus <em>dome </em>berbahan <em>KAPTON </em>dan desain khusus <em>Horn Point </em>melalui simulasi <em>FEA </em>menghasilkan <em>Range</em> frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan memiliki karakter suara yang istimewa pada <em>range high</em> frekuensi.</p></li><li><p><strong>- Ideal untuk <em>compact 2-way system &amp; multi driver line array system</em></strong></p></li><li><p>Desain <em>voice coil 1.75in (44.4 mm)</em> menggunakan<em> rectangular wire</em> dengan<em> exit throat 1in (25.4 mm)</em> pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>compact 2-way system &amp; multi driver line array system </em>yang menghasilkan kualitas suara lebih bagus dan bersih.</p></li></ul>', 'cd-440k1b-08f-fabulous', '02d4d5a3-1ef3-4670-b3d7-a7f16280d410', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal &amp; Low-Distortion Driver Motor System</strong><br>The motor driver structure design, simulated using FEMM and utilizing a ferrite magnet, produces an effective magnetic field that makes the driver motor optimized, low in distortion, and more efficient at high frequencies.</p></li><li><p><strong>- Wider Frequency Response with Distinct Sound Character</strong><br>A specially designed dome made from KAPTON and a uniquely engineered Horn Point—developed through FEA simulation—provide a wider frequency response range (1000 Hz – 20000 Hz) and a distinctive sound character in the high-frequency range.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.75-inch (44.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the Compression Driver is perfectly suited and ideal for compact 2-way systems and multi-driver line array systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('934a2091-4fc0-41db-b6b0-12f5878c4b58', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15500-Mk1 BLACK', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-26 03:42:15.597', '2025-10-23 07:09:43.421', '<p><strong>1. Daya magnet optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Material conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\"</em> dan dilapisi dengan lapisan <em>weather resistance</em> sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Respon frekuensi yang halus</strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type </em>dan dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p>', '15500-mk1-black', '5078e4ee-ac4d-4243-b2e3-cbc0e8a3f295', 'admin', 0, '-', '', 'a68df00a-9f49-4300-a064-9da8129327e2', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimized magnetic performance.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from special paper processed using a rigid non-press method and coated with a weather-resistant layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>4. Smooth Frequency Response</strong><br>The conepaper, paired with an M-type cloth surround and damping glue, delivers a smooth and consistent frequency response.</p></li></ul>'),
('95c56a04-76b9-466e-8fae-825be3887d4a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-113183 -MK II SW FAB ACR SERIES', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:21:07.249', '2025-10-24 08:37:32.209', '<p>-</p>', 'voice-coil-18inpa-113183-mk-ii-sw-fab-acr-series', 'd1f04de3-8f34-41eb-a856-e0bde3695bc5', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('987cc90e-3f71-4553-8649-9976816c0bb9', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 187175 DELUXE BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-25 08:30:55.976', '2025-10-23 07:38:50.751', '<ul><li><p><strong>- Material <em>Conepaper </em>Khusus<em> (Special conepaper material)</em></strong></p></li></ul><p>Material <em>conepaper </em>dibuat berbahan dasar 90% UKP (Paper) dan 10% KPK (Kapuk) yang diproses dengan metode<em> \'rigid non-press\' </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik.</p><ul><li><p><strong>- Minimum Kompresi <em>(Low Compression)</em></strong></p></li><li><p>Motor dan <em>Chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p></li><li><p><strong>- <em>Power Handling</em> Yang Maksimal <em>(Maximum power handling) </em></strong></p></li><li><p><em>Voice coil wire</em> menggunakan material <em>EISVW </em>dan gulungan <em>voice coil</em> dilapisi dengan spesial coating membuat<em> voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p></li><li><p><strong>- Daya Magnet Optimal</strong></p></li><li><p>Daya motor magnet <em>speaker </em>yang optimal karena didesain dengan menggunakan teknologi <em>software FEA (Finite Element Analysis).</em></p></li></ul>', '187175-deluxe-by-acr', '40a3de96-a9b7-4dd5-bbcc-20d0006bf970', 'admin', 0, '', '', 'b9e3c4e8-7718-4905-afe7-b72816983fa5', 0, 0, '', '', 0, '<ul><li><p><strong>- Special Conepaper Material</strong><br>The conepaper is made from a blend of 90% UKP (paper) and 10% KPK (kapok fiber), processed using the ‘rigid non-press’ method. This makes the conepaper highly weather-resistant and capable of producing better sound quality.</p></li><li><p><strong>- Low Compression</strong><br>The motor and chassis are designed with special ventilation, preventing air compression and providing airflow that functions as an effective cooling system.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil wire uses EISVW material, and the winding is coated with a special layer, allowing the voice coil to endure high temperatures—ensuring the speaker can perform reliably even under high power handling conditions.</p><ul><li><p><strong>- Optimized Magnetic Power</strong><br>The speaker’s magnetic motor power is optimized using FEA (Finite Element Analysis) software technology.</p></li></ul>'),
('99460bb7-c036-46e2-819b-e5f1c01cb533', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in ACR-1225', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:09:16.890', '2025-10-24 08:41:03.636', '<p>-</p>', 'voice-coil-12in-acr-1225', '619b6e15-a907-461b-aa54-1f9f93250f69', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('999f8748-c4bb-4bb7-b75d-688373372f82', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" ACR 1225 NEW', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-27 08:56:48.403', '2025-10-23 06:50:26.228', '<ul><li><p><strong>- Daya magnet yang optimal<em> (optimized magnet power)</em></strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>-<em> Respon frequency </em>yang lebar <em>(wide bandwidth frequency response)</em></strong></p></li><li><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\" </em>memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em></p></li></ul>', 'acr-1225-new', '6c6e1d7f-a788-403a-99c7-7365b066d467', 'admin', 0, '', '', '94a4c86d-9bdc-496a-890e-bd3305f948b8', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to achieve optimal magnetic power.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker design features a \"whizzer cone,\" providing a wide operating frequency range, making it ideal for full-range speaker applications.</p></li></ul>'),
('9ac02f4a-1e29-4601-8ab1-a6f6481745dc', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'HORN 2538 ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 07:18:45.887', '2025-10-23 09:11:15.864', '', 'horn-2538-acr', 'c4654896-994d-4cd3-bd27-e265ad9d1296', 'admin', 0, '', '', '', 0, 0, '', 'c6c4783b-bf6a-4a85-b533-4c69a836a07f', 0, ''),
('9b9bc4b9-c041-442d-9614-7e8ed3884159', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 650TR15B-08F FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:58:48.811', '2025-10-23 09:10:09.678', '<p><strong>- Desain Struktur Motor <em>Driver </em>yang optimal.</strong></p><p>Desain struktur motor menggunakan magnet <em>ferrite </em>yang sudah di simulasikan dengan <em>FEMM </em>secara optimal dan dilengkapi dengan desain khusus pada struktur motor untuk menghasilkan kualitas respon yang bagus pada frekuensi tinggi.</p><p><strong>- <em>Range </em>frekuensi lebih lebar dengan sistem motor yang rendah distorsi.</strong></p><p>Desain khusus <em>dome </em>yang terbuat dari <em>Titanium </em>memungkinkan <em>Compression Driver </em>menghasilkan <em>range </em>frekuensi yang lebih lebar (1000 Hz - 20000 Hz) yang didukung dengan desain khusus pada sistem motor untuk meredam distorsi <em>Compression Driver</em>.</p><p><strong>- Ideal untuk <em>Compact 2-way system &amp; Multi Driver Line Array System</em></strong></p><p>Desain <em>Voice Coil 2.55in (65 mm) </em>menggunakan <em>Pure Aluminium Wire </em>dengan <em>Exit Throat 1.4in (35.6 mm) </em>pada <em>Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>Compact 2-way system &amp; Multi Driver Line Array System </em>yang menghasilkan kualitas suara lebih baik.</p>', 'cd-650tr15b-08f-fabulous', '7131ce96-3a8a-40e2-b2bf-6a053be2e929', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Driver Motor Structure Design</strong><br>The motor structure design uses ferrite magnets that have been optimally simulated with FEMM and is equipped with a special motor structure design to deliver excellent response quality at high frequencies.</p></li><li><p><strong>- Wider Frequency Range with a Low-Distortion Motor System</strong><br>A specially designed titanium dome enables the compression driver to produce a wider frequency range (1000 Hz – 20,000 Hz), supported by a specially designed motor system to reduce distortion in the compression driver.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 2.55-inch (65 mm) voice coil design using pure aluminum wire with a 1.4-inch (35.6 mm) exit throat on the compression driver is highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering superior sound quality.</p></li></ul>'),
('9cca679c-f9fb-4976-ba59-5de15ff5c3b7', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 15838 EXCEL BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-28 07:02:10.921', '2025-10-23 07:31:08.533', '', 'pa-15838-excel-by-acr', 'b83aaf84-3e89-487b-943e-909ea36db14a', 'admin', 0, '', '', '7acfadb8-efa9-4e81-a3f1-d5e2aca7ee2f', 0, 0, '', '', 1, ''),
('9d02c11c-d0ec-4102-a3a2-dfb17de845c4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 750TR15B-08 FABULOUS BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 07:03:14.703', '2025-10-23 09:10:49.952', '<ul><li><p><strong>- Desain Struktur Motor <em>Driver </em>yang optimal.</strong></p></li><li><p>Desain struktur motor menggunakan magnet <em>ferrite </em>yang sudah di simulasikan dengan <em>FEMM </em>secara optimal dan dilengkapi dengan desain khusus pada struktur motor untuk menghasilkan kualitas respon yang bagus pada frekuensi tinggi.</p></li><li><p><strong>- <em>Range </em>frekuensi lebih lebar dengan sistem motor yang rendah distorsi.</strong></p></li><li><p>Desain khusus <em>dome </em>yang terbuat dari <em>Composite Titanium </em>memungkinkan <em>Compression Driver</em> menghasilkan <em>range </em>frekuensi yang lebih lebar (1000 Hz - 20000 Hz) yang didukung dengan desain khusus pada sistem motor untuk meredam distorsi <em>Compression Driver.</em></p></li><li><p><strong>- Ideal untuk<em> Compact 2-way system &amp; Multi Driver Line Array System</em></strong></p></li><li><p>Desain<em> Voice Coil 2.55in (75 mm) </em>menggunakan <em>Pure Aluminium Wire </em>dengan <em>Exit Throat 1.4in (35.6 mm)</em> pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk <em>Compact 2-way system &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih baik.</p></li></ul>', 'cd-750tr15b-08-fabulous-by-acr', 'f38532a0-0f60-42e8-9a21-48a0cb8b166c', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Driver Motor Structure Design</strong><br>The motor structure is designed using ferrite magnets that have been optimally simulated with FEMM and is equipped with a specially designed motor structure to deliver excellent response quality at high frequencies.</p></li><li><p><strong>- Wider Frequency Range with Low-Distortion Motor System</strong><br>A specially designed dome made from composite titanium allows the compression driver to produce a wider frequency range (1000 Hz – 20,000 Hz), supported by a specially designed motor system to reduce distortion in the compression driver.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 2.55-inch (75 mm) voice coil design using pure aluminum wire with a 1.4-inch (35.6 mm) exit throat on the compression driver is highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering improved sound quality.</p></li></ul>'),
('9ef91ba9-7386-4f99-a0c6-4aa981b73430', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '6\" CS 603 ACR', 0, 0, 'ed8a91c0-2efb-4f49-892e-5f5cb123bd86', '2025-03-28 04:30:46.949', '2025-10-23 08:38:57.898', '', 'cs-603-acr', 'b90d717d-9088-4b86-98e4-10709dd4e222', 'admin', 0, '', '', '', 1, 0, 'ea2a96f2-a8c8-44d2-af94-184b29cde810', '', 0, ''),
('9f4aafe3-72b5-44ca-8fa1-47eb31614b06', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 127187 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 02:05:51.082', '2025-10-23 07:48:19.533', '<p><strong>1. Tahan Panas</strong></p><p>- Penambahan alat pendingin pada <em>t-yoke </em>untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil.</p><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Distorsi Rendah</strong></p><p>Adanya <em>ring aluminium</em> pada<em> t-yoke</em> yang berfungsi untuk meredam distorsi.</p><p><strong>3. Kokoh dan Minimum Kompresi</strong></p><p><em>Chassis </em>berbahan <em>aluminium</em> <em>diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya. Ditambah dengan warna <em>grey texture powder coating </em>membuat <em>speaker </em>terkesan lebih kokoh.</p><p><strong>4. Stabil dan lintasan geraknya tinggi</strong></p><p><em>Double damper &amp; Triple round surround </em>menjadikan <em>speaker</em> lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p><strong>5. Daya magnet lebih optimal</strong></p><p>Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA</em></p>', 'pa-127187-sw-fab-by-acr', '2a7cef74-13a6-4494-b43a-2fcf8a1a26d7', 'admin', 0, '', '', '09fab62c-49be-48ca-9166-90a23022f692', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>A cooling device is added to the T-yoke to maintain stable speaker temperature, ensuring consistent performance. The voice coil (spool) uses a non-conductive fiberglass former and advanced wire coating technology, allowing it to operate reliably even at temperatures above 280°C.</p></li><li><p><strong>2. Low Distortion</strong><br>An aluminum ring on the T-yoke functions to suppress distortion, resulting in cleaner and more accurate sound.</p></li><li><p><strong>3. Robust and Low-Compression Design</strong><br>The carefully designed die-cast aluminum chassis provides maximum structural strength while minimizing compression. The grey texture powder coating adds to its solid and durable appearance.</p></li><li><p><strong>4. High Stability and Long Excursion</strong><br>Equipped with a double damper and triple round surround, the speaker offers greater stability and longer cone excursion for improved dynamic performance.</p></li><li><p><strong>5. Optimized Magnetic Power</strong><br>The speaker\'s magnetic motor is engineered using FEA (Finite Element Analysis) software to ensure maximum magnetic efficiency and performance.</p></li></ul>'),
('a4a0194b-235f-4263-8e7a-e8cd24a313de', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1240-Mk1 PA ACR CLASSIC', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-25 09:06:47.897', '2025-10-23 06:33:08.563', '<ol><li><p><strong>1. Daya magnet yang optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca <em>(Weatherproof conepaper)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p></li><li><p><strong>3. Kokoh</strong></p></li><li><p>Menggunakan <em>chassis </em>plat dengan desain yang baru sehingga memiliki konstruksi yang lebih kokoh</p></li><li><p><strong>4. Minimum kompresi <em>(Low Compression)</em></strong></p></li><li><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p></li><li><p><strong>5. <em>Respon frequency </em>yang lebar <em>(wide bandwidth frequency response)</em></strong></p></li><li><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em></p></li></ol>', '1240-mk1-pa-acr-classic', '3c3cd6fc-38f4-445d-95d4-bb3320461458', 'admin', 0, '', '', '3a2ae945-2071-4629-ac8f-0819194912df', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic power.</p></li><li><p><strong>2. Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>3. Sturdy Construction</strong><br>Built with a newly designed metal chassis plate, providing a stronger and more durable structure.</p></li><li><p><strong>4. Low Compression</strong><br>The motor includes special ventilation to eliminate air compression and enable airflow that acts as a cooling system.</p></li><li><p><strong>5. Wide Bandwidth Frequency Response</strong><br>The speaker design features a \"whizzer cone,\" providing a wide frequency range and making it ideal for full-range speaker applications.</p></li></ul>'),
('a4a520ce-1b54-4e87-a1a1-761f5d240fe4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" ACR 15600 BLACK', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-26 04:10:40.981', '2025-10-23 07:24:11.229', '<ul><li><p><strong>- Daya magnet yang optimal<em> (Optimized Magnet Power)</em></strong></p></li></ul><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>- Respon frekuensi yang halus<em> (Smooth Frequency Response)</em></strong></p><p><em>Conepaper </em>dilengkapi <em>damping glue </em>pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>- Minimum kompresi <em>(Low Compression)</em></strong></p><p><em>Motor </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dengan material dasar BKP 100% dengan <em>chemical weatherproof </em>sehingga menghasilkan suara yang bagus dan cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p>', 'acr-15600-black', '66d7fbfc-29aa-49f9-9420-88ecf0ee2eb9', 'admin', 0, '', '', 'eb953a03-47d6-4ac1-b83d-4e9942e976a9', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>- Smooth Frequency Response</strong><br>The conepaper is equipped with damping glue on the surround, producing a smooth and well-balanced frequency response.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and ensure airflow that functions as an effective cooling system.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>Made from 100% BKP base material and treated with a chemical weatherproof coating, the conepaper delivers excellent sound quality and is suitable for both indoor and outdoor applications.</p></li></ul>');
