('a5007c7a-fb7d-4a30-aa0e-de39f035bbb5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 1280 Mk1 ACR BLACK MAGIC', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-25 09:16:22.169', '2025-10-23 06:47:37.594', '<p><strong>1. <em>New motor design</em></strong></p><p>Speaker menggunakan desain motor baru yang mampu mengakomodasi gerakan speaker dan menambah ekskursi <em>driver </em>menjadi lebih tinggi sehingga menggurangi potensi <em>bottomming</em></p><p><strong>2. <em>Good chassis design</em></strong></p><p><em>Speaker </em>menggunakan <em>chassis </em>dengan material <em>aluminium diecast </em>memberikan rangka <em>speaker </em>yang kokoh dan di<em> finishing black wrinkle </em>memberikan penampilan speaker yang lebih eksklusif dikelasnya.</p><p><strong>3. <em>Good air compression</em></strong></p><p><em>Design motor driver </em>yang dilengkapi dengan ventilasi udara memberikan transfer panas dan sirkulasi udara yang baik sehingga memberikan kompresi udara yang baik juga.</p><p><strong>4. Design <em>speaker Fullrange </em>yang handal</strong></p><p>Perpaduan desain<em> surround tripple roll </em>yang menambah ekskursi speaker dengan didukung struktur motor yang dalam <em>(deep motor structure)</em> serta <em>dustcap </em>yang berbahan <em>aluminium </em>memberikan kualitas suara <em>fullrange </em>yang prima di frekuensi rendah maupun di frekuensi tinggi.</p>', '1280-mk1-acr-black-magic', '39c0778a-a6be-4d75-a4ec-14a72d86b605', 'admin', 0, '', '', '1f57a7c8-c07b-44af-a72b-20dfaa9a0e48', 0, 0, '', '', 0, '<ul><li><p><strong>1. New Motor Design</strong><br>The speaker uses a new motor design that accommodates greater cone movement, increasing driver excursion and reducing the risk of bottoming out.</p></li><li><p><strong>2. Good Chassis Design</strong><br>The speaker features a chassis made of aluminum die-cast, providing a strong frame, and is finished with a black wrinkle coating that gives the speaker a more exclusive appearance in its class.</p></li><li><p><strong>3. Efficient Air Compression</strong><br>The driver motor design includes air ventilation, allowing for effective heat transfer and airflow, which contributes to improved air compression performance.</p></li><li><p><strong>4. Reliable Full-Range Speaker Design</strong><br>A combination of a triple-roll surround that increases speaker excursion, a deep motor structure, and an aluminum dustcap delivers excellent full-range sound quality—both in low and high frequencies.</p></li></ul>'),
