('a5cdac0c-e945-4578-81ca-333d974895ff', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" 818-W CURVE', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 00:42:20.975', '2025-10-23 08:44:29.032', '<p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca<em> (Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Desain karakter <em>woofer </em>yang kuat</strong></p><p><em>Speaker </em>ini mempunyai <em>Fo </em>yang rendah dan <em>range </em>frekuensi respon yang lebar sehingga cocok digunakan sebagai <em>woofer </em>dan <em>midwoofer </em>yang handal.</p>', '818-w-curve', 'd5ab9cdd-e920-4a53-b100-737af371a2d2', 'admin', 0, '', '', '57450df4-02d6-4799-93c8-084d6477e75a', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic force for enhanced speaker performance.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Strong Woofer Character Design</strong><br>This speaker features a low Fs (resonance frequency) and a wide frequency response range, making it a reliable choice for both woofer and midwoofer applications.</p></li></ul>'),
('a5fa9a03-6fb5-420e-86d4-cb1b9e941b61', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18in 18700-MK', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:24:49.728', '2025-10-24 08:38:35.743', '<p>-</p>', 'voice-coil-18in-18700-mk', 'b468afda-65fa-46fc-8bca-653435c756b1', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('a6210fbc-5908-4215-bc45-d4f10734daab', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in 15710', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-10-22 07:49:10.041', '2025-10-24 08:42:52.911', '', 'voice-coil-15in-15710', 'a5607590-96fd-46f5-b0b7-96fccb01f891', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('a8abc1a9-9de0-4eee-8880-f627936a3315', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in PA-15900 -MK I PRE ACR SERIES', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:12:46.896', '2025-10-24 08:39:38.086', '<p>-</p>', 'voice-coil-15in-pa-15900-mk-i-pre-acr-series', 'a21ee4a6-c674-4d6b-9927-76d0a4c037d6', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('a9a63a5a-be0f-4816-99b4-0c4931763040', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 250C1-08F Mk1 BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:19:25.608', '2025-10-23 08:52:01.999', '<p><strong>- Sistem Motor <em>Driver </em>optimal</strong></p><p>Desain <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang menggunakan <em>Ferrofluid </em>lebih tahan panas dan lebih stabil pada frekuensi tinggi.</p><p><strong>- Frekuensi respon lebih bagus dan <em>flat </em>pada frekuensi tinggi</strong></p><p>Desain khusus <em>Phase Plug </em>dan <em>Horn Adapter </em>melalui simulasi <em>FEA </em>menghasilkan frekuensi respon yang lebih bagus dan flat pada frekuensi tinggi</p><p><strong>- <em>Output </em>suara Istimewa</strong></p><p>Desain khusus <em>Dome </em>yang terbuat dari <em>Cloth </em>dan menggunakan <em>Former Newcon </em>menghasilkan <em>output</em> suara yang bagus dan istimewa</p>', 'cd-250c1-08f-mk1-by-acr', '1f09f49d-947d-4d45-8a1e-af072d17cc2f', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal Driver Motor System</strong><br>The driver motor design uses a ferrite magnet with Ferrofluid, providing better heat resistance and more stability at high frequencies.</p></li><li><p><strong>- Improved and Flat High-Frequency Response</strong><br>A specially designed Phase Plug and Horn Adapter, optimized through FEA simulation, deliver improved and flat frequency response at high frequencies.</p></li><li><p><strong>- Exceptional Sound Output</strong><br>A specially designed dome made from cloth and using a Newcon former produces excellent and outstanding sound output.</p></li></ul>'),
('a9fd5620-2c09-41d2-af29-08b1cf86acfa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15inACR-15100', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-10-22 07:53:32.578', '2025-10-24 08:42:41.402', '', 'voice-coil-15inacr-15100', '903d2008-a7f1-4215-ad10-e7837d2d7c11', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('abac8cb7-8e91-4aeb-8dad-bd01b94af49d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" PA 10880 Mk3 EXCEL BY ACR', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-18 07:35:26.633', '2025-10-23 06:26:21.530', '<p><strong>- Daya magnet optimal <em>(Optimized magnet power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weather resistance)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p><p><strong>- Respon frekuensi yang halus<em> (Smooth frequency response)</em></strong></p><p><em>Conepaper </em>dengan <em>surround cloth M-type </em>dan dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>- Minimum kompresi<em> (Low compression)</em></strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p>', 'pa-10880-mk3-excel-by-acr', 'a3b7bc5c-2e29-4254-9d20-2b7327752825', 'admin', 0, '', '', '6a3426c6-62a4-4665-90f2-874491c3e137', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis) measurements to deliver optimal magnetic power.</p></li><li><p><strong>- Weather Resistance</strong><br>The conepaper is coated with a weather-resistant layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Smooth Frequency Response</strong><br>The conepaper, combined with M-type cloth surround and damping glue, results in a smooth frequency response.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and provide airflow that functions as cooling.</p></li></ul>'),
('ac3c3591-7763-4b5b-9bc9-a7ce8f611e99', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 113186 Mk1 SW', 0, 1, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-04-11 01:51:32.969', '2025-08-18 02:19:25.268', '<p><strong>1. Tahan panas</strong></p><p>Penambahan alat pendingin pada <em>t-yoke</em> untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil. Menggunakan <em>former </em>berbahan dasar<em> non-conductive fiberglass </em>dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool</em> mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Distorsi yang rendah</strong></p><p>Adanya<em> ring aluminium</em> pada <em>t-yoke </em>yang berfungsi untuk meredam distorsi.</p><p><strong>3. Kokoh dan minimum kompresi</strong></p><p><em>Chassis </em>berbahan aluminium cor berventilasi menjadikan <em>speaker </em>mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>4. Stabil dan lintasan geraknya tinggi</strong></p><p><em>Double damper &amp; Triple round surround</em> menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p><strong>5. Daya magnet lebih optimal</strong></p><p>Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-desain menggunakan teknologi dari <em>software FEA.</em></p>', 'pa-113186-mk1-sw', 'd2eb9b12-730e-45de-ba42-657f015a3036', 'admin', 0, '', '', 'db21ed9f-06e9-432b-8900-5c91b9ec7615', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant</strong><br>A cooling device is added to the T-yoke to maintain stable speaker temperature, ensuring consistent performance. The voice coil (spool) uses a non-conductive fiberglass former and advanced wire coating technology, allowing it to function reliably even at temperatures above 280°C.</p></li><li><p><strong>2. Low Distortion</strong><br>An aluminum ring is added to the T-yoke to help reduce distortion, resulting in cleaner and more accurate sound output.</p></li><li><p><strong>3. Robust and Low-Compression Design</strong><br>The ventilated cast aluminum chassis offers maximum durability while minimizing air compression, improving airflow and heat dissipation.</p></li><li><p><strong>4. High Stability and Long Excursion</strong><br>Equipped with a double damper and triple round surround, the speaker achieves greater stability and longer excursion for improved dynamic performance.</p></li><li><p><strong>5. Optimized Magnet Power</strong><br>The speaker’s magnetic motor is engineered using FEA (Finite Element Analysis) software to ensure optimal magnetic strength and efficiency.</p></li></ul>'),
('ad5f1fd2-2e95-4303-a6b2-94864a94e6aa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" PA 10880 Mk2 EXCEL BY ACR', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-28 06:14:19.964', '2025-10-23 06:25:35.707', '<p><strong>1. Daya Magnet Optimal</strong></p><p>Daya motor<em> magnet speaker</em> yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>2. <em>Weatherproof</em></strong></p><p><em>Conepaper </em>yang kokoh dilapisi dengan<em> black coating</em> menjadikan tahan terhadap segala cuaca</p>', 'pa-10880-mk2-excel-by-acr', '3651a0aa-600e-48b8-8a10-d50716921fd2', 'admin', 0, '', '', 'e7f409cd-5ee3-4b22-9827-2a0143fda5e4', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The speaker’s magnetic motor power is optimized through a design that uses FEA (Finite Element Analysis) technology.</p></li><li><p><strong>2. Weatherproof</strong><br>The durable conepaper is coated with a black weather-resistant layer, making it suitable for all weather conditions.</p></li></ul>'),
('adcc2e3e-e85e-4879-9acb-669b0f439bd5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 12880 Mk3 EXCEL BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 07:39:36.751', '2025-10-23 06:54:08.094', '', 'pa-12880-mk3-excel-by-acr', '263537f4-be93-4764-974b-8f34e4d2d8f0', 'admin', 0, '', '', 'b478108c-f0b4-41df-a8b2-b23b4a65b71f', 0, 0, '', '', 1, ''),
('aeae055c-aaf8-45a6-9ed5-fa3d73d9be5a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 440K1B-08F', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:39:32.071', '2025-10-23 09:15:53.126', '<p>-</p>', 'recone-kit-cd-440k1b-08f', '4f76bdb0-ca21-43d0-928f-4918fb877795', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('b1b88134-f77f-4051-9201-29cba5ba7cbf', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 75124 W-N FAB BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 04:06:32.722', '2025-10-23 06:56:55.919', '<p><strong>1. Daya magnet yang optimal dan tahan panas</strong></p><p>Pemilihan material <em>magnet neodymium</em> yang tahan panas sampai suhu yang sangat tinggi dan pengukuran dengan menggunakan <em>FEA </em>sehingga<em> design magnet</em> adalah yang optimal.</p><p><strong>2. Minimum kompresi</strong></p><p>Menggunakan <em>voice coil </em>berventilasi untuk mengurangi tekanan pada speaker.</p><p><strong>3. Distorsi rendah</strong></p><p>Penambahan <em>modul ring aluminium </em>sehingga distorsinya sangat rendah.</p><p><strong>4. <em>Minimum damping </em>dan maksimum<em> power handling</em></strong></p><p>Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> untuk meminimalkan <em>damping </em>dan pelapisan kawat <em>coil </em>dengan teknologi terbaru sehingga meningkatkan<em> power handling.</em></p>', 'pa-75124-w-n-fab-by-acr', '0f83c8b1-144c-48a1-9a7e-dfa1b4389632', 'admin', 0, '', '', '72483636-ff37-4319-9d17-abcda61b43a2', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power and Heat Resistance</strong><br>Utilizes neodymium magnet material that withstands extremely high temperatures, with design optimized through FEA (Finite Element Analysis).</p></li><li><p><strong>2. Low Compression</strong><br>Features a ventilated voice coil to reduce air pressure on the speaker.</p></li><li><p><strong>3. Low Distortion</strong><br>Equipped with an aluminum ring module to significantly minimize distortion.</p></li><li><p><strong>4. Minimal Damping and Maximum Power Handling</strong><br>Uses a non-conductive fiberglass former to reduce damping, and the coil wire is coated with the latest technology to enhance power handling.</p></li></ul>'),
('b29558bb-187d-46b5-9e47-717a425e6c46', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 100187 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:37:53.921', '2025-10-23 07:44:02.702', '<p><strong>1. Tahan Panas</strong></p><p> - Penambahan alat pendingin pada<em> t-yoke </em>untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil.</p><p> - Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat<em> voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Distorsi Rendah</strong></p><ul><li><p> - Adanya <em>ring aluminium </em>pada<em> t-yoke </em>yang berfungsi untuk meredam distorsi.</p></li></ul><p><strong>3. Design Kokoh</strong></p><ul><li><p><em> - Chassis </em>berbahan <em>aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya. Ditambah dengan warna <em>grey texture powder coating</em> membuat <em>speaker </em>terkesan lebih kokoh.</p></li></ul><p><strong>4. Daya magnet lebih optimal</strong></p><ul><li><p> - Daya motor magnet speaker yang optimal karena di-<em>design </em>dengan menggunakan teknologi <em>software FEA</em></p></li></ul>', 'pa-100187-sw-fab-by-acr', 'b31721eb-3a66-44c3-a668-a8a4742dc767', 'admin', 0, '', '', '448f458b-58d6-4db1-9496-890d28b8fdd1', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br> - A cooling device is added to the T-yoke to help maintain stable speaker temperature, ensuring consistent performance.</p></li><li><p> - The voice coil uses a non-conductive fiberglass former and advanced wire coating technology, allowing it to operate reliably at temperatures above 280°C.</p></li><li><p><strong>2. Low Distortion</strong><br> - An aluminum ring is added to the T-yoke to help suppress distortion, resulting in cleaner sound output.</p></li><li><p><strong>3. Robust Design</strong><br> - The chassis is made from precision-engineered aluminum die-cast, offering maximum strength and low compression. Finished with a grey texture powder coating, it also provides a visually rugged and durable appearance.</p></li><li><p><strong>4. Optimized Magnetic Power</strong><br> - The speaker\'s magnetic motor is designed using FEA (Finite Element Analysis) software to achieve optimal magnetic strength and performance.</p></li></ul>'),
('b329d446-d865-4fb2-953c-9f8b78044627', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" ACR 15600+ BLACK', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-26 04:14:00.627', '2025-10-23 07:25:00.982', '<p><strong>- Frekuensi lebih lebar<em> (Wide Frequency)</em></strong></p><p>Material <em>conepaper </em>yang berbeda dari tipe 15600 sehingga membuat frekuensi suara yang dihasilkan lebih lebar.</p><p><strong>- Daya magnet yang optimal<em> (Optimized Magnet Power)</em></strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal.</p><p><strong>- Respon frekuensi yang halus<em> (Smooth Frequency Response)</em></strong></p><p><em>Conepaper </em>dilengkapi <em>damping glue</em> pada <em>surround </em>memberikan hasil respon frekuensi yang halus.</p><p><strong>- Minimum kompresi<em> (Low Compression)</em></strong></p><p><em>Motor </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dengan material dasar BKP50% + USP 50% dan dilapisi dengan lapisan <em>weatherproof </em>sehingga menghasilkan suara yang bagus dan cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p>', 'acr-15600plus-black', '1168248d-23e2-473a-b190-3676dd3c7dff', 'admin', 0, '', '', 'a6c59b8e-15e5-4284-864d-a5fb2548eb8c', 0, 0, '', '', 0, '<ul><li><p><strong>- Wider Frequency Range</strong><br>The conepaper material differs from the 15600 type, resulting in a wider sound frequency range.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), delivering optimized magnetic performance.</p></li><li><p><strong>- Smooth Frequency Response</strong><br>The conepaper is equipped with damping glue on the surround, producing a smooth and balanced frequency response.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and ensure proper airflow for cooling.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>Made from a blend of 50% BKP and 50% USP materials, the conepaper is coated with a weatherproof layer, providing excellent sound quality and making it suitable for both indoor and outdoor use.</p></li></ul>'),
('b4bf5258-ac35-4b36-bb95-bd4aeca3d22d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 12880 Mk2 EXCEL BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:28:02.058', '2025-10-23 06:53:20.190', '<p><strong>1. Daya Magnet Optimal</strong></p><p>Daya motor <em>magnet speaker </em>yang optimal karena didesain dengan menggunakan teknologi<em> FEA (Finite Element Analysis)</em></p><p><strong>2. <em>Weatherproof</em></strong></p><p><em>Conepaper </em>yang kokoh dilapisi dengan<em> black coating </em>menjadikan tahan terhadap segala cuaca</p>', 'pa-12880-mk2-excel-by-acr', '0d10d8c8-c280-4412-b11d-9dc155fecb74', 'admin', 0, '', '', '370ff49b-335b-404c-ba6c-96943cca0878', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The speaker\'s magnetic motor delivers optimal power thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>2. Weatherproof</strong><br>The sturdy conepaper is coated with a black layer, making it resistant to all weather conditions.</p></li></ul>'),
