 precisely engineered aluminum die-cast material, providing maximum strength and low compression. Finished with a grey texture powder coating, it gives the speaker a solid and durable appearance.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>The magnetic motor power is optimized using FEA (Finite Element Analysis) software, ensuring high magnetic efficiency and performance.</p></li></ul>'),
('b777f98c-3a0b-499f-bcf2-441c88f04256', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 18inPA-113188', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:53:36.409', '2025-10-24 08:44:03.199', '<p>-</p>', 'recone-kit-18inpa-113188', '3033da94-9bbf-4d04-a1ae-b58fe77f189d', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('b93004bf-c236-48cf-8152-6003d12b24e0', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" 838 CURVE', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 00:46:20.309', '2025-10-23 08:44:59.793', '<p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dibuat dengan menggunakan material UKP 100% menghasilkan <em>conepaper </em>yang kuat dan memberikan suara yang prima. <em>Conepaper </em>juga dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- Frekuensi kerja yang lebar <em>(Wide Bandwidth)</em></strong></p><p>Desain <em>speaker </em>khusus yang menghasilkan frekuensi kerja yang lebar dari 40 Hz - 9900 Hz</p><p><strong>- Kompresi udara yang baik</strong></p><p><em>Conepaper </em>dilengkapi ventilasi pada area<em> inner diameter cone </em>memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada saat bekerja.</p>', '838-curve', '1b7143e4-6629-4af8-9502-5ee0ede70580', 'admin', 0, '', '', '81130195-3632-438e-9782-7a47f0c72c3a', 0, 0, '', '', 0, '<ul><li><p><strong>- Weatherproof Conepaper</strong><br>Made from 100% UKP material, the conepaper is strong and delivers excellent sound quality. It is also coated with a weatherproof layer, making it ideal for both indoor and outdoor applications.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor design, developed using FEA (Finite Element Analysis), ensures optimal magnetic performance for better speaker efficiency.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>Specially designed to produce a wide frequency range from 40 Hz to 9900 Hz, making the speaker suitable for various audio applications.</p></li><li><p><strong>- Improved Air Compression Control</strong><br>Ventilation around the inner diameter of the cone helps provide better airflow and reduces air compression during operation, enhancing performance and cooling.</p></li></ul>'),
('ba109d30-e083-49b8-9f46-5652181a29aa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" C-1018 HW ACR PRO NEW', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-26 04:20:13.676', '2025-10-23 06:23:42.266', '<p><strong>- Distorsi yang rendah<em> (Low distortion)</em></strong></p><p>Penambahan <em>coppercap </em>pada <em>head yoke </em>yang berfungsi untuk meminimalkan distorsi <em>speaker</em>.</p><p><strong>- Respon <em>frequency </em>yang lebar <em>(Wide bandwidth frequency response)</em></strong></p><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk <em>speaker fullrange</em>.</p><p><strong>- Daya <em>magnet </em>yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya <em>magnet </em>yang optimal.</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em>.</p><p><strong>- Minimum kompresi <em>(Low compression)</em></strong></p><p>Motor didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p>', 'c-1018-hw-acr-pro-new', '2817bb91-a94e-4bbd-afde-0b98bc8a521f', 'admin', 0, '', '', '0c0427af-61c7-4e46-ba1f-1bb07a681bfe', 0, 0, '', '', 0, '<ul><li><p><strong>- Low Distortion</strong><br>The addition of a copper cap on the head yoke helps minimize speaker distortion.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is designed with a \"whizzer cone,\" providing a wide frequency range and making it ideal for full-range speaker applications.</p></li><li><p><strong>- Optimal Magnetic Power</strong><br>The motor design, developed using FEA (Finite Element Analysis) measurements, delivers optimal magnetic power.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and provide airflow for cooling.</p></li></ul>'),
('bbaea42b-7214-43f1-97b8-5629671f0ff1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 188175 EXCEL BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 07:25:27.653', '2025-10-23 07:50:26.365', '<p><strong>1. Tahan panas dan minimum kompresi</strong></p><ul><li><p>- Menggunakan former berbahan dasar <em>non-conductive fiberglass </em>dan pelapisan kawat coil dengan menggunakan teknologi spesial coating membuat <em>voice coil/ spool </em>mampu bekerja bahkan pada suhu diatas 280 °C</p></li></ul><p>- Motor dan <em>Chassis </em>didesain dengan ventilasi untuk mencegah adanya kompresi udara</p><p><strong>2. <em>Weatherproof</em></strong></p><p>- <em>Conepaper </em>sangat kuat dan tahan terhadap segala cuaca</p><p><strong>3. Kokoh</strong></p><p>- <em>Chassis </em>memiliki konstruksi yang kuat dan terbuat dari <em>aluminium diecast</em></p><p><strong>4. Daya Magnet Optimal</strong></p><p>- Daya motor magnet <em>speaker </em>yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p>', 'pa-188175-excel-by-acr', '5d2a43db-f635-4cf7-9f0f-2b191abfaed4', 'admin', 0, '', '', 'c68751cf-2087-4051-b91e-14fb4d9afb8e', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant and Low Compression</strong></p></li><li><p><strong>- </strong>Using a non-conductive fiberglass former and applying a special coating technology to the coil wire allows the voice coil/spool to operate reliably even at temperatures above 280 °C.</p></li><li><p>- The motor and chassis are equipped with ventilation to prevent air compression and ensure proper cooling.</p></li><li><p><strong>2. Weatherproof</strong><br>- The conepaper is exceptionally strong and built to withstand all weather conditions, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Robust Construction</strong><br>- The chassis features a strong, durable design made from high-quality aluminum die-cast, ensuring long-term structural integrity.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>- The speaker’s magnetic motor is designed using FEA (Finite Element Analysis) technology to achieve maximum magnetic efficiency and performance.</p></li></ul>'),
('bd567a08-d5cc-499d-b634-355f3a18e30b', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 75125 M FAB BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 03:52:45.758', '2025-10-23 06:58:20.482', '<ol><li><p><strong>1. <em>ISV : Interleaved Sandwich Voice coil.</em></strong></p></li><li><p>Teknologi <em>ISV </em>memberikan transfer panas yang sangat baik dan menurunkan temperatur kerja <em>voice coil</em>. Keunggulan lain dari teknologi <em>ISV </em>adalah menambah daya tahan terhadap panas dan menjadikan speaker mampu bertahan pada level <em>power </em>yang sangat tinggi.</p></li><li><p><strong>2. Material <em>Conepaper </em>khusus.</strong></p></li><li><p><em>Conepaper </em>dibuat tahan terhadap cuaca dengan metode <em>rigid non press </em>serta menggunakan material khusus menghasilkan <em>conepaper </em>yang sangat kuat, kokoh, dan ringan memberikan kualitas suara yang prima.</p></li><li><p><strong>3. <em>Chassis </em>menggunakan desain khusus.</strong></p></li><li><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain ventilasi udara khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang sangat baik</p></li><li><p><strong>4. Maksimum power handling.</strong></p></li><li><p>Gulungan <em>voice coil</em> dicoating menggunakan spesial coating dan MEK menambah ketahanan <em>voice coil </em>sehingga mampu memberikan hasil <em>power handling</em> yang tinggi</p></li><li><p><strong>5. Minimum kompresi<em> (Low Compression).</em></strong></p></li><li><p>Motor didisain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p></li></ol>', 'pa-75125-m-fab-by-acr', '93175224-882d-4cf2-a329-d6e04d62df70', 'admin', 0, '', '', '79c254c7-7aef-4781-91e4-6f8ad11ec340', 0, 0, '', '', 1, '<ul><li><p><strong>1. ISV: Interleaved Sandwich Voice Coil</strong><br>ISV technology provides excellent heat transfer and lowers the operating temperature of the voice coil. Another advantage of ISV is improved heat resistance, enabling the speaker to withstand very high power levels.</p></li><li><p><strong>2. Special Conepaper Material</strong><br>The conepaper is made weather-resistant using a rigid non-press method and special materials, resulting in a very strong, durable, and lightweight conepaper that delivers excellent sound quality.</p></li><li><p><strong>3. Special Chassis Design</strong><br>The robust chassis is made from high-quality die-cast material and features a specially designed ventilation system at the bottom for effective heat dissipation.</p></li><li><p><strong>4. Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special coating and MEK, enhancing its durability and enabling the speaker to achieve high power handling performance.</p><ul><li><p><strong>5. Low Compression</strong><br>The motor is designed with additional ventilation to eliminate air compression and ensure proper airflow for cooling.</p></li></ul>'),
('bf2fe987-efd4-460a-a75d-0b298cf00ef2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" 848 CURVE BLACK', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 00:50:01.773', '2025-10-23 08:45:41.201', '<p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis)</em> memberikan daya magnet yang optimal</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca<em> (Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Desain karakter <em>woofer </em>yang kuat</strong></p><p><em>Speaker </em>ini mempunyai <em>Fo </em>yang rendah dan <em>range </em>frekuensi respon yang lebar sehingga cocok digunakan sebagai <em>woofer </em>dan <em>midwoofer </em>yang handal.</p>', '848-curve-black', 'dd2d53e8-640c-4d4b-8917-cbf737a1525c', 'admin', 0, '', '', '6c5040d8-ab54-47e3-bd76-ac8401515eb0', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic strength to enhance overall speaker performance.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use, while maintaining durability and sound quality.</p></li><li><p><strong>- Strong Woofer Character Design</strong><br>With a low resonance frequency (Fo) and wide frequency response range, this speaker is highly suitable as a reliable woofer and midwoofer.</p></li></ul>'),
('c30680e8-af1b-4f00-ab70-9b2b408b9267', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 18700 Mk1 DELUXE BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-25 08:41:28.231', '2025-10-23 07:48:51.317', '<p><strong>1. Tahan Panas</strong></p><p>- <em>Voice Coil 4inch</em> dengan kawat pipih, memberikan kekuatan lebih terhadap daya tahan, baik terhadap suhu yang tinggi dan <em>power </em>yang besar.</p><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat<em> voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p><p><strong>2. Kokoh dan Minimum Kompresi</strong></p><p>- <em>New Model Chassis</em> berbahan <em>aluminium diecast</em> di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p><p>-<em> Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p><p>- <em>Non Press Conepaper</em> dengan diberi lapisan <em>coating </em>pada bagian depan dan belakang, untuk memperoleh suara bass yang solid.</p><p><strong>4. Daya magnet lebih optimal</strong></p><p>- Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA.</em></p><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p>', 'pa-18700-mk1-deluxe-by-acr', 'd405d0f0-bfd1-4be0-a568-b8e9b30d1a78', 'admin', 0, '', '', '5e587012-1b30-4199-acc4-b38084b60968', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>- The 4-inch voice coil uses flat wire, providing enhanced durability under high temperatures and large power loads.</p></li><li><p>- It also uses a non-conductive fiberglass former and advanced wire coating technology, allowing it to operate reliably even at temperatures above 280°C.</p></li><li><p><strong>2. Robust and Low Compression</strong><br>- The new model chassis is made from precision-engineered aluminum die-cast material, offering maximum strength and reduced air compression.</p></li><li><p><strong>3. High Stability and Long Excursion</strong><br>- The triple round surround ensures greater speaker stability and allows for a longer cone excursion.</p></li><li><p>- The non-press conepaper is coated on both the front and back to produce solid, impactful bass.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>- The magnetic motor is designed using FEA (Finite Element Analysis) software to achieve optimal magnetic performance.</p></li><li><p>- Ventilation holes are added for better airflow, helping to reduce excess heat.</p></li></ul>'),
('c3079bc9-9f3a-454e-9598-0b470ff73b49', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" ARRAY 20601 M FAB BY ACR', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 06:00:19.863', '2025-10-23 08:47:54.377', '<ul><li><p>- Menggunakan magnet <em>neodymium </em>yang dirakit dengan desain khusus menghasilkan <em>speaker </em>yang ringan dan mempunyai aliran medan magnet yang kuat.</p></li><li><p>- <em>Surround</em> <em>conepaper </em>yang dilengkapi dengan <em>damping glue </em>memberikan frekuensi respon yang lebih halus</p></li></ul>', 'array-20601-m-fab-by-acr', 'a350e35b-417d-47f4-a73a-01e06012b2c0', 'admin', 0, '', '', '4df5f025-b0c9-4db1-a3b1-e4949a208436', 0, 0, '', '', 0, '<ul><li><p>- Uses a specially designed neodymium magnet assembly that results in a lightweight speaker with a strong magnetic field flow for optimal sound performance.</p></li><li><p><strong>- </strong>The conepaper surround is equipped with damping glue that effectively reduces excessive vibrations, delivering a smoother frequency response and more natural sound quality.</p></li></ul>'),
('c3fddef4-b179-46dd-8849-4309bedfa2cc', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 18900 Mk1 PRE BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-25 08:56:26.822', '2025-10-23 08:30:54.942', '<ol><li><p><strong>1. Tahan Panas</strong></p></li><li><p>-<em> Voice Coil 4inch </em>dengan <em>sandwich technology </em>(gulungan didalam dan diluar <em>former</em>), memberikan kekuatan lebih terhadap daya tahan, baik terhadap suhu yang tinggi dan <em>power </em>yang besar.</p></li><li><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool </em>mampu bekerja bahkan pada suhu diatas 280°C.</p></li><li><p><strong>2. Kokoh dan Minimum Kompresi</strong></p></li><li><p>- <em>New Model Chassis </em>berbahan <em>aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p></li><li><p><strong>3. Stabil dan lintasan geraknya tinggi</strong></p></li><li><p>-<em> Triple round surround</em> menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p></li><li><p>- <em>Non Press Conepaper</em> dengan diberi lapisan <em>coating </em>pada bagian depan untuk memberi ketahanan terhadap cuaca.</p></li><li><p><strong>4. Daya magnet lebih optimal</strong></p></li><li><p>- Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-<em>design </em>menggunakan teknologi dari <em>software FEA.</em></p></li><li><p>- Lubang ventilasi untuk sirkulasi udara, berguna untuk mengurangi udara panas berlebihan.</p></li></ol>', 'pa-18900-mk1-pre-by-acr', '9c4765c9-7e89-41fd-9fda-6a2dfc87b665', 'admin', 0, '', '', '97ac4419-3a2f-4754-9449-72f41c6a3e29', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>- The 4-inch voice coil features sandwich technology (windings inside and outside the former), providing enhanced durability under high temperatures and high power.</p></li><li><p>- It uses a non-conductive fiberglass former and the latest wire coating technology, allowing the voice coil/spool to operate even at temperatures above 280°C.</p></li><li><p><strong>2. Robust and Low Compression</strong><br>- The new model chassis is precisely designed using die-cast aluminum, offering maximum structural strength while minimizing air compression for improved thermal performance.</p></li><li><p><strong>3. High Stability and Extended Excursion</strong><br>- The triple round surround ensures improved stability and allows for greater cone excursion.</p></li><li><p>- The non-press conepaper is coated on the front side to enhance weather resistance.</p></li><li><p><strong>4. Optimized Magnet Power</strong><br>- The magnetic motor power is determined through FEA (Finite Element Analysis) software to ensure maximum magnetic efficiency.</p></li><li><p>- Additional ventilation holes improve airflow and help dissipate excess heat effectively.</p></li></ul>'),
('c48f63d0-d661-447f-9bcb-f82fd212018f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in PA-75125', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:10:44.963', '2025-10-24 08:40:23.992', '<p>-</p>', 'voice-coil-12in-pa-75125', 'c4e6b301-0921-49a6-9004-ec5178c571da', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('c51f0dac-3f0d-4785-b629-9fbbb9d05dd4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 18100 BLACK', 1, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-26 03:54:35.085', '2025-10-23 07:37:06.338', '<p><strong>1. Tahan panas</strong></p><p><em>Voice coil speaker</em> didesain menggunakan material <em>former glass fiber </em>dan kawat <em>coil </em>yang tahan panas sehingga membuat <em>speaker</em> mampu bertahan pada suhu yang tinggi.</p><p><strong>2. <em>Chassis </em>desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast </em>yang khusus dan kokoh.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>di-desain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Daya magnet yang optimal</strong></p><p>Menggunakan magnet <em>grade </em>terbaik dan di-desain menggunakan bantuan <em>software </em>simulasi terbaru, sehingga daya magnetnya optimal.</p><p><strong>5. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\'Full press\'</em> dan dilapisi dengan lapisan <em>weather resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em></p>', '18100-black', '85592c2a-7d88-47f2-b012-9974bb6e93b6', 'admin', 0, 'ACR Product - Black Series', '', 'd2fb2c11-e244-4a28-9ebd-21792eed4fc1', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant</strong><br>The speaker\'s voice coil is designed using a glass fiber former and heat-resistant coil wire, allowing the speaker to operate reliably at high temperatures.</p></li><li><p><strong>2. Special Chassis Design</strong><br>The chassis is made from specially designed, durable aluminum die-cast material.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and ensure airflow that functions as an effective cooling system.</p></li><li><p><strong>4. Optimized Magnetic Power</strong><br>Uses high-grade magnets and is designed with the aid of the latest simulation software to achieve optimal magnetic performance.</p></li><li><p><strong>5. Weather-Resistant Conepaper</strong><br>The conepaper is made from specially processed paper using the \"full press\" method and coated with a weather-resistant layer, making it suitable for both indoor and outdoor use.</p></li></ul>');
INSERT INTO `product` (`id`, `brandId`, `name`, `isFeatured`, `isArchived`, `sizeId`, `createdAt`, `updatedAt`, `description`, `slug`, `specId`, `updatedBy`, `isNewProduct`, `featuredDesc`, `series`, `thieleSmallParameter2OhmId`, `isCeiling`, `isHorn`, `ceilingSpecId`, `hornSpecId`, `haveSparepart`, `description_english`) VALUES
('c5844596-763e-4021-9977-2caa197339c2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" 858 CURVE', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-18 00:55:03.719', '2025-10-23 08:46:00.871', '<p><strong>- <em>Weatherproof conepaper</em></strong></p><p><em>Conepaper </em>dibuat dengan menggunakan material UKP 100% menghasilkan <em>conepaper </em>yang kuat dan memberikan suara yang prima. <em>Conepaper </em>juga dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor</em> maupun <em>outdoor</em></p><p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- Frekuensi kerja yang lebar <em>(Wide Bandwidth)</em></strong></p><p>Desain <em>speaker </em>khusus yang menghasilkan frekuensi kerja yang lebar dari 41 Hz - 11000 Hz</p><p><strong>- Kompresi udara yang baik</strong></p><p><em>Conepaper </em>dilengkapi ventilasi pada area<em> inner diameter cone</em> memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada saat bekerja</p>', '858-curve', '73c13f92-e2f0-4def-bd9b-6ae4bb7352cf', 'admin', 0, '', '', 'b959f0d5-dc64-4269-b198-350491e90b46', 0, 0, '', '', 0, '<ul><li><p><strong>- Weatherproof Conepaper</strong><br>Crafted from 100% UKP material, the conepaper is both strong and capable of producing excellent sound quality. It is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic force that enhances overall speaker efficiency and performance.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>Specially engineered speaker design delivers a wide working frequency range from 41 Hz to 11,000 Hz, providing flexibility and rich audio detail across lows and highs.</p></li><li><p><strong>- Improved Air Compression</strong><br>The inner diameter of the cone features dedicated ventilation, ensuring efficient airflow that reduces air compression and supports better cooling during operation.</p></li></ul>'),
('c899439b-782f-403f-8b68-8465bca9a40f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" C-1230-PA CURVE (PLS)', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-17 08:51:15.476', '2025-10-23 06:52:10.914', '<ul><li><p><strong>- Daya magnet yang optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weatherproof conepaper)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p></li><li><p><strong>- Respon <em>frequency </em>yang lebar <em>(wide bandwidth frequency response)</em></strong></p></li><li><p>Desain speaker dilengkapi dengan <em>\"whizzer cone\" </em>memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em></p></li></ul>', 'c-1230-pa-curve-pls', '3feba97e-41ce-4db4-b23a-5f763e6a1ded', 'admin', 0, '', '', 'fcd71eb6-6016-471c-b6c8-79f60da6bca7', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic power</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is equipped with a <em>whizzer cone</em>, providing a wide operating frequency range, making it highly suitable for full-range speaker applications</p></li></ul>'),
('ca2da2cb-9a7f-4a72-b011-e704e380f8f7', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '21\" AX 21800 Mk1 BLACK GRAND ACR', 0, 0, '656894ee-ab2f-45e7-ba96-51bcd09eb3b1', '2025-03-26 04:01:39.948', '2025-10-23 08:32:45.419', '<ol><li><p><strong>1. <em>New motor design</em></strong></p></li><li><p><em>Speaker </em>menggunakan <em>design </em>motor baru yang mampu mengakomodasi gerakan speaker sehingga menggurangi potensi <em>bottomming </em>dan menambah ekskursi <em>driver </em>menjadi lebih tinggi <em>(high excursion driver).</em></p></li><li><p><strong>2. Maksimum<em> power handling</em></strong></p></li><li><p><em>Voice coil</em> didesain menggunakan <em>former/bobbin till </em>yang di<em>coating</em> menggunakan <em>VC Bonder 360 </em>menghasilkan desain <em>voice coil </em>yang tahan terhadap suhu yang sangat tinggi. Sehingga <em>speaker </em>mampu bertahan pada <em>power handling</em> yang tinggi.</p></li><li><p><strong>3. <em>Good chassis design</em></strong></p></li><li><p><em>Chassis </em>didesain menggunakan material <em>diecast </em>yang kokoh dan dilengkapi ventilasi udara pada bagian bawah <em>chassis</em>, sehingga mampu memberikan sirkulasi udara yang bagus dan berfungsi sebagai transfer panas.</p></li><li><p><strong>4. <em>Good air compression</em></strong></p></li><li><p>Design <em>driver </em>mempunyai sirkulasi udara yang baik sehingga memberikan kompresi udara yang baik juga.</p></li><li><p><strong>5. <em>Weatherproof conepaper</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>khusus yang membuat <em>speaker </em>tahan terhadap cuaca tropis Indonesia.</p></li></ol>', 'ax-21800-mk1-black-grand-acr', 'cc20d876-af82-4dca-b57f-2e5cfc20f45b', 'admin', 0, '', '', '35488708-309f-4ec1-a50d-dce72e8b5cdb', 0, 0, '', '', 1, '<ul><li><p><strong>1. New Motor Design</strong><br>The speaker features a newly designed motor that supports greater cone movement, reducing the risk of bottoming out and enabling higher excursion—making it a true high-excursion driver.</p></li><li><p><strong>2. Maximum Power Handling</strong><br>The voice coil uses a Till former/bobbin coated with VC Bonder 360, resulting in a design that withstands extremely high temperatures, allowing the speaker to handle high power levels reliably.</p></li><li><p><strong>3. Robust Chassis Design</strong><br>Built from durable die-cast material, the chassis is equipped with air vents on the bottom for effective airflow and efficient heat dissipation.</p></li><li><p><strong>4. Efficient Air Compression</strong><br>The driver is engineered with optimized airflow circulation, contributing to balanced air compression and improved overall performance.</p></li><li><p><strong>5. Weatherproof Conepaper</strong><br>The conepaper is coated with a special weatherproof layer, making it highly resistant to the humid and tropical conditions typical of Indonesia.</p></li></ul>'),
('cb39af49-708e-4d69-bce4-28fa07fd6773', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" ARRAY 3060 M FAB BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 03:18:43.502', '2025-10-23 06:51:01.196', '<p>- Sistem magnet<em> ferrite high flux</em> sampai dengan 12.300 Gauss.</p><p>- <em>Voice coil </em>menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass </em>untuk meminimalkan <em>damping</em>.</p><ul><li><p>- Penambahan lapisan spesial coating pada <em>voice coil </em>sehingga lebih tahan panas.</p></li></ul><p>- Desain<em> voice coil</em> berventilasi untuk sirkulasi udara yang bagus dan mengurangi tekanan udara pada speaker.</p><p>- Lapisan anti air pada <em>conepaper</em>.</p>', 'array-3060-m-fab-by-acr', '3ea296c5-f111-42d5-a123-57e92629108f', 'admin', 0, '', '', '6b7b9dc7-4ee3-4f05-831d-71c47669705e', 0, 0, '', '', 1, '<ul><li><p>- High flux ferrite magnet system up to 12,300 Gauss.</p></li><li><p>- Voice coil uses a non-conductive fiberglass former to minimize damping.</p></li><li><p>- The addition of a special coating layer on the voice coil increases its heat resistance</p></li><li><p>- Ventilated voice coil design for good air circulation and reduced air pressure on the speaker.</p></li><li><p>- Water-resistant coating on the cone paper.</p></li></ul>'),
('cb8cea61-e00b-47e8-8c98-1e9fefe8d736', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 34 Desibel', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-17 03:46:45.718', '2025-10-23 08:57:20.317', '<ul><li><p><strong>- Sistem Motor <em>driver </em>rendah distorsi dan efisien.</strong></p></li><li><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>menghasilkan motor <em>driver </em>yang optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p></li><li><p><strong>- Sistem <em>Screw </em>on untuk aplikasi dengan <em>Horn </em>yang lebih simple.</strong></p></li><li><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p></li><li><p>Desain <em>voice coil 1.35in (34.3 mm) </em>dengan <em>exit throat 1in (25.4 mm)</em> pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></p></li></ul>', 'cd-34-desibel', '41035281-a3a7-434b-bfeb-1fc1e63f832b', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using a ferrite magnet and simulated with FEMM, resulting in an optimized motor driver that is low in distortion and more efficient at high frequencies.</p></li><li><p><strong>- Screw-On System for Simpler Horn Applications</strong><br>- <strong>Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.35-inch (34.3 mm) voice coil design with a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for Compact 2-Way Systems and Multi-Driver Line Array Systems.</p></li></ul>'),
('cce7de31-ba7b-4b12-97dc-1077762b343c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 451006 Desibel', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-17 07:21:14.129', '2025-10-23 07:40:16.021', '<p><strong>- Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>- <em>Weatherproof conepaper</em></strong></p><p>Material <em>conepaper </em>dibuat berbahan dasar UKP 100% SR 18° + KPK (Kapuk) yang diproses dengan metode <em>\'rigid non-press\' </em>dan dilapisi dengan lapisan <em>weatherproof </em>sehingga <em>conepaper </em>mampu bertahan disegala cuaca dan dapat menghasilkan suara yang lebih baik</p><p><strong>- Minim Kompresi</strong></p><p>Motor dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p><strong>- Power Handling Yang Maksimal</strong></p><p><em>Voice coil wire</em> menggunakan material <em>EISVW </em>dan gulungan voice coil dilapisi dengan spesial coating membuat<em> voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p><p><strong>- <em>Chassis </em>Menggunakan Desain Khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari material <em>diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik</p>', '451006-desibel', '687faecf-02ee-4d31-b3d2-06850dc392be', 'admin', 0, '', '', '9b781d82-91b2-481f-92be-9d662fc4462e', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The speaker’s magnetic motor delivers optimal performance thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>Made from 100% UKP SR 18° and KPK (Kapok) fibers, the conepaper is processed using a rigid non-press method and coated with a weatherproof layer, making it highly durable in all weather conditions and capable of producing better sound quality.</p></li><li><p><strong>- Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and ensure efficient airflow that acts as a cooling system.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil wire uses EISVW material, and the winding is coated with a special layer, enabling the voice coil to withstand high temperatures. This allows the speaker to maintain performance even under high power handling conditions.</p><ul><li><p><strong>- Special Chassis Design</strong><br>The chassis is made from strong, high-quality diecast material and includes a specially designed bottom section that enhances heat dissipation.</p></li></ul>'),
('d088dada-2d06-41ec-b978-1c8df4a512aa', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15in ACR-15500 -Mk1 BLACK', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-10-22 07:43:54.827', '2025-10-24 08:43:05.255', '', 'voice-coil-15in-acr-15500-mk1-black', 'a92d7cfc-61e4-4bf8-aa0f-ea4d9c0bfc15', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('d1dc7593-2bbb-46d9-bbda-980e6de706c2', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '5\" 538 CURVE', 0, 0, '65830f7d-49e4-40e7-875c-02f2a72e1383', '2025-03-18 00:23:38.238', '2025-10-23 08:34:24.113', '<ul><li><p><strong>- <em>Weatherproof conepaper</em></strong></p></li><li><p><em>Conepaper </em>dibuat dengan menggunakan material khusus menghasilkan <em>conepaper </em>yang kuat dan memberikan suara yang prima. <em>Conepaper </em>juga dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p></li><li><p><strong>- Daya magnet yang optimal</strong></p></li><li><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>- Frekuensi kerja yang lebar <em>(Wide Bandwidth)</em></strong></p></li><li><p>Desain <em>speaker </em>khusus yang menghasilkan frekuensi kerja yang lebar dari 74 Hz - 10.4 kHz</p></li><li><p><strong>- Kompresi udara yang baik</strong></p></li><li><p><em>Conepaper </em>dilengkapi ventilasi pada area<em> inner diameter cone</em> memberikan sirkulasi udara yang baik dan mengurangi kompresi udara pada saat bekerja</p></li></ul>', '538-curve', '6d4e4477-1e29-4407-bf7d-f1c1da029ea8', 'admin', 0, '', '', '13e69b59-70e1-43b5-9b4f-31b91c5e909b', 0, 0, '', '', 0, '<ul><li><p><strong>- Weatherproof Conepaper</strong><br>Constructed using specially selected materials, the conepaper is both strong and capable of producing high-quality sound. It is also coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using Finite Element Analysis (FEA), resulting in an optimized magnetic force for better performance.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is specially designed to produce a wide working frequency range from 74 Hz to 10.4 kHz, making it suitable for various audio applications.</p></li><li><p><strong>- Effective Air Compression Management</strong><br>The conepaper includes ventilation at the inner diameter area, providing good airflow and reducing air compression during operation.</p></li></ul>'),
('d413e56d-b0e6-4093-8ce5-531f791e2ee8', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA-100122 W FAB ACR SERIES', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-18 04:00:14.402', '2025-10-23 07:02:22.154', '<p><strong>1. Daya <em>magnet </em>optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya <em>magnet </em>yang optimal.</p><p><strong>2. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Material conepaper </em>dibuat berbahan dasar <em>paper </em>khusus yang diproses dengan metode <em>\"rigid nonpress\" </em>dan dilapisi dengan lapisan <em>weather resistance </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em>.</p><p><strong>3. Minim Kompresi</strong></p><p><em>Motor </em>dan <em>chassis </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Power handling yang maksimal</strong></p><p>Penambahan alat pendingin <em>(cooling device) </em>pada<em> t-yoke</em> untuk menjaga suhu speaker tetap terjaga sehingga performa speaker lebih stabil. Gulungan<em> voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling </em>tinggi.</p><p><strong>5. <em>Chassis </em>Menggunakan Desain Khusus</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari <em>material diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang baik.</p>', 'pa-100122-w-fab-acr-series', '15fddbc3-4871-4ded-9a25-fa042edb5e67', 'admin', 0, '', '', '292dfd47-e74c-4df8-8c52-8d05a017e0b0', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>2. Weather-Resistant Conepaper</strong><br>The conepaper is made from special paper material processed using a “rigid non-press” method and coated with a weather-resistant layer, making the speaker suitable for both indoor and outdoor use.</p></li><li><p><strong>3. Low Compression</strong><br>The motor and chassis are designed with special ventilation to eliminate air compression and ensure airflow for effective cooling.</p></li><li><p><strong>4. Maximum Power Handling</strong></p></li></ul><p>A cooling device is added to the T-yoke to help maintain optimal speaker temperature, ensuring more stable performance. The voice coil winding is also coated with a special layer, allowing it to withstand high temperatures—enabling the speaker to perform reliably under high power handling conditions.</p><ul><li><p><strong>5. Special Chassis Design</strong><br>The highly durable chassis is made from quality die-cast material and features a specially designed bottom section for efficient heat dissipation.</p></li></ul>'),
('d419a8c3-d996-4ef2-ad42-acf17d0d72a1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 340T1B-08F Mk1 BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 00:34:58.133', '2025-10-23 09:01:18.526', '<p><strong>- Sistem motor <em>driver </em>rendah distorsi dan efisien.</strong></p><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>untuk menghasilkan <em>Compression Driver </em>yang rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>- <em>Range </em>frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi tinggi.</strong></p><p>Desain khusus <em>dome </em>berbahan <em>Titanium </em>dan desain khusus <em>Horn Point </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi</p><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p><p>Desain <em>Voice Coil 1.34in (34.4 mm) </em>menggunakan <em>rectangular wire </em>dengan <em>exit throat 1in (25.4 mm)</em> pada <em>Compression Driver </em>sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-340t1b-08f-mk1-by-acr', '2e01be36-7ca7-4d81-81b0-f902b4ab82c0', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Low Distortion and Efficient Driver Motor System</strong><br>The driver motor structure is designed using a ferrite magnet and simulated with FEMM to produce a compression driver with low distortion and higher efficiency at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response Range at High Frequencies</strong><br>A specially designed titanium dome and custom Horn Point, simulated through FEA, produce a wider frequency response range (1000 Hz – 20000 Hz) that remains flat at high frequencies.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.34-inch (34.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver makes it highly suitable and ideal for Compact 2-Way Systems and Multi-Driver Line Array Systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('d929fa7e-31d6-41c9-8874-aafa69711e3c', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 440PK1-04N FABULOUS', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-18 06:47:53.129', '2025-10-23 09:05:08.422', '<ul><li><p><strong>- Sistem Motor <em>Driver </em>Optimal &amp; Rendah Distorsi</strong></p></li><li><p>Desain Struktur <em>Driver </em>Motor menggunakan Magnet <em>Neodymium </em>menghasilkan Medan Magnet yg lebih kuat untuk membuat Motor <em>Driver </em>Optimal, rendah Distorsi dan lebih efisien pada Frekuensi tinggi.</p></li><li><p><strong>- Frekuensi Respon Lebih Lebar dan <em>Flat </em>pada Frekuensi Tinggi</strong></p></li><li><p>Desain khusus <em>Dome </em>berbahan <em>PEEK (Polyether ether ketone)</em> dan Desain Khusus <em>Horn Point </em>Melalui Simulasi <em>FEA </em>menghasilkan <em>Range </em>Frekuensi Respon lebih lebar (1000 Hz - 20000 Hz) dan <em>Flat </em>pada Frekuensi Tinggi.</p></li><li><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em></strong></p></li><li><p>Desain <em>Voice Coil 1.75in (44.4 mm) </em>menggunakan <em>Rectangular Wire</em> dengan <em>Exit Throat 1in (25.4 mm)</em> pada<em> Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p></li></ul>', 'cd-440pk1-04n-fabulous', '23b843b8-68b8-4580-af1e-50c89841e370', 'admin', 0, '', '', '', 0, 0, '', '', 1, '<ul><li><p><strong>- Optimal &amp; Low-Distortion Driver Motor System</strong><br>The motor driver structure design using a Neodymium magnet produces a stronger magnetic field, resulting in an optimized driver motor with low distortion and greater efficiency at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response at High Frequencies</strong><br>A specially designed dome made of PEEK (Polyether ether ketone) and a custom Horn Point—developed through FEA simulation—provide a wider frequency response range (1000 Hz – 20000 Hz) that is also flat at high frequencies.</p></li><li><p><strong>- Ideal for Compact 2-Way Systems &amp; Multi-Driver Line Array Systems</strong><br>The 1.75-inch (44.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the Compression Driver is highly suitable and ideal for compact 2-way systems and multi-driver line array systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('d945317d-9acb-43c0-a46e-c00d4919c87f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" 18710 DLX', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-25 07:57:22.645', '2025-10-23 07:38:17.390', '<p><strong>1. Tahan panas</strong></p><p><em>Voice coil speaker</em> didesain menggunakan material<em> former glass fiber</em> dan kawat <em>coil </em>yang tahan panas sehingga membuat <em>speaker </em>mampu bertahan pada suhu yang tinggi.</p><p><strong>2. <em>Chassis </em>desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast </em>yang khusus dan kokoh.</p><p><strong>3. Minimum kompresi</strong></p><p>Motor yang didesain secara presisi dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Daya magnet yang optimal</strong></p><p>Menggunakan magnet <em>grade </em>terbaik dan di-desain menggunakan bantuan <em>software </em>simulasi terbaru, sehingga daya magnetnya optimal.</p>', '18710-dlx', '0c31495d-b5ad-47ca-8cb5-611413f63b5c', 'admin', 0, '', '', 'e0c5704c-0acf-4f6e-adff-6ba9039f97f5', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant</strong><br>The speaker\'s voice coil is designed using a glass fiber former and heat-resistant coil wire, allowing it to operate reliably at high temperatures.</p></li><li><p><strong>2. Special Chassis Design</strong><br>The chassis is made from specially engineered, durable aluminum die-cast material.</p></li><li><p><strong>3. Low Compression</strong><br>The motor is precisely designed with added ventilation to eliminate air compression and provide airflow that functions as an effective cooling system.</p></li><li><p><strong>4. Optimized Magnetic Power</strong><br>Utilizes high-grade magnets and is designed with the help of the latest simulation software to achieve optimal magnetic performance.</p></li></ul>'),
('da392349-7ff3-4725-9c9d-c4add61ec058', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-113186', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:26:13.487', '2025-10-24 08:37:23.529', '<p>-</p>', 'voice-coil-18inpa-113186', '4ec841ef-30d2-4d82-a793-2cb34545b19c', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('dccefeec-f582-4133-af89-f272c55236e4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 38H156SCF CURVE', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-17 08:57:29.814', '2025-10-23 07:20:19.799', '<p><strong>Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran<em> FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Desain speaker <em>fullrange </em>yang handal</strong></p><p><em>Dustcap </em>yang berbahan <em>cloth </em>memberikan kualitas suara <em>fullrange </em>yang prima di frekuensi rendah maupun di frekuensi tinggi</p>', '38h156scf-curve', '9913794d-a007-4e01-8af2-ed912bda5e94', 'admin', 0, '', '', '9c76abe8-259f-49d3-8823-d42257c9fff4', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Reliable Full-Range Speaker Design</strong><br>The cloth dustcap enhances full-range sound quality, delivering excellent performance at both low and high frequencies.</p></li></ul>'),
('dcdd0972-c19a-421b-8511-26ca113f082f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15inPA-100152 Mk2 Sw Fab', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:17:56.464', '2025-10-24 08:38:56.971', '<p>-</p>', 'voice-coil-15inpa-100152-mk2-sw-fab', 'fdc69c30-dc30-47fe-9ade-9aa1c23840c4', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('dd0299e3-bf7b-44ff-b2ea-a2d934367343', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 38H156SCF-MK CURVE', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-17 09:03:51.518', '2025-10-23 07:20:53.648', '<p><strong>- Daya magnet yang optimal</strong></p><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p><p><strong>- <em>Conepaper </em>tahan terhadap cuaca<em> (Weatherproof conepaper)</em></strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Respon frequency yang lebar <em>(wide bandwidth frequency response)</em></strong></p><p>Desain <em>speaker </em>dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk speaker <em>fullrange</em></p><p><strong>- Minimum kompresi <em>(Low Compression)</em></strong></p><p><em>Motor </em>didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p>', '38h156scf-mk-curve', 'fb4362fc-30b0-4fd5-8d26-8f8b03aca6e5', 'admin', 0, '', '', 'd53fba40-ca38-4fba-a101-075b39cee296', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimal magnetic performance.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor use.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker is equipped with a <em>whizzer cone</em>, providing a wide frequency range and making it ideal for full-range speaker applications.</p></li><li><p><strong>- Low Compression</strong><br>The motor is designed with special ventilation to eliminate air compression and ensure airflow that functions as an effective cooling system.</p></li></ul>'),
('dda5df63-bebf-4046-a550-75495ec1bfdb', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in PA-12880 -Mk3 EXCEL ACR SERIES', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:05:47.419', '2025-10-24 08:40:36.042', '<p>-</p>', 'voice-coil-12in-pa-12880-mk3-excel-acr-series', 'eb208ad4-a89e-42c8-b7f5-0d49c0934750', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('df23f3a4-fbc4-433a-9a20-6dd1ba5dddc1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" PA 75127 W-N FAB BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:35:35.882', '2025-10-23 06:57:42.213', '<p><strong>1. Daya magnet yang optimal dan tahan panas.</strong></p><p>Pemilihan material <em>magnet neodymium</em> yang ringan dan tahan panas sampai suhu yang sangat tinggi dan pemilihan design yang optimal melalui hasil pengukuran <em>FEA</em>.</p><p><strong>2. Minimum kompresi.</strong></p><p><em>Voice coil/spool</em> dan <em>motor part </em>didisain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>3. Distorsi yang rendah.</strong></p><p>Penambahan <em>cooper cap </em>pada kepala <em>T-yoke</em> memberikan hasil distorsi yang sangat rendah.</p><p><strong>4. Maksimum <em>power handling</em></strong></p><p>Kawat <em>Voice coil</em> menggunakan material unggulan <em>(APISVCAW) </em>memberikan hasil<em> power handling</em> yang sangat tinggi dan massa yang ringan untuk efisiensi yang lebih bagus.</p><p><strong>5. Material <em>Conepaper </em>khusus.</strong></p><p><em>Conepaper </em>dibuat tahan terhadap cuaca dengan metode <em>rigid non press </em>serta menggunakan material khusus yang dikombinasikan dengan karbon menghasilkan <em>conepaper </em>yang sangat kuat, kokoh, dan ringan memberikan kualitas suara yang prima.</p><p><strong>6. <em>ISV : Interleaved Sandwich Voice coil</em></strong></p><p>Teknologi <em>ISV </em>memberikan transfer panas yang sangat baik dan menurunkan temperatur kerja voice coil. Keunggulan lain dari teknologi <em>ISV </em>adalah menambah daya tahan terhadap panas dan menjadikan speaker mampu bertahan pada <em>level power </em>yang sangat tinggi.</p><p><strong>7. <em>Chassis </em>menggunakan desain khusus.</strong></p><p><em>Chassis </em>yang sangat kokoh terbuat dari <em>material diecast </em>yang bagus dan dilengkapi dengan desain khusus pada bagian bawah <em>chassis </em>menghasilkan transfer panas yang sangat baik</p>', 'pa-75127-w-n-fab-by-acr', '72de201c-a467-4818-ba5a-114ffdfb0103', 'admin', 0, '', '', '4546157e-5804-45aa-be70-932bba49f1fd', 0, 0, '', '', 0, '<ul><li><p><strong>1. Optimal Magnetic Power and Heat Resistance</strong><br>Lightweight neodymium magnet material is selected for its ability to withstand extremely high temperatures, with the design optimized through FEA (Finite Element Analysis) for maximum magnetic performance.</p></li><li><p><strong>2. Low Compression</strong><br>The voice coil/spool and motor parts are designed with special ventilation to eliminate air compression and ensure airflow for effective cooling.</p></li><li><p><strong>3. Low Distortion</strong><br>A copper cap added to the T-yoke head significantly reduces distortion.</p></li><li><p><strong>4. Maximum Power Handling</strong><br>The voice coil wire uses premium material (APISVCAW), delivering very high power handling while maintaining a lightweight mass for improved efficiency.</p></li><li><p><strong>5. Special Conepaper Material</strong><br>The conepaper is made weather-resistant using a rigid non-press method and special materials combined with carbon, resulting in a cone that is extremely strong, rigid, and lightweight—providing excellent sound quality.</p></li><li><p><strong>6. ISV: Interleaved Sandwich Voice Coil</strong><br>ISV technology offers excellent heat transfer and reduces the working temperature of the voice coil. Its added benefit is enhanced heat resistance, enabling the speaker to perform reliably under very high power levels.</p></li><li><p><strong>7. Special Chassis Design</strong><br>The robust chassis is made from high-quality die-cast material and features a specially designed lower section for superior heat dissipation.</p></li></ul>'),
('e43edd46-67a9-4899-933a-2fb004f47563', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" ACR 15400 PRO NEW', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-28 06:48:06.616', '2025-10-23 07:22:03.278', '', 'acr-15400-pro-new', '57cb6982-9af2-43ec-98ac-b1f1cdc12956', 'admin', 0, '', '', '6c501d41-5958-4b46-a4bb-bce629f0e280', 0, 0, '', '', 0, ''),
('e592accd-0772-4fca-9122-87d1deb3c43d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '10\" 25601 Desibel', 0, 0, '7f514f65-c75e-482d-bf43-66c4f8c08edc', '2025-03-17 06:32:02.431', '2025-10-23 06:15:24.243', '<p><strong>- Daya magnet optimal</strong></p><p>Daya motor magnet yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p><p><strong>- Weatherproof conepaper</strong></p><p><em>Conepaper</em> dilapisi dengan lapisan <em>weatherproof </em>sehingga cocok diaplikasikan untuk <em>indoor </em>maupun <em>outdoor</em></p><p><strong>- Minim Kompresi</strong></p><p><em>Voice coil/spool</em> didesain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin</p><p><strong>- Power Handling Yang Maksimal</strong></p><p>Gulungan<em> voice coil </em>dilapisi dengan spesial coating membuat <em>voice coil </em>dapat bertahan di suhu yang tinggi sehingga speaker mampu bertahan pada <em>power handling</em> tinggi.</p>', '25601-desibel', '151068ee-ecab-4770-8dd4-918cf263b6ca', 'admin', 0, '', '', 'aec4d56f-d8d9-4211-8be2-6529889b30d3', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimal Magnetic Power</strong><br>The magnetic motor power is optimized through a design that utilizes FEA (Finite Element Analysis) technology.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making it suitable for both indoor and outdoor applications.</p></li><li><p><strong>- Minimal Compression</strong><br>The voice coil/spool is designed with special ventilation to eliminate air compression and provide airflow for cooling.</p></li><li><p><strong>- Maximum Power Handling</strong></p></li></ul><p>The voice coil winding is coated with a special layer, allowing it to withstand high temperatures—enabling the speaker to maintain reliable performance even under high power handling conditions.</p>'),
('ea7efffa-c376-41c2-90c2-692309b30a6a', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" 127150 DELUXE BY ACR', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-25 08:47:16.353', '2025-10-23 06:46:09.830', '<p><strong>1. Tahan panas dan minimum kompresi</strong></p><p>Motor dan <em>chassis </em>didesain dengan ventilasi sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang baik serta berfungsi sebagai pendingin</p><p><strong>2. <em>Weatherproof</em></strong></p><p><em>Conepaper </em>yang kokoh dilapisi dengan <em>black coating </em>menjadikan tahan terhadap segala cuaca</p><p><strong>3. Kokoh</strong></p><p><em>Chassis </em>memiliki konstruksi yang kuat dan terbuat dari <em>aluminium diecast</em></p><p><strong>4. Daya Magnet Optimal</strong></p><p>Daya motor magnet speaker yang optimal karena didesain dengan menggunakan teknologi <em>FEA (Finite Element Analysis)</em></p>', '127150-deluxe-by-acr', '6d03f3c5-1388-42a7-8a43-d692eb77073f', 'admin', 0, '', '', '416f2cea-8b9f-450c-8eec-9ec87d760862', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant and Low Compression</strong><br>The motor and chassis are designed with ventilation to eliminate air compression and provide good airflow, functioning as an effective cooling system.</p></li><li><p><strong>2. Weatherproof</strong><br>The durable conepaper is coated with a black layer, making it resistant to all weather conditions.</p></li><li><p><strong>3. Sturdy Construction</strong><br>The chassis is strongly built and made from aluminum die-cast.</p></li><li><p><strong>4. Optimal Magnetic Power</strong><br>The speaker\'s magnetic motor delivers optimal power, thanks to a design developed using FEA (Finite Element Analysis) technology.</p></li></ul>'),
