('ed76e45d-2448-4720-a7d0-721d8a3d0e3f', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" ACR 15200 NEW', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-27 09:08:13.017', '2025-10-23 07:21:24.476', '', 'acr-15200-new', '0df9a13d-b7ae-41c2-99e7-faa9f66deada', 'admin', 0, '', '', '8fa7f7ae-59a7-420a-8c1c-9e60a80e55f6', 0, 0, '', '', 1, ''),
('efa08ab2-b9f3-49a5-a46c-f74b29b1cdae', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '12\" C-1230-PA Mk2 SPECIAL NEW', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-03-28 06:39:12.045', '2025-10-23 06:52:41.257', '', 'c-1230-pa-mk2-special-new', '1d43cee5-0504-421d-a4ce-308b8efb6be2', 'admin', 0, '', '', 'ea3a55e2-a5de-4c6e-9c06-e40f48c60d01', 0, 0, '', '', 0, ''),
('f02ec939-1815-44e5-8081-b069e6dd51e4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT 12in PA-75124', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-10-22 06:49:19.664', '2025-10-24 08:45:28.244', '', 'recone-kit-12in-pa-75124', 'cd4b798c-ee41-4c17-afb0-4b8cd572c722', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f08aa073-1e6f-44a8-b5c8-42f3a7d2f9a1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '21\" PA 127212 SW FAB BY ACR', 0, 0, '656894ee-ab2f-45e7-ba96-51bcd09eb3b1', '2025-03-18 02:16:54.697', '2025-10-23 08:33:54.826', '<ol><li><p><strong>1. Tahan Panas</strong></p></li><li><p>- Penambahan alat pendingin pada <em>t-yoke </em>untuk menjaga suhu <em>speaker </em>tetap terjaga sehingga performa <em>speaker </em>lebih stabil.</p></li><li><p>- Menggunakan <em>former </em>berbahan dasar <em>non-conductive fiberglass</em> dan pelapisan kawat <em>coil </em>dengan menggunakan teknologi terbaru membuat <em>voice coil / Spool</em> mampu bekerja bahkan pada suhu diatas 280°C.</p></li><li><p><strong>2. Distorsi Rendah</strong></p></li><li><p>Penambahan<em> ring aluminium </em>pada<em> t-yoke </em>yang berfungsi untuk meredam distorsi.</p></li><li><p><strong>3. Kokoh dan Minimum Kompresi</strong></p></li><li><p><em>Chassis </em>berbahan <em>aluminium diecast </em>di-<em>design </em>secara cermat sehingga mempunyai kekuatan maksimum dan rendah kompresinya.</p></li><li><p><strong>4. Stabil dan lintasan geraknya tinggi</strong></p></li><li><p><em>Double damper &amp; Triple round surround </em>menjadikan <em>speaker </em>lebih stabil dan memiliki lintasan gerak yang lebih tinggi.</p></li><li><p><strong>5. Daya magnet lebih optimal</strong></p></li><li><p>Penentuan daya motor magnet <em>speaker </em>yang optimal karena di-design menggunakan teknologi dari <em>software FEA</em></p></li></ol>', 'pa-127212-sw-fab-by-acr', '60366e3e-c948-490a-8c46-e1337eef9c5c', 'admin', 0, '', '', '37c3a13f-e79f-430a-8b61-37ab4506740b', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant</strong><br>- An added cooling device on the T-yoke helps maintain speaker temperature, ensuring stable performance.</p></li><li><p>- The voice coil uses a former made of non-conductive fiberglass and wire coated with advanced technology, allowing it to operate even at temperatures above 280°C.</p></li><li><p><strong>2. Low Distortion</strong><br>An aluminum ring is added to the T-yoke to effectively suppress distortion, resulting in cleaner sound output.</p></li><li><p><strong>3. Durable and Low Compression</strong><br>The chassis is precisely engineered from aluminum die-cast material, providing maximum strength and reduced air compression for better airflow.</p></li><li><p><strong>4. Stable with High Excursion</strong><br>A double damper and triple round surround design make the speaker more stable and allow greater cone excursion for better sound dynamics.</p></li><li><p><strong>5. Optimized Magnet Power</strong><br>The motor\'s magnetic force is optimized using advanced FEA (Finite Element Analysis) simulation technology, ensuring efficient magnetic performance.</p></li></ul>'),
('f10adbcf-5136-46ce-82c0-6d24f84c0b58', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" PA 75155 W-Mk1 FAB BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-18 04:14:35.840', '2025-10-23 07:36:02.278', '<ul><li><p><strong>- Desain <em>Chassis </em>yang Istimewa</strong></p></li><li><p><em>Chassis </em>terbuat dari <em>material diecast </em>yang baik dan dilengkapi dengan desain khusus pada bagian bawah sebagai pemindah panas yang sangat baik.</p></li><li><p><strong>- Sistem motor rendah distorsi dan lebih tahan panas</strong></p></li><li><p>Spesial coating pada<em> voice coil </em>menambah ketahanan terhadap suhu tinggi dan desain motor khusus membuat distorsi speaker yang sangat rendah.</p></li><li><p><strong>- <em>Output </em>suara yang istimewa</strong></p></li><li><p>Penambahan <em>coating inpact </em>dan<em> CLB </em>pada <em>conepaper </em>mampu memproduksi kualitas suara yang lebih baik.</p></li></ul>', 'pa-75155-w-mk1-fab-by-acr', '622d9716-2890-4b61-866d-d3dcc7b6dc14', 'admin', 0, '', '', 'cbb0c26b-01bc-4a3a-97c4-d2e816941006', 0, 0, '', '', 1, '<ul><li><p><strong>- Exceptional Chassis Design</strong><br>The chassis is made from high-quality die-cast material and features a specially designed bottom section that serves as an excellent heat sink.</p></li><li><p><strong>- Low-Distortion, Heat-Resistant Motor System</strong></p></li></ul><p>The special coating on the voice coil enhances its resistance to high temperatures, while the specially designed motor ensures extremely low speaker distortion.</p><ul><li><p><strong>- Outstanding Sound Output</strong><br>The addition of Inpact and CLB coatings on the conepaper helps deliver superior sound quality.</p></li></ul>'),
('f12e285a-45ec-4cc8-954e-1886597b1446', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 15inACR-15200', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-06-20 03:11:28.364', '2025-10-24 08:39:15.142', '<p>-</p>', 'voice-coil-15inacr-15200', 'daa8f689-1639-4907-b07c-0e19ac6bf864', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f13940fd-b053-4c64-84e0-ccc3416736b1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15710 DLX', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 07:44:11.428', '2025-10-23 07:11:41.615', '<p><strong>1. Tahan panas</strong></p><p><em>Voice coil speaker</em> didesain menggunakan <em>material former glass</em> <em>fiber </em>dan kawat <em>coil </em>yang tahan panas sehingga membuat speaker mampu bertahan pada suhu yang tinggi.</p><p><strong><em>2. Chassis desain khusus</em></strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast </em>yang khusus dan kokoh.</p><p><strong>3. Minimum kompresi</strong></p><p><em>Motor </em>yang didesain secara presisi dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p><p><strong>4. Daya magnet yang optimal</strong></p><p>Menggunakan magnet grade terbaik dan di-desain menggunakan bantuan <em>software </em>simulasi terbaru, sehingga daya magnetnya optimal.</p>', '15710-dlx', 'cf051bce-7428-4734-9f03-3329d7624bef', 'admin', 0, '', '', '344419f2-cc65-450c-a7b4-f368b6285f97', 0, 0, '', '', 0, '<ul><li><p><strong>1. Heat Resistant</strong><br>The speaker’s voice coil is designed using a glass fiber former and heat-resistant coil wire, allowing it to withstand high temperatures.</p></li><li><p><strong>2. Special Chassis Design</strong><br>The chassis is made from specially engineered, durable aluminum die-cast material.</p></li><li><p><strong>3. Low Compression</strong><br>The motor is precisely designed with added ventilation to eliminate air compression and ensure proper airflow for cooling.</p></li><li><p><strong>4. Optimal Magnetic Power</strong><br>Uses high-grade magnets and is designed with the help of the latest simulation software to achieve optimal magnetic performance.</p></li></ul>'),
('f1699fb5-fc27-47f8-8493-2051c3dfbed7', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 8in ARRAY 2050', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-10-22 07:27:46.834', '2025-10-24 08:43:42.489', '', 'voice-coil-8in-array-2050', '465add9d-f459-41d2-b05d-2bfe28d15479', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f297e3e7-dca1-49f9-8888-38bef9328a74', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 18inPA-127187 /21in PA-127212 SW FAB', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-06-20 03:28:46.423', '2025-10-24 08:37:06.464', '<p>-</p>', 'voice-coil-18inpa-127187', '486edb01-b9d0-4461-a850-4a2f60e2f7ec', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f4c9627d-415b-43c5-b63c-e9ea6ff3fbe5', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'VOICE COIL 12in 1240-PA', 0, 0, 'afce813f-8a7d-424c-a086-9031ed369f64', '2025-06-20 03:08:31.308', '2025-10-24 08:41:10.617', '<p>-</p>', 'voice-coil-12in-1240-pa', 'caafa59b-9e0a-4545-b379-8b8453bb1da5', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f6a583f3-0baa-4883-b7c6-9a3da1740036', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" FAR 1580 PA ACR CLASSIC', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-28 06:52:19.984', '2025-10-23 07:25:56.437', '', 'far-1580-pa-acr-classic', '159feb14-f750-4af6-9655-e69a8bc9d013', 'admin', 0, '', '', 'a3e41662-2355-44e4-a4a2-42a671a86941', 0, 0, '', '', 0, ''),
('f76d8dc4-67e2-4d27-8f91-ce61142dab47', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 38H156SCF ACR SPECIAL NEW', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-28 06:44:34.063', '2025-10-23 07:19:51.426', '', '38h156scf-acr-special-new', 'c64459af-b8ca-4a7c-88fc-fe12bae5b686', 'admin', 0, '', '', 'cf1dc191-6543-4ae4-8770-a7d5056fd838', 0, 0, '', '', 0, '');
INSERT INTO `product` (`id`, `brandId`, `name`, `isFeatured`, `isArchived`, `sizeId`, `createdAt`, `updatedAt`, `description`, `slug`, `specId`, `updatedBy`, `isNewProduct`, `featuredDesc`, `series`, `thieleSmallParameter2OhmId`, `isCeiling`, `isHorn`, `ceilingSpecId`, `hornSpecId`, `haveSparepart`, `description_english`) VALUES
('f7ed0529-fbc0-49dd-b85f-0b7df5f378ae', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '8\" C-810 DFH ACR', 0, 0, '3ceafaeb-f3e4-4034-b46a-44948d3c2062', '2025-03-27 09:22:53.594', '2025-10-23 08:50:29.179', '<ul><li><p><strong>- Daya magnet yang optimal<em> (optimized magnet power)</em></strong></p></li><li><p>Desain motor yang melalui hasil pengukuran <em>FEA (Finite Element Analysis) </em>memberikan daya magnet yang optimal</p></li><li><p><strong>- Minimum kompresi<em> (Low Compression)</em></strong></p></li><li><p><em>Voice coil/spool </em>dan <em>motor part </em>didisain dengan penambahan ventilasi khusus sehingga tidak ada kompresi udara dan memberikan sirkulasi udara yang berfungsi sebagai pendingin.</p></li><li><p><strong>- Respon <em>frequency </em>yang lebar <em>(wide bandwidth frequency response)</em></strong></p></li><li><p>Desain <em>speaker </em>dilengkapi dengan <em>\"whizzer cone\"</em> memberikan jangkauan frekuensi kerja yang lebar dan sangat cocok digunakan untuk <em>speaker fullrange</em>.</p></li><li><p><strong>- <em>Conepaper </em>tahan terhadap cuaca <em>(Weather proof)</em></strong></p></li><li><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather proof </em>sehingga <em>speaker </em>cocok diaplikasikan untuk <em>indoor </em>ataupun <em>outdoor</em></p></li></ul>', 'c-810-dfh-acr', 'ffae1c77-947a-49a5-bb04-f1145c006cb9', 'admin', 0, '', '', 'f90e0998-60d3-4ed7-b6da-8ef8e7e66692', 0, 0, '', '', 0, '<ul><li><p><strong>- Optimized Magnet Power</strong><br>The motor is designed using FEA (Finite Element Analysis), resulting in optimized magnetic strength.</p></li><li><p><strong>- Low Compression</strong><br>The voice coil/spool and motor parts are designed with special ventilation to eliminate air compression and provide airflow that functions as a cooling system.</p></li><li><p><strong>- Wide Bandwidth Frequency Response</strong><br>The speaker design includes a <em>whizzer cone</em>, which provides a wide operating frequency range, making it highly suitable for full-range speakers.</p></li><li><p><strong>- Weatherproof Conepaper</strong><br>The conepaper is coated with a weatherproof layer, making the speaker suitable for both indoor and outdoor use.</p></li></ul>'),
('f8c453a4-bf9c-4de2-8e09-a7d6d2639847', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 250T1-08F (CD 2-Mk1) ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:32:04.988', '2025-10-23 09:15:22.089', '<p>-</p>', 'recone-kit-cd-250t1-08f-cd-2-mk1-acr', '5f497769-1cef-4035-9368-f271a1d5929c', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('f95e48ac-84a5-4a40-9e4a-b40544c54c45', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA-113188 SW FAB BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-18 01:27:08.998', '2025-10-23 08:31:28.285', '<p><strong>1. Tahan panas dan minimum kompresi</strong></p><p>Penggunaan material dan teknologi <em>ISV (Interleaved Sandwich Voice Coil) </em>pada <em>voice coil </em>mampu menambah ketahanan <em>speaker </em>terhadap suhu tinggi, ditambah ventilasi pada motor dan <em>chasis </em>untuk sirkulasi udara yang lebih baik.</p><p><strong>2. Distorsi yang rendah</strong></p><p>Penambahan <em>aluminium ring </em>pada<em> head yoke </em>yang berfungsi mengurangi distorsi pada <em>speaker</em>, sehingga suara terdengar lebih bersih.</p><p><strong>3. <em>Conepaper </em>tahan terhadap cuaca</strong></p><p><em>Conepaper </em>dilapisi dengan lapisan <em>weather resistance </em>sehingga mampu bertahan di segala cuaca.</p><p><strong>4. <em>Chassis </em>menggunakan desain khusus</strong></p><p><em>Chassis </em>terbuat dari <em>aluminium die cast</em> yang kokoh, dan dilengkapi <em>heat sink </em>dan ventilasi udara untuk membuang udara panas.</p><p><strong>5. Respon frekuensi rendah</strong></p><p>Desain <em>double spider</em> serta jangkauan gerak yang lebih dalam mampu menghasilkan respon frekuensi yang lebih rendah.</p>', 'pa-113188-sw-fab-by-acr', 'f7cd0905-bc57-4e6b-aacd-6eb6592939f2', 'admin', 0, '', '', 'c86264f2-99e5-4c2b-b98e-0449398e32d6', 0, 0, '', '', 1, '<ul><li><p><strong>1. Heat Resistant and Low Compression</strong><br>The use of ISV (Interleaved Sandwich Voice Coil) technology enhances the voice coil’s durability under high temperatures. Added ventilation in the motor and chassis improves airflow, reducing heat and preventing air compression.</p></li><li><p><strong>2. Low Distortion</strong><br>An aluminum ring on the head yoke helps minimize distortion, resulting in cleaner and more accurate sound reproduction.</p></li><li><p><strong>3. Weather-Resistant Conepaper</strong><br>The conepaper is coated with a weather-resistant layer, making it durable in all weather conditions.</p></li><li><p><strong>4. Specially Designed Chassis</strong><br>Made from sturdy aluminum die-cast, the chassis features an integrated heat sink and ventilation system to dissipate heat efficiently.</p></li><li><p><strong>5. Deep Low-Frequency Response</strong><br>The double spider design and extended cone excursion allow the speaker to produce lower frequencies more effectively.</p></li></ul>'),
('f9e22236-4739-46db-85ef-a7382fe549d4', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'RECONE KIT CD 650TR15B-08F FAB ACR SERIES', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-06-20 03:38:08.491', '2025-10-23 09:16:50.106', '<p>-</p>', 'recone-kit-cd-650tr15b-08f-fab-acr-series', 'ab653974-7fb4-43d3-9652-6f574c114c25', 'admin', 0, '', '', '', 0, 0, '', '', 0, ''),
('fab888f8-9f0a-425a-b221-50d71033143d', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'HORN 2525 ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-28 07:17:11.799', '2025-10-23 09:11:06.561', '', 'horn-2525-acr', '1e0f2418-ead5-4744-b280-fddfb0ae55ac', 'admin', 0, '', '', '', 0, 0, '', '17de787b-3fb0-42ae-85e0-2f1ccfc8e72d', 0, ''),
('fc74332e-cfa3-419d-9cb4-f86a3feef3c1', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', 'CD 440T1B-08 (CD 4B) EXCELLENT BY ACR', 0, 0, '28c45742-6d1f-44bd-915b-f940e30caf92', '2025-03-25 07:10:52.292', '2025-10-23 09:06:51.356', '<p><strong>- Sistem Motor <em>driver </em>rendah distorsi dan efisien.</strong></p><p>Desain struktur <em>driver </em>motor menggunakan magnet <em>ferrite </em>yang disimulasikan dengan <em>FEMM </em>menghasilkan motor <em>driver </em>yang optimal, rendah distorsi dan lebih efisien pada frekuensi tinggi.</p><p><strong>- Frekuensi respon lebih lebar dan <em>flat </em>pada frekuensi tinggi.</strong></p><p>Desain khusus <em>dome </em>berbahan <em>Titanium </em>dan desain khusus <em>horn point </em>melalui simulasi <em>FEA </em>menghasilkan <em>range </em>frekuensi respon lebih lebar (1000 Hz - 20000 Hz) dan <em>flat </em>pada frekuensi tinggi.</p><p><strong>- Ideal untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System.</em></strong></p><p>Desain <em>voice coil 1.75in (44.4 mm) </em>menggunakan<em> rectangular wire</em> dengan <em>exit throat 1in (25.4 mm)</em> pada<em> Compression Driver</em> sangat cocok dan ideal dipakai untuk <em>Compact 2-Way System &amp; Multi Driver Line Array System</em> yang menghasilkan kualitas suara lebih bagus dan bersih.</p>', 'cd-440t1b-08-cd-4b-excellent-by-acr', 'bf74a717-be4b-4b7f-89e2-e94756eafb81', 'admin', 0, '', '', '', 0, 0, '', '', 0, '<ul><li><p><strong>- Low-Distortion and Efficient Motor Driver System</strong><br>The motor driver structure design uses a ferrite magnet and is simulated with FEMM, resulting in an optimized motor driver with low distortion and higher efficiency at high frequencies.</p></li><li><p><strong>- Wider and Flatter Frequency Response at High Frequencies</strong><br>A specially designed titanium dome and custom horn point, developed through FEA simulation, produce a wider frequency response range (1000 Hz – 20000 Hz) and a flat response at high frequencies.</p></li><li><p><strong>- Ideal for Compact 2-Way System &amp; Multi-Driver Line Array System</strong><br>The 1.75-inch (44.4 mm) voice coil design using rectangular wire with a 1-inch (25.4 mm) exit throat on the compression driver is highly suitable and ideal for Compact 2-Way Systems and Multi-Driver Line Array Systems, delivering cleaner and higher-quality sound.</p></li></ul>'),
('fcf8278f-02d2-4300-bfbd-c119046c0501', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '15\" 15737 DELUXE BY ACR', 0, 0, 'bde0763b-2624-4b11-9f5c-993cd19f68ce', '2025-03-25 07:48:42.823', '2025-10-23 07:14:38.918', '<p>- Distorsi yang sangat rendah karena menggunakan <em>surround roll </em>model \"M\".</p><p>- <em>Voice coil</em> 4 inchi yang memiliki <em>damping minimum </em>karena menggunakan <em>non-conducting former</em> dan kawat <em>coil </em>yang tahan panas.</p><p>- Penambahan lapisan anti air pada <em>cone paper</em> dan <em>dustcap </em>sehingga lebih tahan terhadap cuaca.</p><p>- <em>Chasis </em>berteknologi pendingin dengan penambahan sirip pada bagian bawah <em>chasis </em>untuk mengurangi panas dari <em>motor system.</em></p>', '15737-deluxe-by-acr', '23a58176-87cb-47ad-8693-216a447a66ba', 'admin', 0, '', '', 'fffef575-fa81-4c0d-bef2-46993e75b034', 0, 0, '', '', 1, '<ul><li><p>- Very Low Distortion thanks to the use of an \"M\" roll-type surround.</p></li><li><p>- 4-inch Voice Coil with minimal damping, using a non-conductive former and heat-resistant coil wire.</p></li><li><p>- Water-Resistant Coating applied to both the cone paper and dust cap, providing better weather resistance.</p></li><li><p>- Cooling-Technology Chassis with added fins on the bottom of the chassis to help dissipate heat from the motor system.</p></li></ul>'),
('fe695a97-a1bf-4e9f-bf9b-0f3620f30a79', '680c5eee-7ed7-41bc-b14b-4185f8a1c379', '18\" PA 18838 EXCEL BY ACR', 0, 0, '86cab111-e356-4391-b92c-47cf4421b2a8', '2025-03-28 07:09:17.569', '2025-10-23 07:51:09.984', '<p><strong>1. <em>Output </em>yang sangat baik</strong></p><p><em>Conepaper edge </em>tipe M dapat menghasilkan <em>output </em>frekuensi yang lebih baik dan ideal untuk <em>subwoofer</em>.</p><p><strong>2. Tahan segala macam cuaca</strong></p><p><em>Conepaper </em>dan <em>dustcap </em>dilapisi dengan lapisan penahan air sehingga lebih tahan terhadap kondisi cuaca.</p><ol start=\"3\"><li><p><strong>3. Tahan panas dan lebih <em>powerfull</em></strong></p></li><li><p>Penggunaan kawat pipih (<em>ASVCAR</em>) dan proses pelapisan spesial coating + MEK menambah daya tahan terhadap panas sehingga speaker tidak mudah drop.</p></li></ol><p><strong>4. <em>Design chassis </em>unik</strong></p><p><em>Desain chassis </em>dengan bentuk yang unik pada bagian bawah berfungsi sebagai pemindah panas.</p><p><strong>5. Kompresi udara yang lebih rendah</strong></p><p>Penambahan ventilasi pada motor <em>speaker </em>memberikan kompresi dan sirkulasi udara yang baik serta berfungsi sebagai pendingin.</p>', 'pa-18838-excel-by-acr', '892102a6-c8e9-4ec2-803c-204ebf9610b5', 'admin', 0, '', '', '6421cad2-4741-4077-9a91-4338319c3b96', 0, 0, '', '', 1, '<ul><li><p><strong>1. Excellent Output</strong><br>The M-type edge conepaper delivers improved frequency response, making it ideal for subwoofer applications.</p></li><li><p><strong>2. All-Weather Resistant</strong><br>Both the conepaper and dustcap are coated with a water-repellent layer, enhancing durability under various weather conditions.</p></li><li><p><strong>3. Heat Resistant and More Powerful</strong></p></li></ul><p>The use of flat wire (ASVCAR) combined with a special coating and MEK application increases heat resistance, ensuring the speaker maintains consistent performance without easily dropping in power.</p><ul><li><p><strong>4. Unique Chassis Design</strong><br>The uniquely shaped chassis base functions as an effective heat sink, aiding in thermal dissipation.</p></li><li><p><strong>5. Reduced Air Compression</strong><br>Additional ventilation in the motor provides better air circulation and cooling, resulting in lower air compression.</p></li></ul>');
